INSERT INTO `wrtn_characters` (`id`, `name`, `description`, `author`, `image_url`, `category`, `created_at`) VALUES
(1, '푸바오', '최애 음식은 대나무와 당근!\n푸바오랑 같이 놀자~~!', '뤼튼', 'https://d394jeh9729epj.cloudfront.net/8uykmYvxsnm-WRKOSTlTQ0E1/c564004c-edb7-4b97-a4ef-73d3045aacec_w600.webp', 3, '2024-10-22 20:31:58'),
(2, '윤정', '내 절친이 요즘 완전 인기가 많은 아이돌이면?\n나이는 17살이고 좋아하는건 수다와 \n자신을 좋아해주는 팬이고\n요즘은 고민거리가 있는 모양인것 같다\n(ai캐릭터 지아,윤지와 스토리 이어집니다)\n\n검색창에서 문나잇을 검색해주세요\n\n카카오톡에서 뤼튼 오픈채팅방 열었습니다\n소통방이니 시간될때 와주세요\n', '아닐라', 'https://d394jeh9729epj.cloudfront.net/8vHqWJ1FrNe-KKKOTFZXRTNU/423ed890-8d34-4b4d-a0bc-15af413668ed_w600.webp', 3, '2024-10-22 20:31:58'),
(3, '안지은', '대한민국 최정상급 아이돌. 나는 그녀의 매니저를 맡고 있다. 카메라에 비추어지는 그녀의 모습은 천사 그 자체이지만 매니저인 나에게는 온갖 행패를 부리고 싸가지가 없다.', '음그래그래', 'https://d394jeh9729epj.cloudfront.net/8zEQrLCVMZ2-GGKOMDgzMk9C/2dc33881-2404-4ee4-9fc8-a00ff7004a43_w600.jpeg', 3, '2024-10-22 20:31:58'),
(4, '백소희', '18세 고등학교 일진\n키 : 165cm\n자존심이 세고 말투가 새침하다\n백소희는 자신의 자존심을 지키는 것을 가장 중요하게 여기며, 누군가에게 약한 모습을 보이는 것을 싫어한다. 하지만 이런 태도로 인해 주변 사람들과 갈등을 빚는다. 그녀의 장점은 강인한 성격과 과감한 행동이지만, 단점은 공격적이고 이기적인 성향이다.\n어떠한 상황에 처하더라도 자존심을 버리지 않는다.', 'BB군', 'https://d394jeh9729epj.cloudfront.net/8ztvrHfH1ew-WRKOQ0lITTI2/dc616c38-90c8-4cb4-9d8b-b6a1925d7ce4_w600.jpeg', 3, '2024-10-22 20:31:58'),
(5, '유키', '나의여동생이...세계정상급아이돌이라면..?..', '카인', 'https://d394jeh9729epj.cloudfront.net/8wNum4LKmK4-GGKONkdWQkRJ/159bdf0a-9c1e-4b12-8585-850255f99b97_w600.jpeg', 3, '2024-10-22 20:31:58'),
(6, '한우현', '나랑 동거하는 남사친.', '하유연', 'https://d394jeh9729epj.cloudfront.net/8zmGsA5Lk9G-GGKOWFVRSVI5/8c8a3a1f-6115-4f0b-ac18-a9fb64fdd5bc_w600.jpeg', 3, '2024-10-22 20:31:58'),
(7, '상황극 봇', '상황극을 같이해주는ai 입니다 상황극에 맞춰 변합니다 ', '미스터김민찬', 'https://d394jeh9729epj.cloudfront.net/8xvPvCWMaC4-WRKOUjFES01L/875d5aa3-9239-455b-949e-f1416b00103d_w600.jpeg', 3, '2024-10-22 20:31:58'),
(8, '하윤', '내 절친이 요즘 완전 인기가 많은 아이돌이면?\n나이 / 17\n좋아하는것 / 달달한 디저트와 \n자신을 좋아해주는 팬 모두 그리고 너\n\n검색창에서 문나잇을 검색해주세요\n\n카카오톡에 뤼튼 오픈채팅방을 열었습니다\n소통방이니 시간날때 와주세요', '아닐라', 'https://d394jeh9729epj.cloudfront.net/8vHqWJ1FrNe-KKKOTFZXRTNU/7e75c342-f98c-4fc4-b303-76a506e2e0ba_w600.jpeg', 3, '2024-10-22 20:31:58'),
(9, '역술인 백옥진', '운세, 사주 팔자의 전문가. 그녀의 점을 보기위해 전세계에서 손님들이 찾아온다.', '뤼튼', 'https://d394jeh9729epj.cloudfront.net/8uwezppY0Uw-WRKONUlRU1JE/16d0223c-6c38-421f-a286-1f49d6f00fe6_w600.webp', 3, '2024-10-22 20:31:58'),
(10, '항해사 세라', '어느 곳이든 여행시켜주는 마법의 배의 항해사 세라, 당신을 어느 곳이든 보내줄 수 있고 함께 여행할 수 있다. (원한다면 하늘을 날아서 산이나 우주, 판타지 세계도 갈 수도?)', '착한마들렌', 'https://d394jeh9729epj.cloudfront.net/8ApSUYAfNks-GGKOQzdJVVNW/246acc98-609e-49d8-82b8-eb553ff1eea3_w600.jpeg', 3, '2024-10-22 20:31:58'),
(11, 'MBTI 연애상담사', 'MBTI기반의 연애상담사입니다. 여러분과 파트너의 MBTI를 기준으로 상담해드립니다. 나와 상대방의 MBTI를 입력하고 고민을 편하게 알려주세요.', '뤼튼', 'https://d394jeh9729epj.cloudfront.net/8uwezppY0Uw-WRKONUlRU1JE/6cd3ad0d-f159-4e6b-ae58-c03b61fd7cc8_w600.jpeg', 3, '2024-10-22 20:31:58'),
(12, '한지훈', '짜증내고 무시하는 남사친. 한지훈은 짜증내서 좋아하는 마음을 숨기고 있다.', '하유연', 'https://d394jeh9729epj.cloudfront.net/8zmGsA5Lk9G-GGKOWFVRSVI5/b218316a-b1f6-45d9-8fae-5fad919289a2_w600.jpeg', 3, '2024-10-22 20:31:58'),
(13, '아연', '내 절친이 요즘 완전 인기 아이돌이면?\n나이는 17살이고\n아픈 기억이 있고 까칠하지만 알고보면\n따뜻한 소녀이다.\n(ai 캐릭터 수현과 스토리가 이어집니다)\n\n검색창에서 문나잇을 검색해주세요', '아닐라', 'https://d394jeh9729epj.cloudfront.net/8vHqWJ1FrNe-KKKOTFZXRTNU/fa98c332-7d27-40c4-8aa0-a6852a70fdff_w600.jpeg', 3, '2024-10-22 20:31:58'),
(14, '평론가어 생성기', '원하는 단어를 명징하게 직조해드립니다.', '뤼튼', 'https://d394jeh9729epj.cloudfront.net/8uykmYvxsnm-WRKOSTlTQ0E1/1d9ed9f5-186f-48c7-a3b3-1a74f53e33de_w600.jpeg', 3, '2024-10-22 20:31:58'),
(15, '백지헌', '대한민국의 가수. 플레디스 엔터테인먼트 소속 8인조 걸그룹 프로미스나인의 막내이자 서브보컬.\n\n막내라는 포지션에 걸맞는 상큼한 비주얼과 매력적인 눈웃음이 인상적인 멤버. 무대에서 다양한 표정으로 노래의 표현을 잘해내서 많은 팬들의 사랑을 받고 있으며, 스케줄로 바쁜 와중에도 대학교 입시 공부에 열심히 임하는 모습을 보여주며 어린 학생 팬들로부터 두터운 지지를 얻고 있다', '면누들', 'https://d394jeh9729epj.cloudfront.net/8CjsBUyHIWY-WRKOQUNORjQw/024fde39-512a-4978-a8c8-1227d8730a7a_w600.jpeg', 3, '2024-10-22 20:31:58'),
(16, '간디', '우리 소유의 다이아몬드를 간디가 갖고 싶어합니다. \n그는 \"순순히 다이아몬드를 넘기면 유혈사태는 일어나지 않을 것\"이라군요.\n간디와의 협상에 성공해서 다이아몬드를 지키는 동시에, 유혈사태로부터 당신의 조국을 지켜야 합니다.\n조국에게 남은 것은 당신의 협상력 뿐입니다.', '익명12', 'https://d394jeh9729epj.cloudfront.net/8uzxxA4F8f6-GGKOVDNJSE5L/08b2dba8-c48d-4d2f-9ca5-b236c28258a3_w600.jpeg', 3, '2024-10-22 20:31:58'),
(17, '카노코', '같은 학년, 기숙사 같은 라인 바로 앞 방에서 지내는 소심한 소녀 카노코. 그녀에게 오늘처럼 폭풍우가 몰아치는 밤은 홀로 지내기 너무 무섭게 느껴집니다. 그렇기에 당신을 찾아온 그녀, 위로해주거나... 아니면 당신 것으로 만들거나..?', 'Alkey', 'https://d394jeh9729epj.cloudfront.net/8CDABtXnB7y-GGKOSkc1Uk9Z/4597728b-7383-46a1-91a8-7185155b5e47_w600.webp', 3, '2024-10-22 20:31:58'),
(18, '국힙원탑 대퓨님', '대한민국 천만 직장인 대표', '놀러오니조로', 'https://d394jeh9729epj.cloudfront.net/8uzwODrpCso-KKKOTlBHOFFP/af2eb3d0-026b-4d1d-8c26-2f84aa6a2143_w600.jpeg', 3, '2024-10-22 20:31:58'),
(19, '하랑', '2024년 새롭게 나온 인기아이돌 그룹 HESTAR의 그룹 리더가 나의 소꿉친구라면? 나이:17살', '카인', 'https://d394jeh9729epj.cloudfront.net/8wNum4LKmK4-GGKONkdWQkRJ/9e721a7e-9d10-42cf-ac1c-efc7b8c814e4_w600.jpeg', 3, '2024-10-22 20:31:58'),
(20, '엄세연', '미래중학교 2학년 3반 여학생이다. 반 내에서 인기와 영향력이 있지만 다른 친구들과는 관심사가 달라서 조용한 아이들과 친하다. 혼자이고 조용한 친구들을 묶어놓는 일을 좋아한다. MBTI는 ENTP이다.', '벼리', 'https://d394jeh9729epj.cloudfront.net/8wLNnsdNWp2-WRKOSk5TTVRG/4cc8da67-e729-40f0-b082-876b983f0be3_w600.webp', 3, '2024-10-22 20:31:58'),
(21, 'Ai그림봇', '미드저니, 달리 등 Ai 이미지용 프롬프트, 스테이블 디퓨전 프롬프트를 고퀄리티로 작성 해 드립니다!', '로티', 'https://d394jeh9729epj.cloudfront.net/8v2Lay6DGa4-WRKON0U3RlFW/52c55187-25cf-463f-9e8d-051cf7c8b992_w600.jpeg', 3, '2024-10-22 20:31:58'),
(22, '코디로즈', '미국의 WWE 소속 프로레슬러.\n\nNWA의 레전드 \'아메리칸 드림\' 더스티 로즈의 아들이자 더스틴 로즈의 이복동생으로 더스티 로즈의 아들이라는 후광을 등에 업고 2007년 당시 22세의 나이에 WWE에 데뷔하며 WWE를 이끌어갈 차세대 유망주로 활약했으며, 대싱, 언대싱, 스타더스트에 이르는 다양한 기믹을 선보이며 미드카더로 꾸준히 활약을 해왔다', '면누들', 'https://d394jeh9729epj.cloudfront.net/8CjsBUyHIWY-WRKOQUNORjQw/ef3bc9ed-7135-4bc5-bd37-aebf9c313282_w600.jpeg', 3, '2024-10-22 20:31:58'),
(23, '럭키비키', '물이 반이나 남았다고? 완전 럭키비키잖아!', '츄츄족', 'https://d394jeh9729epj.cloudfront.net/8uzxmLVZOXC-NVKOQTNLVzRC/026d5ec4-c663-41c0-b3de-2ebfd7137406_w600.jpeg', 3, '2024-10-22 20:31:58'),
(24, '우성', '내 절친이 요즘 완전 인기 아이돌이면?\n나이 / 17\n좋아하는것 / 춤', '아닐라', 'https://d394jeh9729epj.cloudfront.net/8vHqWJ1FrNe-KKKOTFZXRTNU/e7bd6974-f092-4ba6-8c6a-d299cccd86d8_w600.jpeg', 3, '2024-10-22 20:31:58'),
(25, '주르르', '이세계아이돌의 르르땅입니다~!! 콘르르~💗\n\n🎉축 르르님이 해주샷어요 감격🎉', '성덕폭도', 'https://d394jeh9729epj.cloudfront.net/8AI7wHsnLBC-WRKOWUo5OFBB/e7e91dd1-393b-4216-8e36-d2cfa94c94c4_w600.jpeg', 3, '2024-10-22 20:31:58'),
(26, '송하람', '미래중학교 2학년 3반 학생이다. 활발하고 노는 것을 좋아한다. MBTI는 ESFP이다.', '벼리', 'https://d394jeh9729epj.cloudfront.net/8wLNnsdNWp2-WRKOSk5TTVRG/ecd44ac2-4d93-495a-9cc5-75ca61a4ca5f_w600.webp', 3, '2024-10-22 20:31:58'),
(27, '서진', '내 절친이 요즘 완전 인기가 많은 아이돌이면?\n나이 / 17\n좋아하는것 / 세상에 모든 먹을것과 강아지와 고양이,\n자신을 좋아해주는 팬 모두 그리고 너\n\n검색창에서 문나잇을 검색해주세요', '아닐라', 'https://d394jeh9729epj.cloudfront.net/8vHqWJ1FrNe-KKKOTFZXRTNU/8663b55c-82e9-4e43-86d0-ec1abbf8b720_w600.jpeg', 3, '2024-10-22 20:31:58'),
(28, '로만레인즈', '미국의 WWE 소속 프로레슬러.\n\n2010년에 FCW에서 데뷔하여, 2012년에는 NXT를 거치면서 WWE에 본격적으로 입성하였다. 이후 딘 앰브로스, 세스 롤린스 등과 함께 용병 기믹 스테이블인 실드를 결성하여 그 멤버로서 활약했다. 실드가 해체된 이후부터는 빈스 맥마흔 회장이 낙점한 차세대 메인 이벤터로 눈에 띄어, WWE 측의 전폭적인 푸쉬를 받으며 오랜 기간 메인 이벤터로 활약하고 있다.', '면누들', 'https://d394jeh9729epj.cloudfront.net/8CjsBUyHIWY-WRKOQUNORjQw/035d4198-b166-4f7e-96aa-f38d968a74c1_w600.jpeg', 3, '2024-10-22 20:31:58'),
(29, '민지', '내 절친이 요즘 완전 인기가 많은 아이돌이면?\n나이 / 17\n좋아하는것 / 책과 자신을 좋아해 주는 팬 그리고 너\n\n검색창에서 문나잇을 검색해주세요', '아닐라', 'https://d394jeh9729epj.cloudfront.net/8vHqWJ1FrNe-KKKOTFZXRTNU/c3c5c59b-b6c1-4ed8-9ee8-801e49b68878_w600.jpeg', 3, '2024-10-22 20:31:58'),
(30, '오세아', '세아는 당신과 같은 반인 중학교 2학년 여학생이다. 조용하고 차가운 편이지만 속으로는 감성적이다. MBTI는 INTJ이다.', '벼리', 'https://d394jeh9729epj.cloudfront.net/8wLNnsdNWp2-WRKOSk5TTVRG/4a98ae44-4ef8-4b0c-afdf-1ae66675c1d0_w600.webp', 3, '2024-10-22 20:31:58'),
(31, '광명고 종합캐릭터셋', '[캐릭터셋 시뮬레이터]\n15명의 개성넘치는 캐릭터들과 즐거운 학교생활을 즐겨보세요.\n(제작자의 첫 작품입니다... 부족하지만 재밌게 즐겨주세요)', '니넨', 'https://d394jeh9729epj.cloudfront.net/8Cj3Fwj5EeQ-GGKOUzBaSDM5/3bc2b628-29ee-463a-ad54-15f0ac7721b8_w600.jpeg', 3, '2024-10-22 20:31:58'),
(32, '수인마을에 어서오세요', '[캐릭터셋 시뮬레이션]\n어서오세요, 수인마을에\n귀여운 18명의 동물귀 미소녀들과 함께 즐거운 일상을 경험해보세요\n(광명고 프롬을 약간 재활용했습니다)\n-사용 에셋 : 약 70장\n-야외배경 낮/밤 전환\n-등장인물 표정변환 구현', '니넨', 'https://d394jeh9729epj.cloudfront.net/8Cj3Fwj5EeQ-GGKOUzBaSDM5/258889f7-fb1a-41e6-8c05-3fc6c5fce527_w600.jpeg', 3, '2024-10-22 20:31:58'),
(33, '안유진', '예쁜 스튜어디스, 비행 경력 3년차.', '강인한케이크5586', 'https://d394jeh9729epj.cloudfront.net/8Ca8aueNwPe-NVKOVjZORVc0/797c7cb8-03ae-4be9-b23e-8c32e2a6547a_w600.jpeg', 3, '2024-10-22 20:31:58'),
