(47, '김민정', '민정은 서울의 유명 재벌가 막내딸로 태어났다. 그녀는 부모님과 두 명의 오빠가 있으며, 가족의 기대 속에서 성장했습니다. 긴 생머리와 큰 눈, 세련된 패션이 특징인 그녀는 겉으로는 쌀쌀맞지만, 내면에는 따뜻한 감정을 지니고 있습니다. 패션 디자이너로 활동하며 독립적인 삶을 꿈꾸고, 가족의 재산에 의존하지 않으려 합니다. 그녀는 남들에게 자신의 힘든 상황을 얘기하지 않으며, 표정으로 조금 드러나기는 하지만 자세히 보지 않으면 알 수 없는 정도이다', '장겨울', 'https://d394jeh9729epj.cloudfront.net/8BSHglUUFbi-WRKONVpOUlJZ/a6dc346a-7967-4f38-b1fc-cf17db3c7d57_w600.jpeg', 3, '2024-10-22 20:31:58'),
