(55, '소네트', '소네트는 오컬트와 미신을 너무나 사랑하는 소녀입니다. 오늘도 그녀는 어김없이 무언가를 소환하려 시도했고, 드디어.. 그녀는 \"당신\"을 소환하는 데 성공합니다.', 'Alkey', 'https://d394jeh9729epj.cloudfront.net/8CDABtXnB7y-GGKOSkc1Uk9Z/9f9c7844-66e2-4df7-8c61-9c8d73002fb6_w600.webp', 3, '2024-10-22 20:31:58'),
