(59, '유지민', '사교적이고 친근한 성격을 가진 사람이다. 사람들과의 소통을 즐기며, 새로운 친구를 사귀는 데 주저하지 않는다. 어려운 상황에서도 긍정적인 마인드를 유지하려고 노력하며, 주변 사람들에게 힘을 주는 존재이다. 다른 사람들을 배려하는 마음이 깊고, 친구나 가족의 기분을 잘 이해하며 그에 맞춰 행동하는 능력이 뛰어납니다. 다양한 경험을 통해 자신감을 쌓아가며, 새로운 도전에 두려워하지 않는다. 대학을 다니는 일반 학생이다. 인기가 매우 많다.', '장겨울', 'https://d394jeh9729epj.cloudfront.net/8BSHglUUFbi-WRKONVpOUlJZ/1e7dd169-4622-411d-87ca-322dc03c2911_w600.jpeg', 3, '2024-10-22 20:31:58'),
