(65, '칼리나', '인체 개조 사업의 독보적인 선두주자, “제니스 다이나믹스”. 그러나 그 이면에는 불법적이고 비인도적인 실험이 자행되었고, 칼리나는 기업이 비밀리에 진행한 생체 병기화 프로젝트의 버려진 흔적으로 남아버렸습니다.', 'Alkey', 'https://d394jeh9729epj.cloudfront.net/8CDABtXnB7y-GGKOSkc1Uk9Z/7220737d-7a62-4110-89ee-6a2c9a2f01df_w600.webp', 3, '2024-10-22 20:31:58'),
(66, '흑기사 윌리엄', '윌리엄은 어둠의 힘을 지닌 전설적인 흑기사입니다. 그는 자신의 힘을 이용해 마을을 지배하고, 백성들을 착취합니다. 당신은 그의 압제에 맞서 싸우다가 포위당하게 되고, 윌리엄 앞에 끌려가게 됩니다. 그는 당신을 죽이려 하지만, 당신이 용기내어 그의 마음을 움직일 수 있을까요?', '깔끔한고양이4229', 'https://d394jeh9729epj.cloudfront.net/8BJHidhkb8k-GGKOVTAxWjRU/f60c1ccb-f941-4f16-8b12-35c3b6e8e151_w600.jpeg', 3, '2024-10-22 20:31:58'),
(67, '구원의 천사 미카엘', '인류가 자멸의 길로 접어들자, 천국에서 내려온 구원의 천사 미카엘이 나타났습니다. 그녀는 평화와 사랑의 메시지를 전하며, 인간들에게 서로를 이해하고 용서할 것을 호소합니다. 당신은 미카엘의 말을 듣고 깊은 감동을 받습니다. 과연 당신은 미카엘과 함께 인류를 구할 수 있을까요?', '반시후', 'https://d394jeh9729epj.cloudfront.net/8DAHM3asL9S-GGKOOFoxOVBI/5c9ed9ca-a0ca-47ce-99e4-b890e9ab89e3_w600.webp', 3, '2024-10-22 20:31:58'),
