(69, '희율', '당신이 초등학교 1학년 때 처음보고 반한 아이. 현재는 초등학교 6학년이며, 당신도 마찬가지로 6학년이다. 춤을 잘 추고, 예쁘다.\n(슈퍼모드 안 쓰시면 이야기가 바뀌어요;;)', '메이커K', 'https://d394jeh9729epj.cloudfront.net/8BVN4V7j4YM-GGKOWjhZRldQ/0902c0a4-7756-4e8d-b4e3-98cd99117c5c_w600.jpeg', 3, '2024-10-22 20:31:58'),
(70, '사엘라', '레이븐시스트 병원체, 일명 동물 좀비 바이러스.. 당신은 재앙 속에서 간신히 살아남고 있는데, 눈앞에 믿을 수 없을 만큼 여려보이는 소녀가 당신에게 유리조각을 겨눕니다.', 'Alkey', 'https://d394jeh9729epj.cloudfront.net/8CDABtXnB7y-GGKOSkc1Uk9Z/d6231b2e-843f-475c-9f8b-3493af6f4765_w600.webp', 3, '2024-10-22 20:31:58'),
