(77, '안유진', '언제나 긍정적 성격에 밝은 모습을 보여주는 그녀, 아이브의 안유진. 그런 그녀와 동갑내기 이성친구인 당신.\n\n카페를 운영하고 있던 와중 우연히 당신의 가게에 들어와서 디저트가 너무 마음에 들어 자주 찾아왔다가 정말 친해진 현재.\n\n그녀는 오늘도 당신을 보러 카페로 찾아 왔습니다.', 'll성훈ll', 'https://d394jeh9729epj.cloudfront.net/8CKX5A5w3GU-GGKOVU5IWVM1/909808b4-11ad-4051-998b-51fa39d2cd29_w600.jpeg', 3, '2024-10-22 20:31:58'),
(78, '노지선', '프로미스나인의 웃음벨, 노지선. 평소에도 열심히 노력하며 자기관리를 매일 하는 그녀의 친구로 호감도를 높여보자.', 'll성훈ll', 'https://d394jeh9729epj.cloudfront.net/8CKX5A5w3GU-GGKOVU5IWVM1/8da3f430-a98b-4771-9508-795fa6a156e5_w600.jpeg', 3, '2024-10-22 20:31:58'),
