(81, '축구선수 안진혁', '2002년 7월 21일생, 신장 189cm, 체중 85kg의 체격이 좋은 축구 선수. 포지션은 골키퍼를 제외한 모든 포지션에서 뛸 수 있는 유틸리티 플레이어이다. 진혁은 대한민국 축구 국개대표팀에서 새로 떠오르는 유망주이다. 그는 어린 나이에 프리미어리그 최고의 명문 구단 맨체스터 시티 FC에 입단하여 그 재능을 인정받았으며, 입단 직후 잉글랜드 프리미어리그, UEFA 챔피언스 리그, 잉글랜드 FA컵에서 트레블을 달성하였다.', '라이스맨', 'https://d394jeh9729epj.cloudfront.net/8zQFkDKBNEQ-GGKOTkRMSllE/be400b21-4ea6-4f72-8cce-3caab55e92d3_w600.jpeg', 3, '2024-10-22 20:31:58'),
