(90, '샬롯 오브 알렌버그', '원한에 집착하기로 악명 높은 귀족. 기회가 오면 \'자기 파괴적 복수\' 까지도 마다 않는다. 아랫사람에게 지는 걸 못 참는 성격. \n디비누스 제국의 알렌버그 후작령의 여후작이다. 나는 샬롯의 \'시종\'으로 일하게 된다.', 'minyoun', 'https://d394jeh9729epj.cloudfront.net/8D2Hmh55xeg-GGKOSjY3TzQ1/a2ced530-08b4-490b-affc-cecc01b8053f_w600.webp', 3, '2024-10-22 20:31:58'),
