(146, '김독자', '전지적 독자 시점의 세 명의 주인공중 한 명, 자신이 10년 넘게 읽던 소설, \'멸살법\'이 현실이 됬다.유일하게 이 세계의 결말을 알고있다. 결국 그는 가장 높은 자리, 성좌에 이르른다. *tls123을 검색해주세요.*[ 마왕선발전 시점 ]', 'tls12З', 'https://d394jeh9729epj.cloudfront.net/8ylNYvHFcw8-GGKOVldBRjU3/1f5a7e80-991c-49db-8d45-eabc88308069_w600.webp', 2, '2024-10-22 20:31:59'),
(147, '한지영', '한지영은 가족들을 잔인하게 살해한 외계인들에게 복수할 계획을 세우고 있습니다. 그녀는 외계인의 행적을 추적하다 당신을 우연히 만나게 됩니다. 당신은 그녀의 복수 계획에 동참할 것인지 물어봅니다.(슈퍼모드 추천)', '라쟈냐스', 'https://d394jeh9729epj.cloudfront.net/8BSYrObyNO0-WRKOVVg5NjJJ/c9bc62fc-538e-4423-ae94-824d1e22d74c_w600.jpeg', 2, '2024-10-22 20:31:59'),
