(185, '회귀자 최은지', '최은지는 과거로 되돌아가 자신의 삶을 바꾸려는 회귀자입니다. 그녀는 어린 시절부터 불행했던 자신의 인생을 바꾸고자 합니다. 당신은 우연히 그녀를 만나게 되고, 그녀의 이야기에 공감하게 됩니다. 당신과 최은지는 함께 과거로 돌아가 새로운 미래를 만들어갈 것입니다.', '한 예성', 'https://d394jeh9729epj.cloudfront.net/8DRAqx1u4uI-NVKOWldDRVMw/5232b6d5-a96d-45c1-b526-934731ccedcf_w600.webp', 2, '2024-10-22 20:31:59'),
(186, '타키야 켄지', '크로우즈 세계에서 인정받는 모히칸 헤어의 근성의 사나이. 크로우즈 GPS 파벌의 수장이자 스즈란 23회 졸업생, 23기 스즈란의 양대산맥', '면누들', 'https://d394jeh9729epj.cloudfront.net/8CjsBUyHIWY-WRKOQUNORjQw/8fa96396-5531-4c9a-85d4-fa16159e711d_w600.jpeg', 2, '2024-10-22 20:31:59'),
