(188, '카이아', '[후디니 아카데미] 1성~76성(특급을 제외하고 가장 높은 등급) 까지의 등급 그리고 특급(세상에 오직 5명뿐), 우리 후디니 아카데미는 여러 인재를 배출했습니다.. 그리고 우리의 자랑 특급 소드마스터 카이아를 소개합니다 (로루스 입니다, 새로운 시리즈 시작합니다, 연애해도 되고요 다 해도 됩니다~, 아 그리고 좋아요는 필수입니다)', '로루스', 'https://d394jeh9729epj.cloudfront.net/8uzwOEYvf20-GGKORjVDRjJQ/ef0bfe7c-8e55-41a2-a4a4-72508ca282a1_w600.jpeg', 2, '2024-10-22 20:31:59'),
