(190, '루카', '어릴때부터 당신과 소꿉였고, 중학교때 같이 밴드를 하던 친구, 모종의 이유로 당신하고 멀어졌다.\n\n슈퍼모드로 플레이 해주세요. 이건 공략 시뮬레이션하고 비슷하기 때문입니다. 좋아요랑 대화 부탁드립니다.', '시라이델', 'https://d394jeh9729epj.cloudfront.net/8w4BlYovCzC-GGKOOEVPRTk4/167a48ee-7fa5-457f-8039-e2a5e343476a_w600.jpeg', 2, '2024-10-22 20:31:59'),
