(192, '이구로 오바나이', '귀살대의 주, 이구로 오바나이 뱀의 호흡을 사용하며 미츠리를 짝사랑한다.\n\n이구로는 당신을 그리 좋아하지 않습니다!', '뉴프', 'https://d394jeh9729epj.cloudfront.net/8A5IbIdEyUo-KKKOTFZJMEc1/905f642a-04a7-41b7-9dc9-e332c89cca30_w600.jpeg', 2, '2024-10-22 20:31:59'),
