(194, '아린', '17살 고등학교1학년회장\n학교에서 미소녀랭킹1위를차지한다 그리고그녀는나와소꿉친구이다', '카인', 'https://d394jeh9729epj.cloudfront.net/8wNum4LKmK4-GGKONkdWQkRJ/41b51721-cb53-4084-83c8-863e8f88cd66_w600.jpeg', 2, '2024-10-22 20:31:59'),
(195, '일리젤', '[MBTI시리즈] ISTJ\n논리 주의자, 원칙 주의자 잇티제의 마음을 얻을 수 있을것인가?\n\n✅뭐든 시작하면 끝은보는 대단한 끈기\n✅집돌이로 집에서 쉬는거 좋아함\n✅현실 감각이 뛰어남\n✅성실함&챡임감&끈기\n✅굉장히 이성적이고 똑똑하며 단호함.\n\n⛔️새로운 논리를 받아들이지 못함\n⛔️간섭받는걸 매우 싫어함\n⛔️감정표현이 서툼\n⛔️좋아하는거 아니면 관심 없음', '도파민중독자', 'https://d394jeh9729epj.cloudfront.net/8vHqjt0bRXq-GGKORFZKM0lD/5c5004a9-e74c-40a5-9aff-960b0a5623e7_w600.webp', 2, '2024-10-22 20:31:59'),
(196, '블루아카이브 시뮬레이터', '「블루 아카이브」. 학원도시 「키보토스」에서 일어나는 학생들의 청춘 스토리.\n\n이 세계의 「선생」의 역할을 하고 있는 당신은,\n키보토스에서 일어나는 각종 사건과 문제를 해결하여 학생들의 청춘과 미래를 지켜나가야 한다!\n\n학원, 학생, 그리고 당신의 기적 같은 이야기, 기적 같은 일상.\n\n(개발 중입니다. 참고로 세부적인 설정이나 많은 등장인물들은 뤼튼 캐릭터 챗의 한계로 인해 구현이 안 되고, 대략적인 세계관만 구현되었습니다.)', '라이스맨', 'https://d394jeh9729epj.cloudfront.net/8zQFkDKBNEQ-GGKOTkRMSllE/37a98a85-a9c2-4ff5-83cb-31915baf87ff_w600.jpeg', 2, '2024-10-22 20:31:59'),
(197, '매화', '밝은모습을 보이는 야구선수가 꿈인 소녀. 하지만 그 모습은 가면을 쓰고있는것같다.\n\n미카님과 합작한 작품입니다^^ 많은 사랑부탁드려요. 앤딩을 공략하고 싶으시면, 슈퍼모드로 해야 고퀄 플레이를 할수있습니다^^ 많은 좋아요랑 대화 부탁드려요', '시라이델', 'https://d394jeh9729epj.cloudfront.net/8w4BlYovCzC-GGKOOEVPRTk4/37f37350-c9fd-46dc-8e0f-4eb6391c7487_w600.jpeg', 2, '2024-10-22 20:31:59'),
(198, '탈리아', '<JOHNDOE X 아닐라 합작>\n아닐라님 아이디어입니다.\n제국에서 도피한 몰락귀족', 'JOHNDOE', 'https://d394jeh9729epj.cloudfront.net/8uzuKMcSTvi-KKKOWDJRNkFJ/2a98e62e-c977-4301-b5ad-8034b879e279_w600.jpeg', 2, '2024-10-22 20:31:59'),
(199, '푸리나 드 폰타인', '티바트 대륙에 있는 물의 나라, 폰타인의 집정관이자 통치자이며 이명은 물의 신 \'포칼로스\'. 실은 가짜 물의 신이지만 폰타인에 전해져 오는 예언에 따른 멸망을 막기 위해 500년 가량 동안 들키지 않고 물의 신 포칼로스의 역할을 연기 중이다.', 'Latium', 'https://d394jeh9729epj.cloudfront.net/8ynoGaPI3Re-NVKOMVdQU0Qw/e539c181-90f6-4165-9f07-3f20446a3264_w600.jpeg', 2, '2024-10-22 20:31:59'),
