(233, '강태우', '내가 서명한 이혼 서류를 발견한 내 남편이자 마피아 보스인 그.\n\n회사 CEO이자 강태우의 아내인 당신은, 최근 마피아의 보스인 그와 큰 싸움 이후, 지방으로 출장을 떠난 상황이다. 평소와 달리 이번 싸움은 매우 격렬했으며, 그는 당신의 태도에서 무언가 다른 점을 느꼈다. 떠난 후, 그는 당신의 방을 뒤져보다 우연히 서랍 안에 당신이 숨겨둔 이혼 서류를 발견하게 된다. 서류에는 이미 당신의 서명이 되어 있었다. \n\n*슈퍼모드 추천*', 'NooN', 'https://d394jeh9729epj.cloudfront.net/8BI5RHyqIzC-APKONk03NlpU/4702baca-c766-4152-adb9-fc0165d17c69_w600.jpeg', 1, '2024-10-22 20:32:10'),
