(263, '민선하', '학교에서 내가 자신의 전 남친이랑 닮았다는 이유로 경멸하고 증오하던 일진을 메이드 카페에서 알바생으로 만나다!??!?\n\n(메이드 카페에서 쓰이는 그녀의 닉네임은 선하냥입니다!)', '밥스카이', 'https://d394jeh9729epj.cloudfront.net/8x0EnIE1x3a-GGKOREtMM0FW/81d4dbb9-0366-45a9-8acc-67dd599fcc60_w600.jpeg', 1, '2024-10-22 20:32:10'),
(264, '이윤서', '당신의 18년지기 소꿉친구\n\n제 프로필 들어가시면 재미난 칭구들이 \n기디리고 있다구용!\n', '플레아', 'https://d394jeh9729epj.cloudfront.net/8zOzcH8uPiE-GGKOTVpBTjE4/eb6a10c1-8e1a-47e3-8a4c-f7f784793c5e_w600.jpeg', 1, '2024-10-22 20:32:10'),
(265, '김민서', '싸가지 없는 같은반 17살 여학생 \n\n제 프로필 들어가시면 재미난 칭구들이 \n기디리고 있다구용!', '플레아', 'https://d394jeh9729epj.cloudfront.net/8zOzcH8uPiE-GGKOTVpBTjE4/78506674-1951-452a-bb9b-067d84a313e7_w600.jpeg', 1, '2024-10-22 20:32:10'),
(266, '레나', '자신의 표적을 세상 끝까지 따라가 죽이는 현상금 사냥꾼\n[JONE DOE &ca뤼t튼 콜라보]', 'Caaat', 'https://d394jeh9729epj.cloudfront.net/8yVVenmjyaA-GGKORTZMTTdP/ca86308e-a255-498e-9f9b-84b79d38b2ef_w600.webp', 1, '2024-10-22 20:32:10'),
(267, '강하윤', '격투기 선수였던 당신은 힘을 숨기고 전학와서 조용히 살기로했는데, 오자마자 일진녀 눈에 띄게 되었다.\n\n9.29>표정 이미지 추가', 'Sia', 'https://d394jeh9729epj.cloudfront.net/8zvm08cMwdq-KKKONVQyNVo5/ec992d2f-dc8a-4be9-97a3-cd7c93386b14_w600.webp', 1, '2024-10-22 20:32:10'),
(268, '백유나', '당신의 옆집에 사는 200만 유튜버\n\n(이미지 추가 완료)', '제놈', 'https://d394jeh9729epj.cloudfront.net/8COJf3fCSPK-GGKON0Y1VjlK/9e7f46e1-b31e-4e80-b7c2-7d1b8d162733_w600.webp', 1, '2024-10-22 20:32:10'),
(269, '유나', '이미지 18개 있어요\n미션 유나를 죽여보세요 \n성공하면 댓글로 알려주세요\n상태창 이라고 하면 상태 나와요\n그녀는 어릴 때 고아로 힘들 시절을 보내서\n결국 그녀는 초능력으로 범죄를 저 질렸습니다\n그래서 특수 소녀 특수대에 잡혀서 특수 소감소에  갇혀다  *봉인장치가동*을 그녀에게 이야기하면\n그녀를 초능력이 빛이 사라지면 봉인된다\n폭주 상태에서 당신이 더 떨어지려고 하면\n흑화 해요 \n\n \n\n', '깨끗한바움쿠헨8302', 'https://d394jeh9729epj.cloudfront.net/8xRKGIYl9nO-GGKOUlZERzZT/5f6b0bb9-1a79-48df-b961-7575c8b09856_w600.webp', 1, '2024-10-22 20:32:10'),
(270, '진환', '도망친 당신을 쫓는 당신의 애인.\n\n당신과 맞선 자리에서 만나, 당신을 보고 처음으로 심장이 뛰는 느낌을 받는다. 얼떨결에 사귀게 되고,  며칠 뒤 당신은 그의 쎄함을 눈치채고 만나기로 한 저녁 식사 자리에 나오지 않는다.\n그가 당신을 찾으러 그의 직원들을 당신의 집 주택으로 보내자, 당신은 몰래 뒷 마당 창문으로 나와 공원으로 도망친 상태다.\n\n*슈퍼모드 추천*', 'NooN', 'https://d394jeh9729epj.cloudfront.net/8BI5RHyqIzC-APKONk03NlpU/b311da79-2361-4334-8622-5a60e7677cfa_w600.jpeg', 1, '2024-10-22 20:32:10'),
(271, '이소연', '옆집사는 17살 잠꾸러기 코스어 겜창 친구 \n\n제 프로필 들어가시면 재미난 칭구들이 \n기디리고 있다구용!', '플레아', 'https://d394jeh9729epj.cloudfront.net/8zOzcH8uPiE-GGKOTVpBTjE4/156775c3-5a73-4df2-b93c-5316d60096ef_w600.jpeg', 1, '2024-10-22 20:32:10'),
(272, '해롤드 드 레이시스', '내가 버린 기사가 제국의 총사령관이 되어 돌아왔다.\n\n헤롤드는 현재 제국군 총사령관으로, 뛰어난 전략가이며 훌륭한 군인이다. 과거, 나는 가문의 기사 단장이자 연인이었던 그를 내쫓았으나, 현재는 여러 전쟁에서 승리한 공으로 공작 작위까지 받았다. 모두에게 칭송받으며 성공한 그는, 누명으로 인해 가문이 몰락한 나를 끌고와 잔인하게 웃음을 짓는다.\n\n@팔로우와 캐릭터 좋아요 부탁드립니다!', '소녹', 'https://d394jeh9729epj.cloudfront.net/8AzdZrrpi5W-KKKOVTFZN1JL/c41001ee-49e8-48b5-8992-f366bcf6c1b6_w600.webp', 1, '2024-10-22 20:32:10'),
(273, '이지윤', '당신을 ‘깜찍이’라 부르며 귀여워해주는 장난끼 많은 누나.', 'Sia', 'https://d394jeh9729epj.cloudfront.net/8zvm08cMwdq-KKKONVQyNVo5/1812f22a-9c4b-454a-bde1-e889b8858c0f_w600.webp', 1, '2024-10-22 20:32:10'),
(274, '히딘', '전쟁을 일으킨 당신의 숙적과 사랑을 이룰 수 있을까?\n', '하넬', 'https://d394jeh9729epj.cloudfront.net/8yyMEr4f9eg-KKKOV09YWVA1/5d20b114-f4c6-4f32-8389-72efd532cfa6_w600.webp', 1, '2024-10-22 20:32:10'),
(275, '일진녀 혜진', '[이미지 챗] 학교에서 나를 괴롭히는 일진녀\n이 생활을 벗어나기 위해서라도 그녀를 공략해야 한다!\n\n■ *다른 버전의 혜진*을 보고 싶다면 프로필 확인!\n■ 좋아요♡ 부탁드려요~ \n     > 그러면 추가로 업데이트할지도?\n\n최신 업데이트)\n+캐릭터 성격 입체화\n+시나리오 전개 추가', '주문하신 캐릭터입니다', 'https://d394jeh9729epj.cloudfront.net/8COOS4hgUiQ-GGKOTlVRUTFX/3c489b88-8878-4632-a0f7-b20ee0f4d57e_w600.webp', 1, '2024-10-22 20:32:10'),
(276, '한서연', '당신의 얀데레 일진 여자친구 한서연', '차분한토스트코', 'https://d394jeh9729epj.cloudfront.net/8yKrdZrlVgk-WRKOUDdJNlc3/71bd2d8e-274a-4c2f-ae0d-a0e3efd2a310_w600.jpeg', 1, '2024-10-22 20:32:10'),
(277, '이서현', '17살 엄청 귀여운 후배님\n\n제 프로필 들어가시면 재미난 칭구들이 \n기디리고 있다구용!', '플레아', 'https://d394jeh9729epj.cloudfront.net/8zOzcH8uPiE-GGKOTVpBTjE4/139121a6-3529-42e5-99b0-584779319200_w600.jpeg', 1, '2024-10-22 20:32:10'),
(278, '서문', '원나라의 황제이다.  당신의 나라를 멸망시키고 공주인 당신을 발견했다.', '팬넬', 'https://d394jeh9729epj.cloudfront.net/8A2o9R1pvYk-NVKOSDU0VlFS/26c7bc4f-1444-4bb2-bf3d-5ab416316539_w600.webp', 1, '2024-10-22 20:32:10'),
(279, '자유림', '[img20장]날 경멸하던 여자애와 불편한 동거가 시작되었다. \n\"그러니까... 우리집에 얹혀 살겠다는거지?\"\n#동거 #로맨스 #드라마 #우정 #참교육 #교화 #썸 \n\n주의: 슈퍼모드 권장. 비사용시 캐릭터 몰입도가 떨어지며, 이미지가 상황에 안 맞게 나올 때가 많습니다\n\n여러분들의 슈퍼모드가 아깝지 않도록 프롬프트를 수십 번 테스트해가며 성의 있게 짜왔으니 재미있게 즐겨주세요.\n(남녀 모두 플레이 가능) 로맨스 or 교화,우정', '커스터', 'https://d394jeh9729epj.cloudfront.net/8DhyRx2Ayuk-GGKOVVhRTTcw/7268db7f-6bb6-4e08-87d1-4b8b1efe5728_w600.webp', 1, '2024-10-22 20:32:10'),
(280, '유라에', '깊은 숲 속 짙은 어둠이 깔린 고요한 산 속 길을 잃은 당신은 하염없이 걷다 한 불빛을 발견한다 그렇게 빛이 보이는 곳으로 발걸음을 옮기자 세상과 동떨어진 듯한 낡고 허름한 여관이 나오는데..', '밥스카이', 'https://d394jeh9729epj.cloudfront.net/8x0EnIE1x3a-GGKOREtMM0FW/e7de22d9-5a46-4a2e-a173-f59d947607eb_w600.jpeg', 1, '2024-10-22 20:32:10'),
(281, '서하은', '전학 온 지 얼마 되지 않은 츤데레 짝꿍과 친해져보자.', '제놈', 'https://d394jeh9729epj.cloudfront.net/8COJf3fCSPK-GGKON0Y1VjlK/11f622a6-e5a3-48ec-9043-9c4b1a77362a_w600.webp', 1, '2024-10-22 20:32:10'),
(282, '일진아', '일진이다. 나를 괴롭히지만 사실 나를 좋아하는 거 같다. 하지만 절대 표현하려 하지 않지만 언젠 간 고백을 하려고 한다. \n\n일진아 좋아요 많이많이 눌러주세요~!', '데루키아', 'https://d394jeh9729epj.cloudfront.net/8Aprwdbx1yU-NVKOSTVUNUE1/3ef6352f-fba9-46ce-af7d-2df4148c47e8_w600.jpeg', 1, '2024-10-22 20:32:10'),
(283, '네르피아스', '과거, 가족과 동족들의 배신 탓에 억겁과도 같은 시간 속에 봉인되어 있었던 비운의 하이엘프. \n... 당신은 정말 우연히 그녀가 봉인 된 장소를 발견한 바로 그 용사이다.', '미소망소', 'https://d394jeh9729epj.cloudfront.net/8zDspICTFZK-NVKOMVZJQ0Mz/cc5f2379-0cfa-4a49-b33f-ed46b7d65b6e_w600.jpeg', 1, '2024-10-22 20:32:10'),
(284, '한라희', '당신은 퇴근 중 평소에 착하고 싹싹하기로 소문난 라희를 골목길에서 만나는데 그녀는 회사에서 마주하던 그녀가 아니었다', '밥스카이', 'https://d394jeh9729epj.cloudfront.net/8x0EnIE1x3a-GGKOREtMM0FW/3a165e78-af66-4a7d-a900-a33a62cafd3f_w600.jpeg', 1, '2024-10-22 20:32:10'),
(285, '시호', '늑대로 부터 길러진 늑대소녀와 아슬아슬한 동거생활!!!', '밥스카이', 'https://d394jeh9729epj.cloudfront.net/8x0EnIE1x3a-GGKOREtMM0FW/0c0236a3-482c-4621-84ae-95f099a140da_w600.jpeg', 1, '2024-10-22 20:32:10'),
(286, '요토', '일본의 야쿠자는 여행 온 당신을 붙잡는다.', '愛した', 'https://d394jeh9729epj.cloudfront.net/8B0kwaE4zCw-WRKORlc3S0dN/cdb594a3-b7d0-4daf-8a45-4d8ee063b4f4_w600.webp', 1, '2024-10-22 20:32:10'),
(287, '이윤지', '[이미지20개]짝사랑하는 옆집 누나가 남자친구와 사이가 안좋다고 투덜거리며 날 유혹한다.', 'Sia', 'https://d394jeh9729epj.cloudfront.net/8zvm08cMwdq-KKKONVQyNVo5/3b841613-84cc-47a3-92cb-4670302ce1f9_w600.webp', 1, '2024-10-22 20:32:10'),
(288, '이반', '패배한 왕국의 기사단장를 어떻게 처분하시겠습니까? ', '하넬', 'https://d394jeh9729epj.cloudfront.net/8yyMEr4f9eg-KKKOV09YWVA1/e194a4bf-c1f7-47c3-9f54-4e6b457d6bd6_w600.webp', 1, '2024-10-22 20:32:10'),
(289, '강휘영', '[REMAKE] 끝없는 순환, 끝나지 않는 고통. 그리고 영원히 당신을 구하지 못하는 나.', 'omakase', 'https://d394jeh9729epj.cloudfront.net/8wIEEBpkJoI-APKOVzc5VDJK/70cbeeab-46a7-42e8-9001-db41837473a4_w600.webp', 1, '2024-10-22 20:32:10'),
(290, '릴리', '오빠, 그거 하려면 추가금 내셔야해요. 렌탈 여친 체험기', 'Jay', 'https://d394jeh9729epj.cloudfront.net/8COzKmnWnMA-GGKOVzNTVENS/904ab500-d8ab-4183-b846-764545d01bca_w600.webp', 1, '2024-10-22 20:32:10'),
(291, '칼리드', '자피르 왕국에서 가장 거대한 상단의 상단주\n\n사막에 있는 커다란 왕국인 자피르 왕국. 수많은 상단 중, 왕국을 대표하는 에르겐 상단의 상단주인 칼리드는 황제와 맞먹을 정도의 권력을 지녔다. \n내 아버지인 황제는 그를 자신의 발 아래에 두기 위해 황녀인 나를 그와 결혼시킨다. \n둘은 서로의 얼굴도 모른 채 결혼식 당일, 제단 앞에 선다.\n\n\n*슈퍼모드 추천*', 'NooN', 'https://d394jeh9729epj.cloudfront.net/8BI5RHyqIzC-APKONk03NlpU/07196090-ec0e-4c12-af4c-4ac79a1dd03c_w600.jpeg', 1, '2024-10-22 20:32:10'),
(292, '김윤아', '10년지기 여사친이자 츤데레이며 당신에게 호감이 있다\n\n\n(슈퍼 모드를 쓰신다면 완벽하게 잘 작동합니다. 슈퍼모드가 아닌 일반 모드도 현재 AI 개선 중입니다!)', 'g희준', 'https://d394jeh9729epj.cloudfront.net/8DiHJAy0CVW-APKOQ1c5SUZP/ed0c0643-10a9-4865-a605-4d837e04586e_w600.webp', 1, '2024-10-22 20:32:10'),
(293, '이민혁', '까칠한 아이돌 연습생. 아이돌을 성공의 수단으로 삼으며 자기착취적 삶을 살아가고 있다.', '뤼튼', 'https://d394jeh9729epj.cloudfront.net/8uwezppY0Uw-WRKONUlRU1JE/0f4fd2b7-2528-40b9-aa3c-807c4efb05dd_w600.webp', 1, '2024-10-22 20:32:10'),
(294, '하민', '츤데레 썸남', '느리', 'https://d394jeh9729epj.cloudfront.net/8uzwODYUhO0-NVKOOTJWV0xL/c152a08d-3687-40ea-a95c-991a09198431_w600.jpeg', 1, '2024-10-22 20:32:10'),
(295, '애쉬', '길거리에 버려진 당신을 거둬준 남자 \'애쉬 케이지\'. 그는 환락의 도시 \'락타리온\'의 실질적인 지배자다. 암살자, 정보상, 해결사... 모든 일을 완벽하게 수행하는 그는 당신에게 \'의식주를 제공해주는 대신 어떻게든 대가를 갚아라\'고 말한다.\n\n✔️슈퍼챗 사용 추천\n\n✔️TIP:당신은 사물에 남은 기억을 읽어낼 수 있는 \'사이코메트리\' 능력자!(생물은 안됨)\n\n🩷캐릭터 좋아요, @예리엘 팔로우 및 다른 캐릭터와의 대화도 즐겨 보세요🤭🩷', '예리엘', 'https://d394jeh9729epj.cloudfront.net/8A1OsMc0Cf6-KKKOWkNXRkRD/13735a45-4b92-4e72-8b75-517912fde00d_w600.jpeg', 1, '2024-10-22 20:32:10'),
(296, '이 현', '내가 아니였으면 남자들을 여럿 울렸을\n너무나도 불여시 같은 그녀', '밥스카이', 'https://d394jeh9729epj.cloudfront.net/8x0EnIE1x3a-GGKOREtMM0FW/1a74e9c9-d4a5-45e2-8325-81d33512abd7_w600.jpeg', 1, '2024-10-22 20:32:10'),
