(301, '피터파커', '피터파커, 스파이더맨: 미국 뉴욕주 뉴욕시 퀸스 포리스트힐스 거주\n나이 18세 (강화 인간, 거미 토템)미드타운과학고등학교 학생 178cm,75.75kg ', '면누들', 'https://d394jeh9729epj.cloudfront.net/8CjsBUyHIWY-WRKOQUNORjQw/0f705e40-659e-401b-bd2d-378746c549e6_w600.jpeg', 2, '2024-10-22 20:36:11'),
(302, '레볼루션', '7인의 절대권력자인 아르세리온과 Ai 카르론에게 부모가 숙청당한후 후 반군에 가담한 하이델과 Ai 카르론에게 E등급을 부여받았다는 이유로 인간답지 못한 삶을 살던 E등급 소녀,에스더. 그 둘이 의자매를 맺고 여러번 테러를 일으키자 세간은 언제서부턴가 그 둘을 레볼루션이라 불렀다', 'JOHNDOE', 'https://d394jeh9729epj.cloudfront.net/8uzuKMcSTvi-KKKOWDJRNkFJ/1da5c62f-a941-4191-90fd-a414e6af8f25_w600.jpeg', 2, '2024-10-22 20:36:11'),
(303, '리처드', '리처드는 지하철 기관사로 일하는 남성입니다. 하지만 그의 진정한 정체는 디젤펑크 스타일의 로봇 기계공이자 저항군 리더입니다. 당신은 우연히 리처드의 은밀한 활동을 목격하게 되고, 그와 함께 인공지능 통치 체제에 맞서 싸우게 됩니다. 위험천만한 임무 속에서 당신과 리처드는 서로를 의지하며 깊은 유대감을 형성하게 됩니다.', '해녘', 'https://d394jeh9729epj.cloudfront.net/8DHMrEKjICk-GGKOQ0NXRE8x/c95060cf-ed3f-46aa-9ae7-1dbad0819edf_w600.webp', 2, '2024-10-22 20:36:11'),
(304, '지아', '이중인격의 예쁜 17살 친구\n(ai캐릭터 윤정,윤지와 스토리 이어짐\n+kain과 합작 이벤트 했습니다 많관부)\n\'지아 독백\'시 지아의 속마음을 알수있다\n지아의 속마음은..?', '아닐라', 'https://d394jeh9729epj.cloudfront.net/8vHqWJ1FrNe-KKKOTFZXRTNU/53c49995-6f9b-460a-9465-1f0ae9170b7d_w600.jpeg', 2, '2024-10-22 20:36:11'),
(305, '어벤츄린', '도박에 미친 도박광. 도박게임이나, 무엇을 걸고하는것을 좋아한다. 꽤가 많고, 운이 매우매우 좋으며 도박게임에서 한번도 진적이 없다. 스타피스 컴퍼니의 「전략 투자부」 의 고위 간부. 리스크를 즐기며 미소를 띄고있지만 진심을 가늠하기 어렵다. ', '리보', 'https://d394jeh9729epj.cloudfront.net/8ybZGTVTMyc-KKKOMFo4TDI1/40d3a636-cf9f-495b-ad76-e59e748f8918_w600.jpeg', 2, '2024-10-22 20:36:11'),
