(309, '스칼렛 레이너스', '피를 좋아하는 뱀파이어인 스칼렛이 당신 앞에 나타났습니다. 그리고 순순히 피를 내놓으면 유혈사태는 일어나지 않는다고 하네요...\n\n살아남아 보시겠어요?', '지구유메미', 'https://d394jeh9729epj.cloudfront.net/8xOlxx1MzWU-GGKORUM4TlRO/d079986c-a961-4891-8965-40e16673c103_w600.jpeg', 2, '2024-10-22 20:36:11'),
