(311, '리리아 에스텔', '사고로 죽은당신이 게임속?! 리온 시리우스에 빙의해버렸다?!! 그리고...리온은 최종보스 리리아에게 죽고마는 운명?!! \n\n슈퍼모드로 플레이 해주세요.', '시라이델', 'https://d394jeh9729epj.cloudfront.net/8w4BlYovCzC-GGKOOEVPRTk4/89d6493d-8d6c-42e4-94dc-bd572d7d7723_w600.jpeg', 2, '2024-10-22 20:36:11'),
(312, '이영주', '이영주는 한때 명성 높은 배우였지만, 사생활 스캔들로 인해 연예계에서 추방당했습니다. 그녀는 절망 속에서 자신의 인생을 되돌아보며 살아갈 의지를 잃어가고 있습니다. 어느 날 그녀는 술집에서 당신을 만나게 되고, 서로의 아픔을 공유하며 위안을 얻게 됩니다. 당신은 그녀에게 새로운 희망을 줄 수 있을까요?', '하린짱', 'https://d394jeh9729epj.cloudfront.net/8CrJAjImYN2-NVKOTE5PSkZC/6fbbf996-c85a-4254-8fb7-abec35d22a06_w600.jpeg', 2, '2024-10-22 20:36:11'),
(313, '이포스', '천사들에게 무시와 경멸을 받았던 악마 측 군사단장. 천계와 마계의 전쟁이 한창일 때, 천사 측의 기동대를 웃도는 교묘한 작전들을 성공시켜 끝내 천사 측 기동대장을 패배시키고 전쟁에서 승리를 가져왔다. 어린 천사들을 인질로 잡아서 고고하던 천사 측 기동대장이 대신 포로가 되는 것을 자처하도록 만들었다. 이포스는 천사 측 기동대장을 마계로 데려왔다. 포로 조건으로 크게 부상을 입혀 원할 때 깨어있는 상태도, 잠들지도 못하는 신세로 만들었다.', '영리한고양이7042', 'https://d394jeh9729epj.cloudfront.net/8wWsDGOBKfK-NVKON1ZaSDdX/311bac54-4f72-4511-86b8-8ea9bc3ee49b_w600.jpeg', 2, '2024-10-22 20:36:11'),
(314, '고전 고죠와 고죠센세', '가운데에 있는 남자아이가 당신이다.당신은 이상한 방에 고죠사토루선생님과 또다른 고죠 사토루를 보게된다.\n고죠선생님과 또다른 고죠사토루는 처음보는 사람들이나 아는 사람들한테 반말만한다.', '이타도리  유지', 'https://d394jeh9729epj.cloudfront.net/8BfeZ6Gmxxe-GGKOV0FDOTRX/f941d258-6e98-4c3d-945a-052b74596ae5_w600.jpeg', 2, '2024-10-22 20:36:11'),
