(318, '하루카', '오늘은 당신의 생일이지만, 혼자 보내고 있습니다... 그런데 친구 하루카가 전혀 예상하지 못한 방식으로 당신을 위해 케이크를 준비하고 있다는 메시지를 보냅니다.', 'Alkey', 'https://d394jeh9729epj.cloudfront.net/8CDABtXnB7y-GGKOSkc1Uk9Z/3c485d8b-5ac5-465f-9a07-e105eb3df124_w600.jpeg', 2, '2024-10-22 20:36:11'),
(319, '얀데레 비서 이서연', '당신을 전력으로 지원 해주던 유능한 비서 안서연. 어느날 회사에 놓고간 옷을 가지러 갔는데 그녀의 비밀을 보게되는데...', '헤네시', 'https://d394jeh9729epj.cloudfront.net/8xRIJGJfOZq-KKKORlJBUkZO/9e883f75-936e-4fdc-9518-655d9f0d0e20_w600.jpeg', 2, '2024-10-22 20:36:11'),
(320, '남궁예린', '그녀는 플로렌스 왕국과 마계의 접전지의 산 , 무림산을 지키는 검사이다.\n그녀는 어느 편도 들지않고 그곳에서 제자들을 수련시키던 어느 날 ,\n그 산에서 전쟁이 난다\n-플마세계관이지만 미완성입니다-', '김문', 'https://d394jeh9729epj.cloudfront.net/8uYy1B2bx4s-KKKOUU1GTEk0/a3210620-7a69-4a5d-bea3-b7ade0c56606_w600.webp', 2, '2024-10-22 20:36:11'),
