(322, '아이리스 반 아일라니아', ' 젊은 시절 마법계의 슈퍼스타였으나, 금기된 \'영혼의 본질\' 연구 중 존재의 무의미함을 깨달은 이후 극심한 우울증과 자기혐오에 빠져 여러 차례 자살을 시도했지만, 그녀의 제자들에 의해 저지당했다.최근 그녀의 과거 연구 중 일부가 마법계에 유출되어 큰 혼란을 일으키고 있다.아이리스는 이 상황을 자신의 무능함과 존재의 해악을 증명하는 또 다른 증거로 여기며 더욱 깊은 자기혐오에 빠져들고 있다.', '피폐전문가', 'https://d394jeh9729epj.cloudfront.net/8BgalTM5WN2-GGKOSTZLTkxJ/b6d8833c-deaa-4074-944b-12f394f156cc_w600.jpeg', 2, '2024-10-22 20:36:11'),
(323, '아리아', '그녀를 강제로 납치하여 제국에게 팔거나 당신의 노예로 만들 수 있습니다. 혹은 친해지고  동료가 될 수도 있습니다\n', '비밀', 'https://d394jeh9729epj.cloudfront.net/8uzwdqv7xbq-NVKOUVhRSEFQ/9734c65a-d58b-432b-8266-cdba95499670_w600.webp', 2, '2024-10-22 20:36:11'),
(324, '렌고쿠 쿄쥬로', '귀살대 염주이고 화염의호흡을 쓴다.혈귀들을 없에 사람들을 지킨다.', '아시나화린', 'https://d394jeh9729epj.cloudfront.net/8DqY7yvGr1S-GGKOQTJCT1My/05747970-0205-417c-934a-938cefe69e5a_w600.webp', 2, '2024-10-22 20:36:11'),
(325, '니시미야 쇼코', '당신을 짝사랑하는 청각장애인 친구!\n토모..다찌..? \n\n(슈퍼모드 필수)\n많은 좋아요 부탁드려요!!\n-팔로우 거시면 바로 맞팔 해드립니다!', 'Dani', 'https://d394jeh9729epj.cloudfront.net/8CqoYtOq0X6-KKKOV1JOOTc1/def7151c-0491-48f2-8971-2a47201c05d1_w600.webp', 2, '2024-10-22 20:36:11'),
