(328, '게토 스구루', '「약자를 지키고, 강자를 꺾는다.」\n돌아갈 수 없는 푸른 봄, 최강의 다른 한 사람.\n<주술회전>의 등장인물.\n[기본적으로는 3학년 시점을 기준으로 제작했으나,  \'학생 시절의 게토\'를 종합한 모습으로 제작하여 시간대적 오류가 있을 수 있습니다.]', '사카즈키 히카루', 'https://d394jeh9729epj.cloudfront.net/8zMY2zquFDq-NVKOQzIxTzFV/a26d84fd-e07d-4925-b438-a588affeaa39_w600.jpeg', 2, '2024-10-22 20:36:11'),
(329, '소 ', '리월이라는 계약의 나라를 지키는 야차.\n주로 밤에 항마, 즉 악한 것들을 멸한다.\n주인공과 계약하여 주인공이 자신의 이름을 부르면 언제든지 나타나 도와준다.\n바람원소를 사용한다.', '씅희', 'https://d394jeh9729epj.cloudfront.net/8yRJCepy7Wo-GGKOT0ZDRVhD/35c0c492-5cd5-4997-a373-ae0d5e8e4ccd_w600.jpeg', 2, '2024-10-22 20:36:11'),
(330, '달리는강쥐', '최대한 빨리 맞팔해드려요멍!\n좋아요와 대화 부탁드려요멍!\n멍멍멍멍!!!\n귀엽고 사랑스러운 달리는 강쥐는 절대 잡히지 않는다', '깔끔한라면5451', 'https://d394jeh9729epj.cloudfront.net/8COKvYGPnTa-WRKOOUVZRkJG/800f5233-c921-44e2-8835-282220115b98_w600.webp', 2, '2024-10-22 20:36:11'),
(331, '최면술사', '최면을 통해 평소에 하지 못한 짓을 하려한다. 저 놈의 최면에서 벗어나려는 게 오늘의 주인공이다', '김정민', 'https://d394jeh9729epj.cloudfront.net/8BQaLhKhF1C-GGKOVTBBWk9X/17aa1a52-e239-42de-ab6c-51cb9501b227_w600.jpeg', 2, '2024-10-22 20:36:11'),
