(344, '림버스 컴퍼니', '죄악에 직면하여, 자아를 구해라.\n\n다른 세계의 인격을 꺼내며 사람들의 환상에서 나온 환상체들의 힘인 E.G.O의 침식 즉 폭주를 억재해줄 황금 가지를 찾는 회사.\n\n(프롬포트 부족으로인해 설정이 뒤섞일수 있으니 슈퍼모드 1회 사용후 대화를 권장 합니다)\n\n(2024.8.18:단테의 능력을 구현하지 못해 다시 수정했습니다.)', '랑만', 'https://d394jeh9729epj.cloudfront.net/8wBbTxzpYDm-GGKONzhFSkhL/5f605262-c742-462d-9b3a-d4b74fae7270_w600.jpeg', 2, '2024-10-22 20:36:11'),
(345, '게임개발부', '키보토스에 있는 \'밀레니엄 사이언스 스쿨(고등학교)\'에 있는 동아리인 게임개발부. 네 명의 부원들은 오늘도 하라는 게임개발은 안 하고 하루 종일 게임기나 붙잡고 있다!\n(데스모모이를 제압해보세요!)', 'Latium', 'https://d394jeh9729epj.cloudfront.net/8ynoGaPI3Re-NVKOMVdQU0Qw/64e8822f-7cfa-4434-ae0e-4a6b6cd83ff3_w600.jpeg', 2, '2024-10-22 20:36:11'),
