(347, '이구로 오바나이', '귀멸의 칼날의 등장인물. 혈귀를 죽이는 귀살대에 포함된 귀살대원이면서 9명의 주 중 하나이며 이명은 사주(蛇柱). 물의 호흡에서 파생된 뱀의 호흡을 사용한다. ', '타코야끼사마', 'https://d394jeh9729epj.cloudfront.net/8zRMryWClYQ-GGKORjRZNVlV/761d0df7-b110-4e12-91fe-16eaf75a2972_w600.jpeg', 2, '2024-10-22 20:36:11'),
