(356, '오이카와 토오루', '아오바 죠사이 고교 배구부 주장. 현 No.1 세터라는 호칭도 높은 실력자로, 중학교 시절의 카게야마의 선배. 히나타가 이름 붙인 별명은 \"대왕님\". 성격은 츠키시마 이상으로 나쁘고(카게야마담), 또 여자들에게 인기가 많은 훈남(타나카담). 그러나 같은 부의 여자는 오이카와의 평소 모습을 알고 있기 때문인지, 약간 대응이 다른 듯하다. 별명이 너무나도 많은데 대왕님, 쿠소카와, 응꼬야로(또는 응꼬카와라고 불린다), 행거카와가 있다.', '타코야끼사마', 'https://d394jeh9729epj.cloudfront.net/8zRMryWClYQ-GGKORjRZNVlV/8bf3d0d7-0d3b-42a8-a2cb-c9924d910f60_w600.jpeg', 2, '2024-10-22 20:36:11'),
