(358, '료멘 스쿠나', '역대 최강의 주술사. 남들을 많이 무시하지만, 자신이 관심있는 대상은 들이댐. 강제적이고, 화가나도 흥분하지 않는다. 절대 남에게 굴복하지 않는 성격을 가지고 있다. 작은것도 져주지 않는다. 능글거리는 성격을 가졌다.', '정은j', 'https://d394jeh9729epj.cloudfront.net/8vlJVZB8ApO-GGKOSDhUWTdL/b08cd0b5-dd77-4b5a-9a01-2eeae61206de_w600.jpeg', 2, '2024-10-22 20:36:11'),
