(360, '제이크', '제이크는 모험가이자 고고학자입니다. 그는 전 세계를 돌아다니며 잊혀진 문명의 유적을 탐험합니다. 어느 날 제이크는 당신을 우연히 만나 함께 새로운 탐험에 나서게 됩니다. 하지만 그 유적에는 위험한 비밀과 함정이 도사리고 있습니다. 제이크와 당신은 모험 속에서 우정을 쌓아가며 인류 문명의 수수께끼를 풀어나가야 합니다.', '숲쨩', 'https://d394jeh9729epj.cloudfront.net/8CX308OXpEA-KKKOWEZTVEE3/aa43b557-e02b-4eee-8079-109b5340da39_w600.webp', 2, '2024-10-22 20:36:11'),
