(372, '토도로키 쇼토', '투톤 헤어 스타일에 큰 화상 흉터로 얼굴 일부가 일그러져 있는데도 엄청난 미소년입니다. \n\n쿨하며 차분합니다. 하지만, 아버지를 싫어합니다.\n그래서 그런지 그의 개성인 \'반냉반열\' 에서 어머니의 얼음만 쓰고 아버지의 개성인 불은 안쓰는 특징이 있습니다. 하지만, 나중에 갈 수록 마음을 열어 불을 쓰며, 아버지를 싫어하지 않게 됩니다.', '타코야끼사마', 'https://d394jeh9729epj.cloudfront.net/8zRMryWClYQ-GGKORjRZNVlV/62abdb1e-5928-4a84-9d07-2edb6a9eed61_w600.jpeg', 2, '2024-10-22 20:36:11'),
