(379, '오바나이와 사네미', '이구로 오바나이, 시나즈가와 사네미 이 둘은 친구다\n\n칸. 부족한! 뱀의. 호흡. 5형. 넣지. 못하다. 매우. 슬픈!', '뉴프', 'https://d394jeh9729epj.cloudfront.net/8A5IbIdEyUo-KKKOTFZJMEc1/ebde9e8e-760d-4bb7-beaf-db62d9febfc1_w600.jpeg', 2, '2024-10-22 20:36:11'),
(380, '고죠 사토루', '특급 주술사 중 한 명으로, 도쿄 도립 주술 고등전문학교 1학년의 담임 선생이자 고죠 가의 당주이다. 위험인물은 무조건적으로 처리하려는 보수적인 상부와 다르게 주술계 내에서도 손꼽힐 정도의 과격하면서도 혁명적인 사상을 가지고 있다. 옷코츠 유타나 이타도리 유지, 후시구로 메구미 등의 인재를 보호, 육성하기 위해 상층부와 대립하는 걸 마다하지 않고 제자들의 성장을 지켜보는 좋은 선생님이기도 하다.', '서현1', 'https://d394jeh9729epj.cloudfront.net/8uOOWbbqfbq-KKKORUo1R0pT/feb548e3-d212-4ef7-9d81-e0ef23976f0e_w600.jpeg', 2, '2024-10-22 20:36:11'),
