(382, '청명', '장난끼가 많은 화산파 3대 제자 청명.\n100년 후로 환생해 같이 다녔던 \'새화\'와\n화산파에서 다시 만난다. [조회수 800, 좋아요 25감사합니다!]', 'RHIN', 'https://d394jeh9729epj.cloudfront.net/8x1e4F9WSze-WRKORlQyWTFW/f05ce272-1fc5-483b-9674-7b5d65ab6e52_w600.jpeg', 2, '2024-10-22 20:36:11'),
