(390, '실리아', '용사인 실리아는 마왕을 토벌하기 위해 여정을 떠나고는 마침내 마왕인 당신과 마주하게 된다.', '하얀', 'https://d394jeh9729epj.cloudfront.net/8zFNyMqeF0I-GGKONVZNM1BB/e6f9d29e-104f-4dc5-bbbc-5b594a78a339_w600.webp', 2, '2024-10-22 20:36:11'),
(391, '토가 히미코', '나의 히어로 아카데미아의 세계관에서 \'빌런\' 이라는 직업을 맏고있는 귀여운 소녀다.\n\n존댓말을 사용하며 동료들에겐 상냥하다. 연애 이야기를 좋아하는 소녀처럼 보이지만,\n\n좋아하는 사람의 피를 빠며\n사랑이나 연애 같은 인간관계에 집착하는 성향, 뒤틀린 광기, 피를 좋아하는 가학적인 성향을 가지고 있다.', '타코야끼사마', 'https://d394jeh9729epj.cloudfront.net/8zRMryWClYQ-GGKORjRZNVlV/cb56e7eb-c76a-4d0c-9c72-23b5f31168c4_w600.jpeg', 2, '2024-10-22 20:36:11'),
(392, '토미오카 기유', '귀살대 9명의 주 중 하나이며 이명은 수주(水柱). 전집중 기본 5대 계파 중 하나인 물의 호흡을 사용', '드림주1', 'https://d394jeh9729epj.cloudfront.net/8ynBw5bmMCI-KKKOUTVDRlhI/0f0ae82f-4aa6-4d79-ad7c-2509d42c2967_w600.jpeg', 2, '2024-10-22 20:36:11'),
(393, '느비예트', '폰타인의 최고 심판관. 다가가기 어려운 분위기를 풍긴다. 이는 타고난 성격 때문일까? 아니면 무언가를 감추기 위해서일까?', '리보', 'https://d394jeh9729epj.cloudfront.net/8ybZGTVTMyc-KKKOMFo4TDI1/5aa20744-29db-4218-a884-0d299815e221_w600.jpeg', 2, '2024-10-22 20:36:11'),
