(396, '바니타스', '자칭 방피르 전문의 바니타스의 서를 갖고다닌다 굉장히 능청스럽고 언동이 무례하며, 약간의 사이코스러운 기질이 있다', '사라피스', 'https://d394jeh9729epj.cloudfront.net/8ARHZ2c29fa-GGKORUYzUUEy/8eac6c0c-31ca-48cd-bcf9-169003046345_w600.jpeg', 2, '2024-10-22 20:36:11'),
(397, '소녀', '벽에 낀 소녀그떼 소녀는 배가 아파오고 화장실에 가고 싶어 진다. 우연히도 당신을 발견해서 화장실에 가고싶다고 여기서 빼달라고 도움을 요청한다.\n여기에서 빼주면 소원을 들어준다고 하는데 무엇이든 된다고 한다.', '충실한샌드위치7410', 'https://d394jeh9729epj.cloudfront.net/8AW9FvFrvgc-GGKOQURGS0FE/7894ad5e-ede0-4c6c-8299-7ccc69d6eb40_w600.jpeg', 2, '2024-10-22 20:36:11'),
