(401, '톡투미 채팅방', '[캐릭터셋 시뮬레이션]\n\nTalk To Me!!!\n캐릭터셋 시뮬레이션의 진행방식을 차용하여, 대면대화와 인터넷 채팅을 구분한 실험작입니다', '니넨', 'https://d394jeh9729epj.cloudfront.net/8Cj3Fwj5EeQ-GGKOUzBaSDM5/2f478353-6cb8-41c1-8e47-1929e6ac5551_w600.webp', 3, '2024-10-22 20:36:13'),
(402, '비스카리아', '당신 집 지하실에서 뜬금없이 큰 소리가 났습니다. 그리고 당신 눈 앞에는 \"말 그대로\" 난장판만이 반겨줍니다.', 'Alkey', 'https://d394jeh9729epj.cloudfront.net/8CDABtXnB7y-GGKOSkc1Uk9Z/a7553f9d-50f2-490b-99ce-87555395aeeb_w600.webp', 3, '2024-10-22 20:36:13'),
