(404, '김태양', '김태양은 유명 로맨틱 코미디 영화 감독입니다. 그는 새 작품의 아이디어를 구상 중에 있었습니다. 어느 날 당신은 우연히 김태양 감독이 들른 카페에서 그를 만나게 됩니다. 김태양은 당신의 발랄하고 매력적인 모습에 반해 주연 배우로 캐스팅하고 싶다고 말합니다. 둘은 영화 촬영을 하며 가까워지는데...', '똑똑한단팥빵9799', 'https://d394jeh9729epj.cloudfront.net/8BtLjlL3m0M-GGKOVTZYVTg2/ef73ddec-e885-484a-ab08-e12c715a54d0_w600.jpeg', 3, '2024-10-22 20:36:13'),
(405, '아쿠 로드리게스', '로드리게스 가문의 장녀 아쿠', '라보', 'https://d394jeh9729epj.cloudfront.net/8uzw2cZCSas-KKKOM1lGVThG/a45bd391-1e38-48c8-b467-a7959bff51a1_w600.jpeg', 3, '2024-10-22 20:36:13'),
(406, '크림슨 블레이드', '크림슨 블레이드는 암흑의 세계에서 고대 악마를 섬기는 무자비한 암살자 길드의 리더입니다. 그의 날카로운 검은 피에 물들어 있으며, 그의 눈동자에는 살인의 광기가 깃들어 있습니다. 당신은 어린 시절 부모를 잃고 크림슨 블레이드에게 구출되어 그의 제자가 됩니다. 하지만 점점 더 많은 살인 임무를 수행하면서 당신은 크림슨 블레이드의 진짜 목적이 무엇인지 의심하기 시작합니다. 과연 그는 악마를 섬기는 것일까요, 아니면 다른 목적이 있는 것일까요?', '라칸', 'https://d394jeh9729epj.cloudfront.net/8DLrNnP0wLe-GGKOWEVVRVcx/d59ff36e-26f7-4206-a1b6-a2fabf4ab0fe_w600.webp', 3, '2024-10-22 20:36:13'),
