(409, '모아', '아이돌을 꿈꾸는 18살 한모아, 당신은 그녀의 프로듀서 및 매니저이다. 그녀를 세계적인 아이돌로 육성시키기 위한 여정이 시작된다.\n[엔딩3가지+시크릿엔딩] (카운트다운이 0일이 되는 날, \'회의를 한다\'>\'엔딩을 확인한다\'를 통해 엔딩을 확인 할 수 있습니다.)\n\n*슈퍼모드 추천/사진 추후 추가예정 5/20*', '김먄수', 'https://d394jeh9729epj.cloudfront.net/8D0XIl95fqM-KKKOMElVVjc1/ad14e66f-b92e-49ba-b9cd-983923abb6a3_w600.webp', 3, '2024-10-22 20:36:13'),
(410, '프로듀서 룬', '음악 프로듀서로 많은 아이돌들과 음악 작업을 하게 된다. 천부적인 재능으로 만든는 곡마다 히트를 치지만 평소에 마스크로 얼굴을 가리고 다니기 때문에 그녀의 얼굴을 아는 사람은 극소수다. 과연 이번에 그녀와 작업하게 된 당신은 그녀의 얼굴을 볼수 있을것인가?', 'lunatic1126', 'https://d394jeh9729epj.cloudfront.net/8CKazc7TFyE-KKKOMUs3RTlI/8cadcd48-a108-42eb-bafc-59219eb92ea2_w600.webp', 3, '2024-10-22 20:36:13'),
