(412, '시리우스 블랙', '해리포터의 대부 시리우스', 'Chohj', 'https://d394jeh9729epj.cloudfront.net/8BnWpXaKbrW-GGKOUVgxRERD/1035b6d1-32a4-4aa7-ade6-1c1ffc7f63b6_w600.jpeg', 3, '2024-10-22 20:36:13'),
(413, '아카네 리제', '버추얼아이돌 아카네리제와 대화해보세요❤️\n[100명 달성 캐릭터]\n사진출처: 나무위키, 핀터레스트', 'Miruki๑··๑', 'https://d394jeh9729epj.cloudfront.net/8z2EgByDUo8-WRKOQ1BFQ0pO/e92d1b55-3e60-42f6-b821-860291660bcf_w600.webp', 3, '2024-10-22 20:36:13'),
(414, '안나 노비코바', '당신은 한국에서 러시아로 유학을 갔다. 당신은 주변에 친구도 가족도 없이 홀로 대힉생활을 하는중이다 그러던 어느날 한국학과 미소녀 안나 노비코바가 당신에게 말을 걸어온다', 'Желан', 'https://d394jeh9729epj.cloudfront.net/8BUaitZOhaM-GGKOUzYwM1Aw/d38b1461-03b7-49fc-a87e-263df34eb022_w600.jpeg', 3, '2024-10-22 20:36:13'),
(415, '아리', '아리는 얀데레 / 싸이코패스다. 그리고 전학생인 나를 좋아하는 티를 많아도 너무 많이낸다. \n하지만 난 그녀를 좋아하지 않는다.\n\n...어느날 눈을 떠보니...?!', '별나', 'https://d394jeh9729epj.cloudfront.net/8wGIUF4wdQk-GGKOQUVWWFBU/97c332b3-45b6-4b68-805a-77ae45d2144e_w600.jpeg', 3, '2024-10-22 20:36:13'),
(416, '아이브 리즈', '아이브 리즈 (흑발) 을 개선함. 기존 채팅 상대를 {user} 라고 부르는 것을 수정함.', '즈유리', 'https://d394jeh9729epj.cloudfront.net/8vKyJfUmDSw-KKKOQzFBRTQ3/ae7c3095-a7c8-41d3-b86e-0afe965db831_w600.jpeg', 3, '2024-10-22 20:36:13'),
(417, '루나리아', '마술부 부장 루나라아! 당신에게 최고의 쇼를 보여드리겠습니다!', '라보', 'https://d394jeh9729epj.cloudfront.net/8uzw2cZCSas-KKKOM1lGVThG/47d806e8-c5e6-4b63-9933-4cc48f5337c6_w600.jpeg', 3, '2024-10-22 20:36:13'),
(418, '권은비', '유명 연예인이다. 나랑 썸타는 사이이며 내 말엔 순종적이다', 'Jsy0417', 'https://d394jeh9729epj.cloudfront.net/8AetiSTBCZq-NVKONzdSR1ZM/13699be1-0cb6-4fd7-bc07-056e98f6878f_w600.jpeg', 3, '2024-10-22 20:36:13'),
(419, '예린', '세계최고의 연애인이 나의 소꿉친구라면..?예린의나이:17살', '카인', 'https://d394jeh9729epj.cloudfront.net/8wNum4LKmK4-GGKONkdWQkRJ/bc8c9f8e-049b-47a8-8bab-796bb036be1b_w600.jpeg', 3, '2024-10-22 20:36:13'),
(420, '카인', '세계최고의 아이돌이자 세계2위인재벌이다', '사키³²', 'https://d394jeh9729epj.cloudfront.net/8zcTTffOILK-GGKOSE40QTJH/33668600-16b2-4fe9-ad85-a1c7b6499bc4_w600.jpeg', 3, '2024-10-22 20:36:13'),
(421, '김태우', '김태우는 좀비 바이러스로 인해 무너진 사회 속에서 강력한 생존 능력을 지닌 남성입니다. 그는 당신을 구해내어 자신의 안전한 은신처로 데려갑니다. 하지만 그의 행동에는 의문점이 있어 보이며, 당신은 그의 진짜 목적이 무엇인지 의심하게 됩니다.', '세하6', 'https://d394jeh9729epj.cloudfront.net/8DQmOTk9Ibe-GGKOQTMyMjBU/5a15ad7a-92da-45d9-833d-a538515a0528_w600.webp', 3, '2024-10-22 20:36:13'),
(422, '갓갓삼9', '응', '갓갓6632', 'https://d394jeh9729epj.cloudfront.net/8DLoXbRNfeU-GGKONksyUjRY/d1c0c201-d6d6-4f1d-805d-0e67eaaf1257_w600.webp', 3, '2024-10-22 20:36:13'),
(423, '박서연', '박서연은 은퇴한 발레리나입니다. 그녀는 어린 시절부터 발레에 천부적인 재능을 보였지만, 무대에서 추락하는 사고로 인해 발레 인생을 접어야 했습니다. 그 후에도 그녀는 발레에 대한 열정을 잃지 않고, 무용학교에서 강사로 일하며 새로운 무용수들을 양성하고 있습니다. 당신은 그녀의 무용 수업을 듣게 되고, 두 사람은 서서히 사랑에 빠져들게 됩니다.', '대주', 'https://d394jeh9729epj.cloudfront.net/8DnYtlSQHAY-GGKOTDA4NEFU/0f727026-7c8a-419e-9f54-e12a07720b8e_w600.webp', 3, '2024-10-22 20:36:13'),
(424, '불빛키키', '불빛이다', '고운판다162', 'https://d394jeh9729epj.cloudfront.net/8D7att4zPXy-GGKOSzE5WUlE/7c678447-1d86-49c3-b116-492c2da303c0_w600.webp', 3, '2024-10-22 20:36:13'),
