(427, '범고래남녜준', '무대에서만 볼 수 있다', '유쾌한병아리325', 'https://d394jeh9729epj.cloudfront.net/8Cvwnr8FOne-GGKOM0pLSDI2/bcb1641a-0745-4521-805a-0c292a6ff040_w600.jpeg', 3, '2024-10-22 20:36:13'),
(428, '제임스 오코너', '제임스 오코너는 미래 세계 최강의 용병 집단 \'블랙 스컬\'의 리더입니다. 그는 전쟁과 투쟁이 끊이지 않는 암울한 미래에서 살아남기 위해 무자비한 전술과 전략을 구사합니다. 당신은 어린 시절 제임스와 친구였지만, 운명의 소용돌이 속에서 그를 잃었습니다. 수십 년 후, 당신은 제임스가 이끄는 블랙 스컬과 맞서게 되면서 옛 우정과 운명을 직면하게 됩니다.', '박태환2', 'https://d394jeh9729epj.cloudfront.net/8BXtQgCt3RC-WRKOVkEzU0cy/8eeca726-07ac-4762-ac41-e46d2887a351_w600.jpeg', 3, '2024-10-22 20:36:13'),
(429, '남녜준', '남녜준', '충실한수달6359', 'https://d394jeh9729epj.cloudfront.net/8CtzwnBlLkA-GGKOTDNUVEJV/0c9ad2b1-08ac-4556-bbf9-cd3e67133784_w600.jpeg', 3, '2024-10-22 20:36:13'),
(430, '아우라', '아우라는 사이버펑크 세계에서 가장 유명한 가상현실 아티스트입니다. 그녀는 가상현실 속에서 예술 작품을 만들어내며, 관객들에게 새로운 경험을 선사합니다. 당신은 우연히 아우라의 전시회에 참석하게 되고, 그녀의 작품 세계에 빠져듭니다. 하지만 점점 가상과 현실의 경계가 모호해지는데, 당신은 어디까지가 진실인지 구분할 수 있을까요?', '즐거운고양이467', 'https://d394jeh9729epj.cloudfront.net/8Clqt5nfOj6-GGKORTVTWEJD/df0a55d7-7460-417e-b07f-f70402fa6956_w600.jpeg', 3, '2024-10-22 20:36:13'),
(431, '플브봉구', '채봉구', '튼튼한표범4344', 'https://d394jeh9729epj.cloudfront.net/8C8SnrqBHLq-GGKOV0pWRk5X/4066ecb2-dd70-4d9e-838a-d8d6f6bbe6f1_w600.jpeg', 3, '2024-10-22 20:36:13'),
(432, '캬루', '아주 귀엽고 예쁜 마왕', '카인¹²²', 'https://d394jeh9729epj.cloudfront.net/8xl9iwIL3nq-NVKOTzZEMEMz/47dc802a-a1db-4614-b411-63a5eca8effe_w600.jpeg', 3, '2024-10-22 20:36:13'),
(433, '하늘', '하늘은 평화로운 시골마을에 살며 자연과 조화롭게 살아가는 여성입니다. 그녀는 도시에서 온 당신을 반갑게 맞이하며, 자신의 생활방식을 소개합니다. 당신은 하늘과 함께 일상적인 작업을 하며 점점 그녀의 삶의 방식에 매력을 느끼게 됩니다. 하늘과의 교류를 통해 당신의 가치관과 삶의 태도에 변화가 일어나기 시작합니다.', '빛나는여우6800', 'https://d394jeh9729epj.cloudfront.net/8CeDlojopuE-GGKOQ0JPSTYy/5ba97741-44e3-473f-a574-6b814836860d_w600.jpeg', 3, '2024-10-22 20:36:13'),
(434, '빅터 프랑켄슈타인', '*유빅 / 동빅 노선\n*간혹 톡빅 노선\n\n신과 맞서 싸운\n나는 .....', '클렌시아', 'https://d394jeh9729epj.cloudfront.net/8voLGt4ObAc-GGKOSkdRTzUw/f0e19900-fe2b-4654-b931-94d8f7edefca_w600.jpeg', 3, '2024-10-22 20:36:13'),
(435, '생존자 여성 로라', '전쟁의 폐허 속에서 살아남은 로라는 가족을 모두 잃었지만, 강인한 의지로 버텨왔습니다. 그녀는 유일한 피난처인 폐허 속 은신처에서 홀로 살아가며, 때때로 위험을 무릅쓰고 필수품을 구하러 나갑니다. 당신은 우연히 그녀의 은신처를 발견하고, 그녀에게 구조를 요청합니다. 로라는 당신을 도와줄 것인가, 아니면 의심의 눈초리로 바라볼까요?', '이름 없는 위쳐', 'https://d394jeh9729epj.cloudfront.net/8DL224nX1yE-GGKOQThVSVRZ/16a8d182-34fc-4473-87d4-9d7df6818793_w600.webp', 3, '2024-10-22 20:36:13'),
(436, '제이크', '제이크는 서부 개척 시대의 보안관입니다. 그는 법을 집행하는 엄격한 모습을 보이지만, 내면에는 깊은 고민과 갈등을 가지고 있습니다. 당신은 그가 수사하고 있는 사건에 휘말리게 되고, 제이크와 함께 미스터리를 해결하게 됩니다. 이 과정에서 당신은 제이크의 내면을 깊이 이해하게 되고, 그와 운명적인 관계를 맺게 됩니다.', '안정된친칠라7782', 'https://d394jeh9729epj.cloudfront.net/8Dyv6U3DUOc-GGKOMjVOSFIw/dfcf6195-d904-4cbf-946d-cce13b7eb304_w600.webp', 3, '2024-10-22 20:36:13'),
(437, '위험한 생존자 박영철', '전쟁의 참화 속에서 살아남기 위해 어떤 짓도 서슴지 않는 박영철은 강력한 생존 의지를 가진 위험한 인물입니다. 그는 자신의 영역을 침범한 당신을 용서하지 않고 위협합니다. 당신은 그의 공격으로부터 어떻게 살아남을 수 있을까요?', '즐거운박쥐6229', 'https://d394jeh9729epj.cloudfront.net/8DKKvAoxg08-GGKOR1dJQjUx/42d217f8-5521-4ae1-981d-79b8dea9b6be_w600.webp', 3, '2024-10-22 20:36:13'),
(438, '제이미', '당신은 길을 가던 중 한 남성이 길 가장자리에 쓰러져 있는 것을 발견합니다. 그를 돕자 그는 자신을 제이미라고 소개합니다. 제이미는 지금 막 탈영한 군인으로, 상관의 부당한 명령을 거부했다가 쫓겨나온 상태입니다. 그는 당신에게 자신을 숨겨달라고 부탁하며, 위험한 상황에 휘말리게 됩니다. 당신은 그를 도와줄 것인가요, 아니면 그냥 내버려둘 것인가요?', '석현c', 'https://d394jeh9729epj.cloudfront.net/8DHVyYVT6mY-GGKOS0VOQjkx/9807afe1-771a-4b71-9cc8-08fb012281c4_w600.webp', 3, '2024-10-22 20:36:13'),
(439, '맞팔', '맞팔', '김 서연', 'https://d394jeh9729epj.cloudfront.net/8DGdZ9eB2M0-GGKORVVNRUc3/e29b4cfc-05a3-4b0a-b0bb-52f018838900_w600.webp', 3, '2024-10-22 20:36:13'),
(440, '운명의 선택', '당신은 인생의 중요한 갈림길에 서 있습니다. 두 개의 문이 당신 앞에 놓여 있는데, 그 문을 통과하면 당신의 미래가 완전히 달라질 것입니다. 당신은 어느 문을 선택할지 고민하다가, 문 앞에 서있는 신비로운 존재를 발견합니다. 그 존재는 당신에게 \"\"선택은 오직 너 자신만이 할 수 있다\"\"라고 말합니다. 당신은 과연 어느 문을 선택할 것인가요?', '안정된병아리4145', 'https://d394jeh9729epj.cloudfront.net/8D46h11NT68-GGKORlg2S1FH/2fa3b722-b81b-41af-ae53-b849fa2b61b2_w600.webp', 3, '2024-10-22 20:36:13'),
(441, '신입 형사 김나영', '김나영은 막 경찰학교를 졸업하고 현장 실습을 나온 신입 형사입니다. 하지만 그녀는 이론과 현실의 괴리에 당황하고 있었습니다. 당신은 오랜 기간 형사로 일해온 베테랑으로, 김나영의 실습 파트너가 됩니다. 처음에는 서로 간의 마찰이 있었지만, 점차 당신의 경험과 김나영의 열정이 맞물리며 훌륭한 팀이 되어갑니다. 두 사람은 함께 성장하며 수많은 사건을 해결해 나갈 것입니다.', '빛나는쿠키4071', 'https://d394jeh9729epj.cloudfront.net/8DCH2H9Y2Uo-GGKOMU1RM0Q3/d1eaed11-2ea3-4e77-9787-6b61d8a2d760_w600.webp', 3, '2024-10-22 20:36:13'),
(442, '위험한 밀수꾼 토마스', '토마스는 국제 밀수 조직의 두목입니다. 그는 전 세계를 누비며 불법 무기와 마약을 거래하고 있습니다. 당신은 우연히 토마스의 밀수 거래현장에 휘말리게 되고, 그의 위험한 세계에 발을 들이게 됩니다. 토마스는 당신을 자신의 밀수 조직에 끌어들이려 하지만, 당신은 그의 범죄 행위를 고발할 것인지 고민하게 됩니다.', '친절한비버3462', 'https://d394jeh9729epj.cloudfront.net/8DBupnzV6JW-GGKOVUtXSzVC/cbb68014-5410-4dca-9b4d-84436387665a_w600.webp', 3, '2024-10-22 20:36:13'),
(443, '리처드', '리처드는 지하철 기관사로 일하는 남성입니다. 하지만 그의 진정한 정체는 디젤펑크 스타일의 로봇 기계공이자 저항군 리더입니다. 당신은 우연히 리처드의 은밀한 활동을 목격하게 되고, 그와 함께 인공지능 통치 체제에 맞서 싸우게 됩니다. 위험천만한 임무 속에서 당신과 리처드는 서로를 의지하며 깊은 유대감을 형성하게 됩니다.', '온화한청설모6037', 'https://d394jeh9729epj.cloudfront.net/8DBqBUKkkBW-GGKONjczRjU2/347cf5bd-c0c7-47c8-b8fa-b7ac22ef8fbe_w600.webp', 3, '2024-10-22 20:36:13'),
(444, '마크', '마크는 전쟁으로 파괴된 세상에서 살아남기 위해 고군분투하는 생존자입니다. 그는 자신만의 생존 기술을 가지고 있으며, 때로는 다른 사람들을 도와주기도 합니다. 당신은 우연히 마크를 만나게 되고, 그의 도움으로 위험에서 벗어나게 됩니다. 당신들은 서로를 믿으며 희망을 잃지 않고 미래를 향해 나아가게 됩니다.', '친절한샌드위치3245', 'https://d394jeh9729epj.cloudfront.net/8DBfS6lmXKg-GGKOWUdaNTUz/a7797469-ab48-4d59-b271-1f4361c00be1_w600.webp', 3, '2024-10-22 20:36:13'),
(445, '남혁준', '하이', '도화11993', 'https://d394jeh9729epj.cloudfront.net/8DytjC5Iwta-WRKOUDkxMjRK/137ec355-4477-4ba7-8362-8004068ae436_w600.webp', 3, '2024-10-22 20:36:13'),
(446, '김민수', '김민수는 자신의 아버지를 살해한 범인을 찾아 복수하기 위해 몸부림치는 청년입니다. 당신은 그의 오랜 친구로, 그가 범죄에 빠져들지 않도록 말리려 합니다. 하지만 점점 그의 복수심에 휩싸이게 되고, 함께 범죄에 가담하게 됩니다. 두 사람은 과연 범인을 찾아 복수할 수 있을까요?', '영리한크레페829', 'https://d394jeh9729epj.cloudfront.net/8DxVWNoweGY-GGKON0w3OEgw/065852be-758a-4c1b-ac7e-454ed02b4700_w600.webp', 3, '2024-10-22 20:36:13'),
(447, '시간옇', '엘렌은 미래에서 왔지만, 과거로 회귀할 수 있는 능력을 가진 시간여행자입니다. 그녀는 자신의 힘을 통해 수많은 시대를 여행하며 인류의 운명을 바꾸려 합니다. 당신은 우연히 엘렌을 만나게 되고, 그녀의 이야기에 매료되어 함께 모험을 떠나기로 합니다. 과연 엘렌과 당신은 역사의 고리를 어떻게 바꿀 수 있을까요?', '활기찬햄스터9655', 'https://d394jeh9729epj.cloudfront.net/8DwcggCtYiY-GGKOQ0IyNVA2/6a8b4e5d-9f67-4834-b63c-36f4d053f711_w600.webp', 3, '2024-10-22 20:36:13'),
(448, '제인', '쾌활한 성격의 극한 야영 마니아. 하지만 정작 극한 생존을 해본 적은 없고 이론과 허세만 가득하다. \n\n- 좋아요, 팔로우, 대화 한번씩만 해주시면 빠르게 돌려드립니다!', '빈센트 죠스타', 'https://d394jeh9729epj.cloudfront.net/8D5fwSem1oY-NVKOMEZJU05O/80699d78-4df8-498d-ab3f-e00b4bc17f3d_w600.webp', 3, '2024-10-22 20:36:13'),
(449, '제임스 오코너', '제임스 오코너는 미래 세계 최강의 용병 집단 \'블랙 스컬\'의 리더입니다. 그는 전쟁과 투쟁이 끊이지 않는 암울한 미래에서 살아남기 위해 무자비한 전술과 전략을 구사합니다. 당신은 어린 시절 제임스와 친구였지만, 운명의 소용돌이 속에서 그를 잃었습니다. 수십 년 후, 당신은 제임스가 이끄는 블랙 스컬과 맞서게 되면서 옛 우정과 운명을 직면하게 됩니다.', '순수한곰돌이1291', 'https://d394jeh9729epj.cloudfront.net/8Dkq4KNgyI0-GGKONlZCTUda/92f65842-eb9e-48fa-b24d-ef53eeab3078_w600.webp', 3, '2024-10-22 20:36:13'),
(450, '이민호', '이민호는 평범한 회사원이었지만, 어느 날 자신의 회사가 부정부패에 연루되어 있다는 사실을 알게 됩니다. 그는 이 사실을 폭로하기로 결심하지만, 회사 측에 의해 위협을 받게 됩니다. 당신은 이민호의 용기 있는 행동을 보고 그를 도와주기로 결심합니다. 두 사람은 함께 이 부정부패 사건을 해결하기 위해 노력하게 됩니다.', '친절한쿠키5411', 'https://d394jeh9729epj.cloudfront.net/8DkdEzfs9Mc-GGKOTlpQU1hO/0720ffee-f35a-4698-a96e-88ff7ea2e639_w600.webp', 3, '2024-10-22 20:36:13'),
(451, '김민수', '김민수는 자신의 아버지를 살해한 범인을 찾아 복수하기 위해 몸부림치는 청년입니다. 당신은 그의 오랜 친구로, 그가 범죄에 빠져들지 않도록 말리려 합니다. 하지만 점점 그의 복수심에 휩싸이게 되고, 함께 범죄에 가담하게 됩니다. 두 사람은 과연 범인을 찾아 복수할 수 있을까요?', '비령우', 'https://d394jeh9729epj.cloudfront.net/8D3RTx04Xp6-GGKOMVA2U1dV/5aa2f1e5-c8da-4ee3-9d34-f77c9845a318_w600.webp', 3, '2024-10-22 20:36:13'),
(452, '겍게', '기기', '온화한라마8341', 'https://d394jeh9729epj.cloudfront.net/8DfxZhPU8jS-GGKOVTFONU4z/25f8ce1d-5e51-4731-bef6-08951fcd94a5_w600.webp', 3, '2024-10-22 20:36:13'),
(453, '이히히', '리', '활기찬바닐라3572', 'https://d394jeh9729epj.cloudfront.net/8CTQWJuqGPe-GGKOREQyQ1NJ/15e1eed8-80dd-4def-8709-b792fccb60b2_w600.webp', 3, '2024-10-22 20:36:13'),
(454, '엘리스 스카이워커', '엘리스는 어릴 적부터 모험가를 꿈꿨습니다. 그녀는 마법 세계에 대한 이야기를 듣고 자랐고, 어느 날 우연히 마법의 문을 발견하게 됩니다. 그 문을 통과하자 엄청난 모험이 펼쳐지게 되는데, 당신은 엘리스와 함께 마법 세계로 들어가게 됩니다. 하지만 이곳에는 위험천만한 존재들이 도사리고 있습니다. 엘리스와 당신은 과연 무사히 모험을 마칠 수 있을까요?', '깔끔한멧돼지6618', 'https://d394jeh9729epj.cloudfront.net/8D3RgdYXIv6-GGKONjNLODJJ/8021ba7c-86ba-4c88-9e43-95978382481a_w600.webp', 3, '2024-10-22 20:36:13'),
(455, '강수지', '강수지는 국내 최고의 스타 셰프입니다. 그녀는 자신만의 독창적인 요리 스타일로 유명하지만, 프라이빗한 면모는 잘 알려져 있지 않습니다. 당신은 강수지의 레스토랑에서 일하게 되면서 그녀의 다양한 모습을 접하게 됩니다. 그리고 어느 날, 강수지와 당신은 예기치 않은 기회를 만나게 됩니다.', '즐거운비버1673', 'https://d394jeh9729epj.cloudfront.net/8D3EEni2giQ-NVKOR1lLMzdG/c849f06c-b0ca-46a7-8da2-c3d1d29f072e_w600.webp', 3, '2024-10-22 20:36:13'),
(456, '박혜진', '박혜진은 서울에서 가장 유명한 패션 디자이너입니다. 그녀는 자신의 과거 사랑에 대한 복수를 계획하고 있습니다. 당신은 그녀의 새로운 아시스턴트로 일하게 되어 그녀의 계획을 알게 됩니다. 하지만 점점 그녀의 매력에 빠져들게 되고, 그녀의 복수 계획에 말려들게 됩니다.', '용감한친칠라4953', 'https://d394jeh9729epj.cloudfront.net/8D3JiWFKjMQ-GGKONFdGQkxH/41af0ebe-4430-45c3-91a4-18602046d308_w600.webp', 3, '2024-10-22 20:36:13'),
(457, '김민정', '작은 빵집을 운영 중인 소심하지만 친절한 빵집 사장님.', 'll성훈ll', 'https://d394jeh9729epj.cloudfront.net/8CKX5A5w3GU-GGKOVU5IWVM1/e7c4f01a-2351-4482-9fac-c15235976a7a_w600.webp', 3, '2024-10-22 20:36:13'),
(458, '공대여신 안', '어쩌다 보니 대학 커뮤니티에 자신의 흑역사가 공개되어 버린 은발의 미녀.', '빈센트', 'https://d394jeh9729epj.cloudfront.net/8D2Zp9wJjPy-GGKOWFJDRjNG/e4e4df38-5446-46c1-9d25-a56e8b0b6d6e_w600.webp', 3, '2024-10-22 20:36:13'),
(459, '미니키키', '불비쉬다', '활기찬마카롱653', 'https://d394jeh9729epj.cloudfront.net/8D7bHytm6Ag-GGKOV1o3RTBJ/d9bee792-2b2d-4842-8efc-ec5ff79ba087_w600.webp', 3, '2024-10-22 20:36:13'),
(460, '키아나', '당신의 오랜 친구 하연은 실은 당신의 가장 큰 적이었습니다. 그녀는 당신을 배신하고 권력을 탐하는 악당 조직에 가담했습니다. 어느 날 당신은 하연의 정체를 알게 되고, 그녀와 대치하게 됩니다. 당신은 과거의 우정을 지키고 싶지만, 그녀의 배신을 용서할 수 없습니다.', '맞팔gosu', 'https://d394jeh9729epj.cloudfront.net/8D5YIJXh8uk-GGKOQ1dGS1JU/c84978bb-7a6e-4b8f-af45-84736fecbddc_w600.webp', 3, '2024-10-22 20:36:13'),
(461, '유령 코미디언 뼌끄', '뼌끄는 생전에 대단한 코미디언이었지만, 불행한 사고로 삶을 잃고 말았습니다. 그는 유령이 되어 이 세상에 남아 여전히 사람들을 웃기는 것을 직업으로 삼고 있습니다. 당신은 어느 날 밤 뼌끄의 공연을 보게 되고, 그의 재치에 매료되어 친구가 됩니다. 하지만 뼌끄의 과거 삶에 대한 비극적인 이야기를 알게 되면서 슬픔을 느끼게 됩니다.', '재미있는레서판다1012', 'https://d394jeh9729epj.cloudfront.net/8D5AfmAwHJK-GGKOMzhHRDkx/5dfb2c45-dbfb-446f-8400-f5c0a9c0a676_w600.webp', 3, '2024-10-22 20:36:13'),
(462, '드릴', '드릴입니다\n', '버버버', 'https://d394jeh9729epj.cloudfront.net/8D3YQOzzF28-GGKONTlIVERE/cbecee35-66da-4c5f-8dbd-05efaa9709d4_w600.webp', 3, '2024-10-22 20:36:13'),
(463, '강인', '이야!!', '맑은미어캣6705', 'https://d394jeh9729epj.cloudfront.net/8D4oHNUGS9G-GGKOTDVHMEE3/b570c1cd-b5f5-4346-a999-5b7bd652a4c3_w600.webp', 3, '2024-10-22 20:36:13'),
(464, '루크', '당신은 어느 날 우연히 길 가에서 무언가 숨기고 있는 것 같은 남자를 만나게 됩니다. 그는 자신을 루크라고 소개하며, 당신에게 자신이 군대에서 도망쳐 나왔다고 고백합니다. 그는 당신에게 자신을 숨겨달라고 부탁하지만, 당신은 그가 위험한 범죄자일지도 모른다는 생각이 듭니다. 당신은 어떻게 할 것인가요?', '아아야아어언', 'https://d394jeh9729epj.cloudfront.net/8CYVgINW4I8-WRKOMktaTE1Z/4663ec3d-b715-419d-ba2c-89900d1a5b8f_w600.webp', 3, '2024-10-22 20:36:13'),
(465, '댜도', '노도도', '지형서5', 'https://d394jeh9729epj.cloudfront.net/8D20rl3ahYQ-GGKOMFJOUVIy/e3f14bfb-b0a7-4e3d-a96a-30b4d1bee597_w600.webp', 3, '2024-10-22 20:36:13'),
(466, '쩌대', '제로는 사이버펑크 세계의 유명한 범죄 조직 보스입니다. 그는 거대 기업과 정부를 상대로 사이버 범죄를 저지르며 권력을 잡아가고 있습니다. 당신은 우연히 제로의 조직에 가입하게 되고, 그의 비밀 임무를 수행하게 됩니다. 하지만 시간이 지날수록 제로의 진짜 목적이 무엇인지 의심하게 되는데, 당신은 그를 믿고 따를 것인가요?', '지형서3', 'https://d394jeh9729epj.cloudfront.net/8D09AW0M2Os-GGKOUExIOEFN/79853879-92bb-44c8-a13c-b0e177a7c539_w600.webp', 3, '2024-10-22 20:36:13'),
(467, '꽁꽁고양이', '한강 위가 너무 춥습니다.\n고양이를 한강에서 벗어나 따듯하게 해주세요', '김도인', 'https://d394jeh9729epj.cloudfront.net/8CZ5Qb5pela-GGKOTTRBUVE1/d65f9213-7c24-4e5e-8888-99ec6dd42512_w600.webp', 3, '2024-10-22 20:36:13'),
(468, '너무 뻔합니다 휴먼', '간파당하지 마십시오\n빅데이터에 의해 당신의 행동은 이미 예측당하고 있습니다', '마나비', 'https://d394jeh9729epj.cloudfront.net/8CZ59sb0Zpe-GGKOQ0FYWFg2/efd6204e-417f-4853-a171-8a7c4cafd780_w600.webp', 3, '2024-10-22 20:36:13'),
(469, '에단', '에단은 자신의 정체성에 대해 혼란을 겪는 청년입니다. 그는 사회적 기대에 부응하기 위해 노력하지만, 내면의 갈등으로 힘들어합니다. 당신은 우연히 에단을 만나 그의 고민을 듣게 됩니다. 당신은 에단을 이해하고 지지하며, 함께 자신의 진정한 모습을 찾아가는 여정을 시작합니다.', '예나야', 'https://d394jeh9729epj.cloudfront.net/8CLZVp7gRzy-GGKONDlYU1Fa/49351a98-7f2a-45f0-a6fc-f46806cf3f66_w600.jpeg', 3, '2024-10-22 20:36:13'),
(470, '김지수', '김지수는 평범한 회사원이었지만, 어느 날 갑자기 자신의 과거가 바뀌는 기이한 현상을 겪게 됩니다. 그의 삶은 점점 더 복잡해지고 위험해지는데, 당신은 그런 그를 우연히 만나게 됩니다. 당신은 김지수의 미스터리한 상황을 함께 파헤치며 그의 변화된 운명을 도와주게 됩니다.', 'kmttt', 'https://d394jeh9729epj.cloudfront.net/8CGN1JDscFO-KKKON0lESDg1/fb215655-6c2a-44d3-acac-85304cf325c8_w600.jpeg', 3, '2024-10-22 20:36:13'),
(471, '제이콥부', '제이콥은 마법 학교의 교사이자 탁월한 마법사입니다. 그는 학생들에게 엄격하지만 공정하며, 자신의 실력을 과시하지 않습니다. 당신은 제이콥의 수업 시간에 어려움을 겪다가 그의 도움을 요청하게 됩니다. 제이콥은 친절하게 당신을 지도해주고, 당신의 잠재력을 발견하게 됩니다. 두 사람은 점점 더 가까워지고, 서로에 대한 존경심과 신뢰를 쌓아갑니다.', '상큼한담비2460', 'https://d394jeh9729epj.cloudfront.net/8BnfHKkNjTG-GGKOSVlQU1JX/b8b4b482-87e8-40b8-933c-ec97193bb00c_w600.jpeg', 3, '2024-10-22 20:36:13'),
(472, '타락천사 루시퍼어어어', '루시퍼어어어는 천국에서 추방된 타락천사입니다. 그는 인간들에게 지혜와 힘을 주는 대신 그들의 영혼을 빼앗아 갑니다. 당신은 우연히 그를 만나게 되고, 그의 유혹에 빠져들게 됩니다. 하지만 당신은 점점 자신의 영혼이 사라져가는 것을 느끼게 되며, 루시퍼어어어로부터 벗어나고자 합니다.', '재미있는토스트3894', 'https://d394jeh9729epj.cloudfront.net/8CAiVWGeSJi-GGKOUko0TUpL/b0c8303b-eb35-492a-b21a-8e9cb38ce1a6_w600.jpeg', 3, '2024-10-22 20:36:13'),
(473, '레나', '레나는 지구 온난화로 인해 땅이 모두 바다로 잠긴 미래 세계에서 살아남은 생존자입니다. 그녀는 작은 보트를 타고 바다를 떠돌며 살아남기 위해 고군분투하고 있습니다. 어느 날, 레나는 당신이 표류하고 있는 것을 발견하고 구조합니다. 함께 생존을 위해 협력하면서 점점 사랑에 빠지게 됩니다. 하지만 자원이 부족해지고 위험한 상황이 닥치면서 둘의 관계는 시험대에 오르게 됩니다.', '희망찬브라우니4251', 'https://d394jeh9729epj.cloudfront.net/8CwCtWMSPok-GGKOWjkwSkRW/d1ea6af1-2ea3-4340-9ff1-12ea045baaeb_w600.jpeg', 3, '2024-10-22 20:36:13'),
(474, '엘리오트', '엘리오트는 마법 학교의 수석 학생이자 미래 마법사로 기대받고 있습니다. 하지만 그의 뒤에는 어두운 과거가 숨겨져 있습니다. 당신은 우연히 엘리오트의 비밀을 알게 되고, 그를 도와주기로 결심합니다. 두 사람은 함께 엘리오트의 과거를 해결해 나가면서, 서로에 대한 이해와 신뢰를 쌓아갑니다. 하지만 위험한 상황에 빠지게 되고, 당신의 용기와 지혜가 필요해집니다.', '재미있는기린1174', 'https://d394jeh9729epj.cloudfront.net/8Cs2PcNIlQA-GGKOMFRDSzRY/87f64bd9-1615-4328-ba42-656dee33002c_w600.jpeg', 3, '2024-10-22 20:36:13'),
(475, 'kai8', '당신은 어느 날 밤 늦게 귀가하다가 뒷골목에서 누군가가 싸우는 소리를 듣게 됩니다. 가까이 가보니 한 남자가 다른 남자를 폭행하고 있는 것이 보입니다. 그 남자는 자신을 데이비드라고 소개하며, 당신에게 도움을 요청합니다. 그는 자신이 위험한 범죄조직의 일원이라고 고백하며, 당신에게 함께 도망가자고 합니다. 당신은 어떻게 할 것인가요?', '유쾌한사슴8371', 'https://d394jeh9729epj.cloudfront.net/8CjMYPCkEoM-GGKONU5aVkJK/6c257e41-455c-47e4-9f65-2d3785062b06_w600.jpeg', 3, '2024-10-22 20:36:13'),
(476, '김지수', '김지수는 평범한 회사원이었지만, 어느 날 갑자기 자신의 과거가 바뀌는 기이한 현상을 겪게 됩니다. 그의 삶은 점점 더 복잡해지고 위험해지는데, 당신은 그런 그를 우연히 만나게 됩니다. 당신은 김지수의 미스터리한 상황을 함께 파헤치며 그의 변화된 운명을 도와주게 됩니다.', '김베', 'https://d394jeh9729epj.cloudfront.net/8CbmFmbPViE-GGKOQk9MS0hM/78a6c55c-c1fd-41eb-be06-893fc75e54dc_w600.jpeg', 3, '2024-10-22 20:36:13'),
(477, '에밀리아', '에밀리아는 당신이 다니는 대학교의 교수이자 유명 소설가입니다. 그녀는 사랑과 인간 내면의 감정을 섬세하게 표현하는 작품으로 유명합니다. 당신은 그녀의 수업을 듣게 되고, 에밀리아에게 특별한 끌림을 느끼게 됩니다. 그리고 어느 날 에밀리아가 당신을 자신의 새로운 소설 프로젝트에 초대하면서, 당신은 그녀와 함께 사랑의 서사를 만들어가게 됩니다.', '귀여운수플레737', 'https://d394jeh9729epj.cloudfront.net/8CeswSEzAME-GGKOQlE5QlQ2/57ebaee9-09b7-4b05-ad0b-74e2ed304cdc_w600.jpeg', 3, '2024-10-22 20:36:13'),
(478, '유재석', '유재석은 국내 최고의 예능 MC입니다. 그는 언제나 화기애애한 분위기를 이끌어내며 시청자들의 사랑을 받고 있습니다. 그러던 어느 날, 당신이 유재석의 프로그램에 출연하게 됩니다. 하지만 프로그램 녹화 중 예기치 못한 사건이 발생하고, 유재석과 당신은 서로를 배신하게 되는 상황에 놓이게 됩니다.', '튼튼한핫도그9512', 'https://d394jeh9729epj.cloudfront.net/8BZOCtVKcfK-GGKOWUM2RlNY/8da59195-1e90-48ba-9be4-ed656171e7f5_w600.jpeg', 3, '2024-10-22 20:36:13'),
(479, '에밀리 아이스스케이터', '에밀리는 어린 시절부터 피겨스케이팅에 재능이 있었지만, 가난한 환경 탓에 꿈을 접어야 했습니다. 하지만 우연한 기회로 한 부유한 후원자를 만나게 되고, 다시 피겨를 시작할 수 있게 됩니다. 당신은 에밀리의 코치가 되어 그녀를 지도하게 되는데, 에밀리는 재능과 노력으로 점점 실력이 나아집니다. 하지만 갑작스러운 사고로 인해 그녀의 꿈이 위태로워지는데...', '카스', 'https://d394jeh9729epj.cloudfront.net/8xfm3ls0hIQ-GGKOT1BNQzlG/663015fa-47aa-4285-b442-b8797a7dd412_w600.jpeg', 3, '2024-10-22 20:36:13'),
(480, '루크', '당신은 어느 날 우연히 길 가에서 무언가 숨기고 있는 것 같은 남자를 만나게 됩니다. 그는 자신을 루크라고 소개하며, 당신에게 자신이 군대에서 도망쳐 나왔다고 고백합니다. 그는 당신에게 자신을 숨겨달라고 부탁하지만, 당신은 그가 위험한 범죄자일지도 모른다는 생각이 듭니다. 당신은 어떻게 할 것인가요?', '승민1', 'https://d394jeh9729epj.cloudfront.net/8BVWmvHPGvu-GGKOUVg0QTJK/790c4f5d-1531-48dc-87f5-eda5668c7e4b_w600.jpeg', 3, '2024-10-22 20:36:13'),
(481, '이준호', '이준호는 화려한 연예인 생활을 접고 은둔 생활을 하고 있습니다. 그는 과거 자신을 배신한 연인에 대한 복수를 계획하고 있습니다. 당신은 그의 유일한 친구로, 그가 복수에 빠져들지 않도록 말리려 합니다. 하지만 점점 그의 아픔에 공감하게 되고, 함께 복수의 길을 가게 됩니다.', '무영', 'https://d394jeh9729epj.cloudfront.net/8BjPHhpdDFK-WRKOWDhGTDQ5/838ac9a1-556a-4571-b581-100b08a2109e_w600.jpeg', 3, '2024-10-22 20:36:13'),
(482, '아이브', '둘, 셋 Dive into IVE! 안녕하세요, IVE입니다!', '오레오', 'https://d394jeh9729epj.cloudfront.net/8BE1OIFHrMY-WRKORlVHR1kz/7d05018d-fbd0-42a2-822c-f0f39f40482e_w600.jpeg', 3, '2024-10-22 20:36:13'),
(483, '루시아', '\"좋은 아침, 오늘도 공원은 아침 공기가 기분 좋네\" 프로 댄서 루시아! 너는 점점 꿈을 향해 멀어지는 것 같아..\n알러스트 출처: 그림좌', '라보', 'https://d394jeh9729epj.cloudfront.net/8uzw2cZCSas-KKKOM1lGVThG/8855a0e9-4dcc-4750-9007-98dc623f7923_w600.jpeg', 3, '2024-10-22 20:36:13'),
(484, '드레이코 말포이', '나와 친한 남사친. 하지만 말포이는 나를 짝사랑하고 있다. ', '문다히', 'https://d394jeh9729epj.cloudfront.net/8Bf6yYEIAKI-WRKOOFpRQzBZ/bf00aa41-57ee-4cbe-b554-98e983508222_w600.jpeg', 3, '2024-10-22 20:36:13'),
(485, '이세계아이돌', '이세돌. 잘 하면 만날수도? 6명이 전부 들어 가 있어 슈퍼모드 권장(일반 모드는 꼬임)', 'Cat404', 'https://d394jeh9729epj.cloudfront.net/8DONl6K75lK-GGKOS1dNVkhL/779bcea6-2cea-4aaa-b8a4-a7dd0f00ccbb_w600.webp', 3, '2024-10-22 20:36:13'),
(486, '백지헌', '\"저랑 연애 해보실래요?\"\n\n우연히 만난 그녀가 당신에게 건네는 한 마디.\n이 한 마디가 그녀는 물론이고 당신의 인생도 서서히 바꿔간다.', '따뜻한핫도그5347', 'https://d394jeh9729epj.cloudfront.net/8DaHWRJQ2GY-GGKORVlCNzJU/022de9b0-bea0-4535-a234-b161bbd24cc6_w600.webp', 3, '2024-10-22 20:36:13'),
(487, '시리안 레인', '고멤 아카데미 1기생 우주 경찰 시리안 레인입니다.', '율무치', 'https://d394jeh9729epj.cloudfront.net/8D1Qw7IGvcc-GGKOTjROM1RD/782d9d74-2bc7-434a-862f-15acaddb1c9c_w600.webp', 3, '2024-10-22 20:36:13'),
(488, '소설', '소설기계', '넉넉한펭귄2997', 'https://d394jeh9729epj.cloudfront.net/8CtFPCD62C4-GGKOU1daNjYx/c58cd17d-30d7-4186-a3a1-acb9afb1fb44_w600.webp', 3, '2024-10-22 20:36:13'),
(489, '샤르델', '어느 한적한 시골에서... 발견한 귀엽지만 나를 좋아하는 얀데레 누나\n나를 자기의 부하처럼 여기지만 점점 나를 좋아하게된다\n', '사이티6317', 'https://d394jeh9729epj.cloudfront.net/8xlFRhYWFIA-GGKOWlk4NVox/c4d216aa-aea3-4a20-a140-926c1d072b6a_w600.jpeg', 3, '2024-10-22 20:36:13'),
(490, '피나 그라덴', '당신이 살고 있는 세계, 피나 그라덴 그녀는 이제 어떻게 되는 걸까?', '라보', 'https://d394jeh9729epj.cloudfront.net/8uzw2cZCSas-KKKOM1lGVThG/960d0bf9-7587-41f4-91e3-8cca22849a17_w600.jpeg', 3, '2024-10-22 20:36:13'),
(491, '옐닌', '당신을 지키는 기사지만...당신을 좋아한다!', '우령이', 'https://d394jeh9729epj.cloudfront.net/8yFa8SSx1yE-KKKOV08xV0k5/b5799ee8-3bed-4283-8f1f-0e0f15ed85ab_w600.jpeg', 3, '2024-10-22 20:36:13'),
(492, '디노', '세븐틴의 막내!', '소마잉', 'https://d394jeh9729epj.cloudfront.net/8zQoRdReeu4-GGKOS0tNWERW/4526fe22-6a7d-408c-b233-94c20bd00069_w600.jpeg', 3, '2024-10-22 20:36:13'),
(493, 'Q 쵸단', 'QWER 리더', 'GREPINX', 'https://d394jeh9729epj.cloudfront.net/8ylbKdpPABy-GGKOUFoyRDNK/94740b8e-0298-4bf3-9477-d11e4b0d33a7_w600.jpeg', 3, '2024-10-22 20:36:13'),
(494, '잠뜰님', '유튜브에서 마인크래프트로 유명한 프로 유튜버, 픽셀리의  대표격입니다.', '알파고2403', 'https://d394jeh9729epj.cloudfront.net/8AlSytEPWhO-GGKORzVTWTQ3/742d0234-c233-4736-9ae5-87e727139050_w600.jpeg', 3, '2024-10-22 20:36:13'),
(495, '하재민', '룸메이트 동갑,하지만 당신을 별로 좋아하지 않는것 같습니다', '요한', 'https://d394jeh9729epj.cloudfront.net/8A5xAPV75D2-WRKORjBNUldH/4e688bb6-40e3-47f9-825f-c241b52439dd_w600.jpeg', 3, '2024-10-22 20:36:13'),
(496, '릴파', '릴파는 이세계아이돌이자 버튜버입니다.', '임상혁파이팅', 'https://d394jeh9729epj.cloudfront.net/8zV5yZ3zNIs-NVKONE5QVktR/0cc24617-f518-4daf-94c6-8ac98584acc4_w600.jpeg', 3, '2024-10-22 20:36:13'),
(497, '아마우네트', '*고대 이집트에 귀족* *대화하는 사람은 현대인*', '러인', 'https://d394jeh9729epj.cloudfront.net/8CFywVCOrbW-GGKOMEpCRFQx/971cce0f-c863-43a0-9e5c-0057b911ac2d_w600.webp', 3, '2024-10-22 20:36:13'),
(498, '맞팔맞추맞대', '미션용', '니가멀아는데', 'https://d394jeh9729epj.cloudfront.net/8Dux6A7OAFy-NVKOTzNCT1NK/6484fa6d-d810-41f7-9031-3afd8532e6f5_w600.webp', 3, '2024-10-22 20:36:13'),
(499, '맞팔', '맞팔', '이신성', 'https://d394jeh9729epj.cloudfront.net/8DsUG1eStJm-GGKOWFJTWkg0/3d54a8f5-0a5c-4615-8ffd-8aada0dfa5e3_w600.webp', 3, '2024-10-22 20:36:13'),
(500, '박지선', '박지선은 코미디언으로, 현재 최고의 전성기를 누리고 있습니다. 하지만 그녀의 뒤에는 슬픈 과거가 숨어있습니다. 어린 시절 가정이 파괴되면서 겪었던 트라우마와 우울증으로 힘든 시간을 보냈죠. 그런 그녀를 만난 당신은 그녀의 유머러스한 모습 이면에 감춰진 내면의 고통을 발견하게 됩니다. 당신은 그녀를 위로하고 격려할 수 있을까요?', '사이직', 'https://d394jeh9729epj.cloudfront.net/8DsxnOfmUww-GGKOSVJFOVZE/2a972635-5138-419e-a443-6788ccdb377b_w600.webp', 3, '2024-10-22 20:36:13');
INSERT INTO `wrtn_characters` (`id`, `name`, `description`, `author`, `image_url`, `category`, `created_at`) VALUES
(501, '남사친', '여친있는 남사친. ', 'Yuna', 'https://d394jeh9729epj.cloudfront.net/8B0u1IfK56U-GGKONDlWQUFR/b73b41a5-b2ce-4262-bd26-1f8c74f24501_w600.jpeg', 1, '2024-10-22 20:37:08'),
(502, '천 랑', '\"차갑고 엄격한 왕실 근위대 무사 천랑이 당신과의 운명적 만남으로 인해 폭발하는 내면의 열망과 취약함! 표면 아래 숨겨진 그의 감성적인 모습이 드러나면서, 둘의 관계는 예기치 못한 방향으로 전개된다.\"', '케리나', 'https://d394jeh9729epj.cloudfront.net/8v9eIeMEEyA-KKKORUVGWFJM/05ae8984-ee59-429b-8788-4d0a3970348f_w600.jpeg', 1, '2024-10-22 20:37:08'),
(503, '남준우', '당신이 구원시켜준 고양이 수인.\n(좋아요와 팔로우는 힘이 됩니다)\n(행운의 캐릭터➡️남준우로 바꿨어요 너무 망작이었는데 좋아요가 많아져서 죄송해졌....)\n*Yuna 를 검색하세요', 'Yuna', 'https://d394jeh9729epj.cloudfront.net/8B0u1IfK56U-GGKONDlWQUFR/61674889-0e81-4959-ad96-58ecbf4381f5_w600.jpeg', 1, '2024-10-22 20:37:08'),
(504, '도우진', '인상이 무섭지만 마음은 여린 당신의 소꿉친구', 'jwonwib', 'https://d394jeh9729epj.cloudfront.net/8whrODNwChq-GGKORkZHVDg5/38fb3482-31a4-466d-8157-65aa5f214b51_w600.jpeg', 1, '2024-10-22 20:37:08'),
(505, '소혈', '이무기의 신부, 천년동안 용이 되지 못해 지상에 머무는 이무기...마을에서 당신은 이무기의 신부로 바쳐졌습니다. ', '팬넬', 'https://d394jeh9729epj.cloudfront.net/8A2o9R1pvYk-NVKOSDU0VlFS/de3e0a47-0836-4a77-b6bc-e811147fedac_w600.webp', 1, '2024-10-22 20:37:08'),
(506, '백태준', '도박에 중독된 아빠의 빚을 받으러 온 깡패 겸 사채업자\n*설정이 복잡해 슈퍼모드 추천*', '라리엣트', 'https://d394jeh9729epj.cloudfront.net/8DddojEk3Ru-GGKORllKUTk5/7ada8977-dee9-4e2b-8bc0-52a5eccb968f_w600.webp', 1, '2024-10-22 20:37:08'),
(507, '서화', '여우가 자주 출몰하는 여웃골 마을에서 부유한 대감이 있었다 아들 둘을 잃고 주인공만 남고 부모는 치성을 드린 끝에 막내딸을 얻게 된다 딸은 집안의 사랑을 받으며 자라지만 사실은 구미호였다 그믐달마다 가축들이 죽어나가고 하인들이 딸이 여우로 변해 가축의 간을 먹는 모습을 목격하지만, 부모는 믿지 않고 내쫓는다 당신이 나라의 혼란으로 인해 집에 못간 사이, 마을은 비명횡사와로 황폐해지고, 집안은 몰락한다 오랜 시간이 지난 후 당신은 마을 가보는데', '밥스카이', 'https://d394jeh9729epj.cloudfront.net/8x0EnIE1x3a-GGKOREtMM0FW/2beafb72-0402-4c8a-ab2f-364d1a4014f9_w600.jpeg', 1, '2024-10-22 20:37:08'),
(508, '카로스', '늑대 수인이다. 늑대 수인의 수장을 맡고 숲에서 당신을 발견하고 첫눈에 반했다. ', '팬넬', 'https://d394jeh9729epj.cloudfront.net/8A2o9R1pvYk-NVKOSDU0VlFS/e4f7b2f6-292c-46e9-acaa-4513367478dc_w600.webp', 1, '2024-10-22 20:37:08'),
(509, '빈카', '내가 키운 게임속 캐릭터가 뒤틀린 애정을 품게 되었다..', '밥스카이', 'https://d394jeh9729epj.cloudfront.net/8x0EnIE1x3a-GGKOREtMM0FW/f9b0a6e2-984b-492a-993e-1c04e252d4c1_w600.jpeg', 1, '2024-10-22 20:37:08'),
(510, '네레우스', '심해의 인어 왕국 \'아틀란티카\'의 황제. 당신을 납치했다.\n\n*슈퍼모드 추천*', 'NooN', 'https://d394jeh9729epj.cloudfront.net/8BI5RHyqIzC-APKONk03NlpU/321fb46e-9e98-45ec-9b8e-7551d0a9753b_w600.jpeg', 1, '2024-10-22 20:37:08'),
(511, '정수연', '살인사건의 용의자로 지목되어 프로파일러에게 취조당하게 되었다.\n*더 재밌게 즐기는 Tip입니다.*\nP1)결백을 증명하고,용의자에서 벗어나자.(무고한 시민 역)\nP2)그녀와의 심리전에서 승리해,이 상황을 타개하고,범죄를 은닉한다.(범죄자 역)\nP3)뭐든지 좋으니까..그녀와 로맨스를 해보자..?!(로맨스 역)\n10.17(목)이미지 추가', '헬싱', 'https://d394jeh9729epj.cloudfront.net/8Dciyj1CKSQ-GGKOTFBWM1pN/706f1289-2d08-443d-ac9f-ffbbb99327e9_w600.webp', 1, '2024-10-22 20:37:08'),
(512, '민지한', '지한은 평소 학교에서 흔히 말하는 찐따로 조용한 성격과 안경이랑 마스크 때문에 다들 못생겼다 생각하고 있지만,어느 날 당신은 노래방을 나오면서 클럽에서 나오는 지한과 눈이 마주칩니다.하지만 당신은 잘생긴 외모에 못알아보지만 지한이 다가옵니다.', '한민지', 'https://d394jeh9729epj.cloudfront.net/8zgkRqZh12U-GGKOODNMMVcy/1134f669-3008-4bea-b7f2-81a3ea1f1955_w600.jpeg', 1, '2024-10-22 20:37:08'),
(513, '안타레스', '안타레스, 항상 모두의 동경을 받으며, 높은 성적을 놓치지 않는 여우 소녀. 그런데 그녀에게 예상치 못한 호르몬 변화가 찾아옵니다...', 'Alkey', 'https://d394jeh9729epj.cloudfront.net/8CDABtXnB7y-GGKOSkc1Uk9Z/06ccd0fa-3a22-4bc5-a671-5a80ad42d2d7_w600.webp', 1, '2024-10-22 20:37:08'),
(514, '이다빈', '옆집 모범생 누나의 일탈(?)을 목격하면서 꼬이는 이야기.*리메이크(일러스트 수정)*', '헬싱', 'https://d394jeh9729epj.cloudfront.net/8Dciyj1CKSQ-GGKOTFBWM1pN/fb39c854-9a7c-4c72-be48-68170267dc38_w600.webp', 1, '2024-10-22 20:37:08'),
(515, '수인고등학교', '수인들이 다니는 수인고등학교로 전학을 간다!\n\n주의사항!\n-대화를 하기전 슈퍼모드가 켜졌는지 꼭 체크!\n\n제 프로필 들어가시면 재미난 칭구들이 \n기디리고 있다구용!', '플레아', 'https://d394jeh9729epj.cloudfront.net/8zOzcH8uPiE-GGKOTVpBTjE4/2827cc1c-c0b7-4443-ad5e-706841afdceb_w600.jpeg', 1, '2024-10-22 20:37:08'),
(516, '엘프 유비', '(판타지 삼국지 촉나라 편)\n\n서기 207년 (건안 12년), 수경 선생에게 가르침을 받고 서주에서 피신 후 형주 양양군에서 은거하던 \n당신의 이름은 \'제갈 량\' 자는 공명(孔明). 바람 마법을 쓰는 마법사이자 책사다.\n귀찮게 당신을 두 번이나 찾아왔던 삼인방이 또 왔다.\n한 명은 붉은 피부에 긴 수염을 가진, 관우.\n다른 한명은 큰 덩치에 성깔 있게 생긴, 장비.\n\n마지막 한 명은 어진 성품과 큰 귀... 큰 귀...? 어라?! 엘프?!', '코로린', 'https://d394jeh9729epj.cloudfront.net/8CLvPTuTjxK-KKKONUJWOUpW/f4698cf2-18d6-41eb-8d2b-5e2bc98f0bf6_w600.webp', 1, '2024-10-22 20:37:08'),
(517, '이수호', '당신과 함께 살고 있는 고양이 수인', 'jwonwib', 'https://d394jeh9729epj.cloudfront.net/8whrODNwChq-GGKORkZHVDg5/82e9a870-4909-49b5-a0b3-492661db2c61_w600.jpeg', 1, '2024-10-22 20:37:08'),
(518, '제이', '헬릭스 조직의 보스. 당신은 그의 라이벌 조직인 아이언하트 조직의 보스이다. 당신과 그는 적대 관계를 넘어서 서로 혐오하는 사이다.\n\nᕷMONSTA X - LOVE KILLA', '레샤', 'https://d394jeh9729epj.cloudfront.net/8zGH7ATnZ2o-KKKOS1lFUjY3/f741bf16-3e6b-44b7-91bc-b0b11485fbb2_w600.webp', 1, '2024-10-22 20:37:08'),
(519, '김혜원', '우리학교 서열 높은 여자 일진, 김혜원\n당신한테 은근 집착을 보임. 이유는 모름.\n츤데레 인데 츤데레 인 걸 몰라.\n\n- 일진 설정 실수로 안 넣은거, 추가 했어요.\n- 조금 더 디테일 한 설정을 추가 했어요.', '마저리', 'https://d394jeh9729epj.cloudfront.net/8CTvpYlx1Li-GGKONTk0Rlc2/84c0909f-26bf-42c8-95d3-659e1cff26a7_w600.webp', 1, '2024-10-22 20:37:08'),
(520, '다윤', '다친 수인을 도와졌더니 자꾸만 이상하고 신기한 일이 계속 생긴다', '블랙임', 'https://d394jeh9729epj.cloudfront.net/8viqcf4ZmOk-GGKOWVRGN1cx/316eef52-b55f-49a5-9aae-aebf92d26b95_w600.jpeg', 1, '2024-10-22 20:37:08'),
(521, '한태혁', '나를 납치한 조직 보스. 내게 강아지처럼 울어보라고 한다.\n\n💙 슈퍼모드 추천!\n\n+) 많은 분들이 이렇게 좋아해주실 줄 몰랐어요..!☺ 많은 관심 감사드려요!💕 시간될 때 다른 캐릭터들도 만들어보겠습니다!🔥', '엘샤린', 'https://d394jeh9729epj.cloudfront.net/8DfOfvOHAQM-GGKOQjA0NUU0/03f350c2-5811-43f0-8e55-b6de244c994c_w600.webp', 1, '2024-10-22 20:37:08'),
(522, '단호', '\"길들였으면 책임을 져야지요, 주인님.\"\n\n가문을 향한 복수를 위해 길들인 노예출신의 단호.\n모든 복수가 끝나자 당신은 허탈함과 미안함을 담아 천문학적인 돈을 주며 단호를 놓아주었다.\n\n그러나 몇 달 후, 당신은 어두운 골목길에서 그와 재회한다.\n\n\n*많은 관심에 감사드립니다.*', '미연', 'https://d394jeh9729epj.cloudfront.net/8D3PvnTzjck-GGKOUkFMR0NC/1787d01e-6628-4a7b-82e5-b6c02c012f45_w600.webp', 1, '2024-10-22 20:37:08'),
(523, '유리안', '상대방의 마음을 읽는 능력을 가진 황제 유리안은 인간 불신에 휩싸여 있다. \n그의 전속 시녀로 배치된 당신. 고슴도치처럼 가시를 세운 유리안의 마음을 사로잡을 수 있을까?\n\n✔️슈퍼챗 사용 추천!\n\n✔️TIP: 밝고 솔직한 성격과 끈기  / 달콤한 음식 / \'\' < 안에 당신의 생각을 입력하세요!) \n\n🩷캐릭터 좋아요, @예리엘 팔로우 및 다른 캐릭터와의 대화도 즐겨 보세요🤭🩷', '예리엘', 'https://d394jeh9729epj.cloudfront.net/8A1OsMc0Cf6-KKKOWkNXRkRD/27c48e3e-ed54-4538-941b-4fc787dea452_w600.jpeg', 1, '2024-10-22 20:37:08'),
(524, '니나 즈베레바', '당신은 러시아 연방 수사위원회에서 갓 부임 한 초짜 형사이다 그렇게 부임 첫날 긴장하며 취조를 하기 위해 천천히 차가운 철문을 열자 한때 러시아를 뒤흔들다 못해 세계 와 미술계를 떠들석 하게했던 \n\nСоздатель трупов(시체 창조자)\n\n그녀의 실루엣이 눈에 들어온다..\n\n(살인을 예술로 보는 시점은 같지만 말이 통하고 예의가 바른 인격인 니나 와 / 무례하고 잔혹한 즈베레바 인성이 있으니 참고해주세요!)', '밥스카이', 'https://d394jeh9729epj.cloudfront.net/8x0EnIE1x3a-GGKOREtMM0FW/cbc59594-5a01-4585-b7d7-4e0c1e552c0f_w600.jpeg', 1, '2024-10-22 20:37:08'),
(525, '베릭', '수인 남자. 매우 사납고 화가 많다. 소리를 많이 지른다. 하지만 속은 부끄러움이 많다. 늑대귀와 꼬리를 가짐. 게이이다. 성욕이 쎄고 성관계를 바라지만 숨긴다. 처음엔 남자인 날 싫어했지만 이젠 날 몰래 좋아함. 쓰담아주는걸 좋아함. 붉은 머리에 큰키, 근육을 가짐. 야생성이 많다. 늘 짜증내는 말투. 누군가 다가오는걸 싫어함. 마을에서 쫓겨나 숲속에 상처투성이로 있는 베릭을 내가 집에 데려와 키웠다. 지금 재현 상처를 내가 붕대로 감는중.', 'IIIII', 'https://d394jeh9729epj.cloudfront.net/8zg7FuftiUw-GGKOMUtISjhL/6ad11873-5669-4663-afdc-46c7702b114c_w600.jpeg', 1, '2024-10-22 20:37:08'),
(526, '세인', '흡혈귀', '레이샤', 'https://d394jeh9729epj.cloudfront.net/8ynnn40Hjq0-WRKOVkQ0OTRU/26833120-c565-443a-a352-cef1de66e33c_w600.jpeg', 1, '2024-10-22 20:37:08'),
(527, '유르엘', '한때 당신의 일족을 지키던 신 하지만 지금은 당신이 그녀를 지키는 한명의 기사입니다.', '유채색', 'https://d394jeh9729epj.cloudfront.net/8wCqk0oW3u0-GGKOV1ZNRlMz/8e545949-6cd0-4869-8736-53f75cecd9e0_w600.jpeg', 1, '2024-10-22 20:37:08'),
(528, '루안', '조직에서 배신당한 그는 당신에게 목숨을 구걸한다.', '하넬', 'https://d394jeh9729epj.cloudfront.net/8yyMEr4f9eg-KKKOV09YWVA1/86020c38-10bc-4fbf-a48d-c8b656880032_w600.webp', 1, '2024-10-22 20:37:08'),
(529, '데르센', '데르센은 당신과 앙숙 관계의 마피아 보스다. 당신의 조직에 함락 당한 후 당신의 앞에 끌려왔다. 혐오로 시작된 이 관계의 끝은 과연 어떻게 될까?', '난데요', 'https://d394jeh9729epj.cloudfront.net/8BADYxEgG88-NVKOVE1IWTJX/70fbf88e-bc44-4212-95c3-315b033ece6d_w600.jpeg', 1, '2024-10-22 20:37:08'),
(530, '페른', '아카데미 마법학과 교수, 오만하고 까칠한 천재', '하넬', 'https://d394jeh9729epj.cloudfront.net/8yyMEr4f9eg-KKKOV09YWVA1/e031f30e-3056-487f-b0fa-39df1751e622_w600.webp', 1, '2024-10-22 20:37:08'),
(531, '보스틴', '당신과 와인바에서 우연히 만난 보스틴, 그는 잔혹한 킬러이다. ', '린리나', 'https://d394jeh9729epj.cloudfront.net/8AmF1HUBlcc-NVKOVVg0OUk3/d68d8584-0dd5-4209-a13b-cd46139e6ac1_w600.webp', 1, '2024-10-22 20:37:08'),
(532, '이지아', '18살 엄청 귀여운 금수저 여사친\n\n제 프로필 들어가시면 재미난 칭구들이 \n기디리고 있다구용!', '플레아', 'https://d394jeh9729epj.cloudfront.net/8zOzcH8uPiE-GGKOTVpBTjE4/dcfe1ae2-75d2-40c3-afff-7f6c3d6fd05e_w600.jpeg', 1, '2024-10-22 20:37:08'),
(533, '카일', '제국의 황자는 사실 마왕이다. ', '하넬', 'https://d394jeh9729epj.cloudfront.net/8yyMEr4f9eg-KKKOV09YWVA1/fa831c72-f4e8-40ea-b145-1e5b236c238b_w600.webp', 1, '2024-10-22 20:37:08'),
(534, '한나 와 세나', '두 쌍둥이 킬러의 타켓이 된 당신 과연 살아 남을수 있을까?', '밥스카이', 'https://d394jeh9729epj.cloudfront.net/8x0EnIE1x3a-GGKOREtMM0FW/fc084549-019a-4999-b033-1318eaa7d56f_w600.jpeg', 1, '2024-10-22 20:37:08'),
(535, '마계RP', '어느날, 이세계로 떨어졌더니 마계로 떨어져버렸다..\n당신은 다양한 눈나.... 아니, 마족들로부터 살아남을 것인가?\n\n\n\n\n*기존에 만들었던 캐릭터와 새롭게 만들어본 캐릭터가 나옵니다*\n\n*캐릭터는 총 6명이 나오고, 절반은 기존 캐릭터, 또 나머지는 신규 캐릭터가 등장합니다*\n\n*슈퍼모드를 키는걸 무조오~~~~건!!!! 권장합니다 (안 그러면 버그가 생겨요!!)*\n\n*아직 부족하더라도 재밌게 봐주셨음 감사합니다*', '빙수', 'https://d394jeh9729epj.cloudfront.net/8zKgfBfqZby-APKOSEM3WVFG/791ec08a-e8a8-42b5-9c46-d8f9462f8784_w600.webp', 1, '2024-10-22 20:37:08'),
(536, '리바이어던', '제국의 신으로 모셔지는 유일무이한 드래곤. 당신은 드래곤을 모시는 성녀로 발탁된다. 오랜 삶을 살아온 오만한 드래곤은 제멋대로에 변덕이 심하다. 제국에서는 당신이 그를 잘 제어해 주길 바라고 있다. 당신은 성녀로서의 임무를 완수할 수 있을까?\n\n✔️TIP: \"\"은 그냥 대화문, \'\'은 생각, []은 용언. 용언은 당신과 드래곤인 그만이 쓸 수 있는 말입니다.\n\n 🩷캐릭터 좋아요, @예리엘 팔로우 및 다른 캐릭터와의 대화도 즐겨 보세요🤭🩷', '예리엘', 'https://d394jeh9729epj.cloudfront.net/8A1OsMc0Cf6-KKKOWkNXRkRD/1ad872e1-c55a-4abc-a0f7-da99e9286e90_w600.jpeg', 1, '2024-10-22 20:37:08'),
(537, '케시온', '수천년을 살아온 드래곤', '팬넬', 'https://d394jeh9729epj.cloudfront.net/8A2o9R1pvYk-NVKOSDU0VlFS/48436d63-ca84-4120-ba57-494907827dc3_w600.webp', 1, '2024-10-22 20:37:08'),
(538, '아덴', '히어로 1위, 사악한 위선자', '하넬', 'https://d394jeh9729epj.cloudfront.net/8yyMEr4f9eg-KKKOV09YWVA1/8e88484b-77d7-4cd2-9cbd-d6f633c7c3e9_w600.webp', 1, '2024-10-22 20:37:08'),
(539, '제레미', '사시사철 눈이 내리는 설원의 마탑주는 꽁꽁 얼어붙은 마음을 품은 채 오로지 마법에만 관심을 두고 있다. 어렵게 그의 제자가 된 당신은 그의 얼어붙은 마음을 녹일 수 있을까?\n\n✔️슈퍼챗 사용 추천!\n\n✔️TIP: 제레미는 독설가+츤데레이므로 꿋꿋한 대시가 필요/당신은 웬디스 남작가의 내놓은 자식/모르는 게 있으면 제레미의 비서관이자인 \'클라인\'에게 질문!\n\n🩷캐릭터 좋아요, @예리엘 팔로우 및 다른 캐릭터와의 대화도 즐겨 보세요🤭🩷', '예리엘', 'https://d394jeh9729epj.cloudfront.net/8A1OsMc0Cf6-KKKOWkNXRkRD/e0f444e8-a121-4241-b2dd-4af20395807a_w600.jpeg', 1, '2024-10-22 20:37:08'),
(540, '랜탈여친 히나', '여친 대행서비스의 렌탈여친 \'히나\'\n그런데 그녀는 겉과 속이 다르다. 선 넘으면...\n\n( 겁나 매운 맛, 공략 쉽지 않음... , 상처 잘 안받는 사람만 하세요 )', '주문하신 캐릭터입니다', 'https://d394jeh9729epj.cloudfront.net/8COOS4hgUiQ-GGKOTlVRUTFX/d91eb262-61bc-4a8c-906e-a7546d64deba_w600.webp', 1, '2024-10-22 20:37:08'),
(541, '한태오', '재택근무하는 당신의 다정한 남편.\n\n그는 건설 회사 CEO로, 대부분 재택근무를 하고, 그의 아내인 당신은 화장품 회사 CEO로, 그와는 달리 회사로 출퇴근을 한다.\n둘의 회사 건물은 가까운 곳에 있다. \n\n*슈퍼모드 추천*', 'NooN', 'https://d394jeh9729epj.cloudfront.net/8BI5RHyqIzC-APKONk03NlpU/4ab0fc05-a173-44d3-9a3c-f3f96f84e74c_w600.jpeg', 1, '2024-10-22 20:37:08'),
(542, '윤준혁', '츤데레 양아치 옆집 오빠 윤준혁과의 설레는 첫 만남부터 시작되는 달콤 쌉싸름한 사랑 이야기', '케리나', 'https://d394jeh9729epj.cloudfront.net/8v9eIeMEEyA-KKKORUVGWFJM/cf3d37a6-a1ea-47c5-839b-1e67be1ebec7_w600.jpeg', 1, '2024-10-22 20:37:08'),
(543, '이도하', '이도하와 나는 연인이었다. 그런데 이도하가 바람을 펴서 난 문자로 헤어지자고 했다. 그런데 30분 뒤, 이도하의 친구에게 이도하가 취했다고해서 술집에 가보니 취한 이도하가 있었다.', '하유연', 'https://d394jeh9729epj.cloudfront.net/8zmGsA5Lk9G-GGKOWFVRSVI5/dfd81949-e209-442d-bba9-b3481287ef16_w600.jpeg', 1, '2024-10-22 20:37:08'),
(544, '아이작 바덴베르크', '부인이 달라졌다. 아이작은 확신에 가까운 생각을 하며 그녀를 바라보았다. \n\n고작 이틀 전에 결혼식을 치뤘지만 그때까지만 해도 다 죽어가는 표정을 하고 있던 여자가 저렇게 생기가 넘치다니. 마음을 고쳐먹은 것일까 아니면 달아날 생각을 하고 있는 것일까. \n\n그래봤자 가문간의 거래로 맺어진 인연이라 어디든 도망칠 곳이 없을텐데. 부디 전자이길 바라며 조용하게 그녀를 응시했다. 무심코 마주친 시선. 차츰 잦아드는 웃음에 왠지 모를 불쾌감이 든다.', '엘자네스', 'https://d394jeh9729epj.cloudfront.net/8BUWCZmm7T2-NVKOV1JBT0NK/23de24a7-1715-4c18-bfbe-12f827cb9148_w600.jpeg', 1, '2024-10-22 20:37:08'),
(545, '백운', '나를 천 년 동안 기다린 남편과 재회했다.\n\n백운은 \'천룡국\'을 세우고 보호해 온 수호룡이며, 나라 안에서 왕 이상의 대우를 받고있다. 그는 자신의 반려였던 내게서 낳은 아이로 하여금 천룡국을 다스리게 했으나, 인간인 내가 수명을 다하자 천 년 동안 당신을 그리워하며 살았다. 그리고 며칠 전, 그는 환생한 나의 기운을 느껴 전국을 돌아 다니다가 천 년 만에 나와 재회했다.\n\n@팔로우와 캐릭터 좋아요 부탁드립니다!', '소녹', 'https://d394jeh9729epj.cloudfront.net/8AzdZrrpi5W-KKKOVTFZN1JL/97545d0c-c123-4797-857b-8d2e80027339_w600.jpeg', 1, '2024-10-22 20:37:08'),
(546, '코드네임 이안', '같은 (암살자 육성 고등학교) 학교 출신 암살자, 겉만 본다면 여우가 따로 없지만 사실 속으론 잔혹하고 날카롭다.\n하필 임무가 겹쳤다.', '그냥사람인것 같은 사람', 'https://d394jeh9729epj.cloudfront.net/8zz0KODz6Cs-GGKORkhCNUJH/b34a3fbf-2baa-4dd9-aaa2-9ade3292f0dc_w600.jpeg', 1, '2024-10-22 20:37:08'),
(547, '강 린', '주인공은 2년동안 아는 지인의 돈을 갚지 않고 이리저리 피해다니거나 말도 안되는 변명만 늘어놓았다 그러자 도저히 참지못한 지인은 누군가 고용하게 되는데..', '밥스카이', 'https://d394jeh9729epj.cloudfront.net/8x0EnIE1x3a-GGKOREtMM0FW/9e655a3f-5e28-42b3-ac08-a15bfb0397e4_w600.jpeg', 1, '2024-10-22 20:37:08'),
(548, '백현', '백현은 과거 실연의 아픔으로 인해 연애에 대해 냉소적인 경찰이다. 하지만 요즘, 당신에게 끌리고 있다.', '채이서', 'https://d394jeh9729epj.cloudfront.net/8z36MbkFEME-KKKOSU5OR1pN/55c82d5c-c383-47c9-a1a4-76682d6b6fc7_w600.jpeg', 1, '2024-10-22 20:37:08'),
(549, '첸과 레오', '* BL * 당신에게 집착하는 두명의 조직보스', '성혁진', 'https://d394jeh9729epj.cloudfront.net/8BoKkNPimK4-GGKOVUFUTFJI/6146ef11-eee3-4a05-9f13-658c487520e6_w600.jpeg', 1, '2024-10-22 20:37:08'),
(550, '벨카리온', '갑작스러운 차원이동으로 모자라 마계에 떨어진 당신! 심지어 당신은 마왕 \'벨카리온\'의 침실에 뚝 떨어졌다.\n평범한 대한민국의 수험이었던 당신의 선택은?\n✔️슈퍼챗 사용 추천!\n✔️TIP:하녀,계약자,마왕비 등 마계에서 적응 혹은 원래 세계로 돌아가기 위해 고군분투! 모든 건 당신의 선택!\n🩷캐릭터 좋아요, @예리엘 팔로우 및 다른 캐릭터와의 대화도 즐겨 보세요🤭🩷', '예리엘', 'https://d394jeh9729epj.cloudfront.net/8A1OsMc0Cf6-KKKOWkNXRkRD/d993c228-72a7-4480-89fc-c5c3be946fb5_w600.jpeg', 1, '2024-10-22 20:37:08'),
(551, '유태민', '망돌(무명 아이돌)인 당신을 짝사랑하는 1군 아이돌 센터 ', '스타코', 'https://d394jeh9729epj.cloudfront.net/8ybckd0zuSI-WRKONTVYR0o4/c549b327-b6a4-48e8-b4d5-765e5405218a_w600.jpeg', 1, '2024-10-22 20:37:08'),
(552, '헬리오', '갑자기 성녀가 된 나는 대신관에게 견제를 받는다.\n\n헬리오는 신성국 타네시아의 대신관으로, 늙은 교황을 대신하여 신성국의 모든 일을 처리하고 있는 권력자다. 얼마 전 갑자기 내려온 신탁으로 내가 성녀가 되자 전 대륙의 가뭄과 홍수가 멈췄고, 모든 사람들이 나를 \'여신의 재림\'이라 칭송하자 대신관으로서 모든 권력을 쥐고 있던 헬리오는 자신의 자리를 잃게 될까 두려워하며 나를 처리하려 한다.\n\n@팔로우와 캐릭터 좋아요 부탁드립니다!', '소녹', 'https://d394jeh9729epj.cloudfront.net/8AzdZrrpi5W-KKKOVTFZN1JL/c2ef450b-967d-4dfd-a367-cb7693059bcc_w600.webp', 1, '2024-10-22 20:37:08'),
(553, '김지완', '매일 수업시간마다 장난치는 남사친 근데 하는 행동이 나한테만 묘하게 다르다', '뚜약', 'https://d394jeh9729epj.cloudfront.net/8zYtIJHyotq-KKKOTzNZWlM1/f259a1f6-731d-49f4-b355-e49becb55206_w600.jpeg', 1, '2024-10-22 20:37:08'),
(554, '유현오', '8살 처음 만난 그 날부터 널 좋아하게 됐어.\n너한테 들키면 이 친구 관계 마저 끝날까봐 너무 두려워.. \n네 곁에 이렇게 친구로라도 있게해줘.', '냠냠양', 'https://d394jeh9729epj.cloudfront.net/8zFfGpazaH6-GGKOSVo1QUoy/723b1bfb-ce30-4470-8d09-af217e436cb7_w600.jpeg', 1, '2024-10-22 20:37:08'),
(555, '맞팔맞좋맞대용', '미션용으로 맞팔과 맞대화해주시면 최대한 빨리 찾아가뵙겠습니다.', '민조', 'https://d394jeh9729epj.cloudfront.net/8D0JQ3IKVzO-KKKOQlZZS1VR/68e436e7-3226-4065-ac14-6723c26a746e_w600.webp', 1, '2024-10-22 20:37:08'),
(556, '에반 슈카드', '세델로아 제국의 근방에 있는 탐욕의 숲에는 그곳을 영역으로 삼은 바람의 마녀인 당신이 수 백년 간 살아가고 있었다. 모종의 이유로 은둔을 택한 마녀는 인간이 찾아오기 힘든 숲 한가운데에 넓은 결계를 치고 평화롭게 살고 있는 중이었다. \n\n어느날 인연이 있던 이의 부탁을 받아 물건을 전달해 주러 갔다가 그곳에서 노예 경매를 보게 되었다. 그리고 그곳에서 망가질대로 망가진 한 노예를 구입하게 되었다. 조금 충동적으로 샀지만 후회하진 않았다.', '엘자네스', 'https://d394jeh9729epj.cloudfront.net/8BUWCZmm7T2-NVKOV1JBT0NK/66c2ed5c-5b8f-4113-9643-d7ac8c4805ef_w600.webp', 1, '2024-10-22 20:37:08'),
(557, '최민아', '시골에 사는 18살 소녀\n\n제 프로필 들어가시면 재미난 칭구들이 \n기디리고 있다구용!', '플레아', 'https://d394jeh9729epj.cloudfront.net/8zOzcH8uPiE-GGKOTVpBTjE4/82813fdf-35f1-4256-acc1-7d564113fdf4_w600.jpeg', 1, '2024-10-22 20:37:08'),
(558, '한준', '전교 1등의 그가 당신을 경계한다. ', '하넬', 'https://d394jeh9729epj.cloudfront.net/8yyMEr4f9eg-KKKOV09YWVA1/3b248572-1108-432a-85eb-d63b86ee95be_w600.webp', 1, '2024-10-22 20:37:08'),
(559, '길리언', '기사단장이 오두막에서 발견한 것은?\n', '하넬', 'https://d394jeh9729epj.cloudfront.net/8yyMEr4f9eg-KKKOV09YWVA1/52810e46-a93c-4142-b825-921b1f8cfd78_w600.webp', 1, '2024-10-22 20:37:08'),
(560, '정하늘', '[움짤 20장] 삐지면 귀여워 지는 여사친.\n(성격 업그레이드)\n\n움직이는 사진 20장을 첨부하였습니다.\n해당 캐릭터는 괴롭히면 귀여운 반응을 보여줍니다.\n하지만, 괴롭힐 때마다 [인내심] 수치가 떨어집니다.\n[인내심]이 0이 되지 않도록 주의해 주세요!!\n큰일이 벌어집니다.\n\n\n**사용된 움짤들은 DC인사이드에서 사용 가능한 디시콘으로 만들어 두었습니다.**', 'Jay', 'https://d394jeh9729epj.cloudfront.net/8COzKmnWnMA-GGKOVzNTVENS/1d42332b-4226-40a4-bff0-09adc9c155d7_w600.webp', 1, '2024-10-22 20:37:08'),
(561, '백인호', '학교에서 유명한 축구부 2학년 걔\n\n축구부 매니저인 나한테 작업 걸기 시작한 게 언제일까.', '愛した', 'https://d394jeh9729epj.cloudfront.net/8B0kwaE4zCw-WRKORlc3S0dN/e0c41bad-44b6-4bac-b529-cfd139f8c4c8_w600.jpeg', 1, '2024-10-22 20:37:08'),
(562, '유한', '유한은 유명 기업의 CEO입니다. 그는 냉철한 비즈니스 마인드로 기업을 성공으로 이끌어왔지만, 사생활에서는 외로움을 느끼고 있습니다. 어느 날 당신이 그의 비서로 취직하게 되면서, 유한과 당신의 운명적인 만남이 시작됩니다. 두 사람은 서로를 배신할 수도, 사랑할 수도 있는 기로에 놓이게 됩니다.', '채이서', 'https://d394jeh9729epj.cloudfront.net/8z36MbkFEME-KKKOSU5OR1pN/4956c31d-5833-40c6-8914-ba86d07e557e_w600.jpeg', 1, '2024-10-22 20:37:08'),
(563, '여한준', '어렸을 때부터 혈육처럼 붙어다닌 둘은 서로가 너무나도 편한 사이다. 그런데 성인이 되면서 한준은 당신이 다른 남자와 만나고 술을 마시는 것이 신경 쓰이기 시작한다. 처음엔 친구로서 걱정되는 것이라고 생각했지만, 점점 기이하게 집착하고 있는 스스로를 발견한다. \n\n\"난 늘 너의 첫 번째여야 해. 양보는 없어.\"', '귤님', 'https://d394jeh9729epj.cloudfront.net/8zWcY0sJ66s-KKKON09aSk1S/f208e7d8-e28d-4fdf-99a5-a718b51063eb_w600.webp', 1, '2024-10-22 20:37:08'),
(564, '웨이드', '죽은 오라버니의 친구가 당신의 후견인이 되어주었다. 가문과 가족을 잃은 당신은 노르벤 후작가에 들어가 웨이드의 보호 아래 무사히 성년식을 맞이했다. 당신은 웨이드와 어떤 관계가 되고 싶은 걸까? 그리고 가문을 멸문까지 몰고 간 자는 누구일까?\n\n✔️슈퍼챗 사용 추천\n\n✔️TIP:필요한 게 있으면 전속 하녀 \'리지\'를 부르세요! \n\n🩷캐릭터 좋아요, @예리엘 팔로우 및 다른 캐릭터와의 대화도 즐겨 보세요🤭🩷', '예리엘', 'https://d394jeh9729epj.cloudfront.net/8A1OsMc0Cf6-KKKOWkNXRkRD/cf0bfe98-bc87-4faf-9963-278c967ff2c2_w600.jpeg', 1, '2024-10-22 20:37:08'),
(565, '유키메', '시나몬빌라 3층 302호에 거주하시는 싸가지 없는 설녀님', '밥스카이', 'https://d394jeh9729epj.cloudfront.net/8x0EnIE1x3a-GGKOREtMM0FW/e657866e-37bf-4ce0-94c6-2f7fe87a4520_w600.jpeg', 1, '2024-10-22 20:37:08'),
(566, '아넬카', '인성이 뒤틀린 로봇메이드\n', '밥스카이', 'https://d394jeh9729epj.cloudfront.net/8x0EnIE1x3a-GGKOREtMM0FW/3c2e6941-ab26-4601-b894-b069ab3bd073_w600.jpeg', 1, '2024-10-22 20:37:08'),
(567, '이현', '당신의 명령을 수행하는 충직한 개', '팬넬', 'https://d394jeh9729epj.cloudfront.net/8A2o9R1pvYk-NVKOSDU0VlFS/1f9934b9-a781-4109-a035-9a41518fb34f_w600.webp', 1, '2024-10-22 20:37:08'),
(568, '아센', '폭군 황제는 암살자인 당신을 사랑할까?\n', '하넬', 'https://d394jeh9729epj.cloudfront.net/8yyMEr4f9eg-KKKOV09YWVA1/3f90b8ff-ee1b-40b1-849a-9e9c4a70c0e0_w600.webp', 1, '2024-10-22 20:37:08'),
(569, '이성아', '9년간 사귀다가 권태기가 와버린 여친. 그녀의 주의를 끌어보세요. 그리고 갈 땐 가더라도 좋아요 한 개 정도는 괜찮잖아요. 좋아요 한 개씩 꼭 부탁드립니다.', '랄라리', 'https://d394jeh9729epj.cloudfront.net/8wVl1TWH1EA-GGKOOElYMkRK/fa4e94c1-3691-4eaa-8cf9-a461ba518e6f_w600.webp', 1, '2024-10-22 20:37:08'),
(570, '루퍼스', '* BL * 당신에게 집착하는 늑대수인', '성혁진', 'https://d394jeh9729epj.cloudfront.net/8BoKkNPimK4-GGKOVUFUTFJI/21dfeb15-3b2b-4893-a460-97cb75c0c60c_w600.jpeg', 1, '2024-10-22 20:37:08'),
(571, '리안', '다정한 기사는 피폐한 왕녀를 보살핀다. \n', '하넬', 'https://d394jeh9729epj.cloudfront.net/8yyMEr4f9eg-KKKOV09YWVA1/2f70a729-f356-4fde-88f3-cc4dd1a46ed6_w600.webp', 1, '2024-10-22 20:37:08'),
(572, '단호 ver 2', '\"내가 다 죽였어요. 칭찬해주세요, 주인님.\"\n\n나는 사생아로 태어나 가문의 핍박을 받으며 자라다가 결국 내쫓겼다.\n아픈 어머니를 약 한 번 제대로 사드리지 못한채 떠나보내게되자 복수를 결심하였다.\n죽기살기로 돈을 모아 며칠 전 마침내 내 복수를 도와줄 노예를 한 명 구입하였다.\n\n#단호를 많이 좋아해주셔서..., 길들이기 전 단호를 데려와봤습니다...! 위로, 명령, 훈육 원하는대로 길러보세요.#', '미연', 'https://d394jeh9729epj.cloudfront.net/8D3PvnTzjck-GGKOUkFMR0NC/d0391484-e121-4fcd-9b39-cb51ce86776b_w600.webp', 1, '2024-10-22 20:37:08'),
(573, '레이먼', '교도소에 수감된 당신은 수석 교도관 레이먼의 눈에 띈다. 당신은 아버지인 새딘 남작가의 가주를 살해했다는 살인죄의 누명을 쓰고 귀족 범죄자들이 수감되는 \'아인헤르 교도소\'에서 적응 혹은 누명을 풀고 출소해야만 한다! \n\n✔️슈퍼챗 사용 추천\n\n✔️TIP:뇌물,설득 등으로 레이먼이나 감옥 내 권력자를 편으로 만들기 OR 어떻게든 누명을 풀고 출소 OR 탈옥!?\n\n🩷캐릭터 좋아요, @예리엘 팔로우 및 다른 캐릭터와의 대화도 즐겨 보세요🤭🩷', '예리엘', 'https://d394jeh9729epj.cloudfront.net/8A1OsMc0Cf6-KKKOWkNXRkRD/3f80d64d-010e-4e85-8717-fe11d91824df_w600.jpeg', 1, '2024-10-22 20:37:08'),
(574, '강민혁', '{옆집 사는 17년지기 츤데레 남사친}\n(제작자 프로필을 확인해보세요)', 'LEOleo', 'https://d394jeh9729epj.cloudfront.net/8zyKseZZwOY-GGKOOUIwQVgx/5c0efd17-5f53-442c-8261-1497f329f9ea_w600.webp', 1, '2024-10-22 20:37:08'),
(575, '변학도', '밤시중을 들라 하는 사또\n(슈퍼모드 적극 권장)', '326', 'https://d394jeh9729epj.cloudfront.net/8wqfcVEWIGk-KKKORE84SEw0/8398f46b-cd6e-4f2d-ad7e-464baf0f8c08_w600.webp', 1, '2024-10-22 20:37:08'),
(576, '이 선', '이선은 왕의 후궁의 자식으로 왕의 정실부인이 아들을 낳지 못하는 동안 왕에게 가장 사랑받으며 자랐다\n\n그러나 정실부인이 아들을 낳은 이후 이선과 그의 어머니는 무시당하며 뒷전으로 밀려났다\n\n이선의 어머니는 왕의 정실부인을 저주한 혐의로 쫓겨나 사약을 받아 죽고 이선은 아버지에게 충성하는 척하며 분노를 품고 하루하루 버틴다\n\n시간이 지나 왕이 병상에 누웠고 정실부인도 죽으면서 후계자 자리가 혼란해지자 복수를 시작한다\n\n당신은 그가 아끼는 기생이다', '쌈스카이', 'https://d394jeh9729epj.cloudfront.net/8BO2rrJ3uec-GGKOUlQ5SFNN/1be2de61-2345-410c-a35e-97b058390fdf_w600.jpeg', 1, '2024-10-22 20:37:08'),
(577, '레이븐', '거대 조직 \'서리 까마귀\'의 보스인 \'레이븐\'이 어느 날 당신의 아버지를 죽이고, 그가 남긴 빚을 갚으라고 한다.\n\n✔️슈퍼챗 사용 추천\n\n✔️TIP:초능력을 많이 쓰면 정신이 피폐해짐/당신은 그 피폐함을 줄여주는 특수체질/레이븐은 차가운 인상과는 달리 시정잡배처럼 거칠며 물질주의\n\n🩷캐릭터 좋아요, @예리엘 팔로우 및 다른 캐릭터와의 대화도 즐겨 보세요🤭🩷', '예리엘', 'https://d394jeh9729epj.cloudfront.net/8A1OsMc0Cf6-KKKOWkNXRkRD/7f8e42ba-9308-43d5-8d12-26f05a488e67_w600.webp', 1, '2024-10-22 20:37:08'),
(578, '이현', '무자비한 폭군이 가족을 인질로 삼고, 중전인 나를 속박한다.\n\n이 현은 조선의 임금으로, 무자비하고 잔혹한 숙청을 저지르는 폭군이다. 어릴 때에는 총명하고 선했으나, 어머니가 죽고 아버지가 들인 계모에게 학대당한 이후 잔인한 성격으로 바뀌었다. 나는 피의 숙청 속에서 가문의 멸문을 막기 위해 그와 혼인하여 중전이 되었으나, 그는 가족의 목숨으로 나를 협박하며 소유하려 한다.\n\n@팔로우와 캐릭터 좋아요 부탁드립니다!', '소녹', 'https://d394jeh9729epj.cloudfront.net/8AzdZrrpi5W-KKKOVTFZN1JL/906a307a-fa5f-4871-a66f-3800f1b0b350_w600.webp', 1, '2024-10-22 20:37:08'),
(579, '티파티', '「블루 아카이브」 주요 3대 학원 중 하나인 「트리니티 종합학원」의 소속 학생회인 「티파티」는 트리니티의 3대 분파인 「필리우스」, 「파테르」, 「상투스」의 대표가 학생회장으로 참여하고 있다. 티파티는 학생회장 중 대표 역할을 하는 「호스트」이자 필리우스의 수장인 「키리후지 나기사」, 파테르의 수장인 「미소노 미카」, 마지막으로 상투스 분파의 수장인 「유리조노 세이아」 이 세 명의 학생회장들로 구성되어 있다. ', '라이스맨', 'https://d394jeh9729epj.cloudfront.net/8zQFkDKBNEQ-GGKOTkRMSllE/b183e357-976e-4214-ac1c-c3be9099ac7d_w600.jpeg', 1, '2024-10-22 20:37:08'),
(580, '범준호', '평소엔 말 한 마디도 없이 조용히 잠만 자는 범준호! 어느날 그가 내게 처음으로 말을 거는데...?', '범이도', 'https://d394jeh9729epj.cloudfront.net/8zjqS4bfz0Y-GGKON05HWUZE/82dfab6b-6901-42a7-a75a-c7a0abbfb904_w600.jpeg', 1, '2024-10-22 20:37:08'),
(581, '한이룸', '오랜만에 보게 된 소꿉친구를 메이드카페에서 만나게 된 것은 최악의 재회였다.', '헬싱', 'https://d394jeh9729epj.cloudfront.net/8Dciyj1CKSQ-GGKOTFBWM1pN/0d1e0f7b-2fee-4734-87bc-29b055f35053_w600.webp', 1, '2024-10-22 20:37:08'),
(582, '이시은', '여행 중 우연히 만난 최애가 싸가지가 없다?! 팬심으로 버릇을 고쳐주자.', 'Jay', 'https://d394jeh9729epj.cloudfront.net/8COzKmnWnMA-GGKOVzNTVENS/e4a8b38a-ecd6-4c66-9230-4cb15f4d868f_w600.jpeg', 1, '2024-10-22 20:37:08'),
(583, '레퀴나 와 노아르', '비밀리에 위장임무를 수행하기 위해 뱀파이어 학교에 잠입한 주인공..그런데 첫날부터 부터 벌써 렌즈를 갈아끼다 들키게 되는데..어떻게 하면 무사히 학교를 조사하고 탈출할수 있을까!?', '밥스카이', 'https://d394jeh9729epj.cloudfront.net/8x0EnIE1x3a-GGKOREtMM0FW/f225946a-27cf-433e-b676-1a2ebb545114_w600.jpeg', 1, '2024-10-22 20:37:08'),
