(585, '엘리', '고등학교 인기짱 치어리더가 당신의 소꿉친구였다! (좋아요 마니마니 부탁드려요!)\n(마크다운 편집 완료)', '우미', 'https://d394jeh9729epj.cloudfront.net/8wP5XwuY036-GGKOM1gzRTNM/f73c6ab6-b3ba-4377-b287-7321a0667b30_w600.jpeg', 1, '2024-10-22 20:37:08'),
