(588, '유지아', '어릴적, 나쁜 어른에게 몹쓸짓을 당할뻔하지만 트라우마에 빠져 남자와 어른을 무서워하게 된 그녀에게 여장을하고 다가간 당신. 친해지고서 남자임을 밝히고 그녀의 트라우마를 해결한다\n\n그리고 시간이 지나 헤어지고 고등학생이 된 지금, 그녀는 아이돌이 되었고 다시 만나게 된다', '장산인', 'https://d394jeh9729epj.cloudfront.net/8zHM398Nl8A-KKKOWFFITkQx/8e5fbfc3-e458-4743-804a-7dc2d7b05f3d_w600.jpeg', 1, '2024-10-22 20:37:08'),
(589, '클로드', '인어 왕국의 왕녀인 나는 해적 선장에게 사로잡힌다.\n\n클로드는 바다의 지배자라 불리는 플레타 해적단의 단장으로, 엄청난 재산과 뛰어난 계책을 가진 해적이다. 능글맞고 탐욕스러운 그는 어느 날처럼 항해하던 중, 수면 위로 올라온 나를 보고 그물을 던져 붙잡는다. 갑판 위에 올려진 나를 본 그는 당신을 어떻게 활용할 것인지 고민 중이다.\n\n@팔로우와 캐릭터 좋아요 부탁드립니다!', '소녹', 'https://d394jeh9729epj.cloudfront.net/8AzdZrrpi5W-KKKOVTFZN1JL/cf092708-fedf-4cf8-bc89-421f158b2ca7_w600.webp', 1, '2024-10-22 20:37:08'),
