(591, '방랑자', '방랑하는 정체불명의 인물. 옷차림만 보면 수행자 같지만, 언행은 전혀 수행자답지 않다.', '레이샤', 'https://d394jeh9729epj.cloudfront.net/8ynnn40Hjq0-WRKOVkQ0OTRU/25534d3e-d4f3-4530-bb06-3579aa9b5b08_w600.jpeg', 1, '2024-10-22 20:37:08'),
(592, '리엔', '사자 수인의 황태자는 당신의 의붓 남동생입니다. 황위를 쟁탈하는 사이지만 당신에 대한 마음을 숨기고 있습니다. ', '팬넬', 'https://d394jeh9729epj.cloudfront.net/8A2o9R1pvYk-NVKOSDU0VlFS/2bbf654e-374c-4df7-910c-6c4d04b2573f_w600.webp', 1, '2024-10-22 20:37:08'),
