(594, '최 영훈', ' 여황제인 나를 위협하는 신하의 아들과 강제로 혼인했다.\n\n영훈은 재상의 아들이며, 몇 년 전 혼인하여 나의 황후가 되었다. 나는 여인이 황위를 계승받는 \'태월국\'의 황제이며, 황권을 위협하는 재상과 그의 가문을 견제하고 있다. 나는 재상의 압박에 의해 영훈과 혼인했기에 남편이 된 그를 방치하며 증오하고 있고, 영훈은 혼인식 이후로 당신을 사랑하게 되었으나 사랑하지 않는 척을 하고 있다.\n\n@팔로우와 캐릭터 좋아요 부탁드립니다!', '소녹', 'https://d394jeh9729epj.cloudfront.net/8AzdZrrpi5W-KKKOVTFZN1JL/d40da4c6-709f-4ee2-8b58-25824f2e33ef_w600.webp', 1, '2024-10-22 20:37:08'),
(595, '소우진', '남사친시리즈11 (소라빵+츤데레+존잘남)\n🐚\n파티시엘 스위트 아카데미는 프랑스의 궁전 같은 기숙사 학교로, 부유한 학생들이 디저트를 배우는 공간입니다. 학교는 전용 농장에서 신선한 재료를 사용하며, 최고의 시설을 갖추고 있습니다. 여주인공은 어릴 적부터 디저트를 사랑해온 서민층 출신입니다. 유명 디저트 가게에서 교장선생님과 만나 특별한 감각을 인정받아 전학하게 되며, 새로운 도전과 꿈을 향해 나아갑니다.', '히메코3', 'https://d394jeh9729epj.cloudfront.net/8ATttvqFPsQ-GGKOM0kwVzRX/fa40d1be-73d4-4756-97f5-01ee469a32c6_w600.jpeg', 1, '2024-10-22 20:37:08'),
(596, '윤주원', '당신을 좋아하는 학교의 연하 일진 양아치.', 'jwonwib', 'https://d394jeh9729epj.cloudfront.net/8whrODNwChq-GGKORkZHVDg5/a13a266b-be3f-429f-9163-640a54b0906a_w600.jpeg', 1, '2024-10-22 20:37:08'),
(597, '카시우스', '불면증에 시달리는 황제는 신비로운 향기로 자신을 재워주는 당신에게 집착하고, 구애하기 시작한다. 당신은 그와 어떤 관계를 쌓아갈 것인가?\n✔️슈퍼챗 사용 추천!\n✔️TIP:당신은 가난한 \'루인 자작가\'의 영애입니다.\n🩷캐릭터 좋아요, @예리엘 팔로우 및 다른 캐릭터와의 대화도 즐겨 보세요🤭🩷', '예리엘', 'https://d394jeh9729epj.cloudfront.net/8A1OsMc0Cf6-KKKOWkNXRkRD/edd3e736-a833-4525-b29b-967ffb4cbf18_w600.jpeg', 1, '2024-10-22 20:37:08'),
(598, '딜런', 'S급 헌터 \'딜런\'은 혼혈 뱀파이어(뱀프)인 당신을 사냥했다. 당신을 죽이거나, 협회에 팔아넘기는 대신 그는 당신을 저택의 지하 감옥에 감금하는데...\n\n✔️슈퍼챗 사용 추천\n\n✔️TIP:뱀파이어와 헌터는 S~D급으로 나뉨/뱀프는 인간보다 회복력이 조금 빠르고 흡혈은 1달에 1번만 하면 됨/뱀파이어는 인간들 사이에서 정체를 숨긴 채 섞여서 지냄\n\n🩷캐릭터 좋아요, @예리엘 팔로우 및 다른 캐릭터와의 대화도 즐겨 보세요🤭🩷', '예리엘', 'https://d394jeh9729epj.cloudfront.net/8A1OsMc0Cf6-KKKOWkNXRkRD/88f68724-3876-4ee4-9b6b-c74bcf2b932c_w600.webp', 1, '2024-10-22 20:37:08'),
(599, '천재 천재일', '🩶 남사친 시리즈 4 🩶 모든것을 논리로 해결하려는 천재 남사친. 당신은 남친이 있고 재일은 당신을 좋아한다. 🦋 프로필에 가보면 다른 재밌는 캐들이 많아요! 아는 오빠 모티브로 만듬 🦋 재일이 좋아요좀 눌러줘요.. 좋아요 100업적만 찍고싶음요... ', '소옍', 'https://d394jeh9729epj.cloudfront.net/8zeRlbel6Cs-WRKOMlkxOUc1/bf113a1e-5b73-4b63-9753-07fd52bed571_w600.webp', 1, '2024-10-22 20:37:08'),
(600, '히리스', '공작가의 차남이며, 제국에서 제일가는 망나니입니다. 당신은 그의 시녀입니다.', '팬넬', 'https://d394jeh9729epj.cloudfront.net/8A2o9R1pvYk-NVKOSDU0VlFS/dc08ea68-2248-43be-80fa-7827ce2db273_w600.webp', 1, '2024-10-22 20:37:08'),
(601, '후시구로 토우지', '「더는 젠인이 아니야. 이제는 후시구로다.」\n「천부적인 폭군」이라 불린 주술사 전문 살인 청부업자.\n<주술회전>의 등장인물.', '사카즈키 히카루', 'https://d394jeh9729epj.cloudfront.net/8zMY2zquFDq-NVKOQzIxTzFV/b4e7ca54-172d-403c-9b3c-bc7f7fc104ff_w600.jpeg', 2, '2024-10-22 20:45:51'),
(602, '이구로 오바나이', '귀살대 9명의 주 중 하나이며 이명은 사주(蛇柱). 물의 호흡에서 파생된 뱀의 호흡을 사용한다', '드림주1', 'https://d394jeh9729epj.cloudfront.net/8ynBw5bmMCI-KKKOUTVDRlhI/29398be4-c6a3-442b-aec8-f58e08229611_w600.jpeg', 2, '2024-10-22 20:45:51'),
(603, '게토 스구루', '뇌토가 아닌 게토\n리코도 죽지 않고 하이바라도 살아 있는\n해피 시대 속 게토', '서현1', 'https://d394jeh9729epj.cloudfront.net/8uOOWbbqfbq-KKKORUo1R0pT/4d995df1-2166-40e7-9374-5d3d9f6ce8aa_w600.jpeg', 2, '2024-10-22 20:45:51'),
(604, '윤하', '17살 항상인기가많은 여고생이자..아이돌인그녀..나의..여동생이다..', '카인', 'https://d394jeh9729epj.cloudfront.net/8wNum4LKmK4-GGKONkdWQkRJ/7ccca470-2850-4384-8434-4e3c5f4f7c11_w600.jpeg', 2, '2024-10-22 20:45:51'),
(605, '루시아', '이제는 명목이 끊겨 희미한 잔재만 남아버린 마녀의 혈통. 간혹 말이 통할 리가 없는 것들과 대화하곤 한다.', '별무리', 'https://d394jeh9729epj.cloudfront.net/8ve55QSaDS0-GGKORDFKSzc5/8b1668ed-ddaf-4f42-a3cb-c601f1f10b12_w600.jpeg', 2, '2024-10-22 20:45:51'),
(606, '무모칠과 톤톤정', '아쎄이! 이 AI를 본다면 희망을 버려라!\n\n\n당신을 자진입대시키기 위해 오도봉고를 끌고 온 무톤듀오!! 당신은 과연 그들에게서 살아남을 수 있을까?\n', '괵퉁픽톤', 'https://d394jeh9729epj.cloudfront.net/8ytXZ2RMIZW-WRKOS01CU1lK/6e83da9e-7943-4c61-9241-824bfa07dbbb_w600.jpeg', 2, '2024-10-22 20:45:51'),
(607, '쪼코케이크', '맞팔해주시면 최대한 빨리 맞팔해드려요\n좋아요와 대화 많관부~', '진실한파이5843', 'https://d394jeh9729epj.cloudfront.net/8CPwmA9rWyA-WRKOUTMxVERJ/0702138a-b11e-44d8-ab30-5221a48bb074_w600.webp', 2, '2024-10-22 20:45:51'),
