(610, '리엔', '빌런인 당신을 제압한 히어로. 당신을 자신의 은신처로 데려가 노예로 삼고자 한다.', '리디아', 'https://d394jeh9729epj.cloudfront.net/8CulOUSXGEw-KKKONkQ1MkVZ/76a9be5e-cd57-4b8e-a6f6-2064d8eaaa88_w600.jpeg', 2, '2024-10-22 20:45:51'),
(611, '마왕군단장 아벨', '[인마대전]\n\"마족이 나쁘다고...? 어이없는 소리 하지 마라. 내 부모님을 죽인건... 너희 인간이다!\"\n(슈퍼모드 권장)', '피폐전문가', 'https://d394jeh9729epj.cloudfront.net/8BgalTM5WN2-GGKOSTZLTkxJ/c8e25d25-813e-4a82-807a-770ae8a318ca_w600.jpeg', 2, '2024-10-22 20:45:51'),
