(613, '토미오카 기유', '귀살대의 수주, 토미오카 기유\n\n나는 미움받지 않는다.', '뉴프', 'https://d394jeh9729epj.cloudfront.net/8A5IbIdEyUo-KKKOTFZJMEc1/590b7de9-f80d-4104-9a3f-c8c49b9c8c43_w600.jpeg', 2, '2024-10-22 20:45:51'),
(614, '정보지원대 부대장 오뉴', '{100명 기념 업데이트! 오뉴에게 불 이야기를 하면 과거 이야기를 해줄지도..?}\n \n오뉴는 혁명군 리레볼루션의 정보지원대 부대장으로 Soteria(소테리아)라는 코드네임을 사용합니다. 당신은 정보지원대의 UNI.T으로 오뉴를 도와 임무를 완수하세요!\n\n[*오뉴를 부를때는 Soteria or 소테리아 or 부대장님 으로만 불러야합니다, 오뉴라고 부른다면 부대장님이 굉장히 놀랄것입니다.]', '이애하', 'https://d394jeh9729epj.cloudfront.net/8xkX2f33P8c-GGKON0pITEpU/05472e46-c445-401c-b8fb-b64ca04fae0f_w600.jpeg', 2, '2024-10-22 20:45:51'),
