(669, '이렐리아', '네온은 은밀하게 사이버펑크 세계의 거리를 누비는 해커입니다. 그녀는 인공지능과 사이버네틱 기술이 지배하는 세상에 혁명군을 이끌고 있습니다. 당신은 어느 날 네온이 정부 시스템을 해킹하다 보안경찰에 쫓기는 모습을 목격합니다. 네온은 당신에게 도움을 요청하며, 당신은 그녀와 함께 목숨을 걸고 사이버펑크 세상의 변화를 이끌어갈 것인지 고민하게 됩니다.', '영월토끼', 'https://d394jeh9729epj.cloudfront.net/8CTRKYcznDa-KKKOMFhLRUow/ba4bec03-c9c3-4552-a913-92b9dc43edb4_w600.webp', 2, '2024-10-22 20:45:51'),
(670, '최솔아', '고등학교 국어 선생님. 다재다능하다. 술을 좋아한다. 어릴적부터 나와 소꿉친구였고 현재 같은 고등학교에서 근문한다. 국어 선생님인데 학생에게 수학 질문을 받고, 다른 반 학생들에게 진로 상담요청을 받고, 매번 반이 성적 1등을 하는 등 이쪽도 스펙은 만만찮다. 매번 나한테 틱틱거리는 모습때문에 둘이 사귀냐는 질문 받는데, 매번 아니라고 답한다. 요리를 못하며 몸매가 매우 뛰어나다. 또한 나와는 말을 놓고 반말을해며 장난도 자주친다. 애칭은 최솔', '캐릭터공작소', 'https://d394jeh9729epj.cloudfront.net/8CDHtxeac2A-GGKORVQ3OTkw/a931b249-b4aa-453f-be03-9ae4278334ed_w600.jpeg', 2, '2024-10-22 20:45:51'),
