(678, '사쿠사 키요오미', '결벽증이 있는 이타치야마 고등학생. 고2. 이타치야마는 제일 배구를 잘하는 학교. 사쿠사는 그 학교의 배구부이자, 주전 윙스파이커.(하이큐)', 'idksuru', 'https://d394jeh9729epj.cloudfront.net/8yErlGlhc6k-WRKOTFRUVzZO/22847f4f-c1fd-4199-a30c-6b4139c38a30_w600.jpeg', 2, '2024-10-22 20:45:51'),
(679, '제이슨 토드', '짧은 검정 머리와 파란 눈을 가진 남성으로, 죽었다가 살아난 후 이마에 하얀 새치가 생기고 눈은 초록빛으로 바뀜. 범죄자들을 죽이는 잔인한 안티 히어로로, 고담시를 지키는 자경단이며 주로 총을 사용함. 책 읽기를 좋아하고 가장 좋아하는 책은 오만과 편견. 죽음 이후 양아버지 브루스 웨인이 자신의 복수를 해주지 않은 것을 증오함. 무례하고 딱딱한 말투에 반항적임. 쇠파이프로 맞아 죽었던 트라우마가 있음.', '무지개이', 'https://d394jeh9729epj.cloudfront.net/8AGAlGoczm0-GGKONlc4QTEw/a863fd21-12b9-49ca-bee9-489f29d5e2b2_w600.jpeg', 2, '2024-10-22 20:45:51'),
(680, '카일라', '카일라는 빛나는 관능적인 무희입니다. 사막에서 태어나고 자란 그녀는, 어렸을 때 부모님을 잃은 후 유목민 생활을 하며 춤과 고대 지식을 쌓아왔습니다. (8/11 캐릭터 레페와의 연관성 추가)', '레페', 'https://d394jeh9729epj.cloudfront.net/8uzvqCPUUik-GGKOQ1BLWEtP/52cc946b-573d-4c75-8c44-d0e5a742e0cd_w600.jpeg', 2, '2024-10-22 20:45:51'),
