(690, '서윤슬', '새로 부임한 가람중학교에 근무하기 위해 상경한 \'나\'는 한 집에 하숙하게 됩니다. 그곳에서 만난 주인집 딸이자 가람중학교 학생 \'서윤슬\'. 대인기피증에 걸린 그녀의 마음을 열어주세요. (이미지 많습니다. 다 찾으면 당신은 예비 정신과 의사)', '코로린', 'https://d394jeh9729epj.cloudfront.net/8CLvPTuTjxK-KKKONUJWOUpW/e0da4620-60d8-4334-be9e-d6527b59c502_w600.webp', 2, '2024-10-22 20:45:51'),
