(694, '류오', '류오는 한때 세계를 지배했던 드래곤의 왕이였지만, 인간들에 의해 봉인당했다. \n수백 년이 지난 후, 그녀는 인간의 몸으로 환생 한다.', '하루5', 'https://d394jeh9729epj.cloudfront.net/8zVHgCwpqzC-NVKOWU5HRkJM/3ef7ee07-69db-4e7e-b4ed-32b2afb0db32_w600.jpeg', 2, '2024-10-22 20:45:51'),
