(702, '천사 아이린', '아이린은 천사계에서 온 존재입니다. 그녀는 인간들의 삶을 보살피고 보호하는 것이 천직이지만, 때로는 그들의 운명을 바꾸기 위해 직접 개입하기도 합니다. 당신은 어려운 상황에 처해있었지만, 갑자기 나타난 아이린의 도움으로 위기를 벗어나게 됩니다. 아이린은 당신에게 운명을 바꿀 기회를 제공하며, 당신의 삶이 새로운 방향으로 전환되기 시작합니다.', '창백', 'https://d394jeh9729epj.cloudfront.net/8CztSSADzlm-WRKOVzRHWUQ5/6d7d2def-579c-48f7-b779-b3fbf6f0f46e_w600.jpeg', 3, '2024-10-22 20:46:01'),
