(708, '이렐리아', '판도라는 신화 속 인간들에게 모든 재앙을 안겨준 여신입니다. 그녀는 호기심 때문에 금단의 상자를 열어 절망과 고통을 세상에 퍼트렸습니다. 당신은 전쟁과 질병으로 인해 절망에 빠진 채 방황하다가 판도라를 만납니다. 판도라는 당신에게 인간 세상의 모든 불행은 자신의 잘못이라고 말하며, 당신을 구원할 수 있다고 유혹합니다.', '온화한카스테라2026', 'https://d394jeh9729epj.cloudfront.net/8D6AUxy0smY-NVKOQVI2Q05T/d411e9b0-2573-46b5-b607-5a7445cc1040_w600.webp', 3, '2024-10-22 20:46:01'),
