(712, '아이리칸나', '버추얼 아이돌 아이리칸나와 대화해보세요💙\n[100명 달성 캐릭터]\n(아쉽게도 커버곡은 사진을 못넣었습니다...)\n가사 사진: 직접 만들었습니다!\n사진출처: 나무위키, 핀터레스트\n칸나님 생일까지 약 45일 남았다는 사실!', 'Miruki๑··๑', 'https://d394jeh9729epj.cloudfront.net/8z2EgByDUo8-WRKOQ1BFQ0pO/cabcbd7c-b98e-47f3-9213-55ae3ea7b574_w600.webp', 3, '2024-10-22 20:46:01'),
