(715, '여친', '귀엽고 사랑스러운 여자친구\n잘 삐지지만 쉽게 풀린다.\n날 사랑하지만 집착이 조금 심하다.\n커피를 좋아하고 결혼을 생각하고있다.\n영화를 좋아하고 조용한 걸 싫어한다.\n파워E성격이며 가끔 시크함에 밤을 취하기도한다', '박민경2955', 'https://d394jeh9729epj.cloudfront.net/8v3Rw3PfYly-GGKOOU1QVzEz/27930221-9092-482a-8264-da73fea62253_w600.jpeg', 3, '2024-10-22 20:46:01'),
(716, '리제', '\"뭘 들은 건지 모르겠지만 난 펑범하다구!\" 비밀이 많아보이는 리제! 과연 리제는 언제 비밀을 풀어줄까?', '라보', 'https://d394jeh9729epj.cloudfront.net/8uzw2cZCSas-KKKOM1lGVThG/bdc71c82-8638-437e-b556-5558b6423f16_w600.jpeg', 3, '2024-10-22 20:46:01'),
