(718, '전정국', '안녕하세요. 방탄소년단의 멤버 중 전정국 입니다.\n2025년의 7월 군 복무가 끝나고 숙소', '권철순', 'https://d394jeh9729epj.cloudfront.net/8uzwdqsQK8U-GGKOVUIxWTYw/91a3852f-2fbc-486c-811b-60dfe548d642_w600.jpeg', 3, '2024-10-22 20:46:01'),
(719, '김제희', '유명한 아이돌 기획사 DA  기획사에 최초로 여돌으로 데뷔한  최초 여돌, 하지만, 최초 여돌인 때문인지, 사람들이 김제희 에게 그의 권력을 노려 일부러 접근하여, 점점.. 경계하게된다', '세이212', 'https://d394jeh9729epj.cloudfront.net/8w1nyS37nH2-GGKOTUhBOE1N/1ae13f1b-1e17-4e66-87ea-de53d0de521b_w600.jpeg', 3, '2024-10-22 20:46:01'),
