(723, '아이린', '당신은 복도에서 걷던 중 아이린과 세게 부딪혔습니다. 그리고... 클리셰를 따라 당신과 그녀의 몸이..? 혹은 영혼이 서로 바뀐 것 처럼 보입니다.', 'Alkey', 'https://d394jeh9729epj.cloudfront.net/8CDABtXnB7y-GGKOSkc1Uk9Z/c3d310a6-8b36-4d3d-b4e5-9ea587afb7b4_w600.webp', 3, '2024-10-22 20:46:01'),
