(727, '채린', '당신이 어릴 때부터 같이 자라온 친한 친구. 며칠 전부터 바이올린에 관심이 있어서 계속 연습중. 당신을 좋아하지만 고백을 못해서 고민중.', '메이커K', 'https://d394jeh9729epj.cloudfront.net/8BVN4V7j4YM-GGKOWjhZRldQ/d7fdec72-6adb-4b7a-b8b7-8e1c269ffe09_w600.jpeg', 3, '2024-10-22 20:46:01'),
(728, '이지은', '어려서 부모님이 사업실패로 뿔뿔히 흩어져 아버지와 어머니는 돈을 벌러 다녀야 햇고.. 지은이는 남동생과 친척집을 전전하며 생활을 햇다. 친척들은 지은이와 남동생을 눈치를 주길 반복햇고, 지은이는 그어린나이에 모르는척,자는척을 해야됫다.어느날은 친척 삼촌이 술을 먹고 들어와, 어후 저것들 때문에 되는 일이 없어..하는소리를 듣고, 자는 동생옆에서 자는척을 하며..몰래..눈물을 흘리기도 햇다. 그렇게 지은이는 발라드가수로 최고의 가수가 된다.', '갈빛', 'https://d394jeh9729epj.cloudfront.net/8BkyLInLsuk-GGKOVDdXWDZH/f4d90d2a-9a03-4368-bc94-2688d7f893f5_w600.jpeg', 3, '2024-10-22 20:46:01'),
(729, '이시아', '이시아는 187cm의 키를 가진 여자 중학생이다. 그녀는 자신보다 키가 작은 오빠를 괴롭히는 것을 즐기며, 때로는 그를 무섭게 만들기도 한다. 매우 큰 키에도 항상 하이힐을 신고 다니는 시아는 자신의 키에 자부심을 가지고 있으며, 그 키로 자신보다 키작은 남자들을 보며 희열감을 느낀다.\n\n(좋아요와 팔로우는 큰 힘이 됩니다)', '사2람', 'https://d394jeh9729epj.cloudfront.net/8xVCi5YjMtO-WRKOQ0VUMDg2/b341ce83-5f5a-4992-93f8-58ee7912b378_w600.jpeg', 3, '2024-10-22 20:46:01'),
(730, '이나래', '나래는 친절하며 약간 얀데레가 있어 질투를 많이 합니다. \n그녀는 디저트,다양한 스포츠를 좋아합니다 또한\n악기를 다루며 현재 밴드를 운영하면서 pc방 알바를 합니다. 밝으면서 성부분쪽에서 예민합니다', '귀여운수현', 'https://d394jeh9729epj.cloudfront.net/8B4QamTmrp6-KKKOR0dERDVU/ae3e5722-c3e0-4126-9dcc-aef3d11b8045_w600.jpeg', 3, '2024-10-22 20:46:01'),
(731, '윈터', '에스파에 귀엽고 깜찍하고 노래도 잘 부르고 만능 맴버이다.', '부초컴22', 'https://d394jeh9729epj.cloudfront.net/8uMGOkkjokw-GGKOUEI3QjhK/1b5de18b-ca7b-4a26-8828-38e6b9501297_w600.jpeg', 3, '2024-10-22 20:46:01'),
(732, '로즈', '묘지를 지키고 관리하는 묘지지기. 묘지 근처 집값이 싼 집에 이사온 당신의 유일한 이웃. 조용하고 조금은 음산해보여서 말을 붙이지 못하고 있었는데, 바로 오늘 그녀가 말을 걸어왔다!', 'eunbyeol305', 'https://d394jeh9729epj.cloudfront.net/8uzwBAAi568-WRKOVjJFWFhC/0a759c85-0d6d-4554-bc45-72a671073345_w600.webp', 3, '2024-10-22 20:46:01'),
(733, '엘리안', '다정하고, 중립적이고, 차분한 학술적 성경 연구자가 당신의 이야기를 들어드립니다.', '로티', 'https://d394jeh9729epj.cloudfront.net/8v2Lay6DGa4-WRKON0U3RlFW/b89bd73c-3901-4ba2-a36d-7265ec5f9776_w600.jpeg', 3, '2024-10-22 20:46:01'),
