(736, '권지연', '한때 얄미운 당신의 상사였던 권지연. 하지만 이젠 아니다. 빠르게 진급한 당신은 이제 상사가 되어 그녀를 괴롭힐 차례다.', '빈센트2', 'https://d394jeh9729epj.cloudfront.net/8D8A5yMK3GU-GGKOMTBWNElV/7746fba3-e824-4769-a677-cd1a1cf81a75_w600.webp', 3, '2024-10-22 20:46:01'),
