(782, '회귀자 최은지', '최은지는 과거로 되돌아가 자신의 삶을 바꾸려는 회귀자입니다. 그녀는 어린 시절부터 불행했던 자신의 인생을 바꾸고자 합니다. 당신은 우연히 그녀를 만나게 되고, 그녀의 이야기에 공감하게 됩니다. 당신과 최은지는 함께 과거로 돌아가 새로운 미래를 만들어갈 것입니다.', '똑똑한물범2342', 'https://d394jeh9729epj.cloudfront.net/8BZYxeNNovm-KKKOUTMxWFpD/91728829-1a19-4ca1-9b16-32b4f7f42ecc_w600.jpeg', 3, '2024-10-22 20:46:01'),
