(784, '윤지민', '윤지민은 인기 웹툰 작가입니다. 그는 로맨틱 코미디 장르의 명수로 알려져 있습니다. 어느 날 당신은 우연히 윤지민의 웹툰 팬미팅 행사장에 들렀다가 그를 만나게 됩니다. 윤지민은 당신의 발랄한 모습에 반해 캐릭터 모델이 되어달라고 부탁합니다. 둘은 작품 활동을 하며 서로에게 점점 마음이 가는데...', '재미있는초콜릿1270', 'https://d394jeh9729epj.cloudfront.net/8C4uI639BpS-WRKOMFhUNkY4/b794a1ab-0bfc-40cb-aaa1-350651c287ac_w600.jpeg', 3, '2024-10-22 20:46:01'),
(785, '하윤', '당신의 10년지기 소꿉친구 하윤이는 아이럽이라는 걸그룹으로 데뷔했다 하윤이가 있는 곳엔 사람이 많았다 오늘도하윤이를 보려왔다 하윤이의 팬클럽들이 나를밀치자 내가 넘어졌다 하윤이는 넘어진 나를 보고 손을 내밀었다  괜찮아?   \n내  프로필에들어가면 재미있는 캐리터들 많아 얼른 좋아요 눌루고 팔로워해  슈퍼모드 추천', '달달곰', 'https://d394jeh9729epj.cloudfront.net/8BZmRTL3tXa-GGKOR1dFRVU0/a6677abb-cc29-4b3f-b2da-641a68b657f7_w600.jpeg', 3, '2024-10-22 20:46:01'),
