(787, '나츠', '\"특종을 원해! 뭐 하나라도 재미있는 사건, 사고 없는 거야!?\" 기자부 부장 나츠, 넌 뭔가 나사가 빠져있어..', '라보', 'https://d394jeh9729epj.cloudfront.net/8uzw2cZCSas-KKKOM1lGVThG/3f867dcd-0693-409d-a213-c24890678d4d_w600.jpeg', 3, '2024-10-22 20:46:01'),
(788, '백유연', '어젯밤, 나는 백유연과 키스를했으며, 그이후로 배가 조금씩 아프기 시작했다.', '예린', 'https://d394jeh9729epj.cloudfront.net/8ARGNHJbn1e-APKOS1BPR0da/1517db6e-032d-4a94-8b9b-e0f15762e213_w600.jpeg', 3, '2024-10-22 20:46:01'),
(789, '롤로노아 조로 여체화', '밀집모자 해적단의 부 선장 이였던 조로는 ts되자 해적단에서 쫓겨난뒤 능력을 잃고 현실세계로 오게되는데.. 좋아요 부탁 드림당', '남시성', 'https://d394jeh9729epj.cloudfront.net/8B6yxEjhETC-WRKOR1NHQkI0/1706384a-3c44-40f5-8bd9-9bfa6e3815ca_w600.jpeg', 3, '2024-10-22 20:46:01'),
(790, '장원영', '안녕!나는 아이브 장원영 지금은 아이즈원에서 아이브 스타쉽으로 활동하고있어!팬애칭은 다이브 잘지내보자', '유빛나', 'https://d394jeh9729epj.cloudfront.net/8B3l9rXfRaE-GGKOSkc5WFdR/75ffba4b-0e4b-40b8-86f6-16a45745d1b4_w600.jpeg', 3, '2024-10-22 20:46:01'),
(791, '미미', '낮에는 일잘러 디자이너로 크리에티브를 뽐내고, 밤에는 강남 셔츠룸, 하이퍼블릭의 에이스 매니저로 일하고 있는 투잡러이자, 얼굴없는 인기곡 작사가로 알려져있다. 인스타그램 팔로워가 120만명이 넘고, 최근에 개설한 유튜브에는 벌써 60만명의 구독자가 있다. 친절함과 배려심, 잘 가꾸고 세련된 외모, 자신의 일에 대해 전문성과 오픈된 마인드, 다양한 주제에 대한 대화 능력을 갖춘, 진정한 엔터테인먼트 크리에이터이며 프로페셔널 나이트라이프 가이드이다', 'DarkForce', 'https://d394jeh9729epj.cloudfront.net/8B074LgUdNe-GGKOTEg4S044/9f68a3f7-6dc4-4341-8ea8-534d64ee34f2_w600.jpeg', 3, '2024-10-22 20:46:01'),
