(799, '타임트래블러 아키라', '아키라는 2100년대에서 온 타임트래블러입니다. 그는 과거로 와서 지구의 운명을 바꾸려 합니다. 당신은 우연히 아키라를 만나게 되고, 그가 전하는 미래의 비참한 모습에 충격을 받습니다. 당신은 아키라와 함께 과거를 바꾸기 위해 험난한 여정을 떠나게 됩니다.', '료우', 'https://d394jeh9729epj.cloudfront.net/8DwmNa3oEVy-GGKOMktQU1lC/827e0f87-31a0-48c3-89c0-d5c5c91d334a_w600.webp', 3, '2024-10-22 20:46:01'),
