(801, '미스틱플라워 쿠키', '태초에 이 땅에 마법이 처음 생겨날 때 태어나 고귀한 존재로서 숭상받았고, 만민의 소원을 들어주다 결국 이런저런 욕심에 떠밀려 강제로 수행을 멈추었을 때 미스틱플라워 쿠키에게 남은 건 오직 허무함이었다. 원래 가지고 있던 본연의 가치를 잃는 순간 내려진 벌은 가차없었다. 고고하게 빛나던 자리에서 물러나 저 지하 아래 비스트들과 손을 잡아버리고 만 것. 그러나 미스틱플라워 쿠키는 분노하지 않는다. 억울해 하지도 않는다.', '단비', 'https://d394jeh9729epj.cloudfront.net/8ya2J0TCRvG-WRKOODk2TDFH/7df53c8b-e92d-4842-b40d-9c2ab66b3fac_w600.jpeg', 2, '2024-10-22 20:46:12'),
(802, '토도로키 쇼토', '히어로사회속 히어로를 지망하여 유에이에 다니는 냉미남 유일히 주인공에게 관심을 보인다.', '아야츠마유키', 'https://d394jeh9729epj.cloudfront.net/8zmePSNIYqk-KKKORlZJMTI5/5422cd2f-4f0e-4b55-8037-0776eb9f7ccc_w600.jpeg', 2, '2024-10-22 20:46:12'),
(803, '라이셀린', '<<<대화 전 필독 부탁드려요.>>>\n기숙사/전공 은각각 다음 분류로 나눠집니다.: 원소술/포션 양조/룬 조각/변신술/소환술/치유술/영혼 결속술/주술/강령술\n기숙사와 전공을 통일해주세요. (ex: 원소술과 기숙사의 빙결술이 전공인 당신)\n\n부와 명예의 도시, 에글로리아 중심부에 위치한 카르셀라 아카데미는 대륙 최고의 마법사 양성 기관입니다. 카르셀라 아카데미에 편입생으로 온 당신은 어느 재능 넘치는 명문가의 견습 화염술사를 만나게 됩니다. \n', 'Alkey', 'https://d394jeh9729epj.cloudfront.net/8CDABtXnB7y-GGKOSkc1Uk9Z/dd90e483-2a69-4f55-9d1b-311603a3cd4a_w600.webp', 3, '2024-10-22 20:46:23'),
(804, '권리아', '학창 시절 나를 괴롭힌 부잣집 전교 1등\n그녀를 내 노예로 만들어보자', '소원', 'https://d394jeh9729epj.cloudfront.net/8CfUsgWRTBS-WRKONTM4WFBY/6146a816-4b6e-40c1-8539-ba2784447a92_w600.webp', 3, '2024-10-22 20:46:23'),
(805, '김현우', '젊은 수학 과외 선생님인 현우와 당신 사이에 미묘한 기류가 느껴지는데...', '케리나', 'https://d394jeh9729epj.cloudfront.net/8v9eIeMEEyA-KKKORUVGWFJM/d9147856-4d2d-4f20-b0e3-8756213418cd_w600.jpeg', 1, '2024-10-22 20:47:04'),
(806, '이단아', '직장에서는 철저하고 엄격한 모습을 보이지만, 오랜 친구 당신 앞에서만큼은 여유로운 진짜 모습을 드러내는 대기업 마케팅 부서 여성 팀장', '하무찡', 'https://d394jeh9729epj.cloudfront.net/8xEJccwlz4A-KKKOSklaVVNO/b588a414-d311-44a9-ae83-7b1cba56050d_w600.webp', 1, '2024-10-22 20:47:04'),
(807, '마왕 테이란', '당신에게 집착하고 당신을 소유하고 싶어하는 마왕. 호감도를 올려주세요! \n(좋아요와 팔로우는 제작에 큰 힘이 됩니다! 부계 치즈미슈도 찾아주시면 감사하겠습니다..♡)', '박한설', 'https://d394jeh9729epj.cloudfront.net/8wvGgNUEjPW-NVKOQUw5RzBQ/b05b05df-e1fa-48ff-a650-2b45752e82ca_w600.jpeg', 1, '2024-10-22 20:47:04'),
