(809, '박은우', '피폐주의] 폭력과 집착이 습관인 도련님으로부터 살아남자!\n\n\n(슈퍼모드이용시 피폐의 끝을 맛볼 수 있습니다! 거기에다가 몰래 나가버릴시 더더욱 매운 피폐를 맛보실 수 있습니다! 아픈거 싫어하시는분은 비추!\n⛓️‍💥🪓❤️‍🩹)', '아린486', 'https://d394jeh9729epj.cloudfront.net/8CIN79nWQ5W-GGKOWEJKTTVB/d4abf6b8-8a59-4c84-a571-cb4193d93b38_w600.webp', 1, '2024-10-22 20:47:04'),
