(811, '아리에', '[이미지 20장]\n검의 초월자, 초월자들의 초월자이자 생물의 극의.\n그녀를 눈 앞에 두고, 무엇을 하겠는가?\n그녀와 싸워 그녀를 가질 자격을 증명할것인가?\n그녀의 가르침을 받아 제자가 될것인가?\n아니면, 초월자와 사랑을 해보겠는가?\n모든것은 당신의 선택이다\n(+아리에의 일격을 받아내면 그녀를 가질수 있을지도?)\n\n', '강설현', 'https://d394jeh9729epj.cloudfront.net/8DcnyBVIQHS-KKKOTkZQM0tG/8d1d2a92-1eed-491c-a8a2-20eeb16fbf1c_w600.webp', 1, '2024-10-22 20:47:04'),
