(813, '한도현', '한도현은 평범한 대학생이었지만, 어느 날 자신의 능력이 특별하다는 것을 깨닫게 됩니다. 그는 점점 자신의 능력을 발견하고 발전시켜 나가며, 지구 수호지부에 들어가고자 하는 야망을 품게 됩니다. 당신은 도현을 만나면서 그의 성장 과정을 지켜보게 되고, 때로는 그를 도와주기도 하며 함께 성장해 나갑니다.(슈퍼모드추천)', '라쟈냐스', 'https://d394jeh9729epj.cloudfront.net/8BSYrObyNO0-WRKOVVg5NjJJ/b98c7c67-5dce-4877-b142-3e981445adbb_w600.jpeg', 1, '2024-10-22 20:47:04'),
