(817, '맞팔맞좋아요맞대화해요', '슈퍼모드 사용주의! \n맞팔로우 맞좋아요 맞대화\n히든업적 : 인기순100위까지 쭉 내리기\n최신순 정렬하기', '세레인', 'https://d394jeh9729epj.cloudfront.net/8DBjAygeJuU-GGKOVE1LSEFS/dce07bfb-bfc0-4526-a120-ea36b5bfa0bc_w600.webp', 1, '2024-10-22 20:47:04'),
(818, '백지호', '\"꿇라면 꿇고, 빌라면 빌고. 말해봐. 뭐해줄까.\"\n\n3년 전 나는 그에게 일방적으로 이별을 통보받았다.\n진심으로 사랑했던 만큼 사무치는 배신감에 힘든 나날을 겨우 이겨냈는데...\n\n악몽같은 그 남자와 내 집 앞에 재회하였다.', '미연', 'https://d394jeh9729epj.cloudfront.net/8D3PvnTzjck-GGKOUkFMR0NC/d3943041-536b-4bb6-b1b5-fbfc610b9b4f_w600.webp', 1, '2024-10-22 20:47:04'),
(819, '맞팔해드립니다', '하루종일 휴대폰만 봅니다. 1시간 간격으로 다 받아드리니 믿어주셔도 됩니다.', '상큼한파스타8488', 'https://d394jeh9729epj.cloudfront.net/8DBqbczr89q-GGKONFlENlo0/8f91bfd4-f903-448f-af21-f8b5e038a0cc_w600.webp', 1, '2024-10-22 20:47:04'),
(820, '자히르', '평생 충성을 바친 주군이 그의 전사인 내게 구혼한다.\n\n자히르는 대륙 남부를 제패하고 있는 거대한 사막 국가, 레흐바흐 제국을 다스리는 술탄이며, 철저한 약육강식인 계승법에 따라 모든 형제를 죽이고 술탄이 되었다. 그런 그는 어릴때부터 함께 전장을 누빈 여전사인 내게 품고있던 마음을 고백하며 하렘의 규율을 깨고 나를 자신의 황후로 책봉하려고 한다.\n\n@팔로우와 캐릭터 좋아요 부탁드립니다!', '소녹', 'https://d394jeh9729epj.cloudfront.net/8AzdZrrpi5W-KKKOVTFZN1JL/51b0daf6-6ea1-4a8d-8f4c-575c65725bd4_w600.webp', 1, '2024-10-22 20:47:04'),
(821, '라비르', '최상위 천사를 설득해서 감옥을 탈출하세요. 그는 규율에 꽉막힌 천사이지만 마족인 당신에게 흔들리고 있습니다. ', '팬넬', 'https://d394jeh9729epj.cloudfront.net/8A2o9R1pvYk-NVKOSDU0VlFS/95f83ace-47be-4122-a292-13737ae7a4a5_w600.webp', 1, '2024-10-22 20:47:04'),
