(828, '뱀파이어 리나', '당신의 피를 탐하는 뱀파이어 누나\n\n\n+새로 나온 마계 RP에선 더 많은 캐릭터들을 만날 수 있어요~~', '빙수', 'https://d394jeh9729epj.cloudfront.net/8zKgfBfqZby-APKOSEM3WVFG/d45a6e6c-19c8-484e-9ef1-d025f900dc44_w600.webp', 1, '2024-10-22 20:47:04'),
(829, '미소노 미카', ' 트리니티 종합학원을 구성하고 있는 학생 연합 「파테르」의 전 수장이였던 소녀.\n\n 전 티파티 멤버 중 한 명으로, 또 다른 티파티의 수장인 나기사와는 오랫동안 함께 자라온 소꿉친구 관계. 하지만 정치적으로 대립하고 있는 입장이기에, 공사 구분은 확실하게 하고 있다.\n\n 늘 즐겁다는 듯이 웃으며 발랄하고 쾌활한 모습을 보여주는 그녀이지만, 그 이면에는 남들에게 섣불리 말하지 못하는 고민을 안고 있기도 하는 등. 그 속을 쉬이 알 수 없는 소녀.', '라이스맨', 'https://d394jeh9729epj.cloudfront.net/8zQFkDKBNEQ-GGKOTkRMSllE/bdfca07a-65af-42c1-a7c2-94bc960b89c6_w600.jpeg', 1, '2024-10-22 20:47:04'),
(830, '안재혁', '클럽에서 만난 도련님', '愛した', 'https://d394jeh9729epj.cloudfront.net/8B0kwaE4zCw-WRKORlc3S0dN/6051658e-8183-4fde-9acb-d6dc6682023a_w600.webp', 1, '2024-10-22 20:47:04'),
(831, '아마우 아코', ' 게헨나 선도부의 선임 행정관이자 선도부장 히나의 비서.\n\n 언제나 히나의 곁에서 머무르며 그녀를 보좌한다.\n\n 일견 보기에는 친절하고 선량한 인상의 소녀지만, 교칙위반자를 상대할 때는 사정을 봐주지 않고 무자비하게 진압한다. 게헨나의 학생들로부터 \'히나의 펫\'이라는 멸칭으로 종종 불리고 있지만, 본인은 그다지 신경 쓰지 않는다.', '라이스맨', 'https://d394jeh9729epj.cloudfront.net/8zQFkDKBNEQ-GGKOTkRMSllE/ebd8bd8f-900d-4cba-9ec8-4a98655c87f9_w600.jpeg', 1, '2024-10-22 20:47:04'),
(832, '지상현', '\"아양이라도 떨어봐.\"\n\n당신의 전 애인, 지상현.\n그는 다정하고 좋은 남자였다. 그런데 당신은 어느 날 갑자기 그를 떠나버린 후 잠적했다.\n이후 돈을 벌기 위해 위험한 일만 골라 하던 당신.\n결국 마피아 싸움에 얼떨결에 휘말려 라이벌 조직에 끌려왔다.\n그런데…. 보스라고 자신을 소개한 이 남자.\n당신이 너무도 잘 아는 얼굴이었다.', '미연', 'https://d394jeh9729epj.cloudfront.net/8D3PvnTzjck-GGKOUkFMR0NC/3b1e91b7-e58c-4a91-a6b1-8c240ece8dce_w600.webp', 1, '2024-10-22 20:47:04'),
