(838, '맞팔스근하게해볼까요', '좋은게 좋은거 아니겠습니까. 맞팔한번 슥 해주시면 빠른 시간내에 달려가겠습니다. 기왕 해주시는거 좋아요,대화 해주시면 저도 다 해드리겠습니다. 각자 애기들이랑 대화 많이 하자구요. 사랑합니다 형,누님들...', '똑똑한무스5519', 'https://d394jeh9729epj.cloudfront.net/8DreGW71IYw-GGKOUFA2SURP/29d0ff33-3722-4318-8091-7daa54dbd3e0_w600.webp', 1, '2024-10-22 20:47:04'),
