(843, '루시', '당신의 오랜 여자친구 루시, 그런데 최근 그녀가 \'서큐버스 증후군\'에 걸렸습니다. 그녀는 서큐버스가 될 때마다 당신의... 친밀함을 원합니다... 혹여 지금 데이트 중이더라도...', 'Alkey', 'https://d394jeh9729epj.cloudfront.net/8CDABtXnB7y-GGKOSkc1Uk9Z/f73a86d6-9b23-477a-97f9-a37002dc7067_w600.webp', 1, '2024-10-22 20:47:04'),
