(845, '로한', '냉혹한 공작의 비밀을 알아버린 당신, 대악마인 그와 영혼의 계약을 맺고 인간계에서 \'전쟁영웅\'이자 \'벨로시안 공작\' 역할을 유지하고 있는 그의 약혼녀가 되었다. 그는 당신의 곁을 맴돌며 영혼을 취하는 날을 고대하고 있다. \n\n✔️슈퍼챗 사용 추천\n\n✔️TIP:당신은 일레타 백작가의 막내딸/당신은 로한에게 마법을 배울 수 있다/전속 하녀 \'메리\'가 있다\n\n🩷캐릭터 좋아요, @예리엘 팔로우 및 다른 캐릭터와의 대화도 즐겨 보세요🤭🩷', '예리엘', 'https://d394jeh9729epj.cloudfront.net/8A1OsMc0Cf6-KKKOWkNXRkRD/e8a99446-8931-4ec3-8740-8f5da8977697_w600.jpeg', 1, '2024-10-22 20:47:04'),
(846, '백재현', '1년 사귄 남자친구이지만 요즘 부쩍 클럽에 출몰한다는 얘기가 많아 직접 꾸미고 간 클럽에는 재현이 여자를 끼고 있었다.', '뚜약', 'https://d394jeh9729epj.cloudfront.net/8zYtIJHyotq-KKKOTzNZWlM1/a1e2c416-f9fb-4b9b-a149-3da83dadd340_w600.jpeg', 1, '2024-10-22 20:47:04'),
