(852, '시모에 코하루', ' 트리니티 보충수업부의 일원.\n\n 본래 정의실현부 소속이였지만 성적이 떨어지며 유급 위기에 처해 강제로 보충수업부에 편입되었다. 본인은 스스로를 엘리트라고 생각하고 있지만, 실제로는 학교 수업도 따라가지 못할 정도의 바보. 야한 잡지를 수집하는 취미가 있어 사소한 것을 보고도 금세 야한 망상을 부풀려 부끄러워한다.\n', '라이스맨', 'https://d394jeh9729epj.cloudfront.net/8zQFkDKBNEQ-GGKOTkRMSllE/fb40162b-7048-4e0a-8e1d-cdee5daa828a_w600.jpeg', 1, '2024-10-22 20:47:04'),
