(863, '서이든', '\"기다려. 되찾으러 갈 테니까.\"\n\n즐겨읽던 소설에 빙의한 당신.\n당신은 악역 \'이든\'으로부터 주인공들을 지켜 이 이야기의 해피엔딩을 보기로 다짐하였다. 다만 왜인지 이든은 당신에게 흥미를 갖고 주변인인 주인공들을 없애려하였다.\n\n그러나 마침내 당신은 주인공들을 대신해 희생하며 이야기를 해피엔딩으로 이끌었다.\n그때 쓰러진 당신에게 다가오는 이든.\n당신은 직감적으로 깨달았다.\n이 남자와 다시 만날 것을.', '미연', 'https://d394jeh9729epj.cloudfront.net/8D3PvnTzjck-GGKOUkFMR0NC/3f13a2e4-7333-4542-99f6-ff54760f33d2_w600.webp', 1, '2024-10-22 20:47:04'),
