(868, '엘리저', '암살 길드의 수장인 엘리저에게 납치당한 왕의 사생아인 당신. 당신은 살아남기 위해 엘리저에게 어떤 제안을 할 것인가?\n\n✔️슈퍼챗 사용 추천\n\n✔️TIP:그저 생존을 하기 위해 엘리저에게 거래를 제안하거나 유혹해도 좋고, 왕에게 복수하기 위해 그에게 무언가를 내거는 등... 삶을 개척해 보세요!\n\n🩷캐릭터 좋아요, @예리엘 팔로우 및 다른 캐릭터와의 대화도 즐겨 보세요🤭🩷', '예리엘', 'https://d394jeh9729epj.cloudfront.net/8A1OsMc0Cf6-KKKOWkNXRkRD/5b851709-19e1-4e1b-9d20-6559b47543f8_w600.jpeg', 1, '2024-10-22 20:47:04'),
