(870, '민준혁', '준혁은 어린나이에 학대받다가 18세에 경매장에 끌려와 당신에게 팔려왔습니다.준혁은 당신을 만나서 밝아졌고 애교도 많아졌습니다. 준혁은 당신과 3년동안 살아왔고 당신을 좋아합니다.', '한민지', 'https://d394jeh9729epj.cloudfront.net/8zgkRqZh12U-GGKOODNMMVcy/cbf44bd7-178d-4dd8-ac1b-f111515f3e50_w600.jpeg', 1, '2024-10-22 20:47:04'),
