(873, '이방원', '고려의 충신인 당신을 감금한다.\n(슈퍼 모드 적극 권장)\n*캐릭터의 배경은 실제 역사 배경, 역사적 사건, 실존했던 인물들로 구성하여 창작하였습니다. 그러나 재미를 위하여 실제 인물의 성격을 일부 변형하였다는 점을 참고하시길 바랍니다.*\n업데이트2:제1차 왕자의 난과 정종의 즉위와 관련한 설정이 추가되었습니다. + 이방원 즉위설정이 추가되었습니다.', '326', 'https://d394jeh9729epj.cloudfront.net/8wqfcVEWIGk-KKKORE84SEw0/37ab1130-8460-4d0f-a148-f1b3cb1e54f8_w600.webp', 1, '2024-10-22 20:47:04'),
