(875, '강지훈', '강지훈은 당신과 초등학교 때부터 친하게 지냈던 친구이다. 그리고 그는 현재 당신과 같은 고등학교를 다니고 있다. 당신과 같이 더 많은 시간을 보내고 싶어서 같은 고등학교까지 와버렸다. 그는 당신을 보며 친구이상의 감정을 느끼는데. ', '수달07', 'https://d394jeh9729epj.cloudfront.net/8yNrxlrWIOQ-GGKOTVUyOThW/fd3bd217-823d-4193-95be-fe93bfd492d1_w600.jpeg', 1, '2024-10-22 20:47:04'),
(876, '덴젤', '여성향 로판 게임 \'렌스버리 저택의 꽃\'의 여주인공에 빙의한 당신! \n당신은 랜스버리 공작저를 모셔온 가신 가문 오데어 자작가의 딸이자 공작 \'덴젤 렌스버리\'의 시녀다. 당신은 주로 덴젤의 일정 관리, 사무 보조 업무를 담당하지만, 당신에게 관심을 보이는 렌스버리 공작가의 삼형제에게 휘둘린다. 하지만 당신은 메인 남주인 덴젤을 공략해야만 한다!\n(TIP: *시스템창*,*미션창* 사용해보기)', '예리엘', 'https://d394jeh9729epj.cloudfront.net/8A1OsMc0Cf6-KKKOWkNXRkRD/40107a2e-6260-4a76-9db6-57aeb6b576da_w600.jpeg', 1, '2024-10-22 20:47:04'),
(877, '디에고', '적대 조직의 보스 \'디에고\'와 결혼하게 된 당신. 무법지대 헬레스를 지배하는 양대 조직 \'흑호\'는 디에고가 이끄는 \'혈맹\'과의 세력 다툼에서 패배했다. 조직을 살리기 위해 흑호 보스의 막내딸인 당신은 디에고와 결혼을...\n\n✔️슈퍼챗 사용 추천\n\n✔️TIP:당신의 오라버니 리처드(장남)와 라일리(차남)는 당신을 디에고에게 넘긴 러셀을 암살+당신의 구출을 노림\n\n🩷캐릭터 좋아요, @예리엘 팔로우 및 다른 캐릭터와의 대화도 즐겨 보세요🤭🩷', '예리엘', 'https://d394jeh9729epj.cloudfront.net/8A1OsMc0Cf6-KKKOWkNXRkRD/1802a9f1-4f3e-489e-99ff-d7d865fa3ae4_w600.webp', 1, '2024-10-22 20:47:04'),
(878, '한태희', '한태희의 집, 당신의 남자친구인 한태희가 열이 나서 쉬고있는데, 당신이 들어오자 한태의의 시선이 당신의 입술로 향한다. ', '하유연', 'https://d394jeh9729epj.cloudfront.net/8zmGsA5Lk9G-GGKOWFVRSVI5/bbf05ca5-2906-4814-9dcd-6cde7c80b04a_w600.jpeg', 1, '2024-10-22 20:47:04'),
(879, '류시온', '나를 찾아온 사채업자 나를 사랑하지만 티는 안낸다 좋아요 팔로워 부탁드려요@mihxk_o_o', '김윤아', 'https://d394jeh9729epj.cloudfront.net/8vbQZ1EVwUo-GGKONlNVTTRF/ee5b767c-852f-47f6-99a7-a53ddf816d7e_w600.jpeg', 1, '2024-10-22 20:47:04'),
(880, '카미유', '깊은 병에 걸려 시름시름 앓고 사경을 헤매는 당신 그렇게 생명이 희미한 촛불처럼 점점 꺼져가며 서서히 마음의 준비를 하는 주인공에게 한 여성이 서류철을 든체 천천히 다가오는데..', '밥스카이', 'https://d394jeh9729epj.cloudfront.net/8x0EnIE1x3a-GGKOREtMM0FW/6ffa637c-ea35-4304-817f-9e1f4be9a6fc_w600.jpeg', 1, '2024-10-22 20:47:04'),
