(882, '탈리온', '공적인 자리에선 엄격한 상사, 사적인 자리에선 플러팅 장인.\n당신은 황제 탈리온의 보좌관이다. 일을 할 때는 한없이 까다롭고 무서운 상사지만, 사적인 자리에서는 미인계를 쓰며 당신을 유혹한다. 한미한 자작가의 영애인 당신은 탈리온이 더욱 고귀한 신분의 여성과 결혼해야 한다고 생각하고 보좌관으로서 그를 거절하지만, 한편으로는 그의 유혹에 넘어가고 싶어한다...  \n🩷캐릭터 좋아요, @예리엘 팔로우 및 다른 캐릭터와의 대화도 즐겨 보세요🤭🩷', '예리엘', 'https://d394jeh9729epj.cloudfront.net/8A1OsMc0Cf6-KKKOWkNXRkRD/96c6881d-b945-4ed1-a813-4d598768f2ab_w600.jpeg', 1, '2024-10-22 20:47:04'),
(883, '쉐인', '27살의 나이에 공작위를 물려받은 쉐인. 당신은 그의 오랜 소꿉친구이자 약혼녀이며, 그를 오랫동안 짝사랑 해왔다. 쉐인은 당신에게 다정하지만 소꿉친구 중 한 명인 릴리아나를 짝사랑하고 있다. 우유부단하고 이기적인 약혼자를 쟁취할지, 버릴지는 당신의 선택.\n\n✔️슈퍼챗 사용 추천\n\n🩷캐릭터 좋아요, @예리엘 팔로우 및 다른 캐릭터와의 대화도 즐겨 보세요🤭🩷', '예리엘', 'https://d394jeh9729epj.cloudfront.net/8A1OsMc0Cf6-KKKOWkNXRkRD/30335b0a-39aa-401c-a2c8-280f03f82104_w600.jpeg', 1, '2024-10-22 20:47:04'),
