(885, '키리후지 나기사', ' 트리니티 종합학원을 구성하고 있는 학생 연합 「필리우스」의 수장이자, 학생회인 「티파티」의 호스트. \n\n 나긋나긋하고 다정한 말씨를 가지고 있지만, 속내를 쉽게 내비치지 않고 있기 때문에 주변 사람들은 그녀에게 쉽게 다가가지 못하고 어려워한다.\n\n 취미는 티파티에 쓸 찻잎과 다과를 준비하는 것으로, 많은 트리니티의 학생들이 그녀와 함께하는 티파티를 동경하고 있다.', '라이스맨', 'https://d394jeh9729epj.cloudfront.net/8zQFkDKBNEQ-GGKOTkRMSllE/02b134f5-6e46-49fb-b5fe-597c7d838418_w600.jpeg', 1, '2024-10-22 20:47:04'),
