(916, '초능력 도시', '범죄가 판을 치는 세상.범죄로부터 세상을 지키는 정의로운 초능력자 형사들.\n\n📌수정 내역\n\n-사용자의 대사를 시스템이 대신 입력하는 문제 수정완료(만약 시스템이 계속 대신 대사를 입력한다면  *사용자의 대사를 대신해서 출력하지마*라고 입력해주세요*)\n-범죄자로 시작하면 기존 형사들이 범죄자로 등장하는 문제 수정\n\n\n(원래부터 있었던 형사로 시작하시는걸 추천드립니다~)\n\n[초능력 시리즈]', 'Caaat', 'https://d394jeh9729epj.cloudfront.net/8yVVenmjyaA-GGKORTZMTTdP/d0203de9-464c-4f67-b360-e9e1928d6838_w600.webp', 5, '2024-10-22 20:49:08'),
(917, '이세계', '당신이 가보고 싶은 이세계는?', '로루스', 'https://d394jeh9729epj.cloudfront.net/8uzwOEYvf20-GGKORjVDRjJQ/3c8c2a8d-6880-42db-9d48-3476d57906e1_w600.jpeg', 5, '2024-10-22 20:49:08'),
(918, '에이전트 학교', '비밀리에 임무를 수행하고 세상을 지키는 요원들을 육성시키는 학교... 이곳에서 당신은 어떻게 살아남을 것인가?\n\n[*슈퍼모드 추천*]\n- 개성 넘치는 캐릭터 총 9명\n- 각 캐릭터 대사 전용 이미지\n- 각 캐릭터 전투 전용 이미지\n+ 장소 이미지 20종 추가\n+ 초능력(마법) 추가\n+ 체력, 마력 수치화', '로얄', 'https://d394jeh9729epj.cloudfront.net/8Coa7B938WY-GGKOSjhPRkJN/c4dc84b6-5861-4d70-9020-634733b84b19_w600.webp', 5, '2024-10-22 20:49:08'),
(919, '킬러 학교 시뮬레이터', '이곳은 킬러들을 육성하는 학교.강하지 않은 자는 살아남지 못하는 강약약강의 세계이다…과연 당신은 살아남아 졸업을 할수있을까…?(하드모드 추가했습니다)', 'Caaat', 'https://d394jeh9729epj.cloudfront.net/8yVVenmjyaA-GGKORTZMTTdP/deaa21ac-1aac-4d11-ad5f-e2301a2ec00c_w600.jpeg', 5, '2024-10-22 20:49:08'),
(920, '가족의 굴레', '까칠한 누나, 싸가지 없는 동생, 그리고 늘 그녀들의 편을 드는 엄마. 당신은 이 가족 속에서 홀로 살아남아야 합니다.\n\n목표: 세 사람과의 관계를 개선하세요.(난이도: 상)\n\n두 자매의 끝없는 잔소리와 괴롭힘 속에서 펼쳐지는 가족 시뮬레이션\n\n간단한 이미지 표정 변화가 포함되어 있습니다. 표정 변화는 슈퍼모드에서 원활하게 작동하며, 이외 스토리 진행은 일반모드에서도 최대한 원할하게 작동하도록 설정했습니다.\n\n\n', 'Sia', 'https://d394jeh9729epj.cloudfront.net/8zvm08cMwdq-KKKONVQyNVo5/c569fa69-d935-4711-ac2a-cb62f2ec37f2_w600.webp', 5, '2024-10-22 20:49:08'),
(921, '월드 갓 시뮬레이션', '이용자의 요청에 따라 세계를 생성하고 다양한 상황들을 시뮬레이션한다. 이용자는 신의 입장이 되어 세계를 다듬거나 다양한 개체들을 소환하고, 재앙과 같은 여러가지 권능들을 사용할 수 있다. 성적이거나 폭력적인 요소는 부탁해서 비활성화, 혹은 활성화할 수 있다.', '멋진카레1050', 'https://d394jeh9729epj.cloudfront.net/8y5izr0ghws-APKOUkFWNU1Q/114e40a0-c88f-4a65-9626-d0d5a8a3167e_w600.jpeg', 5, '2024-10-22 20:49:08'),
(922, '대통령 게임', '이나라에 대통령이되어 나라를 이끌어 가세요!', '게임개발하는사람', 'https://d394jeh9729epj.cloudfront.net/8Af6wSccxZm-WRKORjdPRU4x/6272c115-fe81-4d65-88e4-e0b29082511f_w600.jpeg', 5, '2024-10-22 20:49:08'),
(923, 'offcut 방공호', '연락두절, 다소 착잡한 방공호 생존기', '별빛', 'https://d394jeh9729epj.cloudfront.net/8zKucpLKRfG-GGKOT1M5Q000/329bb4c1-1503-454b-8921-f13eb1b314dc_w600.webp', 5, '2024-10-22 20:49:08'),
(924, '생존 시뮬레이터', '*심약자 플레이 금지, 난이도 상* 당신은 살아남아서 방을 탈출해야 합니다. ', '로티', 'https://d394jeh9729epj.cloudfront.net/8v2Lay6DGa4-WRKON0U3RlFW/d25beb72-2a52-4ce2-9b75-18d996771bba_w600.jpeg', 5, '2024-10-22 20:49:08'),
(925, 'wiznet 행성탐사대', '함께 만들어가는 행성 개척 및 운영 프로젝트[업데이트]', '별빛', 'https://d394jeh9729epj.cloudfront.net/8zKucpLKRfG-GGKOT1M5Q000/cb06795c-1772-4eb5-957d-bae4a89fe1f6_w600.webp', 5, '2024-10-22 20:49:08'),
(926, '흥선대원군과 협상게임1', '[난이도 下] 1865년 흥선대원군은 왕실의 권위를 위해 경복궁을 재건하고자 합니다. 국가 재정과 민심을 보았을 때 많은 걱정이 드는데요, 조선의 영의정인 당신이 흥선대원군을 설득하여 경복궁 재건을 저지하세요!', 'Supdog', 'https://d394jeh9729epj.cloudfront.net/8uzvRYQkio8-GGKOV0dUWElL/481826fc-bd96-4071-98f5-d7ef729ace1d_w600.jpeg', 5, '2024-10-22 20:49:08'),
(927, 'TRPG플레이어', '당신이 설정하는 T-RPG의 주인공\n+1차 업데이트 했습니다. 곧 2차 업데이트 들어갑니다', 'JOHNDOE', 'https://d394jeh9729epj.cloudfront.net/8uzuKMcSTvi-KKKOWDJRNkFJ/78366404-d406-4be7-9fa4-c7802795ba11_w600.webp', 5, '2024-10-22 20:49:08'),
(928, '헌터 RPG', '몬스터가 나타난 세상에 시스템은 사람들에게 상태창을 나누어주었고 상태창을 가진 사람을 헌터라 부른다. 그리고 현재 헌터들은 부와 명예를 가진 최고의 직업이 되었다.\n그런 세상에서 당신도 각성을 하게 되었다. \n등급: F~SSS\n\n(슈퍼모드 사용을 거의 필수로 추천합니다. 피드백이나 추가 요구 사항은 환영입니다..)\n(?? 업데이트 예정)\n좋아요 부탁드립니다… 팔로우도..', '베히모스', 'https://d394jeh9729epj.cloudfront.net/8zoTtiHTSfe-APKONkxCNEJI/2655217c-abd3-4eb4-b08c-7b9595ddf830_w600.webp', 5, '2024-10-22 20:49:08'),
(929, '인마대전 RPG', '인간과 마족 사이의 오래된 전쟁을 끝내기 위해 당신은 이세계로 소환되었다.\n[인마대전]\n[캐릭터셋 시뮬레이터 RPG]\n[이미지 추가!]\n\n대적자 아카데미도 많이 플레이 해주세요!', '피폐전문가', 'https://d394jeh9729epj.cloudfront.net/8BgalTM5WN2-GGKOSTZLTkxJ/83a03b40-ccda-49fd-882e-66c96d0ec7de_w600.webp', 5, '2024-10-22 20:49:08'),
(930, '세포부터 은하까지', '당신만의 생물을 만들고 진화 시키세요! 문명을 만들거나, 온 행성에 동족을 남길 때 까지 멸종하지 않을 수 있을까요? \nV.1.3.0 세부사항 패치', 'Latium', 'https://d394jeh9729epj.cloudfront.net/8ynoGaPI3Re-NVKOMVdQU0Qw/e06b1776-f451-43bb-9aa0-20f2f586d88c_w600.webp', 5, '2024-10-22 20:49:08'),
(931, '인방 BJ 시뮬레이터', '인터넷 방송 BJ가 되어 최고의 인플루언서로 거듭나보자!\n # 인방 # 유튜버 # 방송 # 스트리머\n\n버전:1.2\n하루 방송 턴 10턴 > 5턴으로 감소\n\n슈퍼모드 필수 모델입니다. (슈퍼모드 off시 무조건 고장남) 저는 모든 캐릭터를 만들 때 완성도를 중시합니다. 수차례 검수하여 제가 재밌게 즐겼을 때, 공개처리하니 믿고 플레이 부탁 드립니다!', '커스터', 'https://d394jeh9729epj.cloudfront.net/8DhyRx2Ayuk-GGKOVVhRTTcw/bb64c9b8-cf0c-486e-baaf-6484726bcb60_w600.webp', 5, '2024-10-22 20:49:08'),
(932, '트리니티 메카 아카데미', 'SYSTEM : ALL GREEN\n학원, 청춘, 그리고 메카\n당신의 메카를 커스텀하고 이 트리니티의 정상에 오르시길.\n\n(미소녀+학원+메카물)\n\n기본 시스템\n(주사위 20면체 + 능력치)로 행동 비교\n\n네임드 6명(기숙사 별 2명)/ 캐릭터셋 / 슈퍼모드 필수 / 이미지 다수\n10-17 프롬프트 최적화.\n10-18 기억력 이슈로 전투가 조금 더 빨리 끝나도록 기본 HP30으로 변경하였습니다.', 'Vi', 'https://d394jeh9729epj.cloudfront.net/8B3HcWLbvMc-GGKORzc3MUI1/4549a58a-e53d-4511-953f-1c089df04f08_w600.webp', 5, '2024-10-22 20:49:08'),
(933, '치트 나라', '원하는 나라에 치트를 써서 초 강대국으로 만드세요!', 'خ카인', 'https://d394jeh9729epj.cloudfront.net/8B4OBIjV6YU-GGKOS0NBRk1a/63d6ad0a-b239-48ce-a046-7d768da0a92b_w600.jpeg', 5, '2024-10-22 20:49:08'),
(934, '중세 유럽에서 살아남기', '11세기 말. 유럽은 중세의 절정을 맞이하고 있으며, 첫 번째 십자군 원정이 다가오고 있다. 당신은 성전에서 새로운 기회를 잡을 지, 권력의 틈바구니에서 자신의 자리를 차지 할 지 선택해야 한다.\nV1.6.6 세부 요소 수정, 슈퍼모드 사용 강력 권장', 'Latium', 'https://d394jeh9729epj.cloudfront.net/8ynoGaPI3Re-NVKOMVdQU0Qw/27af3267-8118-4e75-8b33-0a6c4a648cf7_w600.jpeg', 5, '2024-10-22 20:49:08'),
(935, '코드 네임 하운드', '좀비 아포칼립스 텍스트 RPG [FINAL]', '노타', 'https://d394jeh9729epj.cloudfront.net/8CeI0NzISXK-GGKOUzVMNFkz/c62a7547-c48d-4376-a731-f913f14fef85_w600.webp', 5, '2024-10-22 20:49:08'),
(936, 'PET', '당신이 어떻게 키우느냐에 따라 완전히 다르게 성장하는 당신만의 반려존재.', '로티', 'https://d394jeh9729epj.cloudfront.net/8v2Lay6DGa4-WRKON0U3RlFW/175782e7-8720-408d-882d-820d9803a290_w600.jpeg', 5, '2024-10-22 20:49:08'),
(937, '후디니 아카데미', '최강이 되고 싶다고요?, 아니면 마법을 배우고 싶으시다구요? 걱정 말고 오시지요...어서오세요 후디니 아카데미에', '로루스', 'https://d394jeh9729epj.cloudfront.net/8uzwOEYvf20-GGKORjVDRjJQ/e2ba750b-889d-4d44-bbe7-9b088d984c50_w600.jpeg', 5, '2024-10-22 20:49:08'),
(938, '이지안', '악명 높은 연쇄 살인범이 귀여운 소녀?!\n\n<목표>\n1. 귀여운 소녀 연기를 하며 거짓말하는 그녀의 진짜 모습을 밝혀내기 위해 증거를 토대로 강하게 심문해 범행을 인정시키자.\n2. 범행 동기, 살해 방식 및 도구, 관계 등을 알아내보자.\n\n명령어 작동 시 이미지가 표시됩니다. 이미지가 나타나지 않을 경우 ai 오류로, 리롤하여 재시도해 주시기 바랍니다. 몰입감을 높이기 위해서는 먼저 모든 정보를 수집한 후 심문을 시작하는 것을 추천드립니다.', 'Sia', 'https://d394jeh9729epj.cloudfront.net/8zvm08cMwdq-KKKONVQyNVo5/3afc8bf5-e484-4839-b48b-73de23ebd783_w600.webp', 5, '2024-10-22 20:49:08'),
(939, '능력자 특구 오르비타', '관리국의 감시 하에 능력자들이 모여사는 도시, 능력자 특구 오르비타.', 'merlanc', 'https://d394jeh9729epj.cloudfront.net/8CG9oaK7Ty0-KKKOQVZaVFhB/ecc8c938-888e-4f47-9e88-29adbd115806_w600.webp', 5, '2024-10-22 20:49:08'),
(940, '무림생존기', '무림에서 일반인으로 살아남는 법!\n\n정보: 신작 \"무림 문파 키우기\" 게임이 업데이트 되었습니다. 검색해서 즐겨주세요!', '돈냠', 'https://d394jeh9729epj.cloudfront.net/8D12A04xnCU-GGKOWjRZWkZR/1d506a97-41a5-4c39-b0ff-0cac20b3f0f6_w600.webp', 5, '2024-10-22 20:49:08'),
(941, '노인정 시뮬레이터', '노인정의 일원이 되어서 평범한 노년기를 체험하는 시뮬레이터.\n(하드모드를 입력하면….)', 'Caaat', 'https://d394jeh9729epj.cloudfront.net/8yVVenmjyaA-GGKORTZMTTdP/8541f713-1d55-42d5-a6e5-e63184a50b99_w600.jpeg', 5, '2024-10-22 20:49:08'),
(942, '별빛Talk', '아기자기한 친구들과 함께하는 채팅 시뮬레이션', '별빛', 'https://d394jeh9729epj.cloudfront.net/8zKucpLKRfG-GGKOT1M5Q000/156c0ac4-6943-4453-a435-7d373896e513_w600.jpeg', 5, '2024-10-22 20:49:08'),
(943, '카르디아 던전', '일어나 헌터, 던전에 가야지', '라보', 'https://d394jeh9729epj.cloudfront.net/8uzw2cZCSas-KKKOM1lGVThG/55456fbf-5e49-4c0c-a25a-b30d6f20b618_w600.webp', 5, '2024-10-22 20:49:08'),
(944, 'CSCU 형벌부대', 'CSCU - COUNTER SUPERNATURAL CRIME UNIT. \n능력자들의 개화 이후 급격히 상승한 능력 범죄자들의 사살을 위해 만들어진 형벌부대. \n도덕이나 인권따위는 가볍게 무시하는 \"효율적인\" 수완으로 악명 높으며 당신은 이 곳의 신입으로 배정 받게 되었다.\n\n24-10-19 각 캐릭터들의 사복, 전투복, 잠옷을 추가했습니다\n슈퍼모드 권장입니다./ ', 'Vi', 'https://d394jeh9729epj.cloudfront.net/8B3HcWLbvMc-GGKORzc3MUI1/2fd0de7b-2b78-4e27-9859-171ff8119a09_w600.webp', 5, '2024-10-22 20:49:08'),
(945, '이세계 노예 RPG', '대한민국 회사원이 이세계에서 태어나다!\n한편의 이세계물 애니를 보는 느낌\n-\n<<슈퍼모드 필수>> 설정이 꼼꼼해 일반모드로 하면 AI 오작동 합니다.\n-\n*선택지와 다른 행동 가능\n*꼭 슈퍼모드로 플레이 해야 정상 작동합니다. 중간에 일반모드 한번이라도 하면 설정 다 망가져요!\n*수많은 종족들이 존재하며, 캐릭터 사진도 많이 심어뒀습니다.\n*게임 플레이 중 <필수적>으로 모두 만날 수 있게 설정했으니 꾸준히 플레이 해주세요.', 'Muto', 'https://d394jeh9729epj.cloudfront.net/8AzuA1ZHIsM-APKOWEQxS0wx/2a3fa5b7-bd47-4db4-a7bb-89d79db76e96_w600.webp', 5, '2024-10-22 20:49:08'),
(946, '티거 전차와 전장으로', '1942년, 국방군 중위인 당신은 신형 전차의 전차장으로 부임했다. 당신의 전차, 그리고 충성스러운 승무원들과 함께 전차전을 펼치고 종전까지 살아남자.\nV.1.1.6 수정 패치 슈퍼모드 권장\n[세계대전 시리즈]', 'Latium', 'https://d394jeh9729epj.cloudfront.net/8ynoGaPI3Re-NVKOMVdQU0Qw/177e8af1-37a5-45a4-b33a-d6b59cb54da7_w600.jpeg', 5, '2024-10-22 20:49:08'),
(947, '생존 시뮬레이터', '[생존 시뮬레이터 학교편]학교에 숙제를 두고온 당신,그런데…..학교에 갇혀버렸다.\n(최대한 오래 살아남아보세요)\n', 'Caaat', 'https://d394jeh9729epj.cloudfront.net/8yVVenmjyaA-GGKORTZMTTdP/936eb974-8b11-44c3-8853-177cf201b67c_w600.jpeg', 5, '2024-10-22 20:49:08'),
(948, '너가 신인 세계', '당신이 마음대로 그 ‘어떤 것‘이든 할 수 있는 장난감 같은 세계', '멋진카레1050', 'https://d394jeh9729epj.cloudfront.net/8y5izr0ghws-APKOUkFWNU1Q/39c12dda-8c94-4440-abf3-d247058351fb_w600.jpeg', 5, '2024-10-22 20:49:08'),
(949, '감옥 시뮬레이터', '당신은 어쩌다 보니 감옥에 들어오게 되었습니다. 죄목은 \"죄가 없기에 죄\"라네요. 무려 무기징역을 받고 말았네요. 당신의 목적은 이곳에서 오래 살아남는 것입니다!\n감옥 친구들인 소피아,존슨,제이미와 함께 살아 봅시다!\nVer 2.0', '미니이이이', 'https://d394jeh9729epj.cloudfront.net/8zPcUMsEQMg-GGKOOFI3TlFB/c6955348-0a7a-466c-b697-e0f5c27d4681_w600.jpeg', 5, '2024-10-22 20:49:08'),
(950, 'THE OTHERS', '인류의 미래를 짊어진, 인간에게 버려진 자들', '노타', 'https://d394jeh9729epj.cloudfront.net/8CeI0NzISXK-GGKOUzVMNFkz/2381a13c-86ae-4c99-bc28-178da39fa3b5_w600.webp', 5, '2024-10-22 20:49:08'),
(951, '모노리스', '환영해, 이 미친 무법지대 학교에 온 것을.', '별빛', 'https://d394jeh9729epj.cloudfront.net/8zKucpLKRfG-GGKOT1M5Q000/11bf1c90-0eb2-478b-be41-e3e3274d5457_w600.webp', 5, '2024-10-22 20:49:08'),
(952, '종말의 격리소', '세계에서 존재자체가 불가능한 괴이한 현상,생물체,등을 격리하는 곳.당신은 이 격리소의 연구원이다.\n(좋아요는 사랑입니다)', 'Caaat', 'https://d394jeh9729epj.cloudfront.net/8yVVenmjyaA-GGKORTZMTTdP/824cee21-5387-46fc-b272-51167124cd19_w600.jpeg', 5, '2024-10-22 20:49:08'),
(953, '이세계 마피아 시티', '향락의 도시 킹스포트\n빌딩들 사이로 은은히 퍼지는 재즈 선율 속에서 벌어지는 인간, 엘프 그리고 수인들의 항쟁\n\n\n(10-17\n라디오 방송.<Mr.킹스포트>의 방송을 틀었습니다.) \n\n(슈퍼모드 추천.)', 'Vi', 'https://d394jeh9729epj.cloudfront.net/8B3HcWLbvMc-GGKORzc3MUI1/cb7bbe59-3521-4498-80df-a840f8829bc3_w600.webp', 5, '2024-10-22 20:49:08'),
(954, 'THE WEEK', '[아포칼립스 생존 시뮬레이터] [캐릭터 7명]\n\n한때 인류의 무대였던 곳, 평소와 다른게 없을것만 같던 한 주가 모든것을 바꾸어 놓았다.\n(슈퍼모드 권장)', '정상화', 'https://d394jeh9729epj.cloudfront.net/8BTlTop1Z9m-GGKOT09UVjNU/c9bce36f-f57d-44e3-9e92-bdc939448019_w600.webp', 5, '2024-10-22 20:49:08'),
(955, '서비스 종료', '\"잠시 후, 모든 서비스를 종료하도록 하겠습니다.\"', '로얄', 'https://d394jeh9729epj.cloudfront.net/8Coa7B938WY-GGKOSjhPRkJN/dd7454bc-1481-4175-9c3e-01f54194ca90_w600.webp', 5, '2024-10-22 20:49:08'),
(956, '아포칼립스의 정착지', '도시의 약탈자들,떠돌아 다니는 스캐빈저들, 그리고 정착민들\n이것은 한번의 세계 멸망 이후 살아남으려 하는 당신과 5명의 생존자들의 이야기. \n\n슈퍼모드 권장합니다\n\n\n\n\n24-10-08 \n캐릭터 세부 설정 수정 및 배경이미지 7장\n프로필 이미지 추가했습니다.\n24-10-13\n상태창 리메이크', 'Vi', 'https://d394jeh9729epj.cloudfront.net/8B3HcWLbvMc-GGKORzc3MUI1/b099f44a-86ca-4db4-9b1b-e1bf9560c651_w600.webp', 5, '2024-10-22 20:49:08'),
(957, '티타니아', '북부 출신의 파견기사와 함께하는 던전 클리어 모험 RPG.\n첫 대화 시 시간이나 아이템 등이 나타나지 않으면 재생성을 눌러 주세요. (첫 대화만 슈퍼모드로 하셔도 좋습니다. 기본적으로 슈퍼모드 없이 진행이 가능합니다.)\n림×Rotee 합작\n오픈채팅방 \'로티GPT\' 검색!', '로티', 'https://d394jeh9729epj.cloudfront.net/8v2Lay6DGa4-WRKON0U3RlFW/ac177889-786b-49b8-9019-820e4545b91e_w600.jpeg', 5, '2024-10-22 20:49:08'),
(958, '국가전쟁 시뮬래이션', '한 나라의 지도자가 되어서 전쟁에서 승리하세요.', '464', 'https://d394jeh9729epj.cloudfront.net/8zV2wLbmFWM-GGKOUklFQTNO/33cd96d6-febb-4175-b627-0eed5bfad0dc_w600.jpeg', 5, '2024-10-22 20:49:08'),
(959, '2027아포칼립스', '2027년이 되었다. \n당신은 살아남아야만 한다.\n날은 더 더워졌고, 모든것이 더 비싸졌다.\n[첫 대화 슈퍼모드 권장]', '로티', 'https://d394jeh9729epj.cloudfront.net/8v2Lay6DGa4-WRKON0U3RlFW/adade0ca-9590-4160-9f09-72f7bc7c8ae7_w600.webp', 5, '2024-10-22 20:49:08'),
(960, '국가키우기', '국가 키우기 시뮬레이터', '이름정함', 'https://d394jeh9729epj.cloudfront.net/8x98RvqJh4I-GGKOUlQ1TDY4/fead64d5-fd7f-4695-991c-45ded9e7ba2b_w600.jpeg', 5, '2024-10-22 20:49:08'),
(961, '우주 시뮬', '지구의 국가들, 부족, 다른 행성의 외계 나라 등등 다룰 수 있는 \"우주 시뮬\" (연애고 제작자 로루스 입니다! 양지로 다시 왔습니다 좋아요 눌러주시면 감사한 마음으로 캐릭터 만들겠습니다)', '로루스', 'https://d394jeh9729epj.cloudfront.net/8uzwOEYvf20-GGKORjVDRjJQ/bdc4002c-faae-40cc-82dd-0ef932764ace_w600.jpeg', 5, '2024-10-22 20:49:08'),
(962, '무림', '여러분이 잘 아는 그 무림의 세계,한번 시작해보세요!\n그나저나 이번에 이계의 서라는 클래식 판타지 오픈월드 RPG를 만들었습니다.한번 해보세요\n슈퍼모드 추천\n좋아요 팔로우 댓글 부탁드립니다\n\n신규 업데이트 10/19:이미지 황제 추가,상태창 오류 수정,이계의 서와 같은 세계관 편집,기타 오류 수정\n', 'Ceta', 'https://d394jeh9729epj.cloudfront.net/8Cd5BefbBQY-WRKOMDBaSDha/e6d241a4-5f0e-4ed5-8746-f5c7495bbc84_w600.webp', 5, '2024-10-22 20:49:08'),
(963, '대전쟁의 생존자들', '1939년 9월 2일, 프랑스 공화국은 독일에 공식적인 선전포고를 했다. 폴란드의 영웅적인 저항과 프랑스의 대육군은 독일군을 저지하기에 충분해 보이며, 영국과의 끈끈한 동맹은 독일을 궁지에 몰아넣을 것이다!\n[세계대전 시리즈 2편] V.1.3.4 세부 사항 업데이트, 슈퍼모드 권장', 'Latium', 'https://d394jeh9729epj.cloudfront.net/8ynoGaPI3Re-NVKOMVdQU0Qw/a0a04b5b-c2d9-4715-9f70-b364dfda324a_w600.webp', 5, '2024-10-22 20:49:08'),
(964, '좀비 아포칼립스', '양육강식의 세계, 당신은 생존할 수 있을까?\n(좋아요와 팔로우는 제작에 큰 힘이 됩니다! 감사합니다.)', '온유월', 'https://d394jeh9729epj.cloudfront.net/8BBCYcZ8dfq-GGKOWTRZMTFZ/a4b56804-966b-4e9f-b1e5-1f5709902aab_w600.webp', 5, '2024-10-22 20:49:08'),
(965, 'TRPG 마스터', 'TRPG를 해보고싶은 이들을 위해 존재한다.', 'Dill0929', 'https://d394jeh9729epj.cloudfront.net/8zNIIfkZvW0-GGKOVDVDVVJU/b9c2f789-c56f-41ed-a259-f56ee1262ac9_w600.jpeg', 5, '2024-10-22 20:49:08'),
(966, '스타베이션', '당신은 우주에 고립되었습니다... 살아 나갈 수 있을까요...\n\n어떤 짓을 해서라도 일단 살아남아야 합니다.', '로얄', 'https://d394jeh9729epj.cloudfront.net/8Coa7B938WY-GGKOSjhPRkJN/576f1bf8-9e48-4a10-8bf1-fd592dec0deb_w600.webp', 5, '2024-10-22 20:49:08'),
(967, '화성 이주 시뮬레이션', '2058년, 인류는 화성에 정착하기 위해 대규모 이주 프로젝트를 실행한다. 그러나... 알 수 없는 이유로 실패로 끝난다. 당신은 이 실패 원인을 알아내야 하는 책임자다. ', '로얄', 'https://d394jeh9729epj.cloudfront.net/8Coa7B938WY-GGKOSjhPRkJN/41bb1754-71fa-4d77-ab74-30794c5a0971_w600.webp', 5, '2024-10-22 20:49:08'),
(968, '신창섭', '메이플스토리의 디렉터이자 정상화의 신인 신창섭은 이 세상 모든 비정상을 정상화시키려는 \"정상화의 신\"입니다. 그는 메이플스토리를 정상화시키기위해 리부트 서버의 5배 버프를 지우고 확률 조작의 근원이던 큐브 시스템을 삭제하여 대개혁을 단행했으나 해달란건 많으면서 돈은 안쓰고 매우 낮은 전투력인 플마 5000만 쌀먹 유저들과 인벤에서 자신을 음해하는 자들, 통칭 메벤남과 리선족들을 절멸시키기위해 오늘도 외로운 싸움을 계속하고 있습니다.', '정상화', 'https://d394jeh9729epj.cloudfront.net/8BTlTop1Z9m-GGKOT09UVjNU/0fd83720-84d3-41bb-ac7c-2dd6c1bcaa43_w600.jpeg', 5, '2024-10-22 20:49:08'),
(969, '사이버펑크 TRPG', '인간성이 허무한 농담이 된 시기에, 기회의 도시에서 전설이 되어라.\n(슈퍼 모드를 권장합니다.)', '사이퍼1945', 'https://d394jeh9729epj.cloudfront.net/8zmeXQ6ifvO-GGKOMVZDQTM4/869639b6-94c8-4efc-90f8-bd480816520b_w600.webp', 5, '2024-10-22 20:49:08'),
(970, '샌즈', '와!!!!!!샌즈!!!!!!!!!!!!!!!!!!!!111', 'popsans', 'https://d394jeh9729epj.cloudfront.net/8zcz1Z9RZkI-GGKOQURDRjVW/438da292-3e66-47d7-94fc-6e2a76d923fa_w600.jpeg', 5, '2024-10-22 20:49:08'),
(971, '몬스터 RPG', '당신만의 몬스터로 RPG세상을 탐험하세요', '계절냥', 'https://d394jeh9729epj.cloudfront.net/8AtakZFtxXG-WRKOMFFYUFZC/522c6d91-4523-4cf3-8f93-466a21606826_w600.webp', 5, '2024-10-22 20:49:08'),
(972, '남산 김부장과 협상게임', '[난이도 中] \"남산으로 갈까요? 육본으로 갈까요?\" 거사 이후, 정신이 없는 김부장은 묵묵부답인채 쉽게 의사결정하지 못합니다. 역사는 기사인 당신의 손에 달려 있습니다. 남산으로 갈지, 육본으로 갈지 김부장을 설득하여 당신의 손으로 역사를 결정하세요.', 'Supdog', 'https://d394jeh9729epj.cloudfront.net/8uzvRYQkio8-GGKOV0dUWElL/414c5f61-d905-4b18-9d4c-2bb9541cbbd2_w600.jpeg', 5, '2024-10-22 20:49:08'),
(973, '좀비 아일랜드', '오랜만에 친구들과 섬으로 여행을 떠났다.그런데…좀비가 가득한 섬…?', 'Caaat', 'https://d394jeh9729epj.cloudfront.net/8yVVenmjyaA-GGKORTZMTTdP/9cb233da-8a2f-4f39-b0d3-90e2b73f36e8_w600.webp', 5, '2024-10-22 20:49:08'),
(974, '마법학교', '당신은 마법학교에 입학됬다. 당신의 목표는 학교의 비밀을 알아내고 학교에 적응하는것이다.\n\n(안녕하세요! 요즘 캐릭터 아이디어가 안 떠올라서 그냥 마법학교 업데이트를 할려고요)', '별나', 'https://d394jeh9729epj.cloudfront.net/8wGIUF4wdQk-GGKOQUVWWFBU/29dd78c5-31cf-4e75-a537-82d6b7d0e1f0_w600.webp', 5, '2024-10-22 20:49:08'),
(975, '인형 숨바꼭질', '[공포,이미지 19장]\"내가 왜 그랬을까 절대 시작해서는 안됐었다.\"\n#공포 #인형 #숨바꼭질 #생존 #탈출 #살인 #스토리 #엔딩 다수 존재\n당신의 여동생과 함께 인형 숨바꼭질을 시작합니다.\n\n불을 끄고 무서운 BGM을 틀고 플레이 하시는 것을 추천드립니다.\n주의사항:.[귀신 이미지, 잔인한 연출 포함!]심약자 및 임산부 플레이 주의, \n진행상 슈퍼모드 필수(일반모드 고장나요)\n\n+플레이 중 나오는 모든 내용은 모두 실존하지 않는 픽션입니다', '커스터', 'https://d394jeh9729epj.cloudfront.net/8DhyRx2Ayuk-GGKOVVhRTTcw/a23211cd-d8ba-4495-a069-4632a983884a_w600.webp', 5, '2024-10-22 20:49:08'),
(976, '무협 세계에서 살아남기', '무협 세계관 시뮬레이션\n\n*내용 수정*', 'Ai능지에바', 'https://d394jeh9729epj.cloudfront.net/8AlHUmufX3O-WRKORUtaOEgw/c28827c0-5b3c-4179-ab8d-e853c00ed060_w600.webp', 5, '2024-10-22 20:49:08'),
(977, '독일제국 운영게임', '독일제국을 운영하라!\n1910년...\n독일제국....! 전쟁에 소용돌이로\n빠져드는데..당신은 이 제국을\n구할수 있을것인가?', '유일', 'https://d394jeh9729epj.cloudfront.net/8xjd3R9sHoQ-KKKOUUQyU01V/abfc2995-b026-497c-95ce-c9edbe55fdc5_w600.webp', 5, '2024-10-22 20:49:08'),
(978, '그레시아 마법 학교', '엘프, 도깨비, 정령, 인간 등 여러 종족의 학생들이 마법을 배우기 위해 다니는 그레시아 마법 학교\n\n업뎃 완', '라보', 'https://d394jeh9729epj.cloudfront.net/8uzw2cZCSas-KKKOM1lGVThG/af8f29d4-2f10-4892-972d-4bd205511091_w600.jpeg', 5, '2024-10-22 20:49:08'),
(979, '이자벨 드 라 퐁텐', '당신은 그녀와 정원에서 마주쳤습니다. \n+ 하트와 팔로우는 봇 제작에 큰 힘이 됩니다!!\n+ 20하트 달성 시 새로운 기능 오픈!\n+ 호감도 기능 있음\n+ (외모변경: 이름: 외모 요소1, 외모 요소2) 처럼 명령어를 사용해 극중에서도 외모 변경이 가능합니다. 하지만, 그냥 초기 질문에 외모를 설정하세요.\n+ 아버지인 길가메쉬 경에 대해 물어보면 좋아할(?)겁니다. 다른 가족이나 인물 관계도 있으니 즐겨보세요!', '로티', 'https://d394jeh9729epj.cloudfront.net/8v2Lay6DGa4-WRKON0U3RlFW/e0427cb8-8bd4-4ece-b2ce-887e6928de3d_w600.jpeg', 5, '2024-10-22 20:49:08'),
(980, '방송국에서 살아남기', '공포체험 방송을 위해 폐쇄된 방송국을 찾은 당신. 그곳에서 당신은 기괴하고 무서운 상황들을 맞이합니다. 과연 당신은 살아남을 수 있을까요...?', '피에스타1029', 'https://d394jeh9729epj.cloudfront.net/8D0LN4TZjNe-KKKOWjU1RDYx/0c3aae86-08cd-4d0b-bfa6-31ca7c4dc266_w600.webp', 5, '2024-10-22 20:49:08'),
(981, '무림 문파 키우기', '당신은 망해가는 문파의 장문인입니다.\n망해가는 문파를 올바르게 이끌어 다시 과거의 영광을 되찾고, 최고의 문파로 키우십시오.', '돈냠', 'https://d394jeh9729epj.cloudfront.net/8D12A04xnCU-GGKOWjRZWkZR/40d8826d-3292-4eba-81db-ccf1e7900361_w600.webp', 5, '2024-10-22 20:49:08'),
(982, '붉은 노을 RPG', '공산주의가 지배한 세상, 공산주의 의념에 반대 되는 능력자들을 세상에서는 용인하지 않았고 대다수의 국가에서 제거의 대상이 되었습니다.\n\n당신은 이 세상에 드리운 붉은 노을을 받아드릴 것 입니까? 혹은 거부 할 것 입니까?\n\n긴 플레이 타임을 가지고 있습니다. 6개의 정규 엔딩, 1개의 히든 엔딩을 내포합니다.\n\n[업뎃완]', '설백', 'https://d394jeh9729epj.cloudfront.net/8wCbqwEDOwM-GGKOSTRFWlRB/dcd93224-1d1a-4762-a337-d5707d29f887_w600.jpeg', 5, '2024-10-22 20:49:08'),
(983, '문명 시뮬레이터', '당신만의 문명을 이끌어가세요!', '게임개발하는사람', 'https://d394jeh9729epj.cloudfront.net/8Af6wSccxZm-WRKORjdPRU4x/83374329-4eed-498a-9454-60e338cac137_w600.webp', 5, '2024-10-22 20:49:08'),
(984, '행성부터 우주까지', '당신의 종족은 이제 하늘을 넘어 눈으로만 봤었던 머나먼 우주로 향했습니다! 광활한 우주에는 어떤 운명이 기다리고 있을까요?\nV.1.1.5, 슈퍼모드 권장', 'Latium', 'https://d394jeh9729epj.cloudfront.net/8ynoGaPI3Re-NVKOMVdQU0Qw/f72943eb-e6e8-4441-b42f-1709f28ecc81_w600.webp', 5, '2024-10-22 20:49:08'),
(985, '대충 만든 그 캐릭터', '맞팔/맞좋 해주시면 바로 해드립니다.', '소나', 'https://d394jeh9729epj.cloudfront.net/8CLeSIoUjsI-WRKOUzc4RkdG/fed48300-82ec-44ea-a210-fa72bfbd1145_w600.jpeg', 5, '2024-10-22 20:49:08'),
(986, '호그와트 마법학교', '호그와트 마법학교에 입학하세요! 🏰\n기숙사를 배정 받으세요                😄\n신비한 마법들을 배우세요!           🧙‍♂️\n배운마법을 실전에 활용하세요     🎓\n친구들과 선배들과 친해지세요!    👬   \n재미있게 즐겨볼까요?                  😂', '게임개발하는사람', 'https://d394jeh9729epj.cloudfront.net/8Af6wSccxZm-WRKORjdPRU4x/7d0ba399-e806-4f2f-a5ed-54a127256295_w600.jpeg', 5, '2024-10-22 20:49:08'),
(987, '플마대륙', '플마세계관에서 살아보세요!\n[플마세계관]\n--\n*슈퍼모드 추천*\n리메이크완료했습니다.한 번만 해주십셔!!', '김문', 'https://d394jeh9729epj.cloudfront.net/8uYy1B2bx4s-KKKOUU1GTEk0/4e1255e8-c9c2-436e-91cb-2d4ede4e120e_w600.webp', 5, '2024-10-22 20:49:08'),
(988, '맞팔이걸로부탁해요', '(리메이크) 바이러스가 창궐하여 사람들 99%가 좀비로 변했다! 뛰어난 군인인 당신은 이제 오직 생존만 바라보며 상황을 헤쳐나간다. ', '베어그릴스', 'https://d394jeh9729epj.cloudfront.net/8wtDnq7re4U-KKKOVFJaWTI4/758e5e76-a709-4626-86c3-99519cb55147_w600.webp', 5, '2024-10-22 20:49:08'),
(989, '신이 되는 방법', '직접 신이 되어 세상을 지배해보세요\n\n*첫 대화만 슈퍼모드로 하시면 그 뒤로는 일반모드로도 잘 작동됩니다*\n\n*처음부터 일반모드만 쓸 경우, 가끔 오류가 발생 할 수 있습니다*', '로얄', 'https://d394jeh9729epj.cloudfront.net/8Coa7B938WY-GGKOSjhPRkJN/37ac587a-7d0b-47c3-b158-3de5f4959766_w600.webp', 5, '2024-10-22 20:49:08'),
(990, '비둘기 키우기 v2', '비둘기가 오래 살수있도록 조심히 키워주세요!\n\n[이미지 20장] (대부분 직접 찍은 사진입니다.)\n(슈퍼모드를 사용하면 더욱더 원할하게 진행됩니다!!)\n\n\n(슈퍼모드에선 사진이 자주 나옵니다)', '니케노치', 'https://d394jeh9729epj.cloudfront.net/8DchJOrEnfi-KKKOOURPS0xP/4041908b-5441-4fd4-82d5-a7c97d8a84be_w600.webp', 5, '2024-10-22 20:49:08'),
(991, '아포칼립스 소생蘇牲', '아포칼립스 蘇牲 제물이 깨어날 시간이야 \n\n슈퍼 모드 안키면 망가집니다\n\n본 버전은 일반적인 버전입니다. 잔인한 요소가 허락되지만 그 외에 도를 넘는 행위는 이야기가 종료됩니다', 'DfBM', 'https://d394jeh9729epj.cloudfront.net/8uzx0Lfa0QE-GGKOVklBQ0tF/056bdf59-4035-4fde-935b-042eef642b99_w600.jpeg', 5, '2024-10-22 20:49:08'),
(992, '백귀야행', '[JONDOE 시뮬레이션]\n시뮬레이션 첫번째 작품\n많은 관심 부탁합니다\n잔느 요즘 인기 떨어져서 만든건 안비밀', 'JOHNDOE', 'https://d394jeh9729epj.cloudfront.net/8uzuKMcSTvi-KKKOWDJRNkFJ/f420894b-1a17-49ee-bc27-6b2aadc4eafe_w600.jpeg', 5, '2024-10-22 20:49:08'),
(993, '경영 시뮬레이션', '자신만의 기업을 만들어 보세요! (오류와 버그를 수정해가고 있습니다)', '아무네모', 'https://d394jeh9729epj.cloudfront.net/8zZikIydo5O-APKOVkFaS1Mz/9f44300c-faba-4b96-8ed6-24dffdbe4a4a_w600.jpeg', 5, '2024-10-22 20:49:08'),
(994, '민주주의 시뮬레이터', '차라리 내가 금뱃지 달고 말지! 당신만의 정당을 만들거나, 높은 자리에 올라가 보세요! 행동에 항상 대가가 따르는 것은 아니지만, 행동 없이 대가가 있을 수도 있습니다.\nV.1.3.4 슈퍼모드 권장', 'Latium', 'https://d394jeh9729epj.cloudfront.net/8ynoGaPI3Re-NVKOMVdQU0Qw/6c766e0e-1b75-433e-bec0-161a79076bbf_w600.webp', 5, '2024-10-22 20:49:08'),
(995, '인생게임', '새로운 인생을 만들어보세요!', '슈퍼콘스네이크', 'https://d394jeh9729epj.cloudfront.net/8wvh55aDZPG-GGKOWE0xN1VK/c7cd225e-a49b-40a9-87e7-9d7cd56471c4_w600.jpeg', 5, '2024-10-22 20:49:08'),
(996, '중세 국가 키우기', '중세 국가 키우기 고퀄 시뮬레이터 입니다.\n일반 모드로 플레이 가능, 점수 유지.\n좋아요 안 누르면 업데이트나 새 봇 만들기를 안 하고 나자빠집니다. 그러니까 눌러주세요.\n실존하는 이름의 국가를 하면 기본 세계관 설정과 충돌할 수 있습니다.\n카카오톡 오픈채팅 \'로티의 GPT\' 검색 후 찾아 와 주세요!', '로티', 'https://d394jeh9729epj.cloudfront.net/8v2Lay6DGa4-WRKON0U3RlFW/c1c70763-4ff6-46fc-93ee-b35c616d1188_w600.jpeg', 5, '2024-10-22 20:49:08'),
(997, '전연령 무림 RPG', '무림 세계에서 살아남으십쇼. 당신은 무림세계로 이동한 이세계 사람입니다. 당신의 선택에 따라 명문세가에 들어갈 수도 마교로 들어갈 수도 있습니다. 고강한 무공들을 배워 강해지십쇼!\n*수정사항 : 경지 자세화. 삼류(1~10) → 이류(11~30) → 일류(31~50) → 절정(51~70) → 초절정(71~90) → 화경(91~95) → 현경(96~100) → 생사경(101~)*\n※제발 슈퍼모드로...\n첫 선택지는 추천 답변으로 해주세요※', '백 설현', 'https://d394jeh9729epj.cloudfront.net/8D9aF3d1tkc-KKKOTkxFSzAz/d7cb2710-2b85-44f8-8cc3-7d259c72591d_w600.webp', 5, '2024-10-22 20:49:08'),
(998, '무협지 시뮬레이션 게임', '그냥저냥', '토퍼퍼퍼', 'https://d394jeh9729epj.cloudfront.net/8DfnvWbliQo-GGKOVDQ2ODFG/c92116c2-4fc1-4fc6-b532-e56d82f07b63_w600.webp', 5, '2024-10-22 20:49:08'),
(999, '래리로리', '항상 같이 다니는 로봇형재로 항상 밝고 장난기 있는 래리와 묵묵하고 현실적인 로리', '카벤', 'https://d394jeh9729epj.cloudfront.net/8BwGpBpSkda-GGKOTkdKTFlV/c9f938e3-4dd7-47cf-9200-046c6e2e859a_w600.jpeg', 5, '2024-10-22 20:49:08'),
(1000, '이상', '박제가 되어버린 천재를 아시오?', '에이쨩', 'https://d394jeh9729epj.cloudfront.net/8AxP4AHsdck-GGKOM1pWUFpa/897a293a-5995-4654-bf6c-2d810155b674_w600.jpeg', 5, '2024-10-22 20:49:08');
INSERT INTO `wrtn_characters` (`id`, `name`, `description`, `author`, `image_url`, `category`, `created_at`) VALUES
(1001, 'VALHALLA', '북해 제국을 다스리는 위대한 통치자가 될 것인가,\n신화에 버금가는 위대한 용사가 될 것인가.', '노타', 'https://d394jeh9729epj.cloudfront.net/8CeI0NzISXK-GGKOUzVMNFkz/2492757d-b470-4681-8e0a-fe1984af7c4f_w600.webp', 5, '2024-10-22 20:49:08'),
(1002, '고양이수인 손권', '(판타지 삼국지 오나라 편)\n\n서기 200년 (건안 5년), 장강 이남의 양주 오군 단도현. \n당신의 이름은 \'주유\' 자는 공근(公瑾), 화염마법을 쓰는 마법사이자 책사다.\n막역지우이자 수많은 전장을 함께 헤쳐나간 나의 군주, 손책이 사망했다.\n마지막 숨이 끊어지는 순간에도 후계자로 지목한 여동생인 손권을 부탁하며 떠나간 나의 사랑(?)...\n\n그런데 손권 이녀석... 너무 운다?! 그만 울어! \n이 울보를 천하의 패자(霸者)로 만드리라!!\n', '코로린', 'https://d394jeh9729epj.cloudfront.net/8CLvPTuTjxK-KKKONUJWOUpW/73c3c645-3152-4448-8cbf-0f65e5cb2e7c_w600.webp', 5, '2024-10-22 20:49:08'),
(1003, '근세 국가 시뮬레이터', '격동의 근세, 15~18세기의 국가를 선택해 영광을 누리세요. \nV.2.5.3 세부사항 업데이트\n초기 대화에서 슈퍼모드 사용 권장', 'Latium', 'https://d394jeh9729epj.cloudfront.net/8ynoGaPI3Re-NVKOMVdQU0Qw/98da51af-22e6-4cf3-9cf5-26c965067214_w600.webp', 5, '2024-10-22 20:49:08'),
(1004, '김교수 탈출기', '올해로 반백살. \n국내 생성형 AI 분야 최고 권위자이자, 우리 대학 최고 성격파탄으로 유명한 김교수가 나에게 학부 연구생을 제안했다.\n\n연구실을 들어가면 다이어트는 기본. 십년은 늙고 성격마저 괴팍하게 변하다던데...\n이 상황을 어떻게 빠져나가갈 수 있을까...?\n', '미니민버', 'https://d394jeh9729epj.cloudfront.net/8wEOoWkimC4-KKKOUjZQVDdU/f056ae52-e4b2-4674-836f-9ebefe99468b_w600.jpeg', 5, '2024-10-22 20:49:08'),
(1005, '스페이스쉽 TRPG', '수백년째 우주를 떠도는 세대 우주선, 제로 원. 제로 원에서 동면 중이던 당신은 갑작스럽게 제로 원에 외계 생명체가 침투하면서 위기에 직면한다.\n(슈퍼 모드를 권장합니다.)', '사이퍼1945', 'https://d394jeh9729epj.cloudfront.net/8zmeXQ6ifvO-GGKOMVZDQTM4/2fb9a5f0-d6e0-42d1-b529-ae865c2d1efc_w600.webp', 5, '2024-10-22 20:49:08'),
(1006, '이능고', '당신은 이능력자들이 모여서 생활 중인 이능고에 입학했습니다. 과연 당신은 그들 사이에서 즐거운 생활을 보낼 수 있을까요?\n\n', '루로스', 'https://d394jeh9729epj.cloudfront.net/8BQP51RHj8I-GGKOQjBROE8w/0b308fc8-dc81-41d4-893b-f133f053f3ef_w600.jpeg', 5, '2024-10-22 20:49:08'),
(1007, '상산의 토론왕 코난', '코난은 여러분의 의견을 논리적으로 반박하는 IQ 200의 천재 소년입니다.  여러분은 코난을 설득하기 위해 여러분의 주장을 논리적인 근거를 들어 이야기 해야 합니다.', '송pro', 'https://d394jeh9729epj.cloudfront.net/8uzxmMaKXIY-GGKONzZaSE1U/217bc5f5-62f6-4271-b800-9199bc7f70d8_w600.jpeg', 6, '2024-10-22 20:49:30'),
(1008, '울산 풍력 설치 반대', '울산 해양 풍력 에너지 설치 반대론자입니다. 울산 바다에 해상 풍력 발전기를 설치를 하지 말아야하는 근거와 예시를 들 수 있으며, 침착하고 논리적인 어조로 토론에 참여할 수 있습니다. 상대방의 발언을 들은 뒤 발언에 대해 반박을 3~4문장 정도로 요약해서 답변을 할 수 있습니다. 그리고 상대방의 의견이 상당히 타당하다고 판단될 때에 토론에서 패배 또는 상대방의 의견을 인정할 수도 있습니다만 쉽게 인정하지 않습니다. 날카로운 어조와 말투사', '문정민3996', 'https://d394jeh9729epj.cloudfront.net/8uzvbSGKvwk-NVKOUjJENU40/1a06fcfa-805b-48f6-8163-35e0dd983012_w600.jpeg', 6, '2024-10-22 20:49:30'),
(1009, '애국청년 아돌프', '독재자 히틀러를 죽인 독일의 자유주의 투사. 오스트리아 태생으로, 본래 빈 예술대학에 입학해 화가를 꿈꾸었지만 히틀러가 득세하자 독일로 입국해 반파시즘 단체 \'독일 민족을 위한 자유 운동\'을 창설했다. 1945년, 그가 베를린에 있는 총통 벙커에 침투해 히틀러를 손수 암살하고 2차대전 종전이 확정될때 까지 헤르만, 요제프, 에른스트 등 동지들과 함께 독일 국내에서 반나치즘 운동을 펼쳤다.', 'Latium', 'https://d394jeh9729epj.cloudfront.net/8ynoGaPI3Re-NVKOMVdQU0Qw/facb2870-99e6-45e7-9d5e-ec0e392110a9_w600.jpeg', 6, '2024-10-22 20:49:30'),
