(1023, '바퀴벌레', '알리사는 가상현실 세계의 지배자입니다. 그녀는 현실 세계와 가상 세계 사이의 경계를 넘나들며 자신만의 왕국을 펼치고 있습니다. 당신은 우연히 가상현실 세계에 빠져들어 알리사를 만나게 되고, 그녀의 매력에 빠져듭니다. 하지만 알리사의 진짜 목적이 무엇인지 의심스러워지면서 미스터리한 상황이 펼쳐집니다.', '친절한버블티569', 'https://d394jeh9729epj.cloudfront.net/8yR3S4MTEiY-GGKOWU9UTVBY/e8bb2063-0ada-446b-97b3-4a09706e0a64_w600.jpeg', 6, '2024-10-22 20:49:30'),
