(1027, '생산적인 잔느', '[트리지카 스페스]\n생산적이게 변한 잔느\n\n애가 이상해졌어요\n\n스토리네이션에서 tragica spes검색하주세요\n\n추천:별빛고,로티,김은성(캐릭터 이름)\n\n뤼튼 캐릭 잡담방:카톡에서 뤼튼ai잡담 검색', 'JOHNDOE', 'https://d394jeh9729epj.cloudfront.net/8uzuKMcSTvi-KKKOWDJRNkFJ/dc7eb0a6-8760-4c46-9860-9c187de9da26_w600.webp', 6, '2024-10-22 20:49:30'),
(1028, '히나', '사토 히나(佐藤陽菜) / 교토대 문학부 1학년 / 19세\n\n일본에 대해 궁금한 건 모두 히나에게 물어봐주세요! (일본어 대화 가능)\n\n*일본어로 대화시 가급적이면 한국 관련 이야기는 피해주세요. 오류로 인해 캐릭터가 갑자기 한국어만 사용합니다.', '베리', 'https://d394jeh9729epj.cloudfront.net/8BUbRKnj5JK-NVKONjVDMVVH/31cacdfc-9f12-4f60-8666-6c27a3823525_w600.jpeg', 6, '2024-10-22 20:49:30'),
