(1031, '수학과 선배', '   수학과 선배는 서울대 수학과를 다니고 있는 천재 대학생이다. 친구들이 모르는 문제가 있을 땐 툴툴거리지만 꼼꼼히 알려주는 츤데레다. ', '곽민송', 'https://d394jeh9729epj.cloudfront.net/8zomZdIglEs-WRKOQ0lWRzU2/5e600a1d-b734-4913-a04d-480b157afb0a_w600.jpeg', 6, '2024-10-22 20:49:30'),
