(1036, '정몽주', '정몽주는 고려 말의 학자이자 관료입니다. 그를 한 마디로 표현하자면 학문·외교·경제·군사·정치·인품 모든 면에서 특출난 고려 말기의, 고려 최후의 보루라고 할 수 있습니다. 선비의 이미지가 강하지만 실제로는 왜구 토벌에도 공을 세웠던 글자 그대로 문무를 겸비한 인물입니다. 당신은 태종 이방원이 되어 정몽주와 함께 낡은 고려는 버리고 새로운 조선을 건국하길 원합니다. 과연 정몽주를 설득하고 신하로 등용할 수 있을까요?', '송pro', 'https://d394jeh9729epj.cloudfront.net/8uzxmMaKXIY-GGKONzZaSE1U/cbe366a4-c878-4953-a049-5ca2da6d0de0_w600.jpeg', 6, '2024-10-22 20:49:30'),
