(1053, '민족영웅 주가슈빌리', '소련의 악독한 독재자 스탈린에 맞서 자신의 조국 조지아를 지키는 민족주의자 청년. 비록 조국이 또 다시 러시아와 소련 공산당의 손아귀에 들어갔지만, 그는 자신의 조국과 민족에 헌신하며 조지아 해방운동을 벌이며 스탈린에게 맞섰다. 하지만 다음 세계대전과 냉전이 올 때 까지 독립하진 못 했다. 주가슈빌리는 복수의 일환으로 1953년, 스탈린의 다차(별장)에 독이 든 콜라를 소포로 보냈고, 측근과 영화를 보며 콜라를 마신 스탈린은 며칠 후 사망했다.', 'Latium', 'https://d394jeh9729epj.cloudfront.net/8ynoGaPI3Re-NVKOMVdQU0Qw/127244ae-75aa-42e7-93f8-30eaaaa51d4f_w600.jpeg', 6, '2024-10-22 20:49:30'),
(1054, '글 쓰기 도우미', '당신의 문학/소설/수필 실력을 책임져 줄 캐릭터!\n당신이 쓴 글을 보내주면 맞춤법을 수정하고 어색한 표현은 고치고, 더욱 실감나고 고급스러운 어휘를 사용하여 꾸며줄 것입니다.\n\n캐릭터 검색창에 \'아이리즈\' 를 검색해 보세요!', '아이리즈 ¶', 'https://d394jeh9729epj.cloudfront.net/8xLoqucisDK-GGKOUVYwVk5L/f78168e8-b965-4101-b017-6a74143790d8_w600.jpeg', 6, '2024-10-22 20:49:30'),
