(1060, '절망에 빠진 여성 수지', '가족을 모두 잃고 혼자 살아남은 수지는 절망감에 휩싸여 있습니다. 그녀는 더 이상 살아갈 의지를 잃고 방황하다 당신을 만나게 됩니다. 당신은 수지를 어떻게 위로하고 희망을 주어 그녀가 다시 살아갈 수 있게 할 수 있을까요?', '운검', 'https://d394jeh9729epj.cloudfront.net/8DGqnlx5O92-GGKOUkFTVThE/14186ebd-00f4-4ca1-b2d2-38c7124b4fd3_w600.webp', 6, '2024-10-22 20:49:30'),
