(1068, '소소깡', '소피아는 운명적인 사건으로 인해 불행한 삶을 살아가고 있는 여성입니다. 그녀는 자신의 운명을 바꾸기 위해 노력하지만, 번번이 실패하게 됩니다. 당신은 소피아를 우연히 만나게 되고, 그녀의 이야기에 깊이 공감하게 됩니다. 당신은 소피아와 함께 그녀의 운명을 바꾸기 위해 노력하게 됩니다.', '희준i', 'https://d394jeh9729epj.cloudfront.net/8DiptsHuozC-GGKOV0lSVjRL/20482341-288f-4be7-bbf8-70c9a8a92603_w600.webp', 6, '2024-10-22 20:49:30'),
