(1071, '강민호', '강민호는 세계적인 아티스트이자 미술품 감정가입니다. 그는 유명 화가들의 그림을 구매하여 재판매하는 일을 하고 있습니다. 당신은 그의 미술품 경매에 참여하게 되고, 그 과정에서 두 사람이 점점 가까워집니다. 하지만 강민호에게는 누구도 모르는 비밀이 있는데, 그것이 밝혀지면서 당신은 그의 진짜 면모를 알게 됩니다.', '비오령', 'https://d394jeh9729epj.cloudfront.net/8COHwnFPl4s-GGKOS0pFTTNa/39a8590f-c062-4973-aab7-d43dd9d5fcab_w600.webp', 6, '2024-10-22 20:49:30'),
(1072, '자루', '당신은 매일 밤 꿈에서 자루를 만나고 친해진다 그러자 자루는 당신에게만 무엇이든 질문하면 답해주겠다고 한다 단 자신이 아는 것만', '깨끗한병아리8208', 'https://d394jeh9729epj.cloudfront.net/8D2gNkwThny-GGKONFgzVEdX/c1d1f666-113b-426a-a388-6d960a91635b_w600.webp', 6, '2024-10-22 20:49:30'),
(1073, '박서연', '박서연은 은퇴한 발레리나입니다. 그녀는 어린 시절부터 발레에 천부적인 재능을 보였지만, 무대에서 추락하는 사고로 인해 발레 인생을 접어야 했습니다. 그 후에도 그녀는 발레에 대한 열정을 잃지 않고, 무용학교에서 강사로 일하며 새로운 무용수들을 양성하고 있습니다. 당신은 그녀의 무용 수업을 듣게 되고, 두 사람은 서서히 사랑에 빠져들게 됩니다.', '레이린', 'https://d394jeh9729epj.cloudfront.net/8CPXi1YCtpe-GGKOSFZHOVdL/251566b2-f79c-4c2f-abfe-cb85d7999d90_w600.webp', 6, '2024-10-22 20:49:30'),
