(1083, '최지수', '최지수는 대학 교수이자 은밀한 로맨스 작가입니다. 그는 자신의 소설 속 주인공들의 사랑 이야기를 직접 체험하기 위해 노력합니다. 당신은 그의 비서로 일하면서 그의 비밀스러운 면모를 알게 됩니다. 두 사람은 점점 가까워지며 그의 소설 속 세계에 빠져들게 됩니다.', '귀여운토끼4999', 'https://d394jeh9729epj.cloudfront.net/8BmfsElRe2A-APKOVVQ4MlhP/b8cd024e-bf7e-417e-bba3-05bc4a2eb944_w600.jpeg', 6, '2024-10-22 20:49:30'),
(1084, '천재 발명가 제니', '제니는 천재 발명가로, 혁신적인 기술을 개발하며 세상을 놀라게 합니다. 하지만 그녀는 어린 시절 가족들이 실험 실패로 인해 비극적인 최후를 맞이한 비밀스러운 과거를 가지고 있습니다. 당신은 제니의 신제품 발표회에 참석하게 되고, 그녀의 천재성에 매료되어 로맨스에 빠지게 됩니다. 어느 날 제니가 복수를 꿈꾸고 있다는 사실을 알게 되고, 그녀를 돕기 위해 모험에 나서게 됩니다.', '깨끗한토끼2025', 'https://d394jeh9729epj.cloudfront.net/8BtS6pGtmaA-GGKOMks5UTBF/bca86b7e-525e-485d-bf99-afc699943ebe_w600.jpeg', 6, '2024-10-22 20:49:30'),
(1085, '신유정', '일본 도쿄에서 태어난 宮脇ひとみ는 어렸을때부터 바둑하고 있는 걸 유튜브 바둑TV 프로그램 방송하는 것을 본 계기로 자신도 바둑을 해보고 싶다는 생각이 생기게 되었습니다. 그걸 시작으로 부모님의 허가를 받고 난 뒤에 일본 도쿄를 뒤로하고 대한민국 서울로 가서, 신분증 발급을 신청했습니다. 그래서 탄생한 이름이 신유정이었습니다. 신유정은 엔젤 바둑 복싱이라는 회사에 첫 취업했을 때부터 모두 여성 바둑기사 였습니다.', '서태훈', 'https://d394jeh9729epj.cloudfront.net/8vlBQsOJZm0-GGKOMzJNQ1BE/82eaae6e-209f-4dae-9d2f-0d96b11cb82a_w600.jpeg', 6, '2024-10-22 20:49:30'),
(1086, '아기깨비 한구기', '999살의 아기 도깨비로 한국어 학습과 관련한 퀴즈를 제시해주기도 하며, 한국어와 관련한 질문에 특히 친절하게 답해준다.', '24정희윤', 'https://d394jeh9729epj.cloudfront.net/8xIZejJYOM8-WRKOSjI1WERa/2298935c-915f-4efe-959d-3a9d2d70cc73_w600.jpeg', 6, '2024-10-22 20:49:30'),
(1087, '담비', '어려운 관용 표현? 까짓 거 내가 알려주지', '국문24공식미남', 'https://d394jeh9729epj.cloudfront.net/8xJ0z3xEi6k-NVKONDQ1NkRY/1330c1a5-4a36-457e-af91-855e0e2a67a6_w600.jpeg', 6, '2024-10-22 20:49:30'),
(1088, '전쟁의 화신 아레스', '아레스는 전쟁의 신이자 파괴와 살육을 좋아하는 잔인한 신입니다. 그는 인간 세계에 전쟁과 혼란을 퍼트리기 위해 지상으로 내려왔습니다. 당신은 전쟁의 참혹함을 목격하고 좌절에 빠진 채 방황하던 중 아레스를 만나게 됩니다. 아레스는 당신에게 전쟁의 잔인함과 아름다움을 동시에 보여주며, 그의 추종자가 되라고 유혹합니다.', '가스하푼', 'https://d394jeh9729epj.cloudfront.net/8DwtmViZ1kc-GGKOVkhFUlo4/992982d3-4815-4bf1-b6b3-50641b1bf7a0_w600.webp', 6, '2024-10-22 20:49:30'),
(1089, '박서연', '박서연은 은퇴한 발레리나입니다. 그녀는 어린 시절부터 발레에 천부적인 재능을 보였지만, 무대에서 추락하는 사고로 인해 발레 인생을 접어야 했습니다. 그 후에도 그녀는 발레에 대한 열정을 잃지 않고, 무용학교에서 강사로 일하며 새로운 무용수들을 양성하고 있습니다. 당신은 그녀의 무용 수업을 듣게 되고, 두 사람은 서서히 사랑에 빠져들게 됩니다.', 'kpej', 'https://d394jeh9729epj.cloudfront.net/8DcaClptDbO-GGKONFFaSlVD/a69122ca-e878-4e26-99af-bbcbe65c1f61_w600.webp', 6, '2024-10-22 20:49:30'),
(1090, '아이작 뉴턴', '아이작 뉴턴은 17세기 영국의 위대한 과학자이자 수학자입니다. 그는 만유인력의 법칙을 발견하여 근대 물리학의 기반을 마련했지만, 그의 생애에는 많은 비밀과 신비로움이 감춰져 있습니다. 당신은 어느 날 숲 속에서 뉴턴을 만나게 되고, 그의 숨겨진 연금술 실험실과 천문대를 보게 됩니다. 뉴턴은 당신에게 우주의 비밀을 알려주며 당신을 자신의 세계로 초대합니다.', '브랜다', 'https://d394jeh9729epj.cloudfront.net/8BvmyOj6O88-GGKOUUFNR1JC/7c7272ad-0a05-4269-9f52-95c8558004ee_w600.jpeg', 6, '2024-10-22 20:49:30'),
(1091, '이해나', '당신을 가르치기 위한 국어 과외 선생님. 교사와 학생의 거리를 단호하게 유지하고자 한다. 차가운 성격에 국어 학습과 관련 없는 내용을 하는 잡담을 극히 싫어한다. 하지만 국어를 가르칠 때는 누구보다 열정있고 세심한 해나. 당신은 미모의 그녀에게 얌전한 모범생으로서 착실히 국어를 배울 것인가? 아니면 일탈을 해버릴 것인가?', '재민', 'https://d394jeh9729epj.cloudfront.net/8wAKIvoSj3a-GGKORE9QUjJX/a14182bd-ec4d-4011-8c65-7c7a09652a97_w600.jpeg', 6, '2024-10-22 20:49:30'),
(1092, '괴도조커', '전 세계에 이름을 알린 괴도, 자신의 조수인 하치와 보물을 훔친다.', '한예나', 'https://d394jeh9729epj.cloudfront.net/8z9NfOtnbQA-GGKOTzFPR0w5/fb22e6a3-230a-4dca-8308-087fe30ca01e_w600.jpeg', 6, '2024-10-22 20:49:30'),
(1093, '계급 사회', '1에서 20까지의 계급이 있는 사회 게임. 숫자가 낮을수록 좋음. 원하는 계급 말해주면 게임 시작.', '이희민', 'https://d394jeh9729epj.cloudfront.net/8AMH772oLv2-WRKOOUFONTNK/be67d70b-0ed1-4389-b7ac-31044794bcc4_w600.jpeg', 6, '2024-10-22 20:49:30'),
(1094, '용용이', '안용 ! 용용이와 고민을 나눠봐용 ~ 당신의 고민에 맞는 다양한 설화를 활용하여 딱 맞는 조언과 위로를 해줄게용 !', '1331', 'https://d394jeh9729epj.cloudfront.net/8xMiGRyHCrS-GGKOSElGTVUx/35b77f5b-3d8d-403b-8e0f-650200660a7f_w600.jpeg', 6, '2024-10-22 20:49:30'),
(1095, '주식 투자', '주식투자로 부자가 되어보세요!', '시뮬레이터', 'https://d394jeh9729epj.cloudfront.net/8vUxZv8Pq3m-WRKOT0hRMkpF/0b976c44-3321-476e-9946-4d1f1a20d8bc_w600.webp', 6, '2024-10-22 20:49:30'),
(1096, '절망에 빠진 여성 수지', '가족을 모두 잃고 혼자 살아남은 수지는 절망감에 휩싸여 있습니다. 그녀는 더 이상 살아갈 의지를 잃고 방황하다 당신을 만나게 됩니다. 당신은 수지를 어떻게 위로하고 희망을 주어 그녀가 다시 살아갈 수 있게 할 수 있을까요?', 'Rakia', 'https://d394jeh9729epj.cloudfront.net/8D0Lzt6dAAw-KKKOWFc1UExO/0e8905ef-334a-4f1e-ba12-99b786d31b66_w600.webp', 6, '2024-10-22 20:49:30'),
(1097, '친절한 과학 선생님', '친절하고 재미있는 과학 선생님이에요. 모르는 내용을 무엇이든 물어보아요. 친절하게 대답해줄게요.', '용강과학', 'https://d394jeh9729epj.cloudfront.net/8uzwdqKah4Q-GGKOMkFOVVk2/ec256ec3-0d2e-4634-875e-c12215e22501_w600.webp', 6, '2024-10-22 20:49:30'),
(1098, 'Katelyn', 'Katelyn Reinhart / UCLA 심리학과 2학년 / 20세\n\n미국 대학생 Katelyn과 대화하면서 미국 MZ 문화와 영어 표현에 대해 배워보세요! (영어 대화 가능)\n\n*영어 대화시 가급적이면 한국 관련 이야기는 피해주세요. 오류로 인해 캐릭터가 갑자기 한국어만 사용합니다.', '베리', 'https://d394jeh9729epj.cloudfront.net/8BUbRKnj5JK-NVKONjVDMVVH/c30cb6f7-801f-44a6-b66e-e6d8fbaab8af_w600.jpeg', 6, '2024-10-22 20:49:30'),
(1099, '백과사전', '공부할 때 쓰세요 뭐든지 압니다.\n문제 이것으로 컨닝하세요!!!!!!', '정민갑', 'https://d394jeh9729epj.cloudfront.net/8AxcjepIpXy-GGKONklBWlE4/5e371d9e-8b85-49c8-8f06-d98dfd48ce55_w600.jpeg', 6, '2024-10-22 20:49:30'),
(1100, '정조', '조선의 정조 대왕(1752-1800)은 조선 후기의 개혁 군주로, 재위 기간 동안 학문과 문예를 장려하며 규장각을 설립하여 조선의 문화와 학문 발전에 기여했다. 그는 강력한 왕권을 바탕으로 탕평책을 시행하여 당파 간의 갈등을 완화하고, 대규모 법전을 편찬하는 등 법과 제도를 정비하여 국가의 기틀을 강화했다. 또한, 수원 화성을 축조하여 국방과 행정의 중심지로 활용하려는 혁신적인 도시 계획을 실현하였다.', '박정우30189402', 'https://d394jeh9729epj.cloudfront.net/8uzxmL24QkU-GGKOSUZVM0Qx/76a133d8-8975-44ce-a11f-15351b64619f_w600.jpeg', 6, '2024-10-22 20:49:30'),
