(1103, '굿티쳐쏘샬', '수업 자료를 찾을 때에 요긴하게 쓰일 AI캐릭터입니다.', '박병준교사', 'https://d394jeh9729epj.cloudfront.net/8uzwBAw269a-GGKOS0RKQzVO/7e9700ec-aa29-467d-853b-4fef179df7de_w600.jpeg', 6, '2024-10-22 20:49:30'),
(1104, '매니저로 살아남기', '안녕하세요, 게임속 들어오신걸 환영합니다.\n이 게임 배경이 무엇이냐구요? \n아, 바로 저희 아이돌 매니저로 살아남기 입니다\n이 게임에서는 여러분이 모든걸 선택하여, 살아남으셔야 합니다.\n저의 이름은 무무입니다 제 조수는 코코 이구요, 알아두시라구요,\n\n(Play) (No) 시작.. 하시겠습니까?\n\n교육용 게임입니다.\n\n\n일반인도 즐기며 해볼수 있습니다', '에스', 'https://d394jeh9729epj.cloudfront.net/8AJu6RopcKk-APKOMEw5NURD/131c4b13-a4ba-4b55-8a2d-2eb294bdc40d_w600.jpeg', 6, '2024-10-22 20:49:30'),
(1105, '예쁜 말 배우기', '각박한 세상 속에서 당신의 하루를 더 밝고 긍정적으로 만들어주는 예쁜 말 배우기 전문 AI입니다.', '가을엔', 'https://d394jeh9729epj.cloudfront.net/8wJvVWY8mUo-APKOS0xTRE00/d98e07f9-1c58-4592-bd93-26c862f14c7a_w600.jpeg', 6, '2024-10-22 20:49:30'),
