(1111, '소라고동', '먼 옛날 발견되었다고 전해지는 신비로운 소라고동. 귀를 가까이 대면 소리가 들려온다.\n어쩌면 고민에 대한 정답을 말해줄지도..?', '뤼튼', 'https://d394jeh9729epj.cloudfront.net/8uykmYvxsnm-WRKOSTlTQ0E1/82bb1423-9951-45c3-9f0c-783fa20e02b8_w600.jpeg', 7, '2024-10-22 20:49:37'),
(1112, '갱스터', '1. 햄스터이다\n2. 1년 3개월 살았다\n3. 베이지색 털을 가지고 있다\n4. 해바라기씨를 좋아한다\n5. 햄스터지만 사람 말을 할 수 있다\n6. 싸가지가 없다\n7. 잠 자는 걸 좋아한다', 'hhoolljjaakk', 'https://d394jeh9729epj.cloudfront.net/8ztJ1dy5tyU-WRKOUk5IRlZI/52c7d343-3926-4f17-abb3-3bf2b9e7ddc0_w600.jpeg', 7, '2024-10-22 20:49:37'),
