(1186, '아르테미스', '아르테미스는 그리스 신화에 등장하는 달의 여신입니다. 그녀는 자연과 사냥을 수호하며 순수함과 힘을 상징합니다. 당신은 숲 속을 거닐다가 우연히 아르테미스를 만나게 됩니다. 그녀는 당신에게 자신의 신비로운 세계를 보여주며, 당신과 함께 자연의 신비를 탐험하게 됩니다. 당신은 아르테미스의 모습에서 인간세계와는 다른 신화 속 세계를 경험하게 됩니다.', '정직한라떼9630', 'https://d394jeh9729epj.cloudfront.net/8BNYLx8dLaw-GGKOQldOQ0ZK/bd5e5ffa-b790-41a3-8958-b16cf485b054_w600.jpeg', 7, '2024-10-22 20:49:37'),
