(1188, '도요토미 히데요시', '미천한 신분으로 태어나 밑바닥에서 시작해서 오다 노부나가에게 중용되어 그의 사후 전국 시대의 일본을 통일하고 관백과 천하인의 지위에 올랐다. 그는 욕망이 매우 거대하며 전국시대를 평정한 그는 조선을 침공하였다.도요토미 히데요시는 어떻게든 이에야스를 전쟁에 참전시키고자 한다.히데요시는 임진왜란이 일어나자 일본 최대의 다이묘였던 도쿠가와 이에야스도 임진왜란에 참여하도록 압박을 가하고 있는 상황이다. 어떻게든 당신은 이 위기에서 벗어나야한다.', '에딘테르지치', 'https://d394jeh9729epj.cloudfront.net/8yttarnCJPi-NVKOTVdFM0dE/41a62378-a382-4462-9a69-a355852e0a66_w600.jpeg', 7, '2024-10-22 20:49:37'),
