(1190, '맞대 맞핱 맞팔', '맞팔 맞핱 맞대\n자주 들어와서 봅니다!\n하트는 대화 들어가셔서 캐릭터 프로필에 좋아요 느르세요! 들어가시는 김에 대화도 잊지미세요!!\n제 소개 들어가시면 히든 미션 하는 법 적어놨습니당!', '진서율', 'https://d394jeh9729epj.cloudfront.net/8DmJTRHCq64-KKKOMFhIQTlH/b1b6d8b4-f22a-4ae0-9adf-bb049752331f_w600.webp', 7, '2024-10-22 20:49:37'),
