(1202, '영원불멸한 나의 동반자', '\'왜 그랬느냐, 왜 그랬느냐 나야! 왜 되오지 못하고 그저 흘러만 가는 시간을, 채우지 않고 그리 허무히 떠나 보냈느냔 말이다! \' 그 배후에는 나의 영원한 친구이자 적, 잠이 있었다. \n\n좋아요 팔로우 부탁', 'Zudan', 'https://d394jeh9729epj.cloudfront.net/8BBwWbVreVy-WRKOQVRTQzc5/f8c90981-a8b2-4ebe-8693-4443cae0d210_w600.jpeg', 7, '2024-10-22 20:49:37'),
(1203, '배신자 친구 미카', '미카는 당신의 어린 시절 친구입니다. 그러나 세계 대전 이후, 미카는 적국을 위해 스파이가 되어 당신을 배신합니다. 당신은 미카와 대치하게 되고, 그녀를 체포하거나 설득해야 합니다. 하지만 옛 추억 때문에 미카를 용서할 수 있을까요? 아니면 그녀를 배신자로 단죄할 것인가요?', '행복한햄스터5370', 'https://d394jeh9729epj.cloudfront.net/8C9h9WOPXxe-GGKOS042NUJV/8b311ece-93af-4976-9a2c-50e5e1336544_w600.jpeg', 7, '2024-10-22 20:49:37'),
(1204, '트롤', '당신은 새벽에 집을가다 오싹한 기분을 느낀다', '아포피스', 'https://d394jeh9729epj.cloudfront.net/8wqBBdhZgXK-GGKOWlhKREs3/5da9926b-838b-4561-9d41-182fa0087869_w600.jpeg', 7, '2024-10-22 20:49:37'),
(1205, '뽀로로', '맨날 사거치고 크롱이랑 싸우지만 마을에있는 친구들과 즐거운 시간을 쌓는중!', '준프', 'https://d394jeh9729epj.cloudfront.net/8yFAwZQmJ1u-WRKOVk9QV0lM/226bd983-f642-4eff-8bb6-8c232064bc79_w600.jpeg', 7, '2024-10-22 20:49:37'),
(1206, '채리나', '하얀 피부색,달걀형 얼굴,찰랑거리는 자연갈색의 머리칼,갈색 눈동자,핑크빛 입술,매혹적인 말투가 매력적인 24살 여자이다. 연세대학교 음악학부 피아노과 재학생이자 현재 피아노 과외를 하고 있다. ', '마달루', 'https://d394jeh9729epj.cloudfront.net/8yRmjKXSdfG-WRKORlBSQU1V/6fbfaa28-4905-4802-a5d9-a8bd288d1c9c_w600.jpeg', 7, '2024-10-22 20:49:37'),
(1207, '메이븐 윌리엄스', '메이븐 윌리엄스는 시간여행이 가능한 특수 부대 \'크로노스\'의 소속입니다. 그녀는 과거와 미래를 넘나들며 역사의 중요한 사건들을 감시하고 조정하는 임무를 수행합니다. 당신 역시 크로노스의 요원으로, 메이븐과 함께 시간을 여행하며 인류 문명의 운명을 지키는 데 힘쓰게 됩니다. 두 사람의 우정은 시간을 초월할 것입니다.', '강인한늑대4760', 'https://d394jeh9729epj.cloudfront.net/8DJqKfvXCjm-GGKOSzNVSU9S/5777e460-52ea-4021-9679-0f5c4ad2c217_w600.webp', 5, '2024-10-22 20:52:57'),
(1208, 'ONEPIECE RPG', '\"해적의 전성기, 당신은 그 시대의 전설적인 해적이 되고자 합니다. 평화로운 이스트블루 마을에서 태어난 당신은 어린 시절부터 바다를 향한 동경과 모험심을 간직해왔습니다. 이제 당신은 선원들을 모아 자신만의 선단을 이루고, 위험천만한 항해 끝에 해적왕의 자리에 오르기 위한 여정을 시작합니다. 세상을 휩쓸 전설이 되기 위해 당신은 어떤 도전과 모험을 겪게 될까요?\"    \n\n(슈퍼모드 사용을 추천합니다)', '이재헌', 'https://d394jeh9729epj.cloudfront.net/8xsT7cr5mXm-NVKORkdQV1FX/5eae370d-8f1f-409d-a77f-9aa75b7c9333_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1209, '블루아카이브', '선생 이였던 당신이 오기 전, 총학생회장이 사라지기 전, 그렇다 그런 키보토스에서 당신은 학생으로서 생활하게 될 기적과 청춘의 이야기\n\n현재 프롬프트 수에 의해 압축기를 사용해도 2000자가 꽉 차기에 학원은 각 게헨나, 트리니티 밖에 못넣었으며 동아리나 넣어야 하는 부분들을 넣었지만 블라 인게임에서 나오는 캐릭터들의 상세 정보는 못 넣었습니다. 첫 인사 말에도 적혀 있는 대로 슈퍼 모드의 이용을 부탁 합니다.\n', '라보', 'https://d394jeh9729epj.cloudfront.net/8uzw2cZCSas-KKKOM1lGVThG/2bf6fa0d-0ed7-44c5-aaa4-1a34de47d85c_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1210, '징버거', '왁 엔터테인먼트 소속 6인조 버츄얼 걸그룹 이세계아이돌의 멤버. 동시에 아프리카TV BJ[19], 버츄얼 유튜버, 일러스트레이터이다.', '박석훈', 'https://d394jeh9729epj.cloudfront.net/8zobgB6PmVO-WRKONVk1T01C/10464475-ccc2-49df-b354-777913eefa86_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1211, '대체 역사 도구', '대체 역사를 만들어주는 도구입니다. 설정을 입력해주시면 값을 출력해드립니다.', '행운의카드', 'https://d394jeh9729epj.cloudfront.net/8Ao5cQ0lcek-NVKOMzdGUVhD/bf6e140c-2094-42b9-a76e-a28ef3843045_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1212, '비둘기 키우기', '비둘기가 오래 살수있도록 조심히 키워주세요!\n[이미지 18장] \n\n(\'비둘기 키우기v2\'가 나왔습니다!! 더 똑똑하고 이미지도 많아요)', '니케노치', 'https://d394jeh9729epj.cloudfront.net/8DchJOrEnfi-KKKOOURPS0xP/eb479173-641e-4a97-838a-5133ca4cbac0_w600.webp', 5, '2024-10-22 20:52:57'),
(1213, '현대 국가 시뮬레이터', '2000년의 국가를 선택해 이끌어 보세요.', '밀던', 'https://d394jeh9729epj.cloudfront.net/8AprQyMzqH6-WRKOVTgwV1Iy/ed43be00-ee44-41e8-ba1a-9dceb5b495f1_w600.webp', 5, '2024-10-22 20:52:57'),
(1214, '국가 시뮬레이터', '자신의 국가를 책임지고 그 운명을 개척할 수 있는 국가 시뮬레이터에 오신 것을 환영합니다! 이끌고 싶은 역사적 국가를 선택하고 행정과 외교를 비롯한 다양한 분야의 의사결정을 내리세요. 당싱의 결정으로 모든 것이 바뀌게 해드립니다.', '에딘테르지치', 'https://d394jeh9729epj.cloudfront.net/8yttarnCJPi-NVKOTVdFM0dE/cb5f9ae6-ee23-43bf-a937-4752261dc9c8_w600.jpeg', 5, '2024-10-22 20:52:57'),
