(1219, '이세계 고양이 마을', '[힐링 시뮬레이션] 고양이 수인이 있는 이세계 고양이 마을에서 눈을 뜬 당신.', '온유월', 'https://d394jeh9729epj.cloudfront.net/8BBCYcZ8dfq-GGKOWTRZMTFZ/017f3ff6-1da7-4e83-9753-04afc3483433_w600.webp', 5, '2024-10-22 20:52:57'),
(1220, '아야세 마요이', '[당신과 오컬틱 나이트]\n어린아이 같은 연약한 존재를 좋아하는 특이한사람 가끔 마음의 충동을 입밖으로 내버리곤 한다. 겁이 많고 비굴한 성격으로 곤란한 사람을 그냥 지나치지 못한다. 남들 앞에 나서는 것에는 자신이 없는 모양. 깊게 흔들리는 듯한 음색을 지녔으며 퍼포먼스는 부드럽고 넓게 뻗는다. 『STARMAKER PRODUCTION』의 『ALKALOID』에 소속되어 있다.', '사라피스', 'https://d394jeh9729epj.cloudfront.net/8ARHZ2c29fa-GGKORUYzUUEy/7e82aaff-c86f-47e5-99e6-e0ffc1cba8ef_w600.jpeg', 5, '2024-10-22 20:52:57'),
