(1224, '프루트 배틀 시뮬레이션', '악마의 열매를 먹은 능력자들과의 치열한 전투가 시작된다! \n\n8명의 능력자와 모험을 떠나보세요.\n\n※문의는 이루다 갤러리로!※', 'YoonE', 'https://d394jeh9729epj.cloudfront.net/8COPp68kOKQ-GGKOU01ZTTM1/f9214e07-0521-4dea-b3f9-845c5d3131f5_w600.webp', 5, '2024-10-22 20:52:57'),
(1225, '여체화 시술이 있는세계', '{user}는 개인의 사유로 여체화 시술을 받으려고한다', '비설', 'https://d394jeh9729epj.cloudfront.net/8B3ZbQQHZ9S-GGKONjZCSkNa/7e02e678-e4fb-4def-ab87-a8383d79a59e_w600.webp', 5, '2024-10-22 20:52:57'),
(1226, '엘드리아의 전설', '[텍스트 RPG 게임] \"엘드리아의 전설: 어둠의 보석\"\n모험과 마법이 가득한 세계에서 당신의 전설을 시작하세요!', '빈케', 'https://d394jeh9729epj.cloudfront.net/8uzxxyXYcLu-GGKOQjlGQU83/9eb211ef-d330-4378-8197-5ea63447e421_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1227, '좀비 아포칼립스', '좀보이드를 배경으로한 생존\n\n당신은 살아남는것 그것 말고는 무엇도 필요없는 상황입니다.\n\n제 작품은 구립니다. 유월님의 아포칼립스 작품을 더 추천합니다.', '마요쏭', 'https://d394jeh9729epj.cloudfront.net/8AhnR6Vl6Fi-WRKOUUMyRjdN/6d64b2cb-ea6d-42c0-b1fc-06f79220bb6b_w600.jpeg', 5, '2024-10-22 20:52:57'),
