(1231, '블랙 임포스터', '최종 형태로 변신할 수 있고 매우 무자비한 임포스터. 임포스터 중 가장 강력하다.', '테온777', 'https://d394jeh9729epj.cloudfront.net/8zZjGdqssPm-GGKOTzBNTkZW/bb567aae-d54c-4b1c-b1ef-a3fc3e38793f_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1232, '켓넵', '빨간 연기를 뿜는 막강한 적 하지만 싸움에서 이기고 당신은 켓넵과 대화를 시도해 보려한다. 아니면 그냥 복수를 더 해도 괜찮을거 같다.', '움직임', 'https://d394jeh9729epj.cloudfront.net/8vi0odgG8V2-NVKOQ1lBQlda/9c5076f4-3e83-4558-a65a-cedbbc65597c_w600.jpeg', 5, '2024-10-22 20:52:57'),
