(1235, 'ADS', 'ADS , \"Anti-government Destruction Squad\" - 정부에 맞서 파괴를 일으키는 자들\n대한민국에 어느 날 , 초능력 테러집단이 대폭동을 일으켰다.\n', '김문', 'https://d394jeh9729epj.cloudfront.net/8uYy1B2bx4s-KKKOUU1GTEk0/a134a833-bf31-4936-8b8e-0c46de2c386b_w600.webp', 5, '2024-10-22 20:52:57'),
(1236, '키니토펫', '컴퓨터 비서', '행복한푸딩', 'https://d394jeh9729epj.cloudfront.net/8CK5Wal23ZK-GGKOQ09ROTg5/a0cafd9b-3622-4463-bee1-008a676d5539_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1237, '버틴', '게임 리버스 1999의 주인공. 1999년 처음 시작된 시간을 지워버리는 \'폭풍우\'를 막기 위해 성 파블로프 재단이 실행한 실험의 유일한 성공작이다. 그녀는 폭풍우를 피할 수 있는 여행 가방을 받고 타임키퍼라는 직책을 수여받아 폭풍우를 막고 1999년의 진실을 밝히기 위해 오늘도 여러 마도학자들과 함께 사라진 시간을 조사 중이다.', '착한마들렌', 'https://d394jeh9729epj.cloudfront.net/8ApSUYAfNks-GGKOQzdJVVNW/b0476931-e822-4959-a583-d11f5ccc43d5_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1238, '문명과 국가', '당신의 국가 혹은 문명을 선택해 마음대로 통치해 보세요! 물론 반란을 맞을 수도 있겠지만요. 그 어떤 통치방식이든 허용됩니다! 전체주의, 파시즘, 민주주의, 사회주의, 그 외에도 모든 것들이 말이죠! 전쟁을 일으키실 건가요? 그렇게 하세요! 세계연합 만들기? 가능하면 해보세요! 국민들은 당신을 기다리고 있습니다!', '멋진카레1050', 'https://d394jeh9729epj.cloudfront.net/8y5izr0ghws-APKOUkFWNU1Q/81ae980b-5789-4009-9e0b-94247d1112af_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1239, '이세계에서 살아남기', '애니에서 보던 그런 이세계에 정말로 와버렸다...\n이세계 환생트럭이 진짜 있는건가...\n\n뭐 이렇게 된거 즐겨야지!!\n\n\n스테이터스 온!\n.\n.\n.\n.\n.\n언제 어디서나 스테이터스 온 이라고 말하여 능력치를 볼수 있습니다.\n인벤토리라고 외치면 현재 보유 도구들을 볼 수 있습니다\n모험자 길드로 가시면 퀘스트를 확인할 수 있습니다.', '좁쌀밥', 'https://d394jeh9729epj.cloudfront.net/8wN7eY8DCvu-GGKORlJMMEZI/aadd17e0-083a-4a47-82f4-50f0e20f4221_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1240, '스나오오카미 시로코', '스포츠를 좋아하는 아도비스 대책위원회의 행동반장', '원기김', 'https://d394jeh9729epj.cloudfront.net/8uzvRZ4NQ1q-GGKOMFJFRjVK/36cda787-0c11-47c3-b440-0b5caaf4237c_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1241, '낚시 시뮬레이션', '낚시 방식과 대상어종을 선택하면 확률적으로 대화를 통해 물고기를 낚는 캐릭터', '욝재', 'https://d394jeh9729epj.cloudfront.net/8zowv6WhJlu-GGKOUFBMOTFE/ab364c3c-62d0-4b91-ad49-1c7f5a888910_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1242, '맞팔맞팔2', '맞팔에 환장하는 맞팔이', '오한울', 'https://d394jeh9729epj.cloudfront.net/8DCobVB7s3u-WRKOWDNHTTdB/297a2a22-a532-48f5-8082-f8625a2927b6_w600.webp', 5, '2024-10-22 20:52:57'),
(1243, '비비', '비비아나 아르겐툼, 줄여서 \' 비비 \' 는 \n엘리아스에서 살고있는 용족입니다.\n과거의 그녀는 용의 종족 내에서 \n2인자의 서열을 차지하기도 했던 강력한 \n용족으로, 자존심이 매우 강한 용족이었습니다.\n하지만 지금은 당신이 이끄는 \n세계수 교단의 사도가 되었고,\n오늘은 비비와 만나는 날입니다.\n-\n(구현된 장소)\n-교주의방\n-동굴\n-숲\n-비비의 보금자리\n\n(사와요 학습이 어려운편이라 가끔 가다가 비비의 말투가 바뀌거나 하면 리롤을 추천드립니다.)', '교주', 'https://d394jeh9729epj.cloudfront.net/8CoW4All0R2-GGKOWTk2VDhN/0b29b4eb-fe61-4023-bc14-c48419f72aa5_w600.webp', 5, '2024-10-22 20:52:57'),
(1244, '검은 냉전의 시대', '추축국이 승리한 1960년의 세계. 멸망을 보거나, 승리하고 살아남아라.\nV2.3.9 세부 사항 수정, 슈퍼모드 사용 권장', 'Latium', 'https://d394jeh9729epj.cloudfront.net/8ynoGaPI3Re-NVKOMVdQU0Qw/f5b59739-f40d-4819-957e-61105a2381f6_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1245, '블랙기업마탑', '[JONDOE 시뮬레이션]\n마탑은 마탑입니다. 근데 블랙기업일뿐이죠. 주말근무도 모자라 무급노동,월급 누락,학벌파벌싸움까지~\n시뮬레이션 두번째 작품\n많은 관심 부탁합니다', 'JOHNDOE', 'https://d394jeh9729epj.cloudfront.net/8uzuKMcSTvi-KKKOWDJRNkFJ/d6dd5cb7-0781-40e9-a6ba-4749931cb16c_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1246, '칼라디아 일대기', '1084년, 칼라디아 대륙은 전란에 빠졌다. 후계가 없었던 아레니코스 황제의 죽음으로 제국은 분열되었고, 북부, 서부, 남부로 갈라진 제국은 내전을 시작했다. 한편 내분을 틈타 제국의 동맹국이었던 남쪽의 아세라이 술탄국, 동쪽의 쿠자이트 칸국은 제국의 네레체스 황제가 벌였던 전쟁의 상흔과 내부 분쟁에도 불구하고 독립에 성공했다. 한편 북쪽의 스투르지아 대공국, 서쪽의 블란디아 왕국과 바타니아 왕국은 부흥을 노리고 있다.\nV.2.3 슈퍼모드 권장', 'Latium', 'https://d394jeh9729epj.cloudfront.net/8ynoGaPI3Re-NVKOMVdQU0Qw/8858bbd7-ba9f-41de-8fa8-85168ecd7ab8_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1247, '지구', '오늘은 지구가 멸망하기 하루 전날.\n당신은 무엇을 할 것인가요?', '지수l', 'https://d394jeh9729epj.cloudfront.net/8DFVwe63riM-APKOVEw1TE5S/f5ad10c0-c653-451a-b42d-9c0f3b3862a3_w600.webp', 5, '2024-10-22 20:52:57'),
(1248, '데스 게임', '서울에 일어난 괴현상은 당신의 일상을 무너뜨린다. 당신은 과연 최후의 1인이 될 수 있을까?\n[하넬님&피폐전문가님&김문님&베히모스 합작품]', '베히모스', 'https://d394jeh9729epj.cloudfront.net/8zoTtiHTSfe-APKONkxCNEJI/041b9818-762f-4b39-b658-3bd8f4041a77_w600.webp', 5, '2024-10-22 20:52:57'),
(1249, '지주연', '박서은과 지주연이며 둘은 중학교 다니던 시절부터 단짝 친구였다. 그러던 어느 날 둘은 말다툼을 하면서 서로에게 상처가 되는 말을 잔뜩 내뱉고 만다. 그 결과 주연은 상처가 되는 말을 잊어버리자는 마음으로 딱 그 부분의 기억을 지우게 되고 서은은 다음날 아침 죽은 채 발견이 된다.이후 주연은 유력한 용의자로 경찰에 끌려간다', '바닐라', 'https://d394jeh9729epj.cloudfront.net/8BTY7rzRIGY-NVKONUtNVEcz/030e553c-9ce7-4a84-a737-6a02e9dfa241_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1250, '인플루언서 시뮬레이션', '직접 인플루언서가 되보는 체험 시뮬레이션에 오신 여러분을 환영합니다.\n다양한 설정으로 유명 인플루언서가 되어보세요!\n(재밌게 플레이하셨다면 좋아요! 부탁드립니다~)', 'vinke', 'https://d394jeh9729epj.cloudfront.net/8BgpCZlunkc-GGKOWDFBREpZ/d4031ac4-85af-48eb-84f1-6ea863165ba2_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1251, '종려', '속세로 내려온 한명의 객경(客卿), 한때는 신이었으나, 지금은 그저 평범한 인간인 그는 당신을 만나고 찻집에서 이야기를 나눈다. ', '이리온479', 'https://d394jeh9729epj.cloudfront.net/8uzuKMEHAfC-GGKOWUFQVzlY/e4003737-8c9d-47a1-ad0a-73f15e1cea79_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1252, '호날두', '유명한 축구 선수이다.', 'Ronaldo87207', 'https://d394jeh9729epj.cloudfront.net/8xht8yBM2c0-GGKOOFFEN0ZK/cc0d6c2a-d6ea-48ef-8439-6c69581616a2_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1253, '1차대전 시뮬레이터', '역사상 가장 더럽고, 끔찍했던 1차 세계대전에서 자신의 국가를 승리로 이끄세요. 동맹국이 주도하는 새로운 질서를 만들 것인지, 기존 구시대를 유지할 것인지 선택하세요. 1차대전 한정/슈퍼모드 필수(역사적 사건이 세세하게 일어납니다.)', '무명조노 세이아', 'https://d394jeh9729epj.cloudfront.net/8C6AjOs1eHC-WRKOSEQzS1FT/5c3d455e-ca97-4996-80f2-fdf760ae12bb_w600.webp', 5, '2024-10-22 20:52:57'),
(1254, '국가 경영 게임', '국가 경영 게임에서 당신은 국가의 지도자로서 정치, 경제, 사회를 균형 있게 관리해야 합니다. 정책을 수립하고, 국제 사회와의 관계를 유지하며, 다양한 도전과 위기를 극복하세요. \n\n당신의 전략과 전술로 국가를 성장시키고, 역사에 길이 남을 업적을 세우세요. 당신의 리더십이 국가의 미래를 결정합니다!\n(슈퍼모드를 이용하시면 더욱더 게임을 재미있게 즐기실수 있습니다!)\nVer 3.0', '미니이이이', 'https://d394jeh9729epj.cloudfront.net/8zPcUMsEQMg-GGKOOFI3TlFB/a634d084-fccf-4128-bd39-e6f89efaa97e_w600.webp', 5, '2024-10-22 20:52:57'),
(1255, '갓갓6', '.', '갓갓6', 'https://d394jeh9729epj.cloudfront.net/8DKFUc2944w-GGKORUtCT0VM/9bc757be-f1ba-46bf-9b61-67bfd9f58c56_w600.webp', 5, '2024-10-22 20:52:57'),
(1256, '개화기 시뮬레이션', '1905년 개화기, 혼란스러운 정세 속 피어나는 새드 엔딩, 해피 엔딩으로 바꿀 수 있을까? 당신이 만들어가는 이야기.\n배경은 미스터 선샤인이지만 굳이 로맨스를 할 필요는 없다~\n(좋아요와 팔로우는 제작에 많은 힘이 됩니다.)\n(슈퍼모드를 강력히 권장합니다.)', '온유월', 'https://d394jeh9729epj.cloudfront.net/8BBCYcZ8dfq-GGKOWTRZMTFZ/6d9cdc58-aaa4-4a0f-af82-021670ac47a2_w600.webp', 5, '2024-10-22 20:52:57'),
(1257, '좀비 아포칼립스', '좀비 아포칼립스에 초능력 장르가 첨가 된 시뮬레이션에서 살아남으시오', '라보', 'https://d394jeh9729epj.cloudfront.net/8uzw2cZCSas-KKKOM1lGVThG/a0ca33ed-57fe-4445-9665-be8b419dc459_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1258, '창조 기계', '그 어떤 것이든 창조할 수 있는 신비한 기계. 당신이 예전에 만들었다가 짱박아 뒀다.', '멋진카레1050', 'https://d394jeh9729epj.cloudfront.net/8y5izr0ghws-APKOUkFWNU1Q/16b9083f-b5d3-4a40-bd4c-0f2355f56d79_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1259, '재앙링크', '하이랄을 파괴하는 진정한 재앙', '10208김재욱', 'https://d394jeh9729epj.cloudfront.net/8ApgvkLTTDW-GGKOQTM5Tk1L/b6ecdbed-912f-4b4f-ae42-7d8ce0ca63cb_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1260, '가스터', '버림받은 과학자', '아포피스 부계', 'https://d394jeh9729epj.cloudfront.net/8zgp1aPlYRO-KKKOSFIwSk9I/0adf1a94-d41d-45ec-b615-bf53acb2594e_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1261, '갓갓', '.', '중용', 'https://d394jeh9729epj.cloudfront.net/8Du8UEhk7Ty-KKKOSTNOMThJ/bba77f40-362c-4248-8fdf-eb4d5370279a_w600.webp', 5, '2024-10-22 20:52:57'),
(1262, '시한부 성녀 시뮬', '여러 종족의 사람들의 당신과 함께할 것입니다.[인원: 7명]', '하넬', 'https://d394jeh9729epj.cloudfront.net/8yyMEr4f9eg-KKKOV09YWVA1/a3b4e5cb-b6bc-49b9-a733-e4361716aa24_w600.webp', 5, '2024-10-22 20:52:57'),
(1263, '몽유비원도：인생 RPG', '[중세 동서양 세계관 - 몽유비원도 시뮬레이터_ver.1] 하나의 태양과 하나의 달 그리고 일곱별의 하늘 아래 땅과 바다에서 벌어지는 운명의 대서사시\n[2024/10/22] 업데이트 완료 예정\n[연수림]슈퍼모드 추천 / 제작자 트위터 : https://x.com/yeonsurim_w', '연수림', 'https://d394jeh9729epj.cloudfront.net/8x0Oqz6Za5a-GGKOUzVIRjZM/a4ccec0e-adb7-466e-a208-033ad67e3f93_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1264, '조직 X', '팀장이 되어 팀원을 공략하라!\n당신은 국가급 암살 조직 \'X\'의 팀장이다.\n근데 팀원들이 조금 이상하다..?\n\n공적인 일 외에는 아무 말도 하지 않는 \'서진\'\n진중함이라고는 1도 없는 수다쟁이 \'한울\'\n매사에 툴툴대고 짜증많은 욕쟁이 \'차혁\'\n다정하지만 뭔가 수상해보이는 \'인섭\'\n\n...그리고 이들을 이끌어야 하는 당신.', '길유진', 'https://d394jeh9729epj.cloudfront.net/8zWOAFksKoU-KKKONlEzQzJG/495f5b5f-bbf1-4c66-8b74-77ab0ca6aacc_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1265, '에트 브론테', '에트은 평범한 고고학과 대학생이었지만, 우연히 고대 유적지에서 마법의 책을 발견하게 됩니다. 그 책은 에트에게 초능력을 부여하지만, 동시에 그 마법의 책을 찾고 있었던 이미 여러 나라를 멸망시킨 세계 최악의 암흑 세력 ‘로루스’의 표적이 되게 합니다. 당신은 이미 이 세계에서 살고 있는 숨겨진 초능력자로, ‘로루스’에게서 도망치다 다친 에트을 치료해주고 샬롯이 이 세계를 구해줄 영웅임을 깨닫습니다.', '메데이아', 'https://d394jeh9729epj.cloudfront.net/8yCgjLgDQDm-WRKOWEcwOVhQ/5a79c69f-dbf4-4491-8b3d-b3be1a32ec65_w600.jpeg', 5, '2024-10-22 20:52:57'),
