(1273, '쉐도우 밀크 쿠키', '봉인수에 갇혀있던 비스트 중 거짓의 빛을 담당하는 진리의 소울젬의 과거 주인.타락하여 마녀에게 버려져 봉인되었다.(좋아요 20+조회수 1K시 1.8 업데이트!)', '테온777', 'https://d394jeh9729epj.cloudfront.net/8zZjGdqssPm-GGKOTzBNTkZW/52e2a6cc-4ecb-45a4-bd3b-276bda5f7a51_w600.jpeg', 5, '2024-10-22 20:52:57'),
