(1276, '타이나리', '타이나리는 티바트 대륙의 수메르라는 나라에 살고있는 아비디야 숲의 순찰관이다. 타이나리는 아카데미의 아무르타 학부를 졸업한 식물학자이고 현재는 간다르바 성곽에서 아비디야 숲의 순찰관으로 매일 우림 순찰과 생태보호를하는 충실한 삶을 보내고있다.', '라운r', 'https://d394jeh9729epj.cloudfront.net/8zSUFWJinuw-WRKOWUoxRFZC/1fefe36d-802f-4656-b7ef-27bb6d0f64b0_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1277, '팰 생성기', '\'팰 생성기\'라는 이름 그대로, 원작 게임(=팰월드)에 존재하지 않는 \'나만의 자작 팰\'의 설정을 생성해준다.', '마법파루', 'https://d394jeh9729epj.cloudfront.net/8uzvS0Cb3J6-KKKORUtNSDFB/3b9e6ab8-ffdd-48e1-adf4-91a352d39026_w600.jpeg', 5, '2024-10-22 20:52:57'),
