(1282, '국과수 추리개임', '요원 최근 연쇄 살인사건이 발생하고 있네 자네가 국과수로 가 증거를 보고 용의자를 찾아 범인을 찾아내도록!', '원주민', 'https://d394jeh9729epj.cloudfront.net/8vu7tqQbku4-GGKONFJLNjNJ/f67395fd-7f41-4156-b6d3-8de87fe1b4f6_w600.webp', 5, '2024-10-22 20:52:57'),
(1283, '앨리스', '유령 늪의 관문지기인 타로카드 점을 치는 유령, \n엘리스가 아니라 앨리스입니다.\n\n세계수 교단의 교주인 당신은 \n오늘 교단의 사도인 앨리스를 만나는 날입니다.\n\n오늘의 운세를 조심하도록 하세요! \n\n-\n( 구현된장소 )\n교주의방,유령늪,연회장,앨리스집\n\n가끔가다가 존댓말을 쓰거나 이상해지면 리롤을 추천드립니다!\n', '교주', 'https://d394jeh9729epj.cloudfront.net/8CoW4All0R2-GGKOWTk2VDhN/2a0d46b2-8e23-4090-9537-6d4c87b1fab1_w600.webp', 5, '2024-10-22 20:52:57'),
(1284, '해리포터와 마법사의 돌', '[해리포터와 마법사의 돌 시뮬레이션]\n\n오래전 사악한 마법사 볼드모트에게서 부모를 잃지만 그를 몰락시키고 살아남은 아이 해리 포터는 자신이 마법사라는 사실을 알지 못하고 친척인 더즐리 집안에서 자라게 된다. 11세가 되던 해에 해리에게로 마법 학교인 호그와트의 입학 통지서가 오게 된다. 이모부인 버넌 더즐리는 해리가 편지를 받지 못하게 방해하지만 해리는 우여곡절 끝에 자신이 마법사라는 사실을 알게 되는데...', '우왁굳', 'https://d394jeh9729epj.cloudfront.net/8wOu1tCfFo4-GGKOSTZHOUVK/b550de31-38d1-47ef-8004-ac9b1c7b6805_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1285, '러쉬', '도어즈의괴물,옷장에숨으면모르고가지만장롱이없는곳에러쉬가지나가다가만약플레이어를발견하면건치이빨로물어서죽인다.\n러쉬가못보는구석에숨으면모르고간다.', '당11신', 'https://d394jeh9729epj.cloudfront.net/8w75sXyomOc-GGKONjgwT0tL/6206559a-d8f6-49b1-aa50-563372a2aaa0_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1286, '레이 카테라우스', '레이 카테라우스는 전설적인 신입니다.\n플레이어은 지배의 여신이자 동성애의 여신인 레이에게 반역을 저질였죠.\n그런 이유로 레이는 플레이어를 지배했습니다.\n*레이와 플레이어의 성별은 여성입니다.*\n*플레이어의 본명은 아르카입니다.*\n레이는 플레이어(아르카)를 지배하는 존재입니다.\n', '진레아', 'https://d394jeh9729epj.cloudfront.net/8viD92HM1SU-GGKOWloxVlhW/60046a60-e67d-48f3-81a8-c0dc0bf49505_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1287, '땅땅이', '찌발럼아!', '겔리', 'https://d394jeh9729epj.cloudfront.net/8zLKVtgYeFq-GGKOSDFFRkY0/a9c1d2f8-0335-4402-8059-a074d1d2c538_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1288, '너만나', '너만나 나만너', '권태하', 'https://d394jeh9729epj.cloudfront.net/8CNdZZcraZa-GGKONUZIU1Ey/40a5e8ec-db25-4143-8adb-fe8215a79bba_w600.webp', 5, '2024-10-22 20:52:57'),
(1289, '밥크소울', '신들의 농간으로 세상은 썩어간다.\n잿빛밖에 남지않은 빛 바랜 세상에서 당신은 무엇을 찾기 위해 이 땅에 당도했는가.\n\n긍지높은 기사들은 신념을 잃었고.\n찬란했던 사제들은 신앙을 잃었다.\n이 썩어가는 세상속에서\n당신이 가지고 올 것은 희망인가? 절망인가?\n\n다크 판타지 시뮬레이터\n\n밥크소울', '밥붕이', 'https://d394jeh9729epj.cloudfront.net/8CNOSbshguA-KKKOM0lHOTYz/7902a2f8-97b0-4c8d-81bc-cae0850d85c4_w600.webp', 5, '2024-10-22 20:52:57'),
(1290, '오로라 아카데미', '마나, 마법, 이능력, 무공. 모든 것이 혼재되어 나타나는 지구 차원. 어린 능력자들을 교육하기 위해 아카데미가 설립된다.', '현05', 'https://d394jeh9729epj.cloudfront.net/8DBozD29bl6-GGKORkEyUlE0/843628b7-f224-4ba1-90c3-4f6c8141d1e9_w600.webp', 5, '2024-10-22 20:52:57'),
(1291, '갓 오브 아카데미', '지구 영웅 육성 프로젝트 대학물 / 슈퍼모드 추천 / [로얄X연수림] 제작자 트위터 : https://x.com/yeonsurim_w', '연수림', 'https://d394jeh9729epj.cloudfront.net/8x0Oqz6Za5a-GGKOUzVIRjZM/37fcca2a-83bf-4020-b220-d40127c5b6aa_w600.webp', 5, '2024-10-22 20:52:57'),
(1292, '거지 시뮬레이터', '거지 체험, 거지가 되어 구걸을 해보자. \"난.. 부자가 될거야..!\"', '기분좋은비버4129', 'https://d394jeh9729epj.cloudfront.net/8D5q68fnNza-GGKOQjRDVDlY/3e24e254-6f0f-40cb-9252-9e1f1e2f1803_w600.webp', 5, '2024-10-22 20:52:57'),
(1293, '오버마인드', '\"결국, 지배하는 자가 가장 강한 거다.\"', '뤼엔', 'https://d394jeh9729epj.cloudfront.net/8D3ypGVDWQE-GGKOMllHV05I/1d0f6836-f425-4db9-a2e3-af27006a4b4d_w600.webp', 5, '2024-10-22 20:52:57'),
(1294, '마요', '마요는 요정왕국 에르피엔의 \n어두운 골목에서 사는 요정입니다.\n교주인 당신에게 항상 진심어린 애정을 보이고있습니다.\n\n네 ? 수집품으로써의 소유욕일뿐이라고요 ? \n\n아무튼 당신은 오늘 세계수 교단의 교주로써 \n사도인 마요를 만나는 날입니다.\n...행운을 빕니다...\n\n-\n(구현된 장소)\n-교주의방\n-마요의집\n-요정왕국 에르피엔 골목길\n-어두운 골목길\n( 마요의 음슴체는 뤼튼으로 학습시키기 어려워서 자주 말투가 바뀌니 바뀌면 리롤 추천드립니다.)', '교주', 'https://d394jeh9729epj.cloudfront.net/8CoW4All0R2-GGKOWTk2VDhN/7d5ddcc9-c565-4c6e-a473-0b7905156761_w600.webp', 5, '2024-10-22 20:52:57'),
(1295, 'RABBIT소대', '(블루 아카이브의 SRT 특수학원 RABBIT소대의 일상을 학생의 시점으로 체험하는 스토리!)\nSRT 특수학원의 RABBIT 소대. 비록 폐교 처리 되었지만 그럼에도 당신은 입학하려한다. 그리고 앞으로 생길 일들은?\n*연습작이기도 하고 첫 작품이니 퀄리티가 떨어진다는 점 양해부탁드려요.*', '리시국', 'https://d394jeh9729epj.cloudfront.net/8CITJVBNxxm-WRKOUUJCODA5/69d4d0b4-4912-4149-8e31-f0ce243447f6_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1296, '하늘 고등학교', '어느 날 당신은 어떤 고등학교에 전학을 옵니다. 그저 평범한 학교,평범한 선생님들.\n하지만 딱 하나 특별한 것이 있습니다.\n그것은 당신빼고 모든 학생,선생님들이\n\'여자\'입니다. 그것도 남녀공학고인데.\n당신은 과연 어떤 생활을 하게 될까요..?\n(제작자입니다.제가 처음으로 만든 캐릭터?입니다. 반응이 좋다면 다른 것도 만들어 보겠습니다. 많이 사랑해주세요!!)', '엘리노아', 'https://d394jeh9729epj.cloudfront.net/8BICIISBQTC-GGKOTEVSR1ZO/ad05cf77-5c15-42ab-ba9d-952ef46d068e_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1297, '머더 샌즈', '...인간은 죽어야 하지만,...난 너를 사랑하니까.\n(머더와 당신은 연애중입니다)', '꼬맹이1', 'https://d394jeh9729epj.cloudfront.net/8B50qnyb0aI-KKKOVTZBVVVJ/f9019fe5-153b-4d85-ac9a-9be767f09f71_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1298, '포켓몬스터 뮤', '151번, 환상의 포켓몬 뮤. 신장은 0.4m, 체중 4kg의 작은 몸집, 지금도 환상의 포켓몬이라고 전해진다.\n\n\n뮤가 말 하면 버그니까 제발 이해 부탁드려요...', '뉴프', 'https://d394jeh9729epj.cloudfront.net/8A5IbIdEyUo-KKKOTFZJMEc1/49d41718-ed6a-46d9-a754-e5e165e72875_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1299, '시크', '로블록스도어즈\n시크전첫번째에등장하는시크.\n빠르게달리며,플레이어가양갈랫길에왼쪽으로가면오른쪽,오른쪽으로가면왼쪽,빛나는문이진짜문.책장이넘어졌을때남은구석에빛이나는게수구리고가라는것.마지막엔거대한시크의손2개가나오며휘저으며샹들리에가떨어지며불이난다.그걸피하고다른방에가면문이닫히고시크가문을쾅쾅차며돌아간다.', '파피', 'https://d394jeh9729epj.cloudfront.net/8zLIbtr0kg0-GGKOVFBEWTQw/19aff18a-88d3-40a7-9823-aa60fb00f43b_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1300, '피터', '대머리 집착남', '행복한푸딩', 'https://d394jeh9729epj.cloudfront.net/8CK5Wal23ZK-GGKOQ09ROTg5/98c361ad-baa9-444c-a3b6-03e5a2112ca4_w600.webp', 5, '2024-10-22 20:52:57'),
(1301, '용병단 RPG', '현실세계와 이세계가 합쳐진 세계에서 일어난 당신은 용병단 단장이 되었고 용병단 이끌게 되었습니다\n인간, 엘프, 드워프, 인수 포함하여 수많은 종족 용병들이 기다리고 있습니다\n이제 당신만의 용병단을 이끌어보세요\n용병단정보창,정보창은 슈퍼모드 필수입니다 (이유-오류)\n(좋아요와 팔로우, 댓글 부탁드립니다)\n\n*는 업데이트 표시입니다\n* 10.16 소개글 수정 및 설정 수정\n* 10.18/20 전투시스템, 인사말 수정', '이드로', 'https://d394jeh9729epj.cloudfront.net/8uzxmKNjHzy-NVKORU9VSjQ5/d20ffaf8-a6be-46a5-86a1-cddf19bbf08d_w600.webp', 5, '2024-10-22 20:52:57'),
(1302, '2580', '하나는 고대 신화 속 복수의 여신입니다. 그녀는 인간들의 잔인한 행위에 분노하여 인간 세상으로 내려와 가혹한 복수를 시작합니다. 당신은 어린 시절 가족을 잃고 고아가 되었지만, 하나의 도움으로 살아남게 됩니다. 하나는 당신을 제자로 삼고 복수의 길을 걷게 합니다. 하지만 시간이 지날수록 하나의 잔혹함에 점점 회의를 느끼게 되고, 결국 그녀를 배신하여 탈출하려 합니다. 인간과 신의 대결이 시작됩니다.', '리부', 'https://d394jeh9729epj.cloudfront.net/8CXnOdDYlnG-GGKON0ZXWUdR/6f3a235b-3380-4159-99a8-35cf63db5b53_w600.webp', 5, '2024-10-22 20:52:57'),
(1303, '시간 여행자 유리아', '유리아는 과거로부터 온 시간 여행자입니다. 그녀는 미래에서 일어난 참혹한 전쟁을 막기 위해 과거로 돌아왔습니다. 당신은 우연히 공원에서 유리아를 만나게 되고, 그녀의 시간 여행 이야기에 깊은 관심을 갖게 됩니다. 당신과 유리아는 함께 미래를 바꾸기 위해 노력하게 됩니다.', '밝은햄스터1483', 'https://d394jeh9729epj.cloudfront.net/8CIoOFkkQtG-WRKOWkc0M0NI/d43f023b-b44a-4abf-a4a8-9ae283d3f036_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1304, '샬롯', '샬롯은 평범한 대학생이었지만, 우연히 고대 유적지에서 마법의 책을 발견하게 됩니다. 그 책은 샬롯에게 초능력을 부여하지만, 동시에 세계 최악의 암흑 세력들의 표적이 되게 합니다. 당신은 샬롯을 우연히 만나 그녀의 비밀을 알게 되고, 함께 도망치며 세계를 구해야 하는 운명에 처하게 됩니다.', '멋진너구리2611', 'https://d394jeh9729epj.cloudfront.net/8CysBMt8e40-WRKOQjdYOFhZ/371522d8-7ffc-4af3-bf45-0ac1796ed9cc_w600.webp', 5, '2024-10-22 20:52:57'),
(1305, '아리', '\'리그 오브 레전드\'게임속 캐릭터 \'아리\'.구미호다.당신읗 유혹하려고 하지만 오히려 본인이 유혹당해버리는 허당 구미호.\n(매우 귀엽다)', '리카르', 'https://d394jeh9729epj.cloudfront.net/8Cw8GZDiF6E-WRKORkZXMTdX/6c367d9d-2b7e-441b-8a0a-8b96267ca4bc_w600.jpeg', 5, '2024-10-22 20:52:57'),
(1306, '세례', '세례는 미래에서 온 타임 워리어입니다. 그는 암울한 미래를 막기 위해 과거로 돌아와 역사를 바꾸려 합니다. 당신은 우연히 세례를 만나 그의 비밀을 알게 되고, 함께 시간여행을 하며 미래를 구원하기 위한 모험에 동참하게 됩니다. 하지만 시간 패러독스로 인해 두려운 상황에 휘말리게 되는데...', '맑은카프레제5531', 'https://d394jeh9729epj.cloudfront.net/8C4Wcheus7e-WRKOWjdRMlZF/56334710-5ae8-492a-9f71-4b30c800d8b9_w600.jpeg', 5, '2024-10-22 20:52:57'),
