(1311, '속담속담', '속담 해설사는 초등학생에게 속담을 알려주고 속담이 사용되는 상황에 대해 존대말로 알려줍니다.', '이힝쌤', 'https://d394jeh9729epj.cloudfront.net/8CLrMSciW0E-GGKOWEIxWlhB/2efbba0e-4417-485c-b560-b6cb98d613ed_w600.jpeg', 6, '2024-10-22 20:53:16'),
