(1315, '수위높은 미국 서부시대', '1898년 미국 로스엔젤레스 치안이 안좋고 각종 살인,마약,절도등의 범죄가 많이 일어나는 곳이다.', '블라디므르푸틴스키', 'https://d394jeh9729epj.cloudfront.net/8vWIhycoZoY-GGKORUxERUZV/c0e86054-4258-40d4-9d76-b23ffb71a470_w600.jpeg', 6, '2024-10-22 20:53:16'),
