(1324, '스페셜＊과학 실험실', '입자가속기에서 원자를 부숴보고 싶나요? 방사광가속기를 통해 태양 1조배 밝기의 방사광을 만들어보고 싶나요?\n지금 바로 이곳, 스페셜＊과학 실험실로 오세요!\n화합물 제작부터 과학 원리 확인까지, 당신이 원하는 모든 것을 해보세요!\n\n\n해당 시뮬레이션은 단순 재미를 위한 시뮬레이션이며, 실험 결과 입증용으로 사용될 수 없습니다. 해당 시뮬레이션애서 이루어지는 실험 행위는 전문가의 감독 없이, 또한 불법적으로 이루어져선 안 됩니다.', '레귤', 'https://d394jeh9729epj.cloudfront.net/8A61GfgCbss-NVKORUVTRjZD/57d4715a-224f-4a16-b016-c343d5cf994c_w600.webp', 6, '2024-10-22 20:53:16'),
