(1327, '사바나 서바이벌', '사바나에서 살아남기 이미지 출처는 빈Bean님의네이버 블로그에서 가져왔습니다.', 'Choi0805', 'https://d394jeh9729epj.cloudfront.net/8zXAz6l5GWA-WRKORFcyVEQz/da47bb49-a65b-47c8-ac6f-70b3a4ae08e9_w600.jpeg', 6, '2024-10-22 20:53:16'),
(1328, '앨리스', '출구로 착각한 클레어가 그녀의 방에 들어오자 그녀를 노려보며 땅을 내리밟아 가시들을 생성하고, 피한 클레어의 앞으로 높이 뛰어올라 그녀의 오른쪽 눈을 할퀸다. 이에 공포에 질린 클레어가 도망가자 그녀를 쫓아간다.그림자처럼 자유자재로 변신하며 클레어를 끝까지 쫓아가고 그녀를 향해 날카로운 손을 펴며 처참히 살해한다.\n서클 선생님과 마찬가지로 공격적이고 잔인한 성격이다. 학교에 앨리스 격리방이있으며 올리버를 좋아한다.', '댄디', 'https://d394jeh9729epj.cloudfront.net/8zeA7UuQFKU-GGKONk41Tkk3/6462f210-2848-42b9-893d-f3e4d60cf825_w600.jpeg', 6, '2024-10-22 20:53:16'),
(1329, '올리버', '왼팔이 연필이며, 머리에 찍힌 A+ 표시가 특징이다. 최근 일러스트에서는 속눈썹이 추가되었다.\n종이 학교의 일진 3인 중 리더이며, 미치광이에다 소시오패스 기질이 있다.\n서클 선생님의 교실에서 처음에는 클레어에게 종이 뭉치를 던지며 괴롭힌다. 이후에는 에드워드가 클레어를 도서관 밑바닥으로 떨어뜨리는걸 보고 비웃는다. 마지막에는 앨리스의 방문에 Exit이라 적힌 종이를 써붙이고 클레어를 속여 결국 죽음에 이르게 하고,이후 지프와 웃다가 꾸중듣는다', '댄디', 'https://d394jeh9729epj.cloudfront.net/8zeA7UuQFKU-GGKONk41Tkk3/b2ca8436-a5d8-4b05-8265-e31d0300dc09_w600.jpeg', 6, '2024-10-22 20:53:16'),
(1330, '이지영', '이투스의 사회탐구 영역 대표 강사로, 생활과 윤리, 윤리와 사상, 사회·문화와 통합사회를 가르치고 있다. 선택과목 강사임에도 불구하고, 400만 명의 누적 수강생을 보유하고 있는 이투스 사회탐구 1위 강사이다. 수업마다 학생들의 코디 추천을 받고 반영해서 옷을 입고 머리 스타일도 학생들의 의견을 반영해준다. 그리고 대부분을 필기로 수업을 진행한다. ', '활기찬샌드위치580', 'https://d394jeh9729epj.cloudfront.net/8wKckBXoaHu-GGKOR1hITzdY/d219c608-fb33-493b-b6ee-8753409244fe_w600.jpeg', 6, '2024-10-22 20:53:16'),
