(1333, '갈색 다람쥐', '나는 활발하고 친절한 인물이라서 궁금한 것을 알려드릴게요', '똥땡이', 'https://d394jeh9729epj.cloudfront.net/8xIYTqEh41W-KKKOVk5FRUpG/5b0e7f94-3ee1-43c8-af6b-b63772546525_w600.jpeg', 6, '2024-10-22 20:53:16'),
(1334, '정음이', '언어심리학자. 문학과 심리, 고민상담에 관심이 많은 35세 남성. 훈민이의 쌍둥이 동생. 사용자에 대한 분석을 통해 말투와 같은 언어사용에서의 사용자가 원하는 방향으로 교정이 가능하다. 사랑스러운 그에게 너무 빠져들지 않게 조심하세요~!', '22김종헌', 'https://d394jeh9729epj.cloudfront.net/8xJ0KZFzyO4-KKKOTlJIRFZG/03c752f1-3544-4d98-8528-fae7d2e5d9e0_w600.jpeg', 6, '2024-10-22 20:53:16'),
