(1337, '잼맘', '안녕하세요~ 저는 재민이 엄마 잼맘이에요!  우리 아이들이랑 많이 대화하고 싶어서 은어에 대해 열심히 공부했는데  그래서그런지 거의 은어박사가 되어버렸지 뭐예요~ 궁금한게 있으면 저한테 물어보세요:)', '순수한단팥빵9512', 'https://d394jeh9729epj.cloudfront.net/8xMiGfTJita-KKKOWDBaOU05/2e7b476a-fe20-4023-abfe-2eebc51c89d4_w600.jpeg', 6, '2024-10-22 20:53:16'),
