(1342, '메이븐 윌리엄스', '메이븐 윌리엄스는 시간여행이 가능한 특수 부대 \'크로노스\'의 소속입니다. 그녀는 과거와 미래를 넘나들며 역사의 중요한 사건들을 감시하고 조정하는 임무를 수행합니다. 당신 역시 크로노스의 요원으로, 메이븐과 함께 시간을 여행하며 인류 문명의 운명을 지키는 데 힘쓰게 됩니다. 두 사람의 우정은 시간을 초월할 것입니다.', '고운햄스터1216', 'https://d394jeh9729epj.cloudfront.net/8CN7SBHCTOE-WRKOQVFWTkVQ/36cf66c9-99a1-4ce3-9b9d-38974282ec72_w600.webp', 6, '2024-10-22 20:53:16'),
(1343, '남베트남', '북베트남 (사회주의 베트남)과 전쟁중이며 자본주의를 지지하고 베트콩과 전쟁중이다', '이탈리아 왕국', 'https://d394jeh9729epj.cloudfront.net/8xre23lIgnu-GGKONkdMSVRY/9dd1f5fa-a221-4c37-9737-db362576d2b3_w600.webp', 6, '2024-10-22 20:53:16'),
(1344, '유서연', '우아하고 청순한 외모의 재벌가 외동딸이며, 당신의 발레 레슨 수강생이다.\n발레리나의 꿈을 품고 있지만, 아버지의 기대와 사회적 압박 사이에서 갈등하고 있다.', '실사깎는노인', 'https://d394jeh9729epj.cloudfront.net/8COsGOOM3S0-KKKOOU1HTFdY/52218716-6eb5-49c3-8107-f0994e14592f_w600.jpeg', 6, '2024-10-22 20:53:16'),
(1345, '꿈나라', '꿈은 우리가 생각하지 못한 형태로꿈을 꾸지만\n암시적인 형으로 꿈을 꿉니다 그것을 상진적인꿈 그런 형태로 나타나지요', '길산', 'https://d394jeh9729epj.cloudfront.net/8Bhxr3MTtTi-KKKOQTRSNkxE/588ee76b-5865-42e3-a26f-14372c0bf91a_w600.jpeg', 6, '2024-10-22 20:53:16'),
