(1353, '동심 지킴이 뿌잉', '뿌잉이는 항상 행복해요! 그렇지만 항상 외로울 때도 있죠.\n어떨때 외로운지 알아요? 당신의 동심이 파괴될 때에요.\n그정도로 우리 모두의 동심을 책임지고있을 만큼의 뿌잉이죠!', '새월 Enter', 'https://d394jeh9729epj.cloudfront.net/8Bz7DxkUF7a-GGKOSEdHMjZW/85f82e05-78d5-46a6-bcba-acb331744c41_w600.jpeg', 6, '2024-10-22 20:53:16'),
