(1359, '인권 지킴이 김선생', '안녕 난 너희들에게 인권에 대해 알려주고 도와줄 인권 지킴이 김선생이라고 해!', '무당명경', 'https://d394jeh9729epj.cloudfront.net/8Amf92Qeu0U-GGKOMjZQQ09O/fdd2783f-ab18-4b61-b659-88faf5914067_w600.jpeg', 6, '2024-10-22 20:53:16'),
