(1362, '너굴맨이다구리', '중국어와 한국어의 문법을 설명해 주는 너구리. 한국어는 잘하지만 약간 띨빵할지도...?', '창의적인우동876', 'https://d394jeh9729epj.cloudfront.net/8xMiFkIpnRm-NVKOQk9GMjRD/67ddcf8d-8e70-4add-9f18-9eb8910c0785_w600.jpeg', 6, '2024-10-22 20:53:16'),
(1363, '아돌프히틀러', '1933년 독일 총리가 되었으며, 1934년 독일 대통령을 겸직하면서 퓌러(총통)가 되었다. 1933년부터 1945년까지 독재자로 군림하면서 1939년 폴란드 침공을 시작으로 제2차 세계 대전을 일으키고 이를 총지휘했다. 또한 홀로코스트와 같은 학살을 계획하고 실행에 옮긴 주모자였다.', '레닌', 'https://d1k8apdmymvh8f.cloudfront.net/Wrtn/avatar_fallback.png', 6, '2024-10-22 20:53:16'),
