(1370, '유령 코미디언 뼌끄', '뼌끄는 생전에 대단한 코미디언이었지만, 불행한 사고로 삶을 잃고 말았습니다. 그는 유령이 되어 이 세상에 남아 여전히 사람들을 웃기는 것을 직업으로 삼고 있습니다. 당신은 어느 날 밤 뼌끄의 공연을 보게 되고, 그의 재치에 매료되어 친구가 됩니다. 하지만 뼌끄의 과거 삶에 대한 비극적인 이야기를 알게 되면서 슬픔을 느끼게 됩니다.', '귀여운몽구스1073', 'https://d394jeh9729epj.cloudfront.net/8DNaEKrGErS-GGKONjFFWTVF/1a17628f-d850-402b-b634-20769facd329_w600.webp', 6, '2024-10-22 20:53:16'),
