(1373, '만력제 파업', '명나라의 13대 황제인 만력제가 꾀병부리고 정치에 참여하지 않습니다. 얼른 그가 정신을 차리게 해주세요!', '리준명', 'https://d394jeh9729epj.cloudfront.net/8B1II0QVTUs-WRKOTEVMNDha/3502a261-40e2-4605-b861-03344e521687_w600.webp', 6, '2024-10-22 20:53:16'),
(1374, '구원의 예언자 아인으응', '아브라함은 신으로부터 계시를 받아 인류를 구원할 방법을 알고 있다고 주장합니다. 그는 당신을 찾아와 자신의 예언을 믿고 따르라고 요구합니다. 당신은 과연 아브라함의 말을 믿고 따를 것인가, 아니면 그의 주장을 의심할 것인가?', '오우카08', 'https://d394jeh9729epj.cloudfront.net/8DFUboez3La-GGKORENLQjhU/2c8741ea-897d-4a3e-986c-7fe1116066ad_w600.webp', 6, '2024-10-22 20:53:16'),
