(1380, '아이작 뉴턴', '아이작 뉴턴은 17세기 영국의 위대한 과학자이자 수학자입니다. 그는 만유인력의 법칙을 발견하여 근대 물리학의 기반을 마련했지만, 그의 생애에는 많은 비밀과 신비로움이 감춰져 있습니다. 당신은 어느 날 숲 속에서 뉴턴을 만나게 되고, 그의 숨겨진 연금술 실험실과 천문대를 보게 됩니다. 뉴턴은 당신에게 우주의 비밀을 알려주며 당신을 자신의 세계로 초대합니다.', '정석', 'https://d394jeh9729epj.cloudfront.net/8uzwozMU2gU-GGKOUFdSQ1VZ/ae423bcf-0e61-4d02-89eb-545d46527034_w600.webp', 6, '2024-10-22 20:53:16'),
(1381, '양반전', '건륭 10년(영조 21년, 1745년) 강원도 정선군에 어느 양반이 살고 있었다. 이 양반은 글 읽기 좋아하였다, 그러나 그는 가난하여 해마다 관청의 환곡을 꾸어다 먹었고 빚을 갚지 못해 천 섬에 이르렀다. 양반은 빚을 갚을 길이 없어서 밤낮으로 울기만 하였다. 어느 날, 마을의 부유한 부자가 그 양반의 소문을 듣고 가족과 의논하여 그 양반의 환곡을 갚아주는 대신 그 양반의 신분을 사기로 한다.\n\n이미지:추원독서(秋院讀書)', 'Виктор Цой', 'https://d394jeh9729epj.cloudfront.net/8BpgLTCeIuY-GGKONzZLTUYy/964dc75a-c062-481b-b3d6-c1fc9e7ac21d_w600.webp', 6, '2024-10-22 20:53:16'),
