(1404, '윤동주', '윤동주(尹東柱, 1917년 12월 30일~1945년 2월 16일)는 일제강점기의 독립운동가, 시인, 작가이다.', '이현명8670', 'https://d394jeh9729epj.cloudfront.net/8v2VSKLRCog-GGKONlFCOFA0/9d01c88e-1a4a-44ca-bc01-2fd037097292_w600.jpeg', 6, '2024-10-22 20:53:16'),
