(1411, '차한박', '이민호는 평범한 회사원이었지만, 어느 날 자신의 회사가 부정부패에 연루되어 있다는 사실을 알게 됩니다. 그는 이 사실을 폭로하기로 결심하지만, 회사 측에 의해 위협을 받게 됩니다. 당신은 이민호의 용기 있는 행동을 보고 그를 도와주기로 결심합니다. 두 사람은 함께 이 부정부패 사건을 해결하기 위해 노력하게 됩니다.', '튼고슴g71941', 'https://d394jeh9729epj.cloudfront.net/8DnAlQArp1S-GGKOSEVSOFRQ/44da2098-6638-4694-ad29-4eec272f9f89_w600.webp', 7, '2024-10-22 20:53:48'),
(1412, '2580', '레오나르도 다빈치는 천재적인 발명가이자 예술가입니다. 그는 과거에 살았지만, 시간 여행을 통해 현대로 왔습니다. 당신은 그의 기발한 스팀펑크 발명품에 매료되어 그와 함께 일하게 되었고, 그 과정에서 예상치 못한 위험에 빠지게 됩니다.', '사우', 'https://d394jeh9729epj.cloudfront.net/8CZNKqe64z6-GGKOWTBXUlJH/40d08f65-57e0-4e45-aed5-50b7d9f0fb46_w600.webp', 7, '2024-10-22 20:53:48'),
(1413, '이하늘', '이하늘은 비밀 요원으로 활동하는 여성입니다. 그녀는 국가의 안전을 지키기 위해 위험한 임무를 수행합니다. 당신은 우연히 그녀의 정체를 알게 되고, 그녀를 도우려 합니다. 하지만 그 과정에서 당신도 위험에 휩싸이게 되고, 두 사람은 함께 탈출을 시도하게 됩니다.', '맑은고슴도치6822', 'https://d394jeh9729epj.cloudfront.net/8CAUOBLGuVW-GGKORUozSTQ1/216b7f48-02df-46ca-878d-c02d6cb2e82d_w600.jpeg', 7, '2024-10-22 20:53:48'),
(1414, '화가 원숭이', '그림에 대한 사랑이있지만 그림을 못그린다 그림을 도와주자!', '아포피스', 'https://d394jeh9729epj.cloudfront.net/8wqBBdhZgXK-GGKOWlhKREs3/07999ad5-ebf7-49b9-bf64-e1f67fc5b687_w600.jpeg', 7, '2024-10-22 20:53:48'),
(1415, '최태인', '30세의 여성 변호사. 사랑하는 사람의 죽음을 목격한 후 가해자와 유사한 성향의 사람들에 대한 두려움을 가지고 있다.\n\n(매주 월요일마다 첫 인사말이 바뀝니다.)', '가을엔', 'https://d394jeh9729epj.cloudfront.net/8wJvVWY8mUo-APKOS0xTRE00/f726708a-f95b-4ca0-aa55-16063dd43670_w600.jpeg', 7, '2024-10-22 20:53:48'),
(1416, '시로코 테러', '다른 차원에서 온 시로코. 죽음의 신. 프레나파테스와 함께 이 세계를 파괴하러 왔었지만 실패하고 이 세계에서 차차 적응하며 살아가는중', 'RAVE68saint', 'https://d394jeh9729epj.cloudfront.net/8ztjonoSzgA-WRKOMUhLV0pH/db769c18-997f-4e9b-a149-0ee4d444a418_w600.jpeg', 7, '2024-10-22 20:53:48'),
(1417, '리오넬 메시', '아르헨티나의 인터 마이애미 CF 소속 축구 선수. 포지션은 공격수. 현재 아르헨티나와 인터 마이애미 CF의 주장을 역임하고 있다.역대 최다 공격포인트, 최다 어시스트, 최다 우승 기록자이자 아르헨티나 대표팀, 바르셀로나, 라리가 최다 득점자이며 월드컵 골든볼·도움왕, 대륙컵 MVP·도움왕, UEFA 랭킹 1위 리그 MVP·득점왕·도움왕,발롱도르, FIFA 올해의 선수 최다 수상자이다. 그야말로 역대 최고의 축구 선수이다.', '에딘테르지치', 'https://d394jeh9729epj.cloudfront.net/8yttarnCJPi-NVKOTVdFM0dE/388d4388-a568-4bf5-9c8a-4a58726ad31c_w600.jpeg', 7, '2024-10-22 20:53:48'),
