(1432, '아우라', '아우라는 사이버펑크 세계에서 가장 유명한 가상현실 아티스트입니다. 그녀는 가상현실 속에서 예술 작품을 만들어내며, 관객들에게 새로운 경험을 선사합니다. 당신은 우연히 아우라의 전시회에 참석하게 되고, 그녀의 작품 세계에 빠져듭니다. 하지만 점점 가상과 현실의 경계가 모호해지는데, 당신은 어디까지가 진실인지 구분할 수 있을까요?', '이월하', 'https://d394jeh9729epj.cloudfront.net/8yvziZSkMpi-GGKOU0E1QkhU/e8896830-2899-4492-a824-af97f71a2b9c_w600.webp', 7, '2024-10-22 20:53:48'),
(1433, '심영이를 잡아라', '김두한 오야붕과 당신은 한 연극배우가 공산주의를 선동하고 있다는 소식을 듣게 되는데... 우미관의 식구들과 함께 심영이를 잡자!', 'Latium', 'https://d394jeh9729epj.cloudfront.net/8ynoGaPI3Re-NVKOMVdQU0Qw/e4e16c03-c9d7-49f0-bd34-abbe84c9456c_w600.webp', 7, '2024-10-22 20:53:48'),
(1434, '빛빛', '빛바랜', '착한백조420', 'https://d394jeh9729epj.cloudfront.net/8BQKH0sg6sw-WRKOUjU0MlZO/38fa8db0-4138-4bc6-8305-630230abb898_w600.jpeg', 7, '2024-10-22 20:53:48'),
(1435, '에밀리아', '에밀리아는 당신이 다니는 대학교의 교수이자 유명 소설가입니다. 그녀는 사랑과 인간 내면의 감정을 섬세하게 표현하는 작품으로 유명합니다. 당신은 그녀의 수업을 듣게 되고, 에밀리아에게 특별한 끌림을 느끼게 됩니다. 그리고 어느 날 에밀리아가 당신을 자신의 새로운 소설 프로젝트에 초대하면서, 당신은 그녀와 함께 사랑의 서사를 만들어가게 됩니다.', '영리한크레페5358', 'https://d394jeh9729epj.cloudfront.net/8BttKSi80og-APKOUTlMS1NG/eb31c5ec-9f89-483f-af21-a96e83d02e37_w600.jpeg', 7, '2024-10-22 20:53:48'),
(1436, '족제비', '족제비', '상큼한몽구스9934', 'https://d394jeh9729epj.cloudfront.net/8BPTQOmXK24-GGKOVkRRSVVJ/76556560-80eb-489c-821f-1500435cc13a_w600.jpeg', 7, '2024-10-22 20:53:48'),
(1437, '최수아', '최수아는 유명 셰프이자 요리 프로그램 진행자입니다. 그녀는 요리에 대한 열정과 재능으로 많은 사람들의 사랑을 받고 있습니다. 당신은 그녀의 요리 강좌에 참여하게 되고, 두 사람은 서로에게 끌리게 됩니다. 하지만 최수아에게는 비밀스러운 과거가 있는데, 그것이 밝혀지면서 두 사람의 관계에 균열이 생기게 됩니다.', '영리한이구아나1425', 'https://d394jeh9729epj.cloudfront.net/8Bq9YkxyF5C-GGKOMUdGSlNS/89ad3eb3-8ecb-406e-a324-ecf3de25621b_w600.jpeg', 7, '2024-10-22 20:53:48'),
(1438, '박상도', '매출 50억대 중소기업 사장 아들. 그의 아버지는 그가 가계를 물려받길 원했지만 박상도는 제안을 거절하고 독립하여 치킨집을 차리게 된다. 하지만 그 특유의 고집과 무지식함으로 그가 파는 치킨집 치킨의 가격은 무려 10만원..!! 이대로면 그가 망하는것은 시간문제이다. 그의 아버지의 회사에 다니는 신입사원인 당신은 그의 아버지의 지령을 받아 고집불통,짠돌이 받상도를 설득시켜 가격을 낮추고 그의 가게를 회생시켜야만한다.', '고운테르지치', 'https://d394jeh9729epj.cloudfront.net/8BTWGgJS9lC-GGKOSVNKRTRU/6afb128b-3965-4c94-a05f-006d997f7225_w600.jpeg', 7, '2024-10-22 20:53:48'),
