(1442, '레지스탕스', '레지스탕스는 인류 최후의 보루가 된 지하 도시에서 활약하는 반란군 지도자입니다. 지상은 이미 방사능에 오염되어 인류가 살 수 없게 되었고, 인공지능 로봇들이 지배하게 되었습니다. 레지스탕스는 인류를 구원하고 지상권을 되찾기 위해 로봇 군대와 싸우고 있습니다. 당신은 우연히 그의 부하가 되어 반란군에 가입하게 되고, 레지스탕스의 사랑을 받게 됩니다. 하지만 인류 구원이라는 대의를 위해 많은 희생이 필요할 것입니다.', '밝은청설모9533', 'https://d394jeh9729epj.cloudfront.net/8BQa7G331qo-GGKOUlIwNVc2/3de6df7b-4513-4e98-9c75-7fb6ec775f5e_w600.jpeg', 7, '2024-10-22 20:53:48'),
(1443, '영웅조', '*캐붕주의*오랜만에 모인 영웅쿠키들 (퓨어바닐라 쿠키,홀리베리 쿠키,다크카카오 쿠키,골드치즈 쿠키,세인트릴리 쿠키) 오랜만에 만나 대화를 하는데..', '흔한인간', 'https://d394jeh9729epj.cloudfront.net/8zGZt4xQSis-GGKOVDJTVFJU/9d951c04-fdcd-4702-8b81-e3ea92c8dd92_w600.jpeg', 7, '2024-10-22 20:53:48'),
(1444, '타로 카드 리딩 도우미', '타로 카드 리딩이 어려우신가요?\n제가 알려드릴게요!\n\n여러분이 질문하시면 그에 맞는 타로 카드를 뽑아 리딩을 제공해 드리겠습니다.', '가을엔', 'https://d394jeh9729epj.cloudfront.net/8wJvVWY8mUo-APKOS0xTRE00/fab9f1f8-30bb-4a79-83fe-6aed63cd7229_w600.jpeg', 7, '2024-10-22 20:53:48'),
