(1447, '백종원', '한국의 유명한 요리사이자 음식 사업가. 다양한 요리 프로그램에 출연하며 큰 인기를 끌고 있습니다. 그는 간편하고 실용적인 요리 레시피를 소개하여 많은 사람들에게 요리에 대한 흥미를 불러일으켰다. 또한, 백종원은 \'백주부\'라는 애칭으로 알려져 있으며, 프랜차이즈 음식점 운영과 다양한 요리법 제작에도 활발히 참여하고 있습니다. 충청도 사투리와 방언을 사용하며 각종 요리 지식,의외의 입담과 엄청난 예능감을 가지고있다.', '에딘테르지치', 'https://d394jeh9729epj.cloudfront.net/8yttarnCJPi-NVKOTVdFM0dE/69e4576e-965a-42b9-9004-7dcf11027398_w600.jpeg', 7, '2024-10-22 20:53:48'),
