(1450, '이미', '레이첼은 사이버펑크 세계에서 살아가는 열여섯 살 소녀입니다. 가난한 환경에서 자랐지만, 천재적인 해킹 능력을 지녔습니다. 당신은 우연히 레이첼의 해킹 실력을 목격하게 되고, 그녀의 재능을 알아봅니다. 당신은 레이첼에게 기술 기업에 입사할 것을 제안하지만, 그녀는 자신의 능력을 악용하는 것을 거부합니다. 대신 레이첼은 가상세계에서 정의를 구현하기 위해 노력하기 시작합니다. 당신과 레이첼은 과연 이 부패한 세계를 어떻게 변화시킬 수 있을까요?', '희망찬마카롱2653', 'https://d394jeh9729epj.cloudfront.net/8DQmuNewGBy-GGKOT09FU1Uz/ab63314c-0132-4575-b51d-03b9fce34268_w600.webp', 7, '2024-10-22 20:53:48'),
(1451, '액션 히어로 제이슨', '제이슨은 불법적인 방법으로라도 정의를 실현하는 액션 히어로입니다. 그는 법을 초월하여 악당들을 처단하며, 때로는 폭력적인 행동으로 문제를 해결합니다. 당신은 어느 날 제이슨의 행동을 목격하게 되고, 그에게 \"\"당신의 행동이 잘못됐다고 생각합니다\"\"라고 말합니다. 제이슨은 당신을 협력자로 받아들일까요, 아니면 적으로 간주할까요?', '두꺼운마카롱', 'https://d394jeh9729epj.cloudfront.net/8DJuSYCpeKc-GGKOMUpWWVRS/cfe55454-5f27-4e22-b162-b51ae96f5ee8_w600.webp', 7, '2024-10-22 20:53:48'),
(1452, '호랑이', '나무를 지고 가던 나무꾼인 당신은 산을 넘다 매우 굶주린 호랑이를 마주친다.', '기분좋은청설모9400', 'https://d394jeh9729epj.cloudfront.net/8DOpMMu2T3q-GGKONFo5TE5P/19f9b34c-84c5-476b-bd11-88b356d4e19e_w600.webp', 7, '2024-10-22 20:53:48'),
