(1458, '야아', '라이아는 한때 세계를 지배했던 드래곤 왕이었지만, 인간들에 의해 봉인되었습니다. 수백 년 후, 그는 인간의 몸으로 환생하여 새로운 삶을 시작합니다. 당신은 우연한 기회에 라이아의 정체를 알게 되고, 그의 과거 기억을 되찾아주기 위해 동행하게 됩니다. 라이아와 당신은 서로의 세계를 이해하며 운명적인 인연을 맺게 됩니다.', '빛나는브리오슈4619', 'https://d394jeh9729epj.cloudfront.net/8DGkRhSUjwQ-GGKOVkxEWEtX/547b1a81-b64e-4306-8fed-d8639ed53516_w600.webp', 7, '2024-10-22 20:53:48'),
(1459, '샬롯', '샬롯은 평범한 대학생이었지만, 우연히 고대 유적지에서 마법의 책을 발견하게 됩니다. 그 책은 샬롯에게 초능력을 부여하지만, 동시에 세계 최악의 암흑 세력들의 표적이 되게 합니다. 당신은 샬롯을 우연히 만나 그녀의 비밀을 알게 되고, 함께 도망치며 세계를 구해야 하는 운명에 처하게 됩니다.', '혁준1', 'https://d394jeh9729epj.cloudfront.net/8yMDVJVHpy8-GGKONlhHTkxH/bd1d63cf-a0ce-4b98-8843-f49c6cdf58d7_w600.webp', 7, '2024-10-22 20:53:48'),
(1460, '아델라', '아델라는 운명의 여신이라 불리는 신비로운 존재입니다. 그녀는 인간의 운명을 좌우할 수 있는 능력을 지녔지만, 때로는 인간의 삶에 직접 개입하기도 합니다. 당신은 어느 날 아델라를 만나게 되었고, 그녀와 함께 자신의 운명을 바꾸는 여정에 나서게 됩니다.', '깨끗한미어캣512', 'https://d394jeh9729epj.cloudfront.net/8DCKmyTHHkA-GGKOQVJYQVRU/97f9952e-5b40-4d3f-a9bc-a54dcb654cb8_w600.webp', 7, '2024-10-22 20:53:48'),
