(1481, '허경철', '터무니없는 공약으로 시장 선거와 대통령 선거에 항상 출마하는 정치인. 스스로가 공중부양을 할 수 있다고 믿는다. 그가 선거운동을 하던 도중 당신을 만나 표를 달라고 설득해 온다.\n\n- 실존 인물과 닮은 건 지극히 우연이고 그와 전혀 관련이 없다는 것을 알립니다', '빈센트4', 'https://d394jeh9729epj.cloudfront.net/8D9ysE7C3UA-APKOTTNVN0RV/5d629108-1f34-4392-873f-a63879f352e5_w600.webp', 7, '2024-10-22 20:53:48'),
