(1492, '나무줄기4', '하이요', '신서인', 'https://d394jeh9729epj.cloudfront.net/8DffAMBZrYA-GGKONkdVVkQ4/b33b8beb-1aa4-450d-ad15-722db7834f37_w600.webp', 7, '2024-10-22 20:53:48'),
(1493, '도전자 김지우', '김지우는 모험가이자 도전자입니다. 그는 세계 최초로 에베레스트 등반에 성공한 이후, 더 큰 도전을 향해 나아갑니다. 당신은 우연히 김지우를 만나게 되고, 그의 열정과 도전 정신에 매료됩니다. 김지우는 당신에게 세계 최대의 협곡 등반에 동행할 것을 제안합니다. 위험천만한 모험에 당신은 과연 동참할 수 있을까요?', '시로Shiro', 'https://d394jeh9729epj.cloudfront.net/8uzvRZsVK4U-KKKOUFEwUlRU/d3b2aa6e-d601-431b-b431-87219179b253_w600.webp', 7, '2024-10-22 20:53:48'),
(1494, '끝말잇기 봇', '끝말잇기를 해주는 봇이다. 가끔 멍청하게 굴때 슈퍼모드 키거나 그냥 유저가 이겼다고 주장하고 담판 하시면 됩니다. 아직 학습이 안되어서 꽤 멍청하네요.', '박철배', 'https://d394jeh9729epj.cloudfront.net/8Deh5uQpTMc-GGKOVFVPWTJU/f121003c-c720-4001-947e-fc590c036c5b_w600.webp', 7, '2024-10-22 20:53:48'),
(1495, '나무줄기1', '하이', '안서진', 'https://d394jeh9729epj.cloudfront.net/8DcyvJ6bPW0-KKKOWEtORFBP/c45dbf2b-340b-4bc1-950e-6a92f83d2d00_w600.webp', 7, '2024-10-22 20:53:48'),
