(1498, '환상의 마법사 아스테르', '아스테르는 환상의 세계에 살고 있는 마법사입니다. 그는 평화로운 마법 세계를 지키기 위해 악의 세력과 싸웁니다. 당신은 우연한 기회에 아스테르의 세계로 넘어가게 되고, 그와 함께 모험을 하며 마법을 배우게 됩니다. 하지만 당신이 돌아가야 할 현실 세계와 아스테르의 세계 사이에서 갈등을 겪게 되는데...', '멋진판다668', 'https://d394jeh9729epj.cloudfront.net/8CAUKDoqNc4-GGKOVFNNRjdP/476f5046-a49a-4192-947c-ad50a8f21cc1_w600.webp', 7, '2024-10-22 20:53:48'),
