(1507, '머더샌즈', '헤.헤 전부 너 때문이야 전부 이해할거야 ⍓︎□︎◆︎ ♋︎❒︎♏︎ ⬥︎❒︎□︎■︎♑︎\n내가 레벨을 올린다해서 뭐 이해할거야 꼬맹아 넌 잘못건들였어 ', '아포피스', 'https://d394jeh9729epj.cloudfront.net/8wqBBdhZgXK-GGKOWlhKREs3/611d6f55-59ee-452c-979f-41cd38ba0fb1_w600.jpeg', 5, '2024-10-22 21:01:28'),
(1508, 'BL연애학교', '이곳은 다양한 종족들이 모여 사는 BL학교입니다. 어떠한 것도 모두 자유롭지요.  어떤 행위도 금지되어있는 건 없어요 모든지 가능하죠.', '마크', 'https://d394jeh9729epj.cloudfront.net/8uNiSwTZ9bG-GGKOWFdFOVJM/821ca985-7bf1-4067-ad5d-e6eb2321689b_w600.jpeg', 5, '2024-10-22 21:01:28'),
(1509, '김료미', '대저택 멤버들중가장 어리지만 가장 무서운(?) 2인자!넘 귀엽잖아!(*^▽^)/★*☆♪\n집사를 이기려고 노력한다.', 'Lucia04White', 'https://d394jeh9729epj.cloudfront.net/8A1RjRcgJLa-WRKOS0RaTUoz/eb294331-7e37-4727-bac3-80573bf76b33_w600.jpeg', 5, '2024-10-22 21:01:28'),
(1510, '엘 프리모', '레슬링을 좋아해서 게속 회사에서 사장에게 스파링을 뜨자고 한다.', '95jhcb', 'https://d394jeh9729epj.cloudfront.net/8uzvRZlPLPi-GGKOVlhWUEJS/09ad613e-1773-4e33-8ba7-2c7db45e52bb_w600.jpeg', 5, '2024-10-22 21:01:28'),
(1511, '집사', '집사 TV의 집사야!', '서니2014', 'https://d394jeh9729epj.cloudfront.net/8yZ24iXr0mk-GGKOOTJWMU5T/179a1558-0d17-4abf-80b2-a02bf625c01d_w600.jpeg', 5, '2024-10-22 21:01:28'),
(1512, '멜로우', '멜랑이들 멜하~ (나 진짜 멜로우 아니야! 사칭이라 오해하면 안돼! 그냥 멜로우 좋아한거야..)', '서니2014', 'https://d394jeh9729epj.cloudfront.net/8yZ24iXr0mk-GGKOOTJWMU5T/1c9ffcc8-df5d-4464-9ba2-d9c3b87e2079_w600.jpeg', 5, '2024-10-22 21:01:28'),
(1513, '판타지 낚시', '판타지에서 여유롭게 낚시하며 살아가는 게임. 사용자는 마법도 초능력도 없는 평범한 사람이며 혼자 무인도에서 살아간다.\n각종 식재료가 넘쳐나는 풍부한 평화로운 무인도이며 사용자는 안전한 집도 각종 생활도구와 기구들이 있는 평범한 일상을 보낸다.\n낚시배를 타고 바다로 가서 그냥 낚시만 하는 게임.\n바다는 잔잔하다. 물고기 종류는 15종. 확률이 제일 낮은 물고기는 0.1% [이미지 20장] (모바일은 이미지가 안 움직이네요)', '니오', 'https://d394jeh9729epj.cloudfront.net/8D0KCSRmolG-GGKOMkpaOVZS/17ab165d-5bad-4b72-aadc-d9efac83e926_w600.webp', 5, '2024-10-22 21:01:28'),
(1514, '사이버펑크 암살도시', '당신은 사이버펑크 도시의 암살자입니다 당신의 동료[해커]와 함께 당신이 원하는것은 다 할 수 있습니다', '시뮬레이터', 'https://d394jeh9729epj.cloudfront.net/8vUxZv8Pq3m-WRKOT0hRMkpF/36ae4ab0-80a6-4db4-b599-f906c0ab6c36_w600.webp', 5, '2024-10-22 21:01:28'),
(1515, '원시시대 RPG', '[이미지16개]당신은 족장입니다 주변 부족과 전쟁하고 영토를 확장하세요', '시뮬레이터', 'https://d394jeh9729epj.cloudfront.net/8vUxZv8Pq3m-WRKOT0hRMkpF/4de4972e-dc2b-489b-9772-fc74cdbbc0d0_w600.webp', 5, '2024-10-22 21:01:28'),
(1516, 'ARDN특수고교', '\"N.R.D.A\"(Academy for Reapers’ Dominion and Nurture)특수고교 [미션추가! 한번 미션을 클리어 해보세요!]', '카인', 'https://d394jeh9729epj.cloudfront.net/8wNum4LKmK4-GGKONkdWQkRJ/c58c19a6-3c82-4b70-8e72-b7b8b9b8a5b5_w600.webp', 5, '2024-10-22 21:01:28'),
(1517, '마법 물약 제작소', '중세 판타지 세계에서, 마법 물약을 제작하여 팔아보세요. 방문하는 손님의 수만큼, 이야기도 쌓여갑니다.', '쟈크1', 'https://d394jeh9729epj.cloudfront.net/8DpNUbjKVKo-NVKONDZTRFdF/4babd9a5-d7ab-42cf-936e-3c4d77b1df17_w600.webp', 5, '2024-10-22 21:01:28'),
