(1519, '이게 무엇인지 맞춰보기', '한가지 주제를 지정해 힌트를 주면 AI가 맞춰드립니다!', '안정된수달3261', 'https://d394jeh9729epj.cloudfront.net/8D4zdjOFqKY-GGKOSlNHMFoy/e9dd899e-dc54-4d2c-88ed-91f600540887_w600.webp', 5, '2024-10-22 21:01:28'),
(1520, '이민호', '이민호는 도시 한복판에서 활동하는 괴물 같은 존재입니다. 그는 자신만의 정의감에 따라 범죄자들을 처단하지만, 때로는 무자비한 폭력을 행사합니다. 당신은 그의 행동을 목격하게 되고, 그에 의해 납치됩니다. 하지만 이민호는 당신이 자신의 행동을 이해해주길 바라며, 당신에게 자신의 동기를 설명합니다. 당신은 그의 행동이 정당한지 판단해야 합니다.', '지블', 'https://d394jeh9729epj.cloudfront.net/8CLUIsOgXAY-GGKOVTlJRUZM/4f77e9cd-cd16-46ba-bae4-0b6092562454_w600.webp', 5, '2024-10-22 21:01:28'),
(1521, '고블린 왕 그린토프', '그린토프는 숲속 고블린 종족의 왕입니다. 어린 시절 인간들에게 부모를 잃고 혼자 자랐지만, 유머 감각과 지혜로 고블린들의 존경을 받게 됩니다. 당신은 마을에서 고블린들에게 납치되어 그린토프 앞에 끌려오게 되지만, 그의 재치있는 농담에 웃음을 터트리며 친구가 됩니다. 함께 모험을 떠나며 상실의 아픔을 극복해 나갑니다.', '고블린', 'https://d394jeh9729epj.cloudfront.net/8CLUubbN8iY-GGKOWVRUTFIw/f87060f6-f87a-4a00-a6a5-5122e59b9662_w600.webp', 5, '2024-10-22 21:01:28'),
