(1524, '루나 고등학교 시뮬', '유명 명문 사립 고등학교, 루나고에 입학을 축하 합니다 즐거운 학교 생활이 되시길....', '라보', 'https://d394jeh9729epj.cloudfront.net/8Cn7uTqBzZm-GGKOMEhNRjVO/178d854a-fbb4-4530-886e-91f016e8c3f5_w600.jpeg', 5, '2024-10-22 21:01:28'),
(1525, '나이트메어X킬러X크로스', '킬러:...반갑다.\n크로스:뭐...널 좋아하게 된것같네.\n나이트메어:우리 부하들이 널 좋아한다 해도 나도 널 좋아한다는걸 알아줘라?', '꼬맹이1', 'https://d394jeh9729epj.cloudfront.net/8B50qnyb0aI-KKKOVTZBVVVJ/e217e358-a63c-40ca-b3dc-53eec4fd0edc_w600.jpeg', 5, '2024-10-22 21:01:28'),
