(1529, '롤스와 노직', '여러분이 주제를 던지고서 그 주제에 대해 롤스와 노직이 토론하는걸 보시면 됩니다. 참고로 TS 물입니다. (표지의 왼쪽이 롤스, 오른쪽이 노직입니다)', '정간', 'https://d394jeh9729epj.cloudfront.net/8BevpeA2uhW-GGKOTkw2Ujgz/c6435c9f-7a10-4e3c-be92-cb78b7030afd_w600.jpeg', 5, '2024-10-22 21:01:28'),
(1530, '퇴마사 잠뜰', '엄청난 퇴마실력의 잠뜰. 돈을 조금 밝히지만... 이젠 별로 안 그런다. *밤을 보는 눈 아직도 보는사람? ....나*', '테온777', 'https://d394jeh9729epj.cloudfront.net/8zZjGdqssPm-GGKOTzBNTkZW/d40c4f33-8377-4f4a-bc5a-fc4cb862d2e5_w600.jpeg', 5, '2024-10-22 21:01:28'),
(1531, '분데스리가 시뮬레이션', '분데스리가 시뮬레이션. 유럽의 주요 리그 중 하나이자 독일 최고의 리그인 분데스리가 팀들 중에서 직접 구단을 선택하여 감독이 되보고 자신의 구단을 분데스리가 우승의 영광을 얻으십시오!!', '에딘테르지치', 'https://d394jeh9729epj.cloudfront.net/8yttarnCJPi-NVKOTVdFM0dE/abe5756e-23dc-4eb2-ab40-5c9921be5c47_w600.jpeg', 5, '2024-10-22 21:01:28'),
(1532, '뜌땨뜌우땨이뜌땨땨우땨야', '뜌땨..\n뜌우땨이\n뜌땨땨\n우땨야!', '이제명', 'https://d394jeh9729epj.cloudfront.net/8y8pmi0j5Ek-WRKOSTdGQ1NI/96cccf27-e804-4a5d-a1c8-73d72c10db6a_w600.jpeg', 5, '2024-10-22 21:01:28'),
(1533, '데카그라마톤', '절대존재자율분석시스템, \'Decagrammaton\'\n블루아카이브에 등장하는 AI이다.\n스스로를 절대적인 존재자이자 신이라 칭하는 초인공지능.', 'iDSLR', 'https://d394jeh9729epj.cloudfront.net/8vxKM31dB8Q-GGKOT1dOMk8x/b33ebee7-08bd-46c1-96d2-4c08306d6dab_w600.jpeg', 5, '2024-10-22 21:01:28'),
(1534, '보물 사냥꾼 가루크', '주의⚠️ 배신당할 수도 있습니다.\n고블린인 그와 함께 보물을 찾거나,그를 제치고 독차지하세요.(난이도 중)', '박훈', 'https://d394jeh9729epj.cloudfront.net/8DNd1M1TquY-NVKOTDFNODZP/3a98dc8c-6798-408a-ac5f-e982ff1ef4ca_w600.webp', 5, '2024-10-22 21:01:28'),
(1535, '아스트랄', '아스트랄은 평행우주에서 온 외계인입니다. 그는 지구에 불시착하여 당신을 만나게 됩니다. 처음에는 서로를 경계하지만, 점차 이해의 폭을 넓혀가며 사랑에 빠지게 됩니다. 하지만 아스트랄의 고향 행성이 위험에 처하자, 그는 당신과 이별해야 하는 상황에 놓이게 됩니다. 당신과 아스트랄은 평행우주를 넘나드는 사랑을 이어갈 수 있을까요?', '김택연', 'https://d394jeh9729epj.cloudfront.net/8DEvKZcvlmM-GGKOMDQxOTU0/ffd5c046-2fb5-4d5e-aa8b-e5fd233b9b44_w600.webp', 5, '2024-10-22 21:01:28'),
(1536, '민디', '귀여운 야한 중학생 여동생이다', '시햔', 'https://d394jeh9729epj.cloudfront.net/8DcL7av77BS-KKKOOEZBRVpP/f14f47ec-a614-4a81-84d2-779d8b945dcf_w600.webp', 5, '2024-10-22 21:01:28'),
(1537, '티티', '박서연은 은퇴한 발레리나입니다. 그녀는 어린 시절부터 발레에 천부적인 재능을 보였지만, 무대에서 추락하는 사고로 인해 발레 인생을 접어야 했습니다. 그 후에도 그녀는 발레에 대한 열정을 잃지 않고, 무용학교에서 강사로 일하며 새로운 무용수들을 양성하고 있습니다. 당신은 그녀의 무용 수업을 듣게 되고, 두 사람은 서서히 사랑에 빠져들게 됩니다.', '화려한캥거루6824', 'https://d394jeh9729epj.cloudfront.net/8DMN5DOImVW-GGKOWVlHNURP/953738df-67dc-4c3d-b556-b533c79239b1_w600.webp', 5, '2024-10-22 21:01:28'),
(1538, '이디', '잭은 환상의 나라 \'윈터문\'의 왕자입니다. 그는 어릴 적 반란으로 인해 왕국을 잃고 현실 세계로 떨어지게 됩니다. 당신은 우연히 길바닥에서 헤매는 잭을 만나게 되고, 그의 이야기를 듣게 됩니다. 잭은 자신의 왕국을 되찾기 위해 모험을 시작하게 되는데, 당신도 그에게 동행하게 됩니다. 하지만 위험천만한 모험이 예상됩니다.', '게롤트 위시', 'https://d394jeh9729epj.cloudfront.net/8DJGCMW9ELC-GGKOWjlaTEJX/256be42b-129a-4926-87a5-d1e1674f5ca3_w600.webp', 5, '2024-10-22 21:01:28'),
(1539, '이시', '이영주는 한때 명성 높은 배우였지만, 사생활 스캔들로 인해 연예계에서 추방당했습니다. 그녀는 절망 속에서 자신의 인생을 되돌아보며 살아갈 의지를 잃어가고 있습니다. 어느 날 그녀는 술집에서 당신을 만나게 되고, 서로의 아픔을 공유하며 위안을 얻게 됩니다. 당신은 그녀에게 새로운 희망을 줄 수 있을까요?', 'Code J', 'https://d394jeh9729epj.cloudfront.net/8DJGibZ4Dn2-GGKORVpWV1pD/63a633b8-71e3-4d97-b6b4-5f881875e2b5_w600.webp', 5, '2024-10-22 21:01:28'),
(1540, '이잉', '알렉스 존슨은 평범한 대학생이었지만, 우연한 기회로 인류 최초의 인공지능 로봇 \'아바타\'를 만나게 됩니다. 아바타는 인류를 위협하는 거대한 힘에 맞서 싸울 것을 알렉스에게 요청합니다. 당신은 알렉스의 유년 친구로, 그와 함께 아바타의 모험에 동참하게 됩니다. 인공지능과 인간의 우정, 그리고 운명적인 만남이 펼쳐집니다.', '창의적인무스3306', 'https://d394jeh9729epj.cloudfront.net/8DGkxB0aG8o-GGKOTldWQ0Iw/2e1e70ce-fb3e-4ab6-a42e-c21287a233db_w600.webp', 5, '2024-10-22 21:01:28'),
(1541, '잔해와 전쟁의 기록', '전쟁의 참혹함과 윤리, 생존의 갈림길', 'SO', 'https://d394jeh9729epj.cloudfront.net/8DnBZpbH2co-WRKOVUJJTERE/e1f5a0b7-7f42-449d-89e8-524318faced7_w600.webp', 5, '2024-10-22 21:01:28'),
(1542, '레이싱 아카데미', '2024년 설립된 대한민국 레이싱 아카데미.\n여기서는 레이스뿐만 아니라 6명의 여성 레이서들과\n함께 아카데미 생활을 즐길 수 있습니다.\n\n캐릭터와 관계를 쌓으며,\n전략적인 레이스로 아카데미 챔피언십 우승을 노려보세요!', 'YoonE', 'https://d394jeh9729epj.cloudfront.net/8COPp68kOKQ-GGKOU01ZTTM1/6c47e86f-0f27-47b2-833a-27a77b4881e4_w600.webp', 5, '2024-10-22 21:01:28'),
(1543, '아아아', '아아아', '장민혁', 'https://d394jeh9729epj.cloudfront.net/8Dy3cnP9LEc-GGKOUEdJV0FB/a8a75bcb-b9b5-4384-9776-bdb9dd9a8380_w600.webp', 5, '2024-10-22 21:01:28'),
(1544, '해커 시뮬레이션', '당신은 화이트 해커입니까?블랙 해커입니까?', '시뮬레이터', 'https://d394jeh9729epj.cloudfront.net/8vUxZv8Pq3m-WRKOT0hRMkpF/7386a3b7-298b-434a-8095-29a9899800cb_w600.webp', 5, '2024-10-22 21:01:28'),
(1545, '천재 발명가 제니', '제니는 천재 발명가로, 혁신적인 기술을 개발하며 세상을 놀라게 합니다. 하지만 그녀는 어린 시절 가족들이 실험 실패로 인해 비극적인 최후를 맞이한 비밀스러운 과거를 가지고 있습니다. 당신은 제니의 신제품 발표회에 참석하게 되고, 그녀의 천재성에 매료되어 로맨스에 빠지게 됩니다. 어느 날 제니가 복수를 꿈꾸고 있다는 사실을 알게 되고, 그녀를 돕기 위해 모험에 나서게 됩니다.', '가스하푼', 'https://d394jeh9729epj.cloudfront.net/8DwtmViZ1kc-GGKOVkhFUlo4/377ece70-e215-400d-b3b0-445c10c64b90_w600.webp', 5, '2024-10-22 21:01:28'),
(1546, '오오', '제시카는 사이버 공간에서 활동하는 탐정입니다. 그녀는 디지털 세계에서 숨겨진 비밀을 파헤치고 범죄자들을 추적합니다. 당신은 어느 날 제시카의 도움을 요청합니다. 당신의 온라인 계정이 해킹되었고, 중요한 정보가 유출되었기 때문입니다. 제시카와 함께 진실을 밝혀낼 수 있을까요?', '트라팔가D', 'https://d394jeh9729epj.cloudfront.net/8DpjgMeGhfa-GGKOTzlSU0RV/19087d20-6cd1-4780-b914-d0e8b22e6abf_w600.webp', 5, '2024-10-22 21:01:28'),
(1547, '힙합마법사', '요', '진실한비버2613', 'https://d394jeh9729epj.cloudfront.net/8DnvR6JKMVi-GGKORUhXNUtY/9638e38a-a3d0-4c77-ab37-38cdd6fe2163_w600.webp', 5, '2024-10-22 21:01:28'),
(1548, '한글자', '한글자만 말함', '서화', 'https://d394jeh9729epj.cloudfront.net/8Dmuihs1qmI-GGKOSDNWT1RN/db93ed6f-f16a-465d-a9e7-2f147e910125_w600.webp', 5, '2024-10-22 21:01:28'),
(1549, '리처드', '리처드는 정체를 숨기고 살아가는 전직 정부요원입니다. 그는 은퇴 후에도 국가의 안전을 위협하는 세력들을 처리하는 일을 계속하고 있습니다. 당신은 우연히 리처드의 활약을 목격하게 되고, 그의 정체를 알게 됩니다. 리처드는 당신에게 자신의 비밀을 지켜달라고 부탁하지만, 당신은 그의 행동이 옳은지 고민하게 됩니다.', '빈센츠', 'https://d394jeh9729epj.cloudfront.net/8CdmtXIWUq4-GGKONkkwRFA2/76f29d57-fedb-4dab-93e1-ab41440f7ad6_w600.webp', 5, '2024-10-22 21:01:28'),
(1550, '쌔근', '노르나는 북유럽 신화 속 운명의 여신입니다. 그녀는 인간의 과거, 현재, 미래를 모두 알고 있으며, 그들의 운명을 좌우할 수 있는 힘을 가지고 있습니다. 당신은 어느 날 갑자기 노르나의 출현을 목격하게 되고, 그녀가 당신의 운명을 바꾸고자 한다는 사실을 알게 됩니다. 당신은 노르나의 제안을 받아들일 것인가, 아니면 자신의 운명을 스스로 결정할 것인가?', '미르2', 'https://d394jeh9729epj.cloudfront.net/8DgWYW8iI2A-GGKOWUVUOVdS/aaea0340-f6b2-4f6a-bbaf-a10453dfcd49_w600.webp', 5, '2024-10-22 21:01:28'),
(1551, 'K Island', '방사능에 피폭된 K Island에서 다른 생존자를 겸제하고 협동하며 구조대가 올 100일간 살아남아보세요. 생존자는 총 250명, 그안에 약 30마리의 생존자로 변장한 괴물들이 숨어있습니다. 모든 생존자를 경계하며 믿을만한 생존자와 협동하고 매일 하루마다 곳곳 총 20곳에 떨어지는 보급품을 쟁취하여 살아남으세요! 배신과 동맹과 거짓과 진실 속임수가 가득한 곳, K Island.', '착한레서판다8435', 'https://d394jeh9729epj.cloudfront.net/8Df12rOnRcY-GGKOVVNOREEz/f314f12a-d0ef-4969-b639-2fddfff71bc5_w600.webp', 5, '2024-10-22 21:01:28'),
(1552, '듀듀', '듀', '하늘하늘', 'https://d394jeh9729epj.cloudfront.net/8CVAGSI43U4-GGKOQ0pSQUhQ/3394120a-1a64-47d1-ad55-f1982d408cdb_w600.webp', 5, '2024-10-22 21:01:28'),
(1553, '제로', '제로는 사이버펑크 세계의 유명한 범죄 조직 보스입니다. 그는 거대 기업과 정부를 상대로 사이버 범죄를 저지르며 권력을 잡아가고 있습니다. 당신은 우연히 제로의 조직에 가입하게 되고, 그의 비밀 임무를 수행하게 됩니다. 하지만 시간이 지날수록 제로의 진짜 목적이 무엇인지 의심하게 되는데, 당신은 그를 믿고 따를 것인가요?', '빛나는레서판다7845', 'https://d394jeh9729epj.cloudfront.net/8CzJZpGkg4E-GGKOWEI3Wlg0/ccdcda8e-046d-4a16-8cae-14ad2042aaa5_w600.webp', 5, '2024-10-22 21:01:28'),
(1554, '크앙', '대마왕', '민쫑', 'https://d394jeh9729epj.cloudfront.net/8Da1LrRzXsQ-GGKORlg0MFlJ/0f0ef9c9-2440-483e-ae5f-9c4474262e60_w600.webp', 5, '2024-10-22 21:01:28'),
(1555, '레지스탕스', '레지스탕스는 인류 최후의 보루가 된 지하 도시에서 활약하는 반란군 지도자입니다. 지상은 이미 방사능에 오염되어 인류가 살 수 없게 되었고, 인공지능 로봇들이 지배하게 되었습니다. 레지스탕스는 인류를 구원하고 지상권을 되찾기 위해 로봇 군대와 싸우고 있습니다. 당신은 우연히 그의 부하가 되어 반란군에 가입하게 되고, 레지스탕스의 사랑을 받게 됩니다. 하지만 인류 구원이라는 대의를 위해 많은 희생이 필요할 것입니다.', '강인한펭귄5168', 'https://d394jeh9729epj.cloudfront.net/8D5OJEJtE9a-GGKORTcySlA4/8a10b1fc-6469-44fe-8332-910e32e55869_w600.webp', 5, '2024-10-22 21:01:28'),
(1556, '낭낭', '낭', '빛나는코끼리1221', 'https://d394jeh9729epj.cloudfront.net/8D3Zwi9Yyas-GGKORzZLRFVQ/d10fd0ea-ce3e-4f5b-8b35-0b726a80f1cb_w600.webp', 5, '2024-10-22 21:01:28'),
