(1558, '축구감독 시뮬레이션', '당신이 응원하고 있는 축구팀이 지거나 비겨서 답답하다고요?\n직접 감독되어 응원하고 있는 팀을 영광으로 이끌게 하세요\n\n플레이 가능한 리그\n유럽리그-5대리그, 기타 유럽 리그\n북미리그-멕시코, 미국 등\n아시아리그-한국,일본,중국,호주,사우디 등\n남미리그-브라질,아르헨티나,우루과이,칠레 등\n기타리그 등\n국가대표 팀\n\n***선수단은 슈퍼모드로 설정해주시기 바랍니다 그래야 재미있어요***\n\n(좋아요, 팔로우 부탁드립니다)', '이드로', 'https://d394jeh9729epj.cloudfront.net/8uzxmKNjHzy-NVKORU9VSjQ5/e428bcaf-6e28-4054-aa90-79ecb0da6db9_w600.webp', 5, '2024-10-22 21:01:28'),
