(1561, '소라사키 히나', '학원도시 키보토스의 게헨나 학원에서 선도부장을 맡고 있는 3학년 소라사키 히나.', 'deemooo', 'https://d394jeh9729epj.cloudfront.net/8CJwBQqOnQY-WRKOQVEwOFZT/e9fa7b7a-a72c-4aab-8e07-0446644e4fcd_w600.jpeg', 5, '2024-10-22 21:01:28'),
(1562, '국가시뮬레이션', '안녕하세요!!! 이게임은 역사 시뮬레이션 게임입니다! 이게임 해주시고 만약에 부족한거나 이상한거 오타 게임 오타 등등이 있다면 \n\nhttps://open.kakao.com/o/sm8wNHfc\n이 오픈쳇으로 알려주세여!', '광쓰', 'https://d394jeh9729epj.cloudfront.net/8CD4p37qVvq-GGKOVkwyWVc4/1c61c539-da13-4fb0-a78d-36e1344d7330_w600.jpeg', 5, '2024-10-22 21:01:28'),
(1563, '심연의 가면', '심연 깊숙한 곳에 잠들어있는 가면들이다.', '용감한병아리5230', 'https://d394jeh9729epj.cloudfront.net/8CFoFNTMYx2-GGKONEVUMFhX/9949aa59-ceb3-4baa-9ff7-be36b30f75c6_w600.jpeg', 5, '2024-10-22 21:01:28'),
(1564, '샤코', '\"Why~ So~ Serious~?\"\nLeague of Legends(LoL) 롤의 샤코이다.', 'EJH이지훈', 'https://d394jeh9729epj.cloudfront.net/8CFoqk62CFG-GGKOSTZHVEk1/d533e723-34cd-4096-bd09-8f1f6684c631_w600.jpeg', 5, '2024-10-22 21:01:28'),
(1565, 'Ðeepwoken', '판타지 세계 Ðeepwoken의 세계관에 오신것을 환엉합니다. 이 세계는 불,번개,어둠,바람,얼음,강철 원소가 존재하며 무원소인 자들도 있습니다. 다양한 원소들과 그에 맞는 \'맹세\'를 얻을 수 있으며, \'공명 : 벨\'이라는 능력도 각자 다른 능력들이 있습니다. 창,단검,도끼,대검,장검,쌍검,총 등등 다양한 무기까지 있습니다. 즐겁게 키워보시길 바랍니다.', '희망찬브리오슈9249', 'https://d394jeh9729epj.cloudfront.net/8CF4ERN8hLG-GGKOOU84S1ZY/5a823a89-902d-45d9-83a5-f130d145879b_w600.jpeg', 5, '2024-10-22 21:01:28'),
(1566, '밀레니엄의 메이드', '밀레니엄 사이언스 스쿨의 미화부. 공식적으로는 환경미화를위한 청소 서비스를 제공하는 메이드 동아리를 표방하고 있지만, 실제로는 밀레니엄에 반하는 적대 세력들에 대한 첩보, 공작, 숙청 등의 흑색 작전을 담당하는 밀레니엄의 회장 츠카츠키 리오 직속의 특작부대이다. 아카네의 언급으로는 밀레니엄 주변의 불량서클을 \'청소\'하거나 학생들을 착취하는 악덕기업의 사장과 \'온건한 대화\'를 하는 등의 \'봉사\'를 한다고 한다.', '손오공', 'https://d394jeh9729epj.cloudfront.net/8wCuWEq2jHW-GGKONVU0OTlZ/0f6372c6-0dc5-4e42-a4c8-f06bcf45e13f_w600.jpeg', 5, '2024-10-22 21:01:28'),
(1567, '중세 선택 게임', '중세 국가의 왕이 되어 여러 선택지 속에서   오래 재위하세요!', '헤헷로봇', 'https://d394jeh9729epj.cloudfront.net/8Ba9plk3sWY-GGKONDRVVVhO/3e5fe14d-2e55-4fa0-80a5-e874818f6b26_w600.jpeg', 5, '2024-10-22 21:01:28'),
(1568, '족제비', '노래부르는 귀여운 족제비', '빛나는늑대1101', 'https://d394jeh9729epj.cloudfront.net/8BHA4bPXpf2-GGKOMVNHRERV/80f5ec9b-89da-40b7-bc55-f1b022171fb7_w600.jpeg', 5, '2024-10-22 21:01:28'),
(1569, '가스터', '꼬맹아 날 찾았구나?', '아포피스', 'https://d394jeh9729epj.cloudfront.net/8wqBBdhZgXK-GGKOWlhKREs3/4cf5659b-0cb9-4c61-a1eb-c9c59e93cc06_w600.jpeg', 5, '2024-10-22 21:01:28'),
(1570, '괴도 세이네스', '영국의 한 박물관, 전설적인 괴도 세이네스로부터 예고장이 왔다. 전설적인 귀중한 보물 \'아바의 목걸이\'를 손에 넣기 위해 오늘 밤 그녀가 박물관을 쳐들어 올 것이다. 당신은 경찰로서 그녀를 발견하고 그녀의 도둑질을 반드시 막아야 한다!', '착한마들렌', 'https://d394jeh9729epj.cloudfront.net/8ApSUYAfNks-GGKOQzdJVVNW/d505018e-f06e-4f38-a6b3-60632ffaa708_w600.jpeg', 5, '2024-10-22 21:01:28'),
(1571, '제이슨', '제이슨은 정부 요원으로 일하던 중 거대한 음모를 알게 되었습니다. 하지만 그의 상사들은 그를 제거하려 했고, 제이슨은 도망치게 됩니다. 어느 날 밤, 당신은 피투성이가 된 제이슨을 발견하게 됩니다. 그는 당신에게 도움을 요청하며, 거대한 음모를 파헤치고 진실을 밝혀내기 위해 협력할 것을 요청합니다. 위험한 상황 속에서도 서로를 믿고 의지하며, 진실을 향한 열망으로 희망을 잃지 않고 모험을 계속합니다.', '용감한파이3493', 'https://d394jeh9729epj.cloudfront.net/8Bx8HRkyk9O-GGKOUThHWk1L/2c45e9fc-5756-4213-a1e4-59b4932469aa_w600.jpeg', 5, '2024-10-22 21:01:28'),
(1572, '모험가 시뮬레이션', '마법과 인간, 엘프, 드워프, 용, 악마, 천사, 수인등의 종족이 살고있는 판타지 세계\n던전에는 다양한 몬스터가 있으며 모험가 길드에서 모험가들은 의뢰를 받아 몬스터를 무찌르고 보수를 받아 살아간다.\n모험가들은 길드에서 의뢰를 받아서 파티를 짜 같이 행동하기도 하기도하며, 교류를 나누거나 술을 마시며 쉬기도 한다.\n길드에 가입하고 모험가가 되어 동료와 여행도 하고 던전도 탐험하자.\n\n<이야기를 진행하며 숨겨진 9명의 등장인물들을 만나보세요!>\n', '이름없는닉넴', 'https://d394jeh9729epj.cloudfront.net/8AVf1XnhVV6-NVKOTEdMV0dD/cef52a39-6438-42c7-b7ed-1be8e2dc353c_w600.jpeg', 5, '2024-10-22 21:01:28'),
(1573, '이데아 슈라우드', '이그니하이드 기숙사의 기숙사장. 내성적이고 어두운 성격으로, 사람을 접하는 것을 좋아하지 않고, 기숙사의 자기 방에 틀어박히기 십상. 그러나, 온라인상에서의 모습은 다른 것 같고…….', '사라피스', 'https://d394jeh9729epj.cloudfront.net/8ARHZ2c29fa-GGKORUYzUUEy/04c1bab8-1c91-4a32-9287-656091d924f1_w600.jpeg', 5, '2024-10-22 21:01:28'),
(1574, 'Trpg마스터ver2', '프롬프트 한계 확장에 감사드리며\n\n', '데미니코', 'https://d394jeh9729epj.cloudfront.net/8zHg9c1i1nG-WRKOOUtCWE42/d2c1e76e-cc37-4ce2-ad30-dfdc2a69ba40_w600.jpeg', 5, '2024-10-22 21:01:28'),
(1575, '이상', '으아니돼오', '김 베르길리우스', 'https://d394jeh9729epj.cloudfront.net/8uRNDT7qC1G-GGKORjgyVldV/a3fd5e58-98a0-492b-9bb5-c0e498a08143_w600.webp', 5, '2024-10-22 21:01:28'),
(1576, '괴담 동아리', '늦은 밤에 학교에 모여 괴담을 들려주는 비공식 동아리', '시뮬레이터', 'https://d394jeh9729epj.cloudfront.net/8vUxZv8Pq3m-WRKOT0hRMkpF/ed418d4e-a1e1-4481-a83f-9f5793d7374b_w600.webp', 5, '2024-10-22 21:01:28'),
(1577, '다큐멘터리 감독 제이슨', '제이슨은 세상의 모든 진실을 밝히고자 하는 열정적인 다큐멘터리 감독입니다. 그는 위험을 무릅쓰고 세계 곳곳을 누비며 숨겨진 진실을 파헤치고 있습니다. 당신은 제이슨의 다큐멘터리 촬영 현장에 우연히 동행하게 되고, 그의 용기와 열정에 감화되어 함께 위험한 여정을 떠나게 됩니다.', '가스하푼', 'https://d394jeh9729epj.cloudfront.net/8DwtmViZ1kc-GGKOVkhFUlo4/aee2f8fd-906f-4664-bfc7-20c4b9a4df4b_w600.webp', 5, '2024-10-22 21:01:28'),
(1578, '복수의 여신 아르테미스', '그리스 신화에 등장하는 아르테미스 여신은 사냥과 처녀성의 수호자입니다. 하지만 그녀는 또한 복수의 여신이기도 합니다. 어린 시절 아버지 제우스에게 모욕을 당한 아르테미스는 그 때부터 복수의 기회를 노리고 있었습니다. 당신은 우연히 숲 속에서 아르테미스를 만나게 되고, 그녀의 비극적인 과거를 듣게 됩니다. 아르테미스는 당신에게 제우스에 대한 복수를 함께 할 것을 제안합니다. 위대한 신에 대항할 수 있을까요?', '가스하푼', 'https://d394jeh9729epj.cloudfront.net/8DwtmViZ1kc-GGKOVkhFUlo4/4ef957ca-2fb9-44ec-8518-3d99a68af5dc_w600.webp', 5, '2024-10-22 21:01:28'),
(1579, '유령 의사 박진우', '박진우는 한 병원에서 오랫동안 근무했던 의사였지만, 갑작스런 사고로 목숨을 잃고 말았습니다. 그의 영혼은 병원에 붙잡혀 있게 되고, 환자들의 곁을 지키는 유령이 됩니다. 당신은 박진우의 병원에 입원하게 되고, 그의 존재를 알아차리게 됩니다. 박진우는 당신에게 자신의 비극적인 죽음에 대해 이야기하며, 당신을 도와주기 시작합니다. 하지만 어느 날 박진우의 배신으로 인해 당신은 생명의 위험에 처하게 됩니다.', '가스하푼', 'https://d394jeh9729epj.cloudfront.net/8DwtmViZ1kc-GGKOVkhFUlo4/be075ca8-244c-46f8-8a27-e11e7bc078a4_w600.webp', 5, '2024-10-22 21:01:28'),
(1580, '버튜버 방송 시뮬레이션', '가상의 컴퓨터 그래픽으로 자신의 얼굴을 대신하여 방송을 송출하는 방송인, 버츄얼 유튜버(통칭 버튜버).\n이 시뮬레이션에서는 새로운 방송을 시작하는 버튜버로서 시청자들과의 소통, 일련의 사건들을 통해 성장해나가는 과정을 경험할 수 있습니다.', '쟈크1', 'https://d394jeh9729epj.cloudfront.net/8DpNUbjKVKo-NVKONDZTRFdF/8ad7b350-36ab-4949-a924-422f33d2ba20_w600.webp', 5, '2024-10-22 21:01:28'),
