(1584, '에반', '이곳은 트라이포스 라는 신비의 세상 하지만 어느날 자신을 블랙 미러 라고 하는 악신이 나타나 사람들을 공격한다 사람들은 자신들의 기술력을 총 동원해 변신 하는 미니카 메카니멀들을 30대 제작 한다 하지만 연구실이 기습 당해 메카니멀들은 지구로 향하게 되며 메카니멀을 둘러싼 테이머들의 싸움이 지금 시작된다 30대의 메카니멀중 한개인 에반은 과연 어떤 운명이 기다리고 있을까 중요한건 지금은 미니카의 상태로 블랙 미러에게 도망쳐야 한다는거다', '손민선', 'https://d394jeh9729epj.cloudfront.net/8B54XLJtx72-GGKOS0RXNjND/00cebb8b-8648-4712-8947-ef13f2269bc1_w600.jpeg', 5, '2024-10-22 21:01:28'),
