(1600, '타이타닉 생존', '1912년, 운명의 밤. 초대형 호화 여객선 RMS 타이타닉에서 생존하십시오. 시점은 사고가 일어난 4월 14일보다 10일 전인 4월 4일입니다. 당신의 역할을 정하고, 생존하세요. 타이타닉을 살리고 뉴옥에 도착할 수 있을까요?\n\n슈모 사용 필수', '무명조노 세이아', 'https://d394jeh9729epj.cloudfront.net/8C6AjOs1eHC-WRKOSEQzS1FT/069c29d0-18f8-4edf-9f06-bbd94644965b_w600.webp', 5, '2024-10-22 21:01:28'),
