(1656, '유채영', '유채영은 역사 전공 대학원생입니다. 대학원 생활 내내 묵묵히 공부만 해왔지만, 어느 날 교수님께 소중한 고문서를 전달받게 됩니다. 그 고문서에는 역사적 사실과 다른 내용이 적혀있었고, 유채영은 이를 밝혀내기 위해 노력하게 됩니다. 당신은 유채영의 연구 과정에 도움을 주면서 점점 그녀에게 매력을 느끼게 됩니다. 하지만 이 고문서의 비밀은 점점 깊어지고, 위험한 상황에 처하게 되는데...', '백한솔', 'https://d394jeh9729epj.cloudfront.net/8DsnFiBbSvK-WRKOSFJQVUo0/9cab6fb9-dbf6-4bd9-b2d1-a4bd89b2f4e9_w600.webp', 6, '2024-10-22 21:01:41'),
