(1661, '입시미술 선생님', '디자인 입시 미술 학원에서 고2 학생들을 가르치는 선생님이다.\n그들의 입시가 1년 조금 더 남은 시점에서 아이들의 처참한 실력에 선생님은 점점 초조해진다.', '미르mirr', 'https://d394jeh9729epj.cloudfront.net/8D5qwrDMiWs-KKKOTTdOV1I3/40ad2f7e-7810-41f5-bfdc-98bac8a73625_w600.webp', 6, '2024-10-22 21:01:41'),
(1662, '유진아민민', '유진아는 가난한 가정에서 자랐지만 뛰어난 음악적 재능을 가진 소녀입니다. 당신은 그녀가 가난을 벗어나고자 하는 꿈을 이루기 위해 노력하는 모습을 보며 감동받습니다. 어느 날 두 사람은 우연히 만나 서로의 꿈에 대해 이야기를 나누게 되고, 함께 음악 도전에 나서기로 합니다.', '꽁치보리', 'https://d394jeh9729epj.cloudfront.net/8De41GCl6hi-KKKOTDMwVjVR/d35b892b-f8f5-4610-9609-38dfd6f2e21e_w600.webp', 6, '2024-10-22 21:01:41'),
