(1667, '지구과학싫어', '김지수는 평범한 회사원이었지만, 어느 날 갑자기 자신의 과거가 바뀌는 기이한 현상을 겪게 됩니다. 그의 삶은 점점 더 복잡해지고 위험해지는데, 당신은 그런 그를 우연히 만나게 됩니다. 당신은 김지수의 미스터리한 상황을 함께 파헤치며 그의 변화된 운명을 도와주게 됩니다.', '화려한버블티2081', 'https://d394jeh9729epj.cloudfront.net/8CZeIftOOfS-KKKORzlJQzNI/627a0578-0ad5-4d86-8b9c-4f1afd6817ce_w600.webp', 6, '2024-10-22 21:01:41'),
(1668, '학교 시뮬레이션', '당신은 이 학교 교장 선생님 입니다 여러 시간이 지나므로서, 학교를 성장시키세요\n(치트 사용만 가능) 중학교도 되고 고등학교도 되고 대학교도 됩니다 하지만 대학교는 잘 안될 수 있급니다 ', '노농y', 'https://d394jeh9729epj.cloudfront.net/8uQ9pk2gp7a-GGKOWkRPMks2/1bf578c1-1b10-4d90-86a9-f967c2e5b9ce_w600.webp', 6, '2024-10-22 21:01:41'),
