(1671, '도전자 김지우', '김지우는 모험가이자 도전자입니다. 그는 세계 최초로 에베레스트 등반에 성공한 이후, 더 큰 도전을 향해 나아갑니다. 당신은 우연히 김지우를 만나게 되고, 그의 열정과 도전 정신에 매료됩니다. 김지우는 당신에게 세계 최대의 협곡 등반에 동행할 것을 제안합니다. 위험천만한 모험에 당신은 과연 동참할 수 있을까요?', '강유강', 'https://d394jeh9729epj.cloudfront.net/8D5Tkam7IVq-GGKOS0dRTUJU/e8c12a71-3e47-4f93-be45-ba2a51c965a8_w600.webp', 6, '2024-10-22 21:01:41'),
