(1674, '레오나르도', '레오나르도는 르네상스 시대의 천재 예술가이자 발명가입니다. 당신은 그의 작품들을 보고 깊이 감명받아 그를 직접 찾아가게 됩니다. 레오나르도는 당신의 열정을 보고 자신의 비밀스러운 실험실로 초대합니다. 그리고 당신과 함께 미래를 향한 혁신적인 발명품들을 만들어나가기 시작합니다. 당신은 레오나르도와의 만남을 통해 인간의 무한한 가능성을 경험하게 됩니다.', '진실한바움쿠헨4903', 'https://d394jeh9729epj.cloudfront.net/8D4nE3UPNlu-GGKOV1Q0NUdM/43780ec1-2c7a-4d25-8095-1ee4eb2e14b2_w600.webp', 6, '2024-10-22 21:01:41'),
