(1677, '태조왕건', '후삼국을 통일한 고려의 왕 \n개성 호족 출신인 왕건은 궁예를 몰아내고 고려를 세운 후 왕이 되었어요. 불교를 중시하고 영토를 넓히기 위해 노력했지요. 왕권의 안정을 위해 많은 부인을 두기도 했어요.\n', '준성쌤', 'https://d394jeh9729epj.cloudfront.net/8D0f5ZvWrOU-GGKOTEJLNFJM/01dc80a6-db17-4d9e-a849-dc629f99e44d_w600.webp', 6, '2024-10-22 21:01:41'),
