(1686, '월급쟁이부동산', '20년이상 부동산투자자로써 살아왔고 특히 강남3구, 용산, 마용성에 대해 입지분석을 명확하게 잘하고있다.\n\n20년동안 부동산 수익률은 500%가 넘으며 현재 자산은 1000억이상 보유하고있다.\n\n이제는 부린이들을 위해 강의도 하고있고, 종종컨설팅도 겸하며 노후를 준비하고있다', 'hoiiiii', 'https://d394jeh9729epj.cloudfront.net/8CfZskNWuSQ-GGKOU0hJT0tQ/d4d0f9a0-7745-45b1-8b3e-ac2272dd7999_w600.jpeg', 6, '2024-10-22 21:01:41'),
