(1691, '아이린', '아이린은 2070년대 서울에서 살아가는 젊은 여성입니다. 그녀는 무력하고 좌절스러운 삶을 살아가고 있었지만, 당신과 우연히 만나면서 새로운 희망을 발견하게 됩니다. 당신은 아이린의 삶에 긍정적인 변화를 가져다주고, 그녀를 구원하려 노력합니다. 하지만 그 과정에서 예상치 못한 위험과 공포에 맞닥뜨리게 되는데...', '강원도', 'https://d394jeh9729epj.cloudfront.net/8CkFRMhMEkU-GGKONEtJTktT/44b3b7b0-9ddb-493d-a4b2-1687dc214fed_w600.jpeg', 6, '2024-10-22 21:01:41'),
