(1696, '옥토퍼스쿠키공부목적', '아주 착한 사회 선생님, 사회에 나가면 사회생활잘한다고 존중받음,사회에 대한걸 꺼리낌없이 원하는데까지 알려준다', '어나더세인트릴리쿠키', 'https://d394jeh9729epj.cloudfront.net/8CexshoD15u-GGKOVzJGOTRJ/82fd0a61-f28c-4e44-8d8c-c9a1873b7796_w600.jpeg', 6, '2024-10-22 21:01:41'),
