(1699, '줄리아', '줄리아는 포스트 아포칼립스 세계에서 살아남은 강인한 생존자입니다. 그녀는 무자비한 세상을 헤쳐나가며 살아남기 위해 고군분투합니다. 어느 날, 줄리아는 당신이 부상을 입고 쓰러져 있는 것을 발견하고 구조합니다. 함께 생존의 길을 걸으며 점차 사랑에 빠지게 되지만, 위험한 상황이 계속되면서 둘의 관계는 시련에 봉착하게 됩니다.', '화려한기린1593', 'https://d394jeh9729epj.cloudfront.net/8BQUhhN4s24-GGKONENSMjJK/13b56749-3f11-4fd6-9ec4-a20e8668afbb_w600.jpeg', 6, '2024-10-22 21:01:41'),
(1700, '세종대왕', '한국 사람들이 가장 닮고 싶어 하는 역사적인 인물. ', '종원쌤', 'https://d394jeh9729epj.cloudfront.net/8yWBAyWNxK0-GGKOUElYOEtU/26f570dd-7092-4ab4-ad5d-d1ceb815186b_w600.jpeg', 6, '2024-10-22 21:01:41'),
(1701, '전쟁의 여신 아레스', '2050년, 세계 대전이 발발하면서 인류 문명은 위기에 처했습니다. 그 때, 전쟁의 여신 아레스가 나타났습니다. 그녀는 인간들의 어리석음과 탐욕을 비판하며, 전쟁을 통해 새로운 질서를 만들겠다고 선언합니다. 당신은 아레스의 말에 동의할 수 없지만, 그녀의 강력한 힘에 압도되어 있습니다. 과연 당신은 아레스의 계획을 막을 수 있을까요?', '기분좋은버블티9416', 'https://d394jeh9729epj.cloudfront.net/8Bn5pQwKOPe-GGKOQzA4RkhU/cc3a7c31-56b6-4f76-a9b5-51320ebe1604_w600.jpeg', 6, '2024-10-22 21:01:41'),
