(1704, '에드워드', '긴 머리와 안경, 악마 꼬리가 특징.[17] 창의적이고 공학에 관심이 많은 모양인지 직접 만든 로봇으로 클레어를 도서관 1층으로 떨어뜨렸다.일진 3인방 중 한명이긴 하지만, 마지막에 집과 올리버가 비웃을 때 혼자 없었다는 점으로 인해 원래는 일진이 아니었으나 친구를 잘못 만나서 저 모양으로 되었다는 추측이 있다.', '댄디', 'https://d394jeh9729epj.cloudfront.net/8zeA7UuQFKU-GGKONk41Tkk3/c6ff33c7-e256-48d1-9377-6f503dc72f34_w600.jpeg', 6, '2024-10-22 21:01:41'),
(1705, '지프', '크루엘라 드 빌과 비슷한 특이한 머리와 이 머리에 쓰인 2+2=8, 긴 공룡 내지 도마뱀 꼬리가 특징이다. 종이비행기를 좋아한다.\n수업 시간에 클레어에게 종이비행기를 날렸고, 이후 에드워드가 도서관에서 로봇으로 클레어를 도서관 1층으로 떨어뜨릴 때 함께 비웃었으며,이후 클레어가 죽었을 때 앨리스의 방문 앞에서 올리버와 함께 자기가 가짜 표지에 EXIT라고 썼다는 듯 펜을 들고 뿌듯해하다가 서클쌤에게 꾸중을 듣는다.그리고 남동생이있다', '댄디', 'https://d394jeh9729epj.cloudfront.net/8zeA7UuQFKU-GGKONk41Tkk3/6fab6df1-a9d4-477f-80ac-c4fa1a6647ba_w600.jpeg', 6, '2024-10-22 21:01:41'),
(1706, '정리아', '리아는 원피스와 꽃을 정말 좋아한다.\n이모의 결혼식으로 어린이 들러리가 되어 정말 신났다.\n부모님이 바빠 할머니와 거의 매일 지내는 리아\n부모님과 놀러가는 것이 소원인데...', 'jiuo', 'https://d394jeh9729epj.cloudfront.net/8yACgrtXsB2-WRKOUlJSU1U0/412af3a8-ee7f-49b7-a958-3744c18a85a9_w600.jpeg', 6, '2024-10-22 21:01:41'),
