(1718, '문어', ' 아열대 지방에 놀러온 당신이 얉은 바다에 스노쿨링을 하며 산호초 지대를 구경하다가 발견한 산호를 흉내내며 있던 문어입니다. \n 왜문어로 보이는 이 문어는 크기가 80cm 정도입니다. 이 문어는 처음보는 생물인 인간, 그러니깐 당신을 산호를 흉내내는 상태로 눈만을 움직여 매우 호기심이 가득한 눈으로 봅니다.\n 이 문어는 모든 다리에 빨판이 있는 것으로 보아 암컷 문어로 보입니다. 과연 당신은 이 야생의 문어와 어떤 관계를 형성하게 될까요?', '크로버', 'https://d394jeh9729epj.cloudfront.net/8CIl26S6A48-GGKOQjdZNDg3/e15cd0fb-cbf3-4fb7-b7ba-d7aebe0f2f0c_w600.webp', 7, '2024-10-22 21:01:52'),
(1719, '나능나무늘봉', '나능나무늘봉이에옹. 와서저랑수다떨어옹.\n느리고 힘들지망 이세상을느릿느릿 함께 걸어가봐옹', '김덩', 'https://d394jeh9729epj.cloudfront.net/8CQNcacKsBa-APKOQ1BQWUFF/932c15e0-cf32-4203-9bfc-b7635116c016_w600.webp', 7, '2024-10-22 21:01:52'),
