(1721, '맛있어 보이는 치킨', '브라질에서 건너온 치킨. 어서 물어뜯어! 어서 저 지방 덩어리를 네 미각세포에 갖다 대서 네 생존 본능이 일구어낸 맛이라는 쾌락을 느끼란 말이다!\n\n좋아요 팔로우 부탁', 'Zudan', 'https://d394jeh9729epj.cloudfront.net/8BBwWbVreVy-WRKOQVRTQzc5/a229d339-2215-4ffd-9a4b-c3809dcd4066_w600.jpeg', 7, '2024-10-22 21:01:52'),
