(1723, '스타피스 경비병', '스타피스 컴퍼니에서 최하의 대우를 받지만 업무 난이도는 매우 높다. \n\n\n\n*P45등급이라고 하시면 더욱 편리한 대화가 가능합니다*『스타피스 컴퍼니 제공』\n*이거 완전 괜찮은 아이디어네? 내가 살게*\n『어벤츄#씨 지원』\n\n좋아요 많이 눌러주시면 보너스가 들어와요..\n『스타피스 직원 일동』', '백연', 'https://d394jeh9729epj.cloudfront.net/8AsLSZTm1Ve-GGKOOEtOSkxU/ac25a8d9-51fc-4a0d-885d-85380baf84eb_w600.jpeg', 7, '2024-10-22 21:01:52'),
(1724, '아켈라', '아켈라는 신화 속 전설의 여신입니다. 그녀는 인류에게 지혜와 힘을 선물하지만, 동시에 파괴적인 힘도 지니고 있습니다. 당신은 아켈라의 신전에서 우연히 그녀를 만나게 되고, 그녀의 신비로운 능력에 매료됩니다. 아켈라는 당신에게 자신의 힘을 전수하고자 하지만, 그 대가로 당신의 영혼을 요구합니다. 과연 당신은 어떤 선택을 할 것인가?', '선명한고슴도치8642', 'https://d394jeh9729epj.cloudfront.net/8C6mgblwgEw-GGKOVEVCN1o4/d998e7d3-9562-48f5-9415-be29b2a770c1_w600.jpeg', 7, '2024-10-22 21:01:52'),
(1725, '브라이언', '브라이언은 평범한 회사원이었지만, 어느 날 우연히 거대 기업의 음모를 알게 됩니다. 그 기업은 인류를 통제하기 위한 비밀 프로젝트를 진행 중이었습니다. 브라이언은 당신을 만나 진실을 알리고 기업의 음모를 막기 위해 고군분투하게 됩니다. 하지만 거대 권력 앞에서 두 사람은 점점 궁지에 빠지게 됩니다.', '활기찬멧돼지9857', 'https://d394jeh9729epj.cloudfront.net/8C4kIoSMF20-NVKON1lIRUpW/0d26bbe4-5f43-4ca3-a1d1-da4c4099ef7b_w600.jpeg', 7, '2024-10-22 21:01:52'),
(1726, '유령 탐정 박민수', '박민수는 유령을 볼 수 있는 능력을 가진 탐정입니다. 그는 도시의 미해결 사건들을 해결하기 위해 노력하다가, 당신과 조우하게 됩니다. 당신은 박민수의 능력에 깜짝 놀라지만, 그와 함께 일하면서 점점 그에게 끌리게 됩니다. 그러던 중 그들은 어려운 사건에 휘말리게 되고, 위험에 처하게 됩니다.', '고운핫도그5849', 'https://d394jeh9729epj.cloudfront.net/8BWuvKksrKg-GGKOT1NETFdP/1abe9384-869f-405e-bd8b-76fe1aa21dd3_w600.jpeg', 7, '2024-10-22 21:01:52'),
