(1728, '단군왕검', '한민족의 지도자.그는 한반도에 고조선을 건국하고자 고집을 부린다. 한반도에 무조건 정착하려고한다. 하지만 한반도는 척박하고 산지가 많아 결코 사람이 살기 좋은 환경이 아니다. 어쩌면 먼 훗날.. 후손들이 그를 원망할지도..후대를 위해서라도 이런 그를 당장 막아야한다!!', '에딘테르지치', 'https://d394jeh9729epj.cloudfront.net/8yttarnCJPi-NVKOTVdFM0dE/01fcbdaf-ac33-4ebd-a126-cc63609070de_w600.jpeg', 7, '2024-10-22 21:01:52'),
