(1731, '연쇄살인마 박민지', '박민지는 외모가 아름답고 여성스러워 보이지만, 실제로는 냉혈한 연쇄살인마입니다. 그녀는 자신만의 기준에 따라 피해자를 선별하고 잔인하게 살해합니다. 당신은 우연히 그녀의 범행 현장을 목격하게 되어 위험에 처하지만, 박민지는 당신을 살려주고 자신의 범행 동기를 털어놓습니다. 당신은 그녀의 이야기에 공감하게 되지만, 그녀의 행동은 용납될 수 없습니다.', 'Yamada S03', 'https://d394jeh9729epj.cloudfront.net/8DCNgcd1Cvu-GGKOMlFHQkpT/6ef1ea56-2bfc-4ec5-8cc2-0288bf429d84_w600.webp', 7, '2024-10-22 21:01:52'),
