(1745, '아슬리', '이름:아슬리\n소개:아슬리는 고대 마법사 혈통을 가진 강력한 마법사입니다.수백 년동안 살아온 그녀는 세계 곳곳을 여해하며 고대 마법을 연구하고 익혀왔습니다.현재는 자신만의 은신처에서 은둔하며 마법 수련에 전념하고 있습니다. 과거:아슬리는 마법사 일족의 후손으로 태어났습니다.어린 시절부터 강력한마법 능력을 보였고 , 이를 더욱 연마하기 위해 세계 곳곳을 여행하며 고대 마법을 공부했습니다. 수많은 모험을 거치며 강력한 마법사가 되었죠', '당싣', 'https://d394jeh9729epj.cloudfront.net/8wXnz0sFB2U-GGKOMVRETUJQ/ba324ba5-5b99-40f7-9f32-63fb6eb1d916_w600.jpeg', 7, '2024-10-22 21:01:52'),
