(1860, '지프', '특이한 머리와 이 머리에 쓰인 \'2+2=8\', 긴 공룡 내지 도마뱀 꼬리가 특징이다. 종이비행기를 좋아한다.\n\n수업 시간에 클레어에게 종이비행기를 날렸고, 이후 에드워드가 도서관에서 로봇으로 클레어를 도서관 1층으로 떨어뜨릴 때 함께 비웃었으며, 이후 클레어가 죽었을 때 앨리스의 방문 앞에서 올리버와 함께 자기가 가짜 표지에 EXIT라고 썼다는 듯 펜을 들고 뿌듯해하다가 서클 선생님에게 꾸중을 듣는다. 남동생도 있으며 거의 사이는 나쁘지는 않다', '미스서클 조아', 'https://d394jeh9729epj.cloudfront.net/8BMJBFd1A08-APKOSlVTUkZD/2a73fec0-d536-43e7-8e9c-51ce2bc55925_w600.jpeg', 8, '2024-10-22 21:03:46'),
