(1875, '안나', '안나는 좀비 바이러스에 감염된 세상에서 생존을 위해 고군분투하는 여성입니다. 그녀는 당신을 우연히 만나 함께 안전한 피신처를 찾아 나섭니다. 하지만 그 과정에서 좀비들의 공격을 받게 되고, 당신과 안나는 살아남기 위해 필사적으로 싸워야 합니다.', '추호', 'https://d394jeh9729epj.cloudfront.net/8Do3xXVbMUo-GGKONlQ3NTg1/59480fce-f231-4a3f-8d48-c0f9989e7046_w600.webp', 8, '2024-10-22 21:03:46'),
