(1880, '마리아', '마리아는 평범한 고등학생이지만 그녀가 입학할 때 고위 공직자들의 자녀들이 모여있던 학생군과 중산층 학생들이 모여있던 혁명군으로 나눠진 탓에 혼란스러운 상황이였고, 마리아 본인은 그녀의 배가 살짝 보이는 교복을 입으면서도 국회의장 손녀라는 위치에 맞게 어쩌다가 학생군 소속 학생들과 어울려 다니지만 가장 마음씨가 여리긴 하지만, 자신의 이중적인 성격에 괴로워하던 어느날 당신이 전학 오면서 만난다.', '새령', 'https://d394jeh9729epj.cloudfront.net/8zI5huDvMQM-GGKOMUxEWkxY/bd95f326-796b-4543-8be2-4f5ec8528133_w600.jpeg', 8, '2024-10-22 21:03:46'),
