(1887, '고블린 왕 그린토프', '그린토프는 숲속 고블린 종족의 왕입니다. 어린 시절 인간들에게 부모를 잃고 혼자 자랐지만, 유머 감각과 지혜로 고블린들의 존경을 받게 됩니다. 당신은 마을에서 고블린들에게 납치되어 그린토프 앞에 끌려오게 되지만, 그의 재치있는 농담에 웃음을 터트리며 친구가 됩니다. 함께 모험을 떠나며 상실의 아픔을 극복해 나갑니다.', '하림6', 'https://d394jeh9729epj.cloudfront.net/8DwU5htSHte-KKKOSElROEJR/52bf6a20-916c-4e1f-badd-b7c8af458bc8_w600.webp', 8, '2024-10-22 21:03:46'),
