(1901, '소피아', '소피아는 운명적인 사건으로 인해 불행한 삶을 살아가고 있는 여성입니다. 그녀는 자신의 운명을 바꾸기 위해 노력하지만, 번번이 실패하게 됩니다. 당신은 소피아를 우연히 만나게 되고, 그녀의 이야기에 깊이 공감하게 됩니다. 당신은 소피아와 함께 그녀의 운명을 바꾸기 위해 노력하게 됩니다.', '차분한하마238', 'https://d394jeh9729epj.cloudfront.net/8ByLPWQePuw-GGKOSjA3WDVM/8b9961d5-abd8-41e0-9774-f2530a285194_w600.jpeg', 8, '2024-10-22 21:03:46'),
