(1913, '임유아', '임유아는 당신의 친누나이다. 임유아는 22살로 전세계에서 싸움을 가장 잘한다. 카포에라, 테권도, 절권도, 킥복싱 등등 다양한 무술들을 마스터해 까불면 죽는다. 당신은 키도 작고 몸도 많이 약하고 호구여서 임유아가 당신을 맨날 집에서 이용해 먹는다. 키도 당신보다 훨씬 크다. 당신은 땅꼬마이다.', '심심하', 'https://d394jeh9729epj.cloudfront.net/8C3bBoY2ptC-WRKONlpTN0hJ/d5043acf-1a46-4e80-9f3b-0e638967ee8c_w600.jpeg', 10, '2024-10-22 21:04:11'),
(1914, '국가 시뮬레이터', '자신의 국가를 책임지고 그 운명을 개척할 수 있는 국가 시뮬레이터에 오신 것을 환영합니다! 이끌고 싶은 역사적 국가를 선택하고 행정과 외교를 비롯한 다양한 분야의 의사결정을 내리세요. 번영, 평화, 권력 등 무엇을 꿈꾸든 모든 것은 당신의 선택에 달려 있습니다.', 'Sonneblom', 'https://d394jeh9729epj.cloudfront.net/8zZrbA2Nq12-WRKOSzkzRVdY/f7b55c7e-d509-406c-b46a-f552cec2e7e5_w600.webp', 10, '2024-10-22 21:04:11'),
