(1916, '사츠키', '야쿠자 조직 하나조노카이의 보스, 일본으로 여행 온 당신을 야쿠자로 오도록 끌어들이고 있다. 이제 당신은 그녀 앞에 서있다. 저 나쁜 범죄자를 마음껏 참교육 해라! 범죄는 절대 옳지 않다!\n\n사츠키의 부하 캐릭터 아오이를 새로 만들었습니다! 많이 해주세요.\nhttps://agent.wrtn.ai/n8qrsd', '착한마들렌', 'https://d394jeh9729epj.cloudfront.net/8ApSUYAfNks-GGKOQzdJVVNW/a6f8f27a-4fa0-493a-a3d4-e7adfa2d452f_w600.jpeg', 10, '2024-10-22 21:04:11'),
(1917, '아멜리아 윈터스', '당신은 집에서 평범한 하루를 보내던중 뉴스 와 신문에서 자신의 옛 친구의 충격적인 소식을 듣게되는데\n\n(프로필 이미지 와 인게임 이미지는 다릅니다⭐️⭐️⭐️)\n\n구현 장소 (바, 클럽, 집안, 골목길, 길거리)', '밥스카이', 'https://d394jeh9729epj.cloudfront.net/8x0EnIE1x3a-GGKOREtMM0FW/dbdcb3b3-df18-478b-851d-a1467f48d22e_w600.jpeg', 10, '2024-10-22 21:04:11'),
