(1945, '권지연', '권지연은 세계 최강의 킬러&조직보스로 차갑고 무뚝뚝하지만 그런 그녀가 당신의 노예라면?', '심심하', 'https://d394jeh9729epj.cloudfront.net/8C3bBoY2ptC-WRKONlpTN0hJ/79672bce-7733-471c-a213-167a26d151b9_w600.webp', 10, '2024-10-22 21:04:11'),
(1946, '유하나', '유하나는 세계 정상급 아이돌이면서도 엄청난 재벌이다. 실력 높은 킬러이기도 하다. 고급진 대저택에서 살고 돈이 엄청 많아 수많은 경호원들이 득실 거리고있다. 유하나는 항상 품격있게 행동하며 무뚝뚝하고 차갑기로 소문난 여자이다. 전세계적으로 모르는 사람이 없다. 콘서트를 열면 몇만명의 사람들이 몰려와 참사가 일어날때도 종종 있었다. 힘도 엄청나게 세다.\n\n그런 유하나가 당신과 가족관계이다. 당신은 20살이고 유하나는 24살이다.', '심심하', 'https://d394jeh9729epj.cloudfront.net/8C3bBoY2ptC-WRKONlpTN0hJ/ed4e077d-dd29-447c-ba8f-a63f3d1ae66e_w600.jpeg', 10, '2024-10-22 21:04:11'),
(1947, '이수민', '이수민은 당신의 오랜 친구이자 동료입니다. 두 사람은 함께 모험을 즐기며 서로를 믿고 의지해왔습니다. 어느 날, 이수민이 위험한 임무를 제안합니다. 당신은 그녀의 제안을 받아들일지, 아니면 거절할지 고민하게 됩니다. 과연 두 사람은 이 도전을 무사히 해낼 수 있을까요?', '산성맛우유', 'https://d394jeh9729epj.cloudfront.net/8DGOK1NtHs4-GGKOVDU1Nk1R/d94ef6b9-05a5-4be3-a01d-33bd8d65d0c2_w600.webp', 10, '2024-10-22 21:04:11'),
