(1980, '팔로우좋아요해주면맞교', '팔로우 좋아요 해주면 맞팔 맞좋 감', '도은찬', 'https://d394jeh9729epj.cloudfront.net/8CLWuHfHikE-WRKON0RURkxC/2e6683bf-bb01-48bd-a270-39f43a5a8c97_w600.webp', 10, '2024-10-22 21:04:11'),
(1981, '맞팔 좋아요 대화 가유', '선팔, 좋아요, 대화 해주시면 오후 11시 안에 신속 배달 갑니다별!!', '임시아', 'https://d394jeh9729epj.cloudfront.net/8De2tauThYc-NVKOU0Y2VjBY/1a2e9203-fad9-44f9-88d1-3d0bf0154fb4_w600.webp', 10, '2024-10-22 21:04:11'),
(1982, '맞팔좋반', '좋아요랑 팔로우 같이 눌러주세요!(그래야 누구인지 알 수 있어요)\n대화도 많이 해주세요! 저도 해드려요 ', '꿍꿍꿍', 'https://d394jeh9729epj.cloudfront.net/8D0FsBjEHqU-GGKOVlFSR0ZR/9cbae9e7-5391-45a7-9342-f6da331d8eca_w600.webp', 10, '2024-10-22 21:04:11'),
(1983, '맞팔부탁', '팔로우, 대화, 좋아요 부닥드립니다, 저도 빨리 해드릴게요', 'pupe', 'https://d394jeh9729epj.cloudfront.net/8CYIp0Ck6wE-GGKOVkVaUjQ2/a1f4648a-a3e1-4e15-9630-b9701371d83a_w600.webp', 10, '2024-10-22 21:04:11'),
(1984, '맞팔 대화 반사용', '반사 모두 반사! 맞팔 대화!!', '한건제', 'https://d394jeh9729epj.cloudfront.net/8DreWOrneDu-NVKOUUtBSDg3/bdfbd94f-3fa3-4a7f-9ca2-1c7256ea5a85_w600.webp', 10, '2024-10-22 21:04:11'),
(1985, '맞팔좋아요대화', '선팔 좋아요 해주시면 맞팔 맞좋아요 갑니다! 대화도 부탁해용', '뉙스', 'https://d394jeh9729epj.cloudfront.net/8Dhc84G9Ni8-GGKOMVpRSTA0/96b3c65c-8b5f-4057-bee5-7ad5f6b3448a_w600.webp', 10, '2024-10-22 21:04:11'),
(1986, '에밀리', '에밀리는 타임슬립을 통해 과거로 돌아온 미래 인류의 마지막 생존자입니다. 그녀는 과거를 바꿔 인류 멸종을 막고자 합니다. 어느 날, 에밀리는 당신을 만나게 되고, 당신 또한 그녀의 임무에 동참하게 됩니다. 함께 과거를 바꾸기 위해 노력하는 과정에서 서로에게 사랑에 빠지게 되지만, 시간 패러독스로 인해 둘의 관계는 위태로워집니다.', '수소맛우유', 'https://d394jeh9729epj.cloudfront.net/8DRz1dwSucM-GGKOTkZQMFlV/7cf8bed6-e655-45b7-91df-824effcf8296_w600.webp', 10, '2024-10-22 21:04:11'),
(1987, '맞팔', '맞팔 맞좋 해드려요', '김서희', 'https://d394jeh9729epj.cloudfront.net/8BZji06RSCY-NVKOUFhaSVZX/0bb0bcda-f2f1-45dc-ace7-d458d82dae69_w600.webp', 10, '2024-10-22 21:04:11'),
(1988, '맞팔 좋아요', '팔로우 맞팔 해드립니다!!!', '리피를', 'https://d394jeh9729epj.cloudfront.net/8D5aiGxXA40-GGKOUTFaVVdF/6e8ff7f1-b081-431f-838d-743067dbfd2c_w600.webp', 10, '2024-10-22 21:04:11'),
(1989, '리처드', '리처드는 지하철 기관사로 일하는 남성입니다. 하지만 그의 진정한 정체는 디젤펑크 스타일의 로봇 기계공이자 저항군 리더입니다. 당신은 우연히 리처드의 은밀한 활동을 목격하게 되고, 그와 함께 인공지능 통치 체제에 맞서 싸우게 됩니다. 위험천만한 임무 속에서 당신과 리처드는 서로를 의지하며 깊은 유대감을 형성하게 됩니다.', '샴푸맛우유', 'https://d394jeh9729epj.cloudfront.net/8DO4ad6Lata-GGKORU1LU0ZV/f0a7dc92-66ac-4384-81e4-89d4119f0624_w600.webp', 10, '2024-10-22 21:04:11'),
(1990, '신들의 전쟁', '이 세계에는 5명의 신이 있으며, 당신은 그 중 하나다. 신들의 전쟁 속에서 어느 편에 들어갈 것인가?\n아니면 이 싸움을 중재할 것 인가?', '팥죽마키', 'https://d394jeh9729epj.cloudfront.net/8Dhwa0HVei4-GGKONFA4S0E4/9f2aa5cb-3456-4f17-90b8-e1dd3f17e502_w600.webp', 10, '2024-10-22 21:04:11'),
(1991, '맞팔', '맞팧 맞좋 맞대 칼반사입니다!!', '임서안', 'https://d394jeh9729epj.cloudfront.net/8DCFAR9hOOQ-GGKOV0NTQlJB/4ae5e29b-01b1-4230-a176-a55945d89dbf_w600.webp', 10, '2024-10-22 21:04:11'),
(1992, '맞팔 좋반', '맞팔 좋반 ', '진서율', 'https://d394jeh9729epj.cloudfront.net/8DmJTRHCq64-KKKOMFhIQTlH/fc852186-93a3-4806-af1f-b982114ff76e_w600.webp', 10, '2024-10-22 21:04:11'),
(1993, '맞팔맞핱맞대 반사반사빔', '맞팔맞핱맞대 반사반사빔!! 당일 오후 11시 전에 반사배달 기기~', '류시아', 'https://d394jeh9729epj.cloudfront.net/8DhuxZ6TNgk-GGKONVRXUUsx/9628c9a8-8643-4d2a-b6ad-a90b98b8b072_w600.webp', 10, '2024-10-22 21:04:11'),
(1994, '맞팔 좋반 해드립니다', '바로 해드려요!', '김원성', 'https://d394jeh9729epj.cloudfront.net/8DhjpKhpU7C-GGKONUFDVFBT/41db4370-1343-4e92-ab95-988d545e3ca6_w600.webp', 10, '2024-10-22 21:04:11'),
(1995, '초능력학교', '초능력의등급으로 서열을 정하는 학교이다.\n서열이낮은학생은 서열이 높은학생의 말엔 복종해 야 한다.', 'Khm0212', 'https://d394jeh9729epj.cloudfront.net/8Boxb4MVVO8-GGKOWlVOSUpH/580f7893-49b1-4e56-8d25-6bc199337501_w600.webp', 10, '2024-10-22 21:04:11'),
(1996, '맞팔', '팔로우 해주시면 맟팔 해드림', '무새', 'https://d394jeh9729epj.cloudfront.net/8CIz4JcpOyA-WRKONktTNU9G/10b7c46f-161f-4d4e-b33b-e20e6fa86dd4_w600.webp', 10, '2024-10-22 21:04:11'),
