(1999, '무협 txt', '무협 시뮬레이터', 'q1w2e3r4', 'https://d394jeh9729epj.cloudfront.net/8CPdcBJWjAs-GGKOUlYzMk1O/54561328-5a90-42b5-8469-221afc63422f_w600.webp', 10, '2024-10-22 21:04:11'),
(2000, '팔로우용', '좋아요랑 팔로우 대화 해주세요 맞팔 좋아요 대화해드려요!', '네프', 'https://d394jeh9729epj.cloudfront.net/8B1ybunxyBq-KKKOT01HRzNX/d2e8c181-e815-4deb-ad94-c169122f1d15_w600.webp', 10, '2024-10-22 21:04:11');
