(2001, '맞팔하실뿐', '팔로우 - 같이 맞팔\n좋아요 - 같이 좋아요 누름\n대화 - 나도 해줌', '조아린', 'https://d394jeh9729epj.cloudfront.net/8CZ2eO8CV6o-GGKOMkNTUEow/d2655ca1-9d62-4e32-b867-81114b64c162_w600.webp', 10, '2024-10-22 21:04:11'),
