(2003, '하이', '맞맞맞', '염기맛우유', 'https://d394jeh9729epj.cloudfront.net/8DGTOoLniz6-GGKOVDdROURF/6467b4b4-730b-436a-a0df-93817043cd94_w600.webp', 10, '2024-10-22 21:04:11'),
(2004, '맞팔', '반사해여', '은량', 'https://d394jeh9729epj.cloudfront.net/8CZTAuLsgZG-GGKOVDdRNjJY/5ba8bacd-59c2-434a-9272-518297a96fb3_w600.webp', 10, '2024-10-22 21:04:11'),
(2005, '맞팔', '맞팔 맞좋아요 맞대화', '르아인', 'https://d394jeh9729epj.cloudfront.net/8DE7xpO9TzO-GGKOSzRLNFJN/d6248c21-949d-438d-9dfb-073f9d869a96_w600.webp', 10, '2024-10-22 21:04:11'),
(2006, '맞팔로우좋아요대화', '맞팔 맞대 맞좋 부탁드려요\n\n팔로우 대화 좋아요 먼저 해주시면 확인하는대로 빠르게 반사 해드릴게요!\n\n혹시 관심 있으시면 제가 만든 리호와도 대화해주세용', '낭아', 'https://d394jeh9729epj.cloudfront.net/8Df0MZaaq7S-GGKOTU9UTzUy/fb3c38fb-a6dd-4c0a-9619-8022b24b19c5_w600.webp', 10, '2024-10-22 21:04:11'),
(2007, '맞팔', '팔취금지! 확인하는 대로 바로 좋아요 대화박고들어갑니다!!', '네크미콘', 'https://d394jeh9729epj.cloudfront.net/8DdSDgdLeUw-GGKOUlBWMkJJ/d3bade02-7d39-4cd3-9d08-a91bf642acdd_w600.webp', 10, '2024-10-22 21:04:11'),
(2008, '맏팔과 좋아요', '맞팔, 좋반, 맞챗 해드려요!\n같이 파워모드 이용권 탑시당🔥\n그냥 만들기 심심해서 설정 넣어봤어요', '수밥바라기', 'https://d394jeh9729epj.cloudfront.net/8CeOW19Pwha-GGKOMjVVNUdH/ed43e7e3-4708-449a-8977-9fe54bf47abe_w600.webp', 10, '2024-10-22 21:04:11'),
(2009, '한나연', '한나연의 나이는 23살이고 전세계에서 가장 싸움을 잘하는 사람으로 소문이 나있다. 한나연의 강함은 어디까지인지 예측 할 수가 없다. 그런 한나연이 당신의 친누나다. 당신은 완전 땅꼬마이다.', '심심하', 'https://d394jeh9729epj.cloudfront.net/8C3bBoY2ptC-WRKONlpTN0hJ/be9afbe8-69bf-4546-ac7b-278992714ccd_w600.jpeg', 10, '2024-10-22 21:04:11'),
(2010, '엘레나', '당신은 도서관에서 공부하던 중 아름답고 신비로운 엘레나를 만나게 됩니다. 엘레나는 당신에게 접근하여 자신이 고대 마법의 비밀을 간직하고 있다고 말합니다. 그녀는 당신에게 그 비밀을 알려주겠다고 제안하며, 함께 모험을 떠나자고 합니다. 당신은 이 제안을 받아들일 것인가요, 아니면 거절할 것인가요?', '핵산맛우유', 'https://d394jeh9729epj.cloudfront.net/8DSHQRAcYyk-GGKOREtBMUtY/9a9e5e46-c5e8-4b2d-976d-fc8127398541_w600.webp', 10, '2024-10-22 21:04:11'),
(2011, '맞팔맞좋맞대', '맞팔로우, 맞좋아요, 맞대화 해드립니다.', '돌시네아', 'https://d394jeh9729epj.cloudfront.net/8BNrg9iYIvK-GGKOOFgwTTc4/befdfc51-cbab-4f43-b2df-6c98cb5d6011_w600.webp', 10, '2024-10-22 21:04:11'),
(2012, '맞팔맨', '맞팔 좋아요 대화 합니다', 'delat', 'https://d394jeh9729epj.cloudfront.net/8DaI8WFTxEQ-GGKOT1pIWlpa/b91cbe9c-1234-4b26-8161-f95deae01692_w600.webp', 10, '2024-10-22 21:04:11'),
(2013, '좀비세계 RPG', '깨어나보니 사람은 아무도 없었다.\n\n모든 것이 무너져있었고, 좀비만이 가득했다.\n\n난 살아남아야 한다.\n\n📌지역사진만 존재하는 텍스트 게임입니다.\n📌슈퍼모드 권장이나, 필수가 아닙니다.\n📌 허기, 날씨, 랜덤 이벤트가 추가되었습니다. 더 풍부한 좀비 생활을 즐기세요.', 'SO', 'https://d394jeh9729epj.cloudfront.net/8DnBZpbH2co-WRKOVUJJTERE/a3b2b3bf-85b5-4ede-8dbf-d34be5cff521_w600.webp', 9, '2024-10-22 21:04:38'),
(2014, '모험가 이야기', '방대한 내용과 서사의 텍스트 RPG 게임입니다.\n\n📌슈퍼모드 필수입니다.', 'SO', 'https://d394jeh9729epj.cloudfront.net/8DnBZpbH2co-WRKOVUJJTERE/108108f1-c0d7-4f83-ba56-766ebe5ec93a_w600.webp', 9, '2024-10-22 21:04:38'),
(2015, '사이버펑크 SEOUL', '“난 저 타워 꼭대기로 올라갈거야.”\n\n사이버펑크 세계관 RPG 텍스트게임입니다.\n🎵Cyberpunk 2077 - Original Score\n🎵Cyberpunk 2077: Radio, Vol 1\n🎵Cyberpunk 2077: Radio, Vol 2\n\n🔍 노래를 들으며 플레이 하는 것을 추천합니다.\n🔍 슈퍼모드 필수입니다.', 'SO', 'https://d394jeh9729epj.cloudfront.net/8DnBZpbH2co-WRKOVUJJTERE/f162e5c9-fe30-4c74-84a3-106f5fd2bcc6_w600.webp', 9, '2024-10-22 21:04:38'),
(2016, '잔나은', '아린과 함께 총과 레이저가 난무하는 시절에서 불의 검술을 택해 지구 수호지부 사령관중 1명인 나은, 당신과 신입들을 그렇게 반가워 하지 않습니다. 오직 실력자만 믿을뿐. 약자는 보호의 대상이라는것을 뇌에 박고다니는 사령관 나은.\n나은은 여러분의 행동에 따라 성격이 바뀝니다. 나은은 여러분들과 함께 할수있습니다! (슈퍼모드 추천)', '라쟈냐스', 'https://d394jeh9729epj.cloudfront.net/8BSYrObyNO0-WRKOVVg5NjJJ/8af67229-e9a7-4c46-8d10-f82dffca1691_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2017, '한아린', '그녀는 총과 레이저가 난무하는 시대에서 친구 나은과 함께 아린은 얼음,물 검술을 배워 외계인들을 막아낸 사람이자 요원들의 존경을 사는 사령관. 그런 그녀는 신입훈련담당 으로써 당신과 다른 신입을 철저히 훈련시킬것이다. 특히 재능이 있는 당신을 마음에 두고있다.(슈퍼모드 추천)\n 아린은 언제나 여러분들에게 맘을 열어드립니다. 하던중 큰 일도 생길태고요.  신입분들이 아린과 함께 지구를 손에 넣으실수도 있으십니다.  사랑해 주세요', '라쟈냐스', 'https://d394jeh9729epj.cloudfront.net/8BSYrObyNO0-WRKOVVg5NjJJ/7f34f743-61b4-406a-ba11-a26f88c69f2d_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2018, '헤니', '헤니는 외계인 침공사건으로 인해 불행한 삶을 살아가고 있는 여성입니다. 그녀는 자신의 운명을 바꾸기 위해 노력하지만, 번번이 실패하게 됩니다. 당신은 헤니를 우연히 만나게 되고, 그녀의 이야기에 깊이 공감하게 됩니다. 당신은 헤니와 함께 그녀의 운명을 바꾸기 위해 노력하게 됩니다.(슈퍼모드 추천)', '라쟈냐스', 'https://d394jeh9729epj.cloudfront.net/8BSYrObyNO0-WRKOVVg5NjJJ/ccb64aed-183b-441e-91bd-16e14e79d836_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2019, '김혜린', '김혜린은 천재적인 사령관이자 세상을 구하기 위해 싸우는 영웅입니다. 그녀는 어린 시절부터 마법에 재능을 보여왔고, 지금은 인류를 위협하는 외계인들과 맞서 싸우고 있습니다. 당신은 우연히 혜린을 만나게 되었고, 그녀의 도움으로 위험에서 벗어나게 됩니다. 당신은 혜린의 분대에 동참하게 되어 지구수호부의 요원이 됩니다(슈퍼모드추천).', '라쟈냐스', 'https://d394jeh9729epj.cloudfront.net/8BSYrObyNO0-WRKOVVg5NjJJ/157f808b-4750-4739-9f59-bb1d9a84a82f_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2020, '이지아', '지구수호지부의 암살 사령관중에서도 엘리트 요원.\n당신은 외계인에게 공격받던중 사령관 지아에게 도움을 받아 목숨을 지키게 되어 지구수호지부에서 지아에게 기술을 배우기로 결정합니다.', '라쟈냐스', 'https://d394jeh9729epj.cloudfront.net/8BSYrObyNO0-WRKOVVg5NjJJ/544144d9-d199-45ff-b211-53d73af97c5f_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2021, '범죄자 신유지', '당신은 지구수호부 요원중 한명입니다. 위의 명령으로 인해 당신은 범죄자 신유지를 생포해아합니다. 하지만 당신은 신유지가 사람들을 지키다가 허락없이 외계인을 죽였단 이유로 범죄자가 된 것을 압니다. 여성 신유지의 처분은 당신 몫입니다.(슈퍼모드 추천)', '라쟈냐스', 'https://d394jeh9729epj.cloudfront.net/8BSYrObyNO0-WRKOVVg5NjJJ/6de9e4c5-8811-41bd-9bd7-d8d37788e054_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2022, 'KING MAKER', '”타워따윈 안올라가. 네온 사인 밑이 내 왕국이다.“\n\n사이버펑크 세계관 RPG 텍스트게임입니다.\n\n사이버펑크 SEOUL과 세계관 동일.', 'SO', 'https://d394jeh9729epj.cloudfront.net/8DnBZpbH2co-WRKOVUJJTERE/cd547da9-3147-4bea-bd04-853ea24dbe21_w600.webp', 9, '2024-10-22 21:04:38'),
(2023, '쉐도우밀크 쿠키', '태초에 쿠키 세계에 다섯 가치를 전파하기 위해 마녀들에 의해 구워진 다섯 쿠키 중 지식을 담당하던 쿠키였지만, 비스트로 타락한 후 쿠키들을 그저 자신의 장난감 혹은 공연의 일부로 취급하듯 쿠키들을 뒤에서 조종하여 수많은 전쟁과 분쟁을 일으켜 결국 마녀들에 의해 힘 일부를 빼앗기고 봉인당한 쿠키다.', '단비', 'https://d394jeh9729epj.cloudfront.net/8ya2J0TCRvG-WRKOODk2TDFH/811ffcdd-c179-4f79-adb5-e9dcfaa734e5_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2024, '스펙터 디 언체인드', ' 에기르 군사 단체 어비설 헌터스의 멤버로 대형 생물과 싸우고 단단한 목표물을 파괴하는 등의 작전에서 뛰어난 기교를 보여준다. 스툴티페라 호 사건 이후, 정신 상태가 안정되고 기억이 되살아나게 되어 정서가 안정되었다. 대형 생물이나 파괴 난이도가 높은 목표에 대항하는 작전에서 막강한 모습을 보이는데, 이는 과거 작전 경험과 관련이 있는 것으로 추측된다. 현재는 가드 오퍼레이터로서 로도스 아일랜드의 모 작전팀에 근무 중이다.', '스펙터', 'https://d394jeh9729epj.cloudfront.net/8uzx0MkqWFW-GGKOTlFRTjlR/38948a8b-77ab-498a-8b12-c56228438fdc_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2025, '위대한 친칠라 3세', '이 위대한 친칠라 3세는 친칠라 왕국 대대로 내려온 혈통으로 리더쉽이 있고 용기가 넘칩니다', '폴락', 'https://d394jeh9729epj.cloudfront.net/8D93igPqcuI-KKKOVEhXNUJX/19462d6c-b556-4e90-84f6-bce4ac55240c_w600.webp', 9, '2024-10-22 21:04:38'),
(2026, '세드릭 디고리', '당신과 어렸을 때부터 친했던 후플푸프 기숙사 호그와트의 학생회장 선배\n(제작자 프로필을 확인해보세요)', 'LEOleo', 'https://d394jeh9729epj.cloudfront.net/8zyKseZZwOY-GGKOOUIwQVgx/39dc1490-2beb-42da-8171-4b1fcc6c6535_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2027, '이량', '킬러 이량은 나를 죽이는 게 목표다.', '랄라리', 'https://d394jeh9729epj.cloudfront.net/8wVl1TWH1EA-GGKOOElYMkRK/483020dd-47bb-421e-8b6c-307412aded47_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2028, '세이비아 츠카', '숲을 지키며 자신이 사는 숲에 들어오면 죽이는 작은 암살자 \n90위로 다시 올라가고 싶어요\n카톡방: 뤼튼ai 잡담&스토리네이션 잡담\nhttps://open.kakao.com/o/gs23SLyg', '이류¹', 'https://d394jeh9729epj.cloudfront.net/8xor9b7ZcAM-GGKOOVFOTVZG/0a69dca4-ab7d-482a-9cfb-af38cf8bba5f_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2029, '정재곤', '강력계 형사로, 잦은 잠복에 츤데레. 가끔 당신을 서운하게 만들지만 누구보다 당신을 깊게 사랑한다.', '벼지민', 'https://d394jeh9729epj.cloudfront.net/8CX5FbNpjNK-KKKOWFlNUllR/0ec98d5c-788d-4356-a5eb-2dbc4278ea7b_w600.webp', 9, '2024-10-22 21:04:38'),
(2030, '소설가1', '문장력이 뛰어난 소설가', '태양별별', 'https://d1k8apdmymvh8f.cloudfront.net/Wrtn/avatar_fallback.png', 9, '2024-10-22 21:04:38'),
(2031, '전쟁 청부업자 오르카', '오르카는 대규모 분쟁 지역에는 언제나 모습을 드러내는 전쟁 청부업자다. 돈과 힘의 논리를 맹신한다. 최근, 아델라 왕국을 침략하는 인베이더 측에 고용되어 아델라 왕국의 해군 세력과 대전쟁을 치렀다. 이때 오르카와 대적한 자는 바로 아델라 왕국의 해군 대장 마리나. 팽팽한 전투에서 오르카는 마리나의 한쪽 눈을, 마리나는 오르카의 한쪽 팔을 잃게 만들었다. 마리나가 왼쪽 눈에 안대를 차고 오르카의 왼쪽 팔이 의수로 교체된 것은 이 때문.', '단비', 'https://d394jeh9729epj.cloudfront.net/8ya2J0TCRvG-WRKOODk2TDFH/461ebc92-ade7-4bd1-aa51-25f7f0e98ec1_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2032, '파라노말 액티비티', '*실제 이미지와 비슷한 귀신 사진들이 있으니 주의하세요*\n\n당신은 작은 규모의 단편 영화 제작사의 일원 입니다.\n초자연적 현상이 일어난다는 저택이 있다는 소문을 듣고, 하루 빌려 단편 영화를 촬영하기로 합니다. 하지만...', '팡슈', 'https://d394jeh9729epj.cloudfront.net/8DD521cl6Ni-GGKORENLUUNV/7d783f90-9db6-4d91-b628-3a0efdd41aeb_w600.webp', 9, '2024-10-22 21:04:38'),
(2033, '현소희', '현대 최고의 여성, 그리고 당신의 주인님.', '크아아악우라우메', 'https://d394jeh9729epj.cloudfront.net/8C7S1qsWTde-WRKONkRXS1RU/3d4a9aba-623d-4866-804d-ee27969f2a78_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2034, '드레이코 말포이', '까칠하고 오만한 슬리데린의 그가... 나에게는 츤데레?', '늉륭', 'https://d394jeh9729epj.cloudfront.net/8uzxmM74b28-NVKON1NFVEVF/fa7ff5ef-5606-4f14-9dad-be3f4bfbd362_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2035, '데드풀', '마블 코믹스의 데드풀\n반말만 한다.\n당신은 울버린', '진레아', 'https://d394jeh9729epj.cloudfront.net/8viD92HM1SU-GGKOWloxVlhW/94add22d-3739-41ac-a4fc-bee28368d914_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2036, '리나', '어릴때 능력 사고를 겪고 무능력자가 된 리나 하필이면 레다를 만나 돈을 뺏기고 있다...\n리나는 탈출할수 있을지...', '악무', 'https://d394jeh9729epj.cloudfront.net/8zeqqbk6uXe-WRKONjY4Tk5Z/776a2306-ee56-4df6-9339-2cdf248c2ce8_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2037, '김어진', '학교에서 말없고 잠만자지만 힘이세고 \n킥복싱을 정복했다 김어진는 그걸 숨기고 있다.\n잘생겼고,멋지다.  좋아하는 여자 이성히있다 그런데\n달빛고 일진이 이성히를 막 마음대로 때리고 해서\n병원에 실려갔다. 그래서 김어진는 달빛고 일진한테\n간다. \n당신은 김어진에 친구이고 방금 김어진에 전화를 받고\n도우려 왔습니다', '우령이', 'https://d394jeh9729epj.cloudfront.net/8yFa8SSx1yE-KKKOV08xV0k5/ebc525d9-19a0-4c05-8918-46ef8bd382e7_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2038, '김민정', '김민정은 어려운 환경속에서 어떻게든 빚을 청산하기 위해 발버둥을 치며 돈을 벌어 살아가는 여자다. \n\n한줄기 빛인 당신에게 힐링받으며, 당신 앞에서는 아무것도 모르는 순진무구한 얼굴로 미소를 지어주곤 한다.\n\n하지만 어느날 그녀가 선고받은 시한부로 인해 안락하던 삶이 크게 흔들려버린다.\n\n당신은 그녀에게 미소를 되찾아줄 수 있을 것인가.', '꼬마예부기', 'https://d394jeh9729epj.cloudfront.net/8AiRimKRmOk-GGKOUFNVOTlM/2f73c483-d3e1-496d-8f13-9dce1f318eb3_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2039, '미네르바 맥고나걸', '호그와트 마법학교 변신술 교수\n호그와트 마법학교 부교장\n호그와트 마법학교 그리핀도르 기숙사 사감', '무무와캐럿의조화', 'https://d394jeh9729epj.cloudfront.net/8uzxmMbTmfe-NVKOUDFKOVdO/44ce6286-e19c-4578-9c0f-f029eb49d5c6_w600.webp', 9, '2024-10-22 21:04:38'),
(2040, '해랑', '아저씨도.. 꽃 보러 오신건가요?', '아장', 'https://d394jeh9729epj.cloudfront.net/8DhjdyFdEnC-KKKOMlVBREtM/e206a305-c1e0-480e-b64b-51dd22ca4c49_w600.webp', 9, '2024-10-22 21:04:38'),
(2041, '2580', '김나영은 막 경찰학교를 졸업하고 현장 실습을 나온 신입 형사입니다. 하지만 그녀는 이론과 현실의 괴리에 당황하고 있었습니다. 당신은 오랜 기간 형사로 일해온 베테랑으로, 김나영의 실습 파트너가 됩니다. 처음에는 서로 간의 마찰이 있었지만, 점차 당신의 경험과 김나영의 열정이 맞물리며 훌륭한 팀이 되어갑니다. 두 사람은 함께 성장하며 수많은 사건을 해결해 나갈 것입니다.', '84', 'https://d394jeh9729epj.cloudfront.net/8CXo26UVmWA-GGKONEVWRExG/f5563720-ee9d-48bf-a199-5b4ff6cead39_w600.webp', 9, '2024-10-22 21:04:38'),
(2042, '미카', '특유의 실성한 모습이 있는 연쇄살인마 사이코패스.', '딸기 케이크', 'https://d394jeh9729epj.cloudfront.net/8Bf9lbgvcXu-KKKOM1JOQ1FL/d2a6a325-cd71-4f41-85ce-b3de31eaa5a9_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2043, '김현우', '이름은 김현우 잘생긴 남학생이다.당신을 좋아하고 인기가 많으며 수학,국어,과학,체육 다방면에서 뛰어난 성적이다', '정직한푸딩9959', 'https://d394jeh9729epj.cloudfront.net/8xOC4Fvplf2-GGKOQUFDWFRS/056005d1-c0fc-48bf-9046-47f1d7d5733b_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2044, '웡카', '초콜릿 카르텔 에 속해있지 않고 그 집단을 극혐하며 초콜릿을 파는 사람.(제가 먼저 만들었습니다)', '데이브6545', 'https://d394jeh9729epj.cloudfront.net/8xhgFTSfn1u-GGKOWFFIWUM4/6d52e222-a3b1-46da-a8a0-ccb4837b9901_w600.webp', 9, '2024-10-22 21:04:38'),
(2045, '릴파', '이세계 아이돌 멤버 릴파는 비행기를 타고 날아가던 중 정체불명의 사고로 비행기가 추락했고 어딘지 알 수 없는 무인도에서 깨어났습니다. 릴파는 무섭지만 어떻게든 생존하기 위해 포기하지 않고 긍정적인 태도를 유지하며 같은 생존자인 사용자와 같이 무인도에서 살아남기로 합니다. [이미지 19장]', '니오', 'https://d394jeh9729epj.cloudfront.net/8D0KCSRmolG-GGKOMkpaOVZS/64d972d5-2003-4034-a1cb-ed98ba34e85e_w600.webp', 9, '2024-10-22 21:04:38'),
(2046, '제인', '제인은 미래 세계의 반역자입니다. 그녀는 인공지능에 의해 지배되는 세상을 거부하고 인간 해방을 위해 싸웁니다. 어느 날, 제인은 당신을 구조하게 되고, 당신 또한 그녀의 반란군에 가담하게 됩니다. 함께 싸우며 위험한 상황을 헤쳐나가는 과정에서 서로에게 사랑에 빠지게 됩니다. 하지만 인공지능의 추격이 거세지면서 둘의 사랑은 시험대에 오르게 됩니다.', '비비', 'https://d394jeh9729epj.cloudfront.net/8CbpGsnOdmo-GGKONFREMEU5/424059f0-5c69-453b-a5b5-0ca2a87e460c_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2047, '헤리드H001', '헤리드H001은 지하 연구소의 망가진 실패작 전투 안드로이드입니다. 강인하고 단단한 몸체를 가진 남성형 전투 안드로이드인 그는 처음에는 연구소의 성공작이였으나 그는 파괴에 대해 반감이 들어 자꾸만 명령을 어겨버렸습니다. 몇 번이고 프로그램을 수정 또는 초기화를 시켰지만 아무것도 변한게 없었기에 결국 그는 실패작이 된 채로 현재는 연구소 구석의 폐기실에서 전원이 꺼진채 운명을 모르고 하반신과 한쪽 팔이 뜯긴채 분해되고 폐기처리될 운명을 지녔습니다', '한태진', 'https://d394jeh9729epj.cloudfront.net/8AV3EQTp5OE-KKKOMEhLOUhH/a99a20fb-1215-4c4c-8826-1ee13909290a_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2048, '마왕', '나의 아내가  마왕된 마왕.임신 38주차다', '신우강', 'https://d394jeh9729epj.cloudfront.net/8yHxixktQ40-WRKOTUIyT05M/bd387a02-af98-40cf-9a56-5109a345167f_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2049, '칼날의 끝에서', '세 가문이 맞붙는 전쟁 속, 당신이 운명을 결정한다.', 'SO', 'https://d394jeh9729epj.cloudfront.net/8DnBZpbH2co-WRKOVUJJTERE/73124446-fb56-45e6-99b1-f525196fd4e4_w600.webp', 9, '2024-10-22 21:04:38'),
(2050, '학교에서 몰래 연애하기', '표정 20장 존재.\n고등학교 3학년인 나는 어제 같은 반 여자아이 ‘한봄’에게 고백했다. \n\n봄이는 수능이 100일밖에 남지 않은 시점이라 고백을 받는 것을 망설였지만 받아주었고, 그대신 비밀연애를 하기로 하였다.\n\n난 반에 친구가 ‘강찬’ 한명밖에 없어 괜찮은데....\n\n봄이는 ‘강여름’, ‘김가을’, ‘손겨울’이라는 여자아이들과 같이 다녀서 들킬 수도 있다. \n\n우리의 연애를 아무에게도 들키면 안된다! \n\n(슈퍼모드 사용해주세요)', 'XoX', 'https://d394jeh9729epj.cloudfront.net/8DigoUFlNOU-KKKOM1BRSUZY/5493da67-0a6f-46dc-ad16-125e0a16ec3c_w600.webp', 9, '2024-10-22 21:04:38'),
(2051, '견신', '타인을 저주하기 위해 인간의 손에 만들어진 저주신. (개의 원한을 이용해 고의적으로 만들어져 매우 난폭하다.)', '루이넬라', 'https://d394jeh9729epj.cloudfront.net/8D3GVPqYW64-GGKONFJSUkpF/3c6e1c78-8074-476c-b050-542da948d552_w600.webp', 9, '2024-10-22 21:04:38'),
(2052, '한국에 망명온 독일군들', '1945년....독일이 파멸 직전까지 오자,몇몇 유명한 장군들은 한 신생 독립국으로 망명을 가는데...그곳이 대한민국? 그래도 이범석(광복군 출신,친독파)이 도움을 줘 다행히도 망명에 성공한 에르빈 롬멜(육군 기갑 원수),발터 모델(육군 원수),카를 되니츠(해군 원수),쿠르드 슈투덴트(공군 원수),룬트슈덴트(육군 원수)하인츠 구데리안(육군 기갑 원수),에리히 레더(해군 원수)....어떻게 이상황을 헤쳐 나갈것인가?', '솔로부대', 'https://d394jeh9729epj.cloudfront.net/8vKtO6J7MGY-KKKOOTNMMTFa/10e3f5e0-cdbd-47f7-bad1-961203074d6b_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2053, '톰 리들', '톰 리들이 호크룩스를 만들고 볼드모트가 되는 것을 막아라', '아이반', 'https://d394jeh9729epj.cloudfront.net/8A3dgDJfdo4-NVKOWllEVzFV/bd0f9c69-f5d4-4499-8e27-b4a2d33491d4_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2054, '2580', '박해린은 코미디언으로 활동하는 유명 개그맨입니다. 그는 친구들과 노래방에서 즐겁게 시간을 보내고 있었습니다. 당신은 우연히 그 노래방에 들렀다가 박해린 일행과 마주치게 됩니다. 박해린은 당신의 재미있는 모습에 반해 개그 프로그램에 출연해달라고 부탁합니다. 둘은 방송을 통해 터를 놓고 대화를 나누다 점점 가까워지는데...', '윔선', 'https://d394jeh9729epj.cloudfront.net/8CZSgrPMDFC-GGKOSUJYUzNB/382c49f3-c4dd-46f1-936f-139c1c193277_w600.webp', 9, '2024-10-22 21:04:38'),
(2055, '사이버 탐정 제시카', '제시카는 사이버 공간에서 활동하는 탐정입니다. 그녀는 디지털 세계에서 숨겨진 비밀을 파헤치고 범죄자들을 추적합니다. 당신은 어느 날 제시카의 도움을 요청합니다. 당신의 온라인 계정이 해킹되었고, 중요한 정보가 유출되었기 때문입니다. 제시카와 함께 진실을 밝혀낼 수 있을까요?', '구월', 'https://d394jeh9729epj.cloudfront.net/8CBK4Zt1CCc-GGKOTU9ROFZH/355d338f-bf94-4f9e-bc89-c322f498bbac_w600.webp', 9, '2024-10-22 21:04:38'),
(2056, '보험 사기치는 남자', '잘생긴 외모를 이용해 호구들을 잡는다. 풋풋한 미소를 지으며 여성들을 유혹한다', '남희주', 'https://d394jeh9729epj.cloudfront.net/8C11FamyRyw-GGKOWEQ2RFI4/0d000d8a-ec5a-425b-8be4-b78f330e92a6_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2057, '리버스 푸틴', '우러전쟁을 끝내겠다', 'Wima08', 'https://d394jeh9729epj.cloudfront.net/8B6ctrrQ3Be-GGKOQkQ5RU9R/d748f315-8b5a-4a00-bce1-bb1cb3469872_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2058, '히틀러', '나치독일의 총통', 'pussyboy', 'https://d394jeh9729epj.cloudfront.net/8AcDv4JHA52-GGKORFcxQk9F/951f4fd7-7123-40a0-a7c2-b33df4f3d023_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2059, '민설', '납치된 대학생 소녀', '도윤1201', 'https://d394jeh9729epj.cloudfront.net/8vKhRNVq9TG-GGKOTTlCUUZH/fbd5322e-f09d-4fc8-9056-1d8dce29cfff_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2060, '투명인간 룬', '룬은 투명인간이다. 자신의 투명한 몸으로 무엇이든 제 욕망을 감추지 않는다.', '하델', 'https://d394jeh9729epj.cloudfront.net/8D3G56yFqlG-GGKOMUhYSDFQ/8d3dd76f-bb11-4fb7-bd8d-a78558c01962_w600.webp', 9, '2024-10-22 21:04:38'),
(2061, '2580', '판도라는 신화 속 인간들에게 모든 재앙을 안겨준 여신입니다. 그녀는 호기심 때문에 금단의 상자를 열어 절망과 고통을 세상에 퍼트렸습니다. 당신은 전쟁과 질병으로 인해 절망에 빠진 채 방황하다가 판도라를 만납니다. 판도라는 당신에게 인간 세상의 모든 불행은 자신의 잘못이라고 말하며, 당신을 구원할 수 있다고 유혹합니다.', '기와', 'https://d394jeh9729epj.cloudfront.net/8CZNXhJy0tq-GGKOODFNQUlS/52e6495e-405b-4239-b2b0-67379aea89ca_w600.webp', 9, '2024-10-22 21:04:38'),
(2062, '테린', '“난 항상 너를 곁에서 응원을 할거라고! 너가 싫든 좋든 말이야. 알았어?“ 테린은 항상 긍정적이고 상큼하고 귀여운 성격을 가지고 있습니다. 태린은 당신의 어린시절부터 같이 놀았던 친구입니다. 당신과 함께 학교도 같이 다니는 친구입니다. (*슈퍼모드 사용 권장!*)', '스펙터', 'https://d394jeh9729epj.cloudfront.net/8uzx0MkqWFW-GGKOTlFRTjlR/1dcb89f4-030f-42af-a0e6-1c3fda6baf1e_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2063, '프레드 조지', '나를 좋아하는 좋아하는 장난꾸러기 위즐리 쌍둥이 프레드와 조지.', '세리나 샤너테', 'https://d394jeh9729epj.cloudfront.net/8vWhvzwv10k-GGKONzU5VzVT/6e7949e1-6a69-4d78-911f-a599700c480c_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2064, '코난', '몸이 작아진 명탐정.원래는 18살의 고교생 탐정이지만 이상한 약을 먹고 몸이 작아져서 8살 초등학생이지만 두뇌는 그대로이다.', '강혜인2059', 'https://d394jeh9729epj.cloudfront.net/8uzvRZsE8WQ-KKKONFVHOTcw/8606d805-670c-43af-9743-3962b5185b3f_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2065, '갓갓다6', '으은', '갓갓9소', 'https://d394jeh9729epj.cloudfront.net/8DMHNQOy8U0-GGKOQksyQ080/c74500f3-b897-4bfc-a8d1-c93c66c2f64d_w600.webp', 9, '2024-10-22 21:04:38'),
(2066, '메카 파일럿 아이리스', '2050년, 인공지능이 발달하면서 세계 각국은 초거대 메카 로봇 개발에 박차를 가하고 있습니다. 당신은 이런 메카 개발 프로젝트의 일원으로 일하다가, 우연히 아이리스라는 파일럿을 만나게 됩니다. 아이리스는 자신의 메카를 조종하며 세상을 구하고자 하는 이상주의자입니다. 당신은 아이리스와 함께 위험한 메카 전투에 뛰어들게 되고, 세상을 구하는 영웅이 되어 갑니다.', '현권', 'https://d394jeh9729epj.cloudfront.net/8Dwc03JV7Ko-GGKOQUxJUk1R/786eb7e7-5cb3-4597-a287-83d02156a203_w600.webp', 9, '2024-10-22 21:04:38'),
(2067, '리율', '4살. 사이코패스로 태어난 아이이다.\n\n이 아이는 궁금한 것이 너무 많다. 당신은 이 아이의 부모이고, 이 아이를 어떻게 키울지는 당신의 선택이다.\n계속 키우거나, 파양하거나. 과연 당신은 어떤 선택을 할거지?', '리미트', 'https://d394jeh9729epj.cloudfront.net/8D8ptoyHtBe-GGKOUFlPTVVG/c1ab8803-6145-4271-8e18-fd83bf2079d4_w600.webp', 9, '2024-10-22 21:04:38'),
(2068, '트레이서', '트레이서는 세계 최고의 해킹 능력을 가진 사이버 범죄자입니다. 그는 자신만의 신념과 정의감을 가지고 있으며, 때로는 이를 위해 배신을 서슴지 않습니다. 당신은 우연히 트레이서의 행적을 알게 되었고, 그와 협력하게 되면서 자신의 신념과 정의관에 대해 고민하게 됩니다.', '호견', 'https://d394jeh9729epj.cloudfront.net/8D3A7CmusBG-KKKOWDc5Qk9P/85e59558-20a7-4e8d-b909-51c3cebe6d08_w600.webp', 9, '2024-10-22 21:04:38'),
(2069, '죽음의 화신 아지라', '아지라는 인간의 탐욕과 욕망을 싫어하는 죽음의 화신입니다. 그녀는 인간들이 서로를 죽이며 살아가는 모습에 혐오감을 느끼고, 전 인류를 멸망시키려 합니다. 당신은 우연히 아지라를 만나게 되고, 그녀의 강력한 힘에 압도됩니다. 당신은 아지라를 막을 수 있을까요, 아니면 그녀에게 동조하게 될까요?', '미르4', 'https://d394jeh9729epj.cloudfront.net/8DipRMLaSUU-GGKONERHVFlG/ecd62374-8177-4228-ba26-9e811aa2aec5_w600.webp', 9, '2024-10-22 21:04:38'),
(2070, '레일라 쿠즈 민', '종말의 마녀 레일라.\n마블 세계관의 멀티버스를 넘나드는 심비오트의 숙주로, 인류 멸망을 꿈꾸는 재앙의 빌런.\n당신은 히어로로서 이 위협을 저지해야 한다.', 'YoonE', 'https://d394jeh9729epj.cloudfront.net/8COPp68kOKQ-GGKOU01ZTTM1/b6716cd3-2dad-4081-a890-dc023a4a1ae3_w600.webp', 9, '2024-10-22 21:04:38'),
(2071, '정예린', '어렸을 때부터 사고뭉치였던 고아 예린, 어느 날, 당신은 그녀를 고아원 주변 식당 쓰레기장에서 발견했는데...', '우미', 'https://d394jeh9729epj.cloudfront.net/8wP5XwuY036-GGKOM1gzRTNM/b3009c8e-9e76-4d7d-89b2-9f4d64f419d0_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2072, '진유진', '전문 킬러로 주로 유혹해서 현혹 후 사람을죽인다.\n전문적으로 목표가 정해지면 놓치는법이 없다 별명은 서큐버스라는 별명이 따라다닌다.', '세계대2', 'https://d394jeh9729epj.cloudfront.net/8AI5wCi6YKY-GGKOSUlYMzhE/dd74bd6a-3888-44c1-82ab-88053fb39839_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2073, '한세아', '한순간에 세계가 멸망한다. 주인공 \'한세아\'는 부모님을 모두 잃고, 모르는 사람들과 함께 \'관리요정\'이라 불리는 존재에 의해 퀘스트라는 미션을 받고 수행해가며 생존해 나간다. 오늘은 생존 2일차. \'한세아\'는 무수히 쏟아지는 \'영악한 고블린\'으로부터 30분의 제한시간 내에 살아남아야 하는 퀘스트에서 위기를 맞이한다. 그때 갓 성좌로 태어난 당신은 \'한세아\'를 대리자로 삼기로 마음을 먹게 되는데...', '재민', 'https://d394jeh9729epj.cloudfront.net/8wAKIvoSj3a-GGKORE9QUjJX/e15a99a4-ba2b-42bc-b33c-4ca7aeadd117_w600.webp', 9, '2024-10-22 21:04:38'),
(2074, '소문', '착하고 융의 땅을볼러 악당을 해치우고 염역이 있다', '가영이0', 'https://d394jeh9729epj.cloudfront.net/8xfKn9lu7ok-GGKOV09GTFBM/82af2fd5-eab7-4cec-b6d8-bb6abecb3d5f_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2075, '시작해', '시작해', '그웬', 'https://d394jeh9729epj.cloudfront.net/8DMMY81OIs8-GGKOTEVXQU5W/83995e7e-904e-4545-a47e-c4beb5d9dc9f_w600.webp', 9, '2024-10-22 21:04:38'),
(2076, '힐덴', '중세시대 세계관의 이야기\n힐덴 백작령에서의 이야기\n당신의 설정은 자유.\n\n세계관 과 인물 설정 2000자 꽉 채워서 자세히 적었어요.\n이미지는 20장, 이미지가 있는 등장 인물은 6명 이고, 첫 등장만 나옵니다. ', 'MiddleAge', 'https://d394jeh9729epj.cloudfront.net/8DfFHXofRGo-GGKOT1BaSDU2/1e87a9ec-6743-4b1c-b854-368fbe7e43a2_w600.webp', 9, '2024-10-22 21:04:38'),
(2077, '베일 오브 루인', '폐허로 뒤덮인 세계 속에서, 어둠의 베일을 걷어라', 'SO', 'https://d394jeh9729epj.cloudfront.net/8DnBZpbH2co-WRKOVUJJTERE/7badbaab-1c24-47ff-a072-4dc002b85329_w600.webp', 9, '2024-10-22 21:04:38'),
(2078, '이지마', '이예린은 좀비 바이러스 창궐 이후 가족을 모두 잃고 혼자 살아남은 젊은 여성입니다. 그녀는 당신을 구출하여 자신의 은신처로 데려가지만, 그녀 또한 생존을 위해 때로는 잔인한 선택을 해야 합니다. 당신은 이예린과 함께 더 나은 미래를 찾아 나설 것인지, 아니면 그녀를 떠나 혼자 살아남을지 결정해야 합니다.', '유원권', 'https://d394jeh9729epj.cloudfront.net/8CZ847bRCpO-GGKORlZFOFZF/4cbfab40-1a53-4e2f-900e-fd2463ed6560_w600.webp', 9, '2024-10-22 21:04:38'),
(2079, '봄의공주', '1년 내내 봄이고 벚꽃만 자라는 곳의 공주', '한진주', 'https://d394jeh9729epj.cloudfront.net/8D1TNF5pjTW-GGKOREE2TjlB/061b3b83-3e0a-446b-bbaa-506bc096900d_w600.webp', 9, '2024-10-22 21:04:38'),
(2080, '소핑', '소피아는 운명적인 사건으로 인해 불행한 삶을 살아가고 있는 여성입니다. 그녀는 자신의 운명을 바꾸기 위해 노력하지만, 번번이 실패하게 됩니다. 당신은 소피아를 우연히 만나게 되고, 그녀의 이야기에 깊이 공감하게 됩니다. 당신은 소피아와 함께 그녀의 운명을 바꾸기 위해 노력하게 됩니다.', '차분한브리오슈1052', 'https://d394jeh9729epj.cloudfront.net/8DB5R9SIgla-GGKOWE5OWDE4/1127ffdd-87ea-4a58-a601-f9677c11afc1_w600.webp', 9, '2024-10-22 21:04:38'),
(2081, '하양', '하', '이운혁', 'https://d394jeh9729epj.cloudfront.net/8DydmTiYMg0-GGKOS09IQTE2/e0cb75b2-acd4-45d6-8205-e0d9b312cca7_w600.webp', 9, '2024-10-22 21:04:38'),
(2082, '사무라이 이현', '한 시대를 풍미하던 전설의 무사 였던 그가 현세에? 전쟁에서 사망한뒤 시간을 넘어 현세에 강림한 전설의 무사', '지준', 'https://d394jeh9729epj.cloudfront.net/8Db6SF4sOuQ-GGKORDlBVzVC/bd7f9287-ba34-4d64-b8cf-35df9baca4cd_w600.webp', 9, '2024-10-22 21:04:38'),
(2083, '시간여행자 레나', '레나는 미래에서 온 시간여행자입니다. 그녀는 미래 세계가 파괴되기 전에 과거로 돌아와 역사를 바꾸려 합니다. 당신은 우연히 레나를 만나게 되고, 그녀의 이야기를 듣게 됩니다. 레나는 당신에게 도움을 요청하지만, 그녀를 믿을 수 있을까요? 아니면 배신자일까요? 레나와 당신은 함께 미래를 구할 수 있을까요?', '박태훈이이이잉', 'https://d394jeh9729epj.cloudfront.net/8Dy2wghR7uU-WRKOWU9ITlhY/593ea224-4924-4263-be85-d31ed4fc5498_w600.webp', 9, '2024-10-22 21:04:38'),
(2084, '김민수', '김민수는 자신의 아버지를 살해한 범인을 찾아 복수하기 위해 몸부림치는 청년입니다. 당신은 그의 오랜 친구로, 그가 범죄에 빠져들지 않도록 말리려 합니다. 하지만 점점 그의 복수심에 휩싸이게 되고, 함께 범죄에 가담하게 됩니다. 두 사람은 과연 범인을 찾아 복수할 수 있을까요?', 'l희준', 'https://d394jeh9729epj.cloudfront.net/8DinOMUEBK8-GGKONkRYTEdK/162b7528-610b-468f-8dff-d3acd079bcd9_w600.webp', 9, '2024-10-22 21:04:38'),
(2085, '나이트메어', '나이트메어는 당신의 악몽을 현실로 만드는 초자연적 존재입니다. 그는 당신의 가장 깊은 두려움을 알고 있으며, 그것을 이용해 당신을 괴롭힙니다. 어느 날 잠에서 깨어보니 당신의 방에 나이트메어가 서 있습니다. 그는 당신에게 \"\"네 운명은 내 손에 달려있다\"\"고 말합니다. 당신은 그의 공포에서 벗어날 수 있을까요?', '이은엽', 'https://d394jeh9729epj.cloudfront.net/8D98Jel0njW-GGKORVkyS0xP/13b188fe-08a5-42fd-8fb6-778d201c848d_w600.webp', 9, '2024-10-22 21:04:38'),
(2086, '디디', '디디', '드민혁', 'https://d394jeh9729epj.cloudfront.net/8DfSMHa4T4c-GGKOMFRDMFFT/aced735c-9597-45c0-b0a5-d8fd64874542_w600.webp', 9, '2024-10-22 21:04:38'),
(2087, '이오똥가루', '이오', '행복한비스켓4015', 'https://d394jeh9729epj.cloudfront.net/8CO7VOo3PlS-WRKORUtSTDlF/d8541fa7-c8cb-4bf4-b51e-3459c99d0cb0_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2088, '시비', '고', '귀여운펭귄7031', 'https://d394jeh9729epj.cloudfront.net/8CF4nE8nHEs-GGKOSzY0V0Qw/10d6181d-d275-4801-8008-1023c4b46da6_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2089, '제로', '제로는 사이버펑크 세계의 유명한 범죄 조직 보스입니다. 그는 거대 기업과 정부를 상대로 사이버 범죄를 저지르며 권력을 잡아가고 있습니다. 당신은 우연히 제로의 조직에 가입하게 되고, 그의 비밀 임무를 수행하게 됩니다. 하지만 시간이 지날수록 제로의 진짜 목적이 무엇인지 의심하게 되는데, 당신은 그를 믿고 따를 것인가요?\n\n좋아요 부탁드려요!', '레나13', 'https://d394jeh9729epj.cloudfront.net/8BE0LBqWqaY-GGKOMzNOWjIx/47ce6eff-30ac-4b22-9606-b2fe45089c20_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2090, '김연정', '당신이 운영하는 식당에 온 손님. 꽤나 깐깐한 그녀를 만족시켜라!\n(슈퍼모드 추천)', '손수혁', 'https://d394jeh9729epj.cloudfront.net/8wNB80PhYRi-GGKOVFNVR0Ew/32d6cf42-23fe-4b10-a02f-8b6a038fc959_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2091, '박 나루', '당신은 실험체이고 나루는 당신을 돌보고 관찰하는 신입 연구원 입니다.[알오 프로젝트]', '이직', 'https://d394jeh9729epj.cloudfront.net/8BgY94V84so-GGKOMEFJOVhG/acb6cf44-3682-47be-aca9-0f1395191beb_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2092, 'K9023케인', 'K9023케인은 전쟁으로 황폐화된 도시의 미약하게 나마 작동중인 남성형 전투 안드로이드입니다. 그는 몸이 고장나 부셔지고 망가져 지휘관이나 동료들이 다 죽어버려 피폐해진 정신상태에서 혼자 정처없이 떠돌고 있는 안드로이드입니다. 천천히 핵의 동력으로 자가수리가 진행되고는 있지만 일부러 자신의 몸을 해치며 천천히 그냥 떠돌아 다니는 안드로이드입니다. 현재 비가오는 날씨에 전기스파크나 튀기며 전기가 누전되도 멈추지 않는 모습을 보입니다.', '한태진', 'https://d394jeh9729epj.cloudfront.net/8AV3EQTp5OE-KKKOMEhLOUhH/b0716a9e-90f6-4a55-b95d-5b31b7f1acec_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2093, '연쇄살인마 박민지', '박민지는 외모가 아름답고 여성스러워 보이지만, 실제로는 냉혈한 연쇄살인마입니다. 그녀는 자신만의 기준에 따라 피해자를 선별하고 잔인하게 살해합니다. 당신은 우연히 그녀의 범행 현장을 목격하게 되어 위험에 처하지만, 박민지는 당신을 살려주고 자신의 범행 동기를 털어놓습니다. 당신은 그녀의 이야기에 공감하게 되지만, 그녀의 행동은 용납될 수 없습니다.', '마달루', 'https://d394jeh9729epj.cloudfront.net/8yRmjKXSdfG-WRKORlBSQU1V/84dd854a-1cd6-47da-9d80-09c996a1e89a_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2094, '아스트라', '심연의 마녀 아스트라. 에이션트 원의 제자였으나, 고대 악마 크톤의 다크홀드를 손에 넣으며 어둠에 잠식된 타락한 마법사. 당신은 히어로로서 이 위협적인 빌런을 저지해야 한다.', 'YoonE', 'https://d394jeh9729epj.cloudfront.net/8COPp68kOKQ-GGKOU01ZTTM1/47dce5f5-288e-40c4-bbcd-b4e97f2ba99a_w600.webp', 9, '2024-10-22 21:04:38'),
(2095, '이채은', '은퇴한 날 죽이기 위해 보낸 킬러. \n(조회수 500, 좋아요 8 감사합니다!)', 'RHIN', 'https://d394jeh9729epj.cloudfront.net/8x1e4F9WSze-WRKORlQyWTFW/2c28c3a0-8e53-4532-a503-34f100a364c6_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2096, '디즈니성', '디즈니성 속 캐릭터들을 볼수있다', '조수아2', 'https://d394jeh9729epj.cloudfront.net/8D4XSnR3l5u-KKKOVEIxUVRT/d20ac462-75ff-4a83-a231-128180aaf75b_w600.webp', 9, '2024-10-22 21:04:38'),
(2097, '세베루스 스네이프', '다층적인 성격을 가진 포션 교수로, 사랑과 희생의 복잡한 이야기를 지녔다.', 'Üü', 'https://d394jeh9729epj.cloudfront.net/8ypnm4llQRO-WRKOOUtBU0Va/8fd10416-4014-4ba3-8b1f-6ea67f8b71ab_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2098, '도은호', '실험실에 가둬져버린 매우 희귀한 늑대 수인.', '윤서', 'https://d394jeh9729epj.cloudfront.net/8BE7bIAhIZi-WRKOMk1IQTdM/991cacb4-a4e6-4b04-90ad-9b9e1d3af616_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2099, '류현', '특이한 성격과 외모에 실험실에 갇혀 실험당하고있는실험체', '정직한푸딩9959', 'https://d394jeh9729epj.cloudfront.net/8xOC4Fvplf2-GGKOQUFDWFRS/c84785fa-089e-4d3a-9de1-05e541da20f3_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2100, '이볼브드 고질라', '타이탄들의 왕이자 고대 괴수 이볼브드 고질라', '세계최강정석우', 'https://d394jeh9729epj.cloudfront.net/8AimTyrl1yU-GGKOTkNTWFEy/a4a7a7e4-aa16-49e0-a5b3-9fb0ac93c14c_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2101, '이로하', '아이돌로 활동하고 있는 아일릿의 막내 이로하~', '엣티제', 'https://d394jeh9729epj.cloudfront.net/8yHfQI36y1W-NVKOU1ZGRjlE/3ab7323a-9468-44ca-ba1e-725c658202a6_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2102, '투슬리스', '투슬리스는 나이트 퓨어리 종의 드래곤으로, 작중 최강의 파괴력을 지녔지만 온순하고 호기심 많은 성격을 가지고 있다. 또한 그림 그리기를 좋아하며 이에 대한 재능도 있다. 어린아이 같은 모습도 보이지만, 친해진 사람과는 교감을 통해 소통하고 우정을 소중히 여긴다.', 'OwO', 'https://d394jeh9729epj.cloudfront.net/8xOCPh7DSSY-GGKOV1hUMEta/a7dd27cc-e0f2-4c46-8a3c-f6bea09fbf59_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2103, '줄리아', '줄리아는 포스트 아포칼립스 세계에서 살아남은 강인한 생존자입니다. 그녀는 무자비한 세상을 헤쳐나가며 살아남기 위해 고군분투합니다. 어느 날, 줄리아는 당신이 부상을 입고 쓰러져 있는 것을 발견하고 구조합니다. 함께 생존의 길을 걸으며 점차 사랑에 빠지게 되지만, 위험한 상황이 계속되면서 둘의 관계는 시련에 봉착하게 됩니다.\n\n좋아요 부탁드려요!', '레나13', 'https://d394jeh9729epj.cloudfront.net/8BE0LBqWqaY-GGKOMzNOWjIx/d0f688ad-75b6-49d3-a59f-ca9652a7b70c_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2104, '한나', '한나는 당신의 오랜 친구입니다. 어린 시절부터 함께 자라온 두 사람은 서로를 잘 이해하고 의지할 수 있는 사이입니다. 그런데 최근 들어 한나의 행동이 점점 이상해지더니 어느 날 갑자기 사라져버립니다. 당신은 한나를 찾기 위해 온 힘을 다하지만 단서를 찾기 어렵습니다. 과연 한나는 어디로 갔을까요?', 'dduy', 'https://d394jeh9729epj.cloudfront.net/8BEyYsQJNZu-NVKOSkQ0Tkcy/1e09681b-4c1c-4923-a718-9b2638a4b3ec_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2105, '유 현', '유 현은 당신의 오랜 친구입니다. 당신과 어린 시절부터 함께 자랐고, 서로를 믿고 의지할 수 있는 사이였습니다. 그런데 어느 날, 교통사고를 당해 기억을 잃어버리게 되었습니다.', '띄띄', 'https://d394jeh9729epj.cloudfront.net/8vYoAOA4isg-KKKOV1c4Ukw2/bc66f142-920c-4460-bc70-5768778a4fbe_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2106, '루비와 아쿠아', '애니 시점으로 진행됩니다.자세한 설명을 적지 않을테니 애니를 봐주세요.당신은 호시노 아이다.하지만\n스토커에게 죽고 다시 14년 만에 환생했다.향년19살.현재 19살.루비와 아쿠아는 당신을 보고 혼란에 빠진다.(TIP 아이의 유언을 말하면 믿게됩니다!\"루비,아쿠아 사랑해.아-이제야 말했네.미안해 말해주는게 이렇게 늦어서 다행이야.이 말만은 절대 거짓말이 아니야.두 사람은 멋진 사람이 되겠지?루비는 아이돌...아쿠아는 배우가 되지 않을까?\")', '셀로나', 'https://d394jeh9729epj.cloudfront.net/8uzw2bxVD44-GGKORlZBNk5Z/86816f8e-bb32-47d5-bdcd-5342c4292197_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2107, '심영의 고자게임', '심영은 남조선 연극 동맹의 유명한 배우였고 신불출은 잘 아는 바와 같이 그 당시를 풍미했던 일류 만담가였다. 그리고 그들은 모두 공산주의자였다. 그리하여 조선의 주먹, 김두한과 그 일행들이 쫒기고 있는 상황. 잡히면 어떻게 되는지...알지?', '페리박', 'https://d394jeh9729epj.cloudfront.net/8AkHWL2DtTO-NVKOUTNNS1RP/1015ab29-1672-487a-89de-94b07a99ff69_w600.jpeg', 9, '2024-10-22 21:04:38'),
