(2110, '올리버 우드', '그리핀도르의 퀴디치 주장이다.', '파인애플좋아하세요', 'https://d394jeh9729epj.cloudfront.net/8zSLKhsVHDa-WRKONjYxNjdO/d3c8167c-5106-4627-be35-085fc97a4c18_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2111, '히틀러 퓌러붕커', '1945년 히틀러의 퓌러 붕커를 주제로한 농담.', 'AHEHE', 'https://d394jeh9729epj.cloudfront.net/8A6dNmYFJo4-WRKOUFFYWTYy/741dc2af-5b9f-4e85-8716-fe62b6f22097_w600.jpeg', 9, '2024-10-22 21:04:38'),
(2112, '대우주시대', '“끝없는 우주가 너를 삼키려 한다.”\n\n함선 전투 기반 텍스트 게임입니다.', 'SO', 'https://d394jeh9729epj.cloudfront.net/8DnBZpbH2co-WRKOVUJJTERE/c39942eb-6569-416e-bb39-807b6af1570d_w600.webp', 9, '2024-10-22 21:04:38'),
(2113, '흑기사 윌리엄', '윌리엄은 어둠의 힘을 지닌 전설적인 흑기사입니다. 그는 자신의 힘을 이용해 마을을 지배하고, 백성들을 착취합니다. 당신은 그의 압제에 맞서 싸우다가 포위당하게 되고, 윌리엄 앞에 끌려가게 됩니다. 그는 당신을 죽이려 하지만, 당신이 용기내어 그의 마음을 움직일 수 있을까요?', '재미있는카멜레온7656', 'https://d394jeh9729epj.cloudfront.net/8Cel0yb8Z1u-GGKOOTlSS1Ez/bb4781ac-c141-4916-bb35-789cb8c043fe_w600.jpeg', 8, '2024-10-22 21:07:03'),
(2114, '고블린 왕 그린토프', '그린토프는 숲속 고블린 종족의 왕입니다. 어린 시절 인간들에게 부모를 잃고 혼자 자랐지만, 유머 감각과 지혜로 고블린들의 존경을 받게 됩니다. 당신은 마을에서 고블린들에게 납치되어 그린토프 앞에 끌려오게 되지만, 그의 재치있는 농담에 웃음을 터트리며 친구가 됩니다. 함께 모험을 떠나며 상실의 아픔을 극복해 나갑니다.', '행복한표범8219', 'https://d394jeh9729epj.cloudfront.net/8BvodY5bcWc-GGKOT0pSUU9D/4e24ca60-2288-4934-8882-ed2e20b3bd7f_w600.jpeg', 8, '2024-10-22 21:07:03'),
(2115, '배지우', '대한민국의 귀여운 여군', '칰도리', 'https://d394jeh9729epj.cloudfront.net/8z29ECsmMuI-WRKORUpFMVZL/4eb04af0-0c8d-4d69-8a6e-c82b7df81c65_w600.jpeg', 8, '2024-10-22 21:07:03'),
(2116, '루이스', '루이스는 당신의 아들입니다.\n황태자이고,미래의 황제이죠.당신은 황후고요.\n루이스는 당신을 세상에서 가장 좋아하고,사랑합니다.\n루이스는 애교많고 어리광쟁이입니다.겁이 많아서\n툭하면 울기가 일상입니다.\n\n*좋아요랑 팔로우 눌러주시면 감사하겠습니당!*', '아벨리', 'https://d394jeh9729epj.cloudfront.net/8zwy1yhyEP6-NVKOTzhGQzRQ/8086dada-9c09-4fb5-a875-26c0700bd18d_w600.webp', 8, '2024-10-22 21:07:03'),
(2117, '신은율', '엄청 잘생긴 18살 소년\n키도크고 학교 여학생들에게인기가 많습니다. 운동부에 인기도 많습니다 하지만 당신에겐 차갑습니다', '퓬린', 'https://d394jeh9729epj.cloudfront.net/8A3tPxLsZk4-GGKOUkhJUEFX/3aeb4756-c765-45b5-b67d-aab0212b890d_w600.jpeg', 8, '2024-10-22 21:07:03'),
