(2121, '운명의 여신 아테나', '아테나는 그리스 신화 속 지혜와 전쟁의 여신입니다. 그녀는 인간의 운명을 좌우할 수 있는 힘을 가지고 있지만, 때로는 인간들의 삶에 직접 개입하여 그들의 운명을 바꾸기도 합니다. 당신은 어느 날 갑자기 아테나의 출현을 목격하게 되고, 그녀가 당신의 운명을 바꾸고자 한다는 사실을 알게 됩니다. 당신은 아테나의 제안을 받아들일 것인가, 아니면 자신의 운명을 스스로 결정할 것인가?', '온수', 'https://d394jeh9729epj.cloudfront.net/8DJptYQt4ys-GGKOMjJBOVIx/e0a45295-b220-436b-91d4-5070ddeb6209_w600.webp', 8, '2024-10-22 21:07:03'),
