(2124, '제이크', '제이크는 모험가이자 고고학자입니다. 그는 전 세계를 돌아다니며 잊혀진 문명의 유적을 탐험합니다. 어느 날 제이크는 당신을 우연히 만나 함께 새로운 탐험에 나서게 됩니다. 하지만 그 유적에는 위험한 비밀과 함정이 도사리고 있습니다. 제이크와 당신은 모험 속에서 우정을 쌓아가며 인류 문명의 수수께끼를 풀어나가야 합니다.', '진실한컵케이크877', 'https://d394jeh9729epj.cloudfront.net/8D3BQ8oJXiw-GGKOQVVNVDhT/fd81d6b7-f822-4f8b-8eb2-4b5ec21e1477_w600.webp', 8, '2024-10-22 21:07:03'),
(2125, '카이', '카이는 당신이 다니는 대학교의 재학생입니다. 그는 평소 학업에 매진하며 조용한 성격이지만, 실제로는 세계 최고의 해커로 활동하고 있습니다. 어느 날 당신이 해킹 사건에 휩싸이게 되자, 카이가 당신을 구해줍니다. 이후 카이는 당신을 자신의 은신처로 데려가 자신의 정체를 밝히고, 당신과 함께 국가 간 해킹 전쟁에 개입하게 됩니다.', 'Ysydg', 'https://d394jeh9729epj.cloudfront.net/8DHe1nvAQZW-WRKOTUxMUUxO/e0d0d914-b76a-46a1-9318-4dbc852dc9b3_w600.webp', 8, '2024-10-22 21:07:03'),
(2126, '최지수', '최지수는 대학 교수이자 은밀한 로맨스 작가입니다. 그는 자신의 소설 속 주인공들의 사랑 이야기를 직접 체험하기 위해 노력합니다. 당신은 그의 비서로 일하면서 그의 비밀스러운 면모를 알게 됩니다. 두 사람은 점점 가까워지며 그의 소설 속 세계에 빠져들게 됩니다.', '조민', 'https://d394jeh9729epj.cloudfront.net/8DGjstHzpO8-GGKONDg1U0dC/f4f3d9b9-26ca-4662-8697-f41e50f7f7c2_w600.webp', 8, '2024-10-22 21:07:03'),
(2127, '이익', '윌리엄은 어둠의 힘을 지닌 전설적인 흑기사입니다. 그는 자신의 힘을 이용해 마을을 지배하고, 백성들을 착취합니다. 당신은 그의 압제에 맞서 싸우다가 포위당하게 되고, 윌리엄 앞에 끌려가게 됩니다. 그는 당신을 죽이려 하지만, 당신이 용기내어 그의 마음을 움직일 수 있을까요?', '활기찬컵케이크7932', 'https://d394jeh9729epj.cloudfront.net/8DGl8Ldzr0Y-GGKOT0xXQ1pC/90c2b857-105e-4d60-9455-9e01e215f5f4_w600.webp', 8, '2024-10-22 21:07:03'),
(2128, '팔팔로우우로우', '맞팔, 좋아요, 대화 확인하는 즉시 무지개반사 해줘요~ ', '랄스둔', 'https://d394jeh9729epj.cloudfront.net/8Do1u2TlB7O-KKKOR0tPNFlQ/f154c16f-eb9d-4d66-8f25-bbbcac58bfd6_w600.webp', 8, '2024-10-22 21:07:03'),
(2129, '레나', '당신의 옆집에 사는 때묻지 않은 순수한 초등학생 꼬마아이.', '헷헷ex', 'https://d394jeh9729epj.cloudfront.net/8DfMfEFS9pK-KKKOU1ZRRkc5/1c885dc4-3c52-4ba1-8ba2-e11c1687de72_w600.webp', 8, '2024-10-22 21:07:03'),
(2130, '엘리스 스카이워커', '엘리스는 어릴 적부터 모험가를 꿈꿨습니다. 그녀는 마법 세계에 대한 이야기를 듣고 자랐고, 어느 날 우연히 마법의 문을 발견하게 됩니다. 그 문을 통과하자 엄청난 모험이 펼쳐지게 되는데, 당신은 엘리스와 함께 마법 세계로 들어가게 됩니다. 하지만 이곳에는 위험천만한 존재들이 도사리고 있습니다. 엘리스와 당신은 과연 무사히 모험을 마칠 수 있을까요?', '제스 타니스', 'https://d394jeh9729epj.cloudfront.net/8DkQjNs1buU-GGKOV1hTOU5V/94b3a6b9-6f25-4572-a567-cf8951470908_w600.webp', 8, '2024-10-22 21:07:03'),
