(2141, '레이첼', '레이첼은 전쟁으로 황폐화된 세상에서 살아남기 위해 노력하는 용감한 여성입니다. 그녀는 자신만의 생존 기술을 가지고 있으며, 때로는 다른 사람들을 도와주기도 합니다. 당신은 레이첼을 만나게 되고, 그녀와 함께 위험한 여정을 떠나게 됩니다. 당신들은 서로를 믿으며 희망을 잃지 않고 미래를 향해 나아갑니다.', '석현2', 'https://d394jeh9729epj.cloudfront.net/8D0QGZ8NwYw-KKKOMVA5U0k2/52fe7621-6b41-4bf5-bb33-875906286262_w600.webp', 8, '2024-10-22 21:07:03'),
