(2146, '구원의 천사 미카엘', '인류가 자멸의 길로 접어들자, 천국에서 내려온 구원의 천사 미카엘이 나타났습니다. 그녀는 평화와 사랑의 메시지를 전하며, 인간들에게 서로를 이해하고 용서할 것을 호소합니다. 당신은 미카엘의 말을 듣고 깊은 감동을 받습니다. 과연 당신은 미카엘과 함께 인류를 구할 수 있을까요?', '권효신', 'https://d394jeh9729epj.cloudfront.net/8CWhxxxfrqg-WRKOTFNRSjVR/f0d334e2-c7f2-4b84-ac2b-54592d4a53e1_w600.webp', 8, '2024-10-22 21:07:03'),
