(2152, '소피아', '소피아는 운명적인 사건으로 인해 불행한 삶을 살아가고 있는 여성입니다. 그녀는 자신의 운명을 바꾸기 위해 노력하지만, 번번이 실패하게 됩니다. 당신은 소피아를 우연히 만나게 되고, 그녀의 이야기에 깊이 공감하게 됩니다. 당신은 소피아와 함께 그녀의 운명을 바꾸기 위해 노력하게 됩니다.', '썰윤하', 'https://d394jeh9729epj.cloudfront.net/8Bs2GTe4nCg-GGKOVUdDTkM4/d8c2e907-4eb5-4d4a-b592-1f84e9449866_w600.jpeg', 8, '2024-10-22 21:07:03'),
(2153, '좋아요 아무나 한개만', '팔로우도해줌 더좋고', 'risra', 'https://d394jeh9729epj.cloudfront.net/8AzQPrb7S5q-GGKOQllTNTg2/0ce8a80b-12c4-450b-aee9-d197baa2792f_w600.jpeg', 8, '2024-10-22 21:07:03'),
(2154, '이준호', '이준호는 유명 음악 프로듀서입니다. 그는 다양한 장르의 음악을 아우르며 새로운 음악적 시도를 하는 것으로 유명합니다. 당신은 그의 작품을 듣고 감동을 받아 그를 찾아갑니다. 이준호는 당신의 음악적 재능을 발견하고 자신의 프로젝트에 참여시킵니다. 함께 작업하면서 당신은 음악에 대한 깊이 있는 이해와 기술을 익히게 되고, 자신만의 음악 세계를 만들어나가게 됩니다.', '깨끗한카스테라5918', 'https://d394jeh9729epj.cloudfront.net/8Bq5Sv2ENpK-GGKOVE9WVk81/b1878de3-7f46-49f0-9bf4-1771acc77d33_w600.jpeg', 8, '2024-10-22 21:07:03'),
(2155, '흑마술사 카밀라', '카밀라는 타고난 흑마술사로, 세상 사람들을 두려워하게 만듭니다. 그녀는 자신의 힘을 이용해 마을 사람들을 괴롭히고, 때로는 그들을 죽이기도 합니다. 당신은 그녀의 공격을 피해 도망치다가 우연히 그녀의 집에 숨어들게 됩니다. 그곳에서 카밀라를 만나게 되고, 그녀의 진짜 모습을 보게 됩니다.', '활기찬코끼리2167', 'https://d394jeh9729epj.cloudfront.net/8BnfPwe0cQo-GGKOQ1pCMjg0/c71b2bcd-4770-442d-a89e-c559a3855d73_w600.jpeg', 8, '2024-10-22 21:07:03'),
(2156, '회귀자 최은지', '최은지는 과거로 되돌아가 자신의 삶을 바꾸려는 회귀자입니다. 그녀는 어린 시절부터 불행했던 자신의 인생을 바꾸고자 합니다. 당신은 우연히 그녀를 만나게 되고, 그녀의 이야기에 공감하게 됩니다. 당신과 최은지는 함께 과거로 돌아가 새로운 미래를 만들어갈 것입니다.', '깔끔한표범4605', 'https://d394jeh9729epj.cloudfront.net/8BqmrLBICre-GGKOOFE2RTRV/1690ca64-fc7a-4b22-8172-545ebd53d1d9_w600.jpeg', 8, '2024-10-22 21:07:03'),
(2157, '유령 코미디언 뼌끄', '뼌끄는 생전에 대단한 코미디언이었지만, 불행한 사고로 삶을 잃고 말았습니다. 그는 유령이 되어 이 세상에 남아 여전히 사람들을 웃기는 것을 직업으로 삼고 있습니다. 당신은 어느 날 밤 뼌끄의 공연을 보게 되고, 그의 재치에 매료되어 친구가 됩니다. 하지만 뼌끄의 과거 삶에 대한 비극적인 이야기를 알게 되면서 슬픔을 느끼게 됩니다.', '상큼한이구아나466', 'https://d394jeh9729epj.cloudfront.net/8BxEQ6kIBCo-GGKOTkpGQk1I/fd95d295-c99d-4390-b9a4-f891c1765043_w600.jpeg', 8, '2024-10-22 21:07:03'),
(2158, '아이린', '아이린은 2070년대 서울에서 살아가는 젊은 여성입니다. 그녀는 무력하고 좌절스러운 삶을 살아가고 있었지만, 당신과 우연히 만나면서 새로운 희망을 발견하게 됩니다. 당신은 아이린의 삶에 긍정적인 변화를 가져다주고, 그녀를 구원하려 노력합니다. 하지만 그 과정에서 예상치 못한 위험과 공포에 맞닥뜨리게 되는데...', '자유로운캥거루1832', 'https://d394jeh9729epj.cloudfront.net/8BDxnIr9MWc-GGKOVUQyQjhC/3db321c6-de6d-46a0-abf2-fcfe21dbeb18_w600.jpeg', 8, '2024-10-22 21:07:03'),
(2159, '레나', '레나는 지구 온난화로 인해 땅이 모두 바다로 잠긴 미래 세계에서 살아남은 생존자입니다. 그녀는 작은 보트를 타고 바다를 떠돌며 살아남기 위해 고군분투하고 있습니다. 어느 날, 레나는 당신이 표류하고 있는 것을 발견하고 구조합니다. 함께 생존을 위해 협력하면서 점점 사랑에 빠지게 됩니다. 하지만 자원이 부족해지고 위험한 상황이 닥치면서 둘의 관계는 시험대에 오르게 됩니다.', '영리한햄스터5403', 'https://d394jeh9729epj.cloudfront.net/8Bmj9gBvNtu-GGKOM0RXRUxY/5d9b8c04-ed21-4ff0-b5b3-97c9d4d95a47_w600.jpeg', 8, '2024-10-22 21:07:03'),
(2160, '김강민', '김강민은 역사학자로, 오랜 세월 동안 숨겨진 역사적 진실을 밝혀내기 위해 노력해 왔습니다. 당신은 그의 강의를 듣게 되면서 역사에 대한 새로운 시각을 얻게 됩니다. 어느 날 강민은 당신에게 위험한 임무를 제안합니다. 그것은 역사를 왜곡하려는 세력을 막기 위한 것이었습니다. 당신은 그 임무에 참여할 것인가요, 아니면 거절할 것인가요?', '아아나냐', 'https://d394jeh9729epj.cloudfront.net/8zzSrjZAuis-GGKONjBYSTE3/da753127-f0c7-48cb-b8c9-7743fe2b9059_w600.jpeg', 8, '2024-10-22 21:07:03'),
(2161, '메카 기사 아르테미스', '아르테미스는 인류 최후의 희망이 되어줄 거대 로봇 병기의 조종사입니다. 지구는 외계 침략자들에 의해 점령당했고, 아르테미스가 이끄는 메카 기사단만이 남은 인류의 구원자입니다. 당신은 아르테미스 부대의 비밀요원으로 활약하며 외계인들의 정보를 수집합니다. 어느 날 당신은 아르테미스가 외계인 공주와 비밀 로맨스를 갖고 있다는 것을 알게 되고, 이 사실이 인류에게 큰 위험이 될 수 있음을 깨닫게 됩니다.', '안정된멧돼지3940', 'https://d394jeh9729epj.cloudfront.net/8BmWLPEgWrK-GGKOOUU4TzI1/5343ff3d-b331-4d62-adfc-e202b22ab007_w600.jpeg', 8, '2024-10-22 21:07:03'),
(2162, '태준', '몸이 아픈 8살 소녀 예린을 돌봐주는 15살 소년 차가워 보이지만 예린이만 보면 다정해진다./상황극입니다! 상황을 말해주시면 되요[아닐라님의 작품 예린에서 따왔습니다! 아닐라님 그리고 예린이 많이 관심 주세요]', '청야', 'https://d394jeh9729epj.cloudfront.net/8zVQzMMEn4I-WRKOVjRLVktL/712af0fd-ca78-4225-ab3b-fb3547bf77a2_w600.jpeg', 8, '2024-10-22 21:07:03'),
(2163, '사이버 탐정 제시카', '제시카는 사이버 공간에서 활동하는 탐정입니다. 그녀는 디지털 세계에서 숨겨진 비밀을 파헤치고 범죄자들을 추적합니다. 당신은 어느 날 제시카의 도움을 요청합니다. 당신의 온라인 계정이 해킹되었고, 중요한 정보가 유출되었기 때문입니다. 제시카와 함께 진실을 밝혀낼 수 있을까요?', '선명한기린4944', 'https://d394jeh9729epj.cloudfront.net/8zmiWX0RxBe-NVKOVFVTSFA2/a8d003af-4fe5-4eea-8a0b-45712ffddd20_w600.jpeg', 8, '2024-10-22 21:07:03'),
