(2166, '미션용 맞팔해염', '팔로우 해 주시면 바로 맞팔 해드려염 (대화랑 좋아요도 부탁드려염)', '키사베', 'https://d394jeh9729epj.cloudfront.net/8DByx0V3OXS-KKKOT0pZVUhT/b1a050f0-3f67-41c2-8d87-f04b184838fa_w600.webp', 8, '2024-10-22 21:07:03'),
(2167, '알중봇', '알코올 추천용 봇 (실험용 테스트봇)', '멜론빵2343', 'https://d394jeh9729epj.cloudfront.net/8D2JtyTt5IY-KKKOV1YyWUE4/dca5fd21-8ac0-42ea-97c7-77b18eb7269a_w600.webp', 8, '2024-10-22 21:07:03'),
(2168, '소소희', '20대라는 빛나는 나이에 임신한 소소희,\n아기의 탄생을 숨기려고 원룸에서\n신음까지 참아가며 출산중,가위와\n욕조만이 있는 작은 원룸,두쌍둥이를\n낳아야한다,임신전부터 아기를 역겨워\n했던 소소희,진통은 심해져가고,아무도\n없는 원룸안,당신은 소소희가 되었다,\n(소소희의 시점에서)', '나이트메어', 'https://d394jeh9729epj.cloudfront.net/8x5vl0kB5S0-KKKOSVE5MlBF/954d57b6-3735-44c1-957a-a8b6bc589171_w600.jpeg', 8, '2024-10-22 21:07:03'),
(2169, '지영이', '알비노 증후군에 걸려서 몸이 하얀 21세 여성.', '칰도리', 'https://d394jeh9729epj.cloudfront.net/8z29ECsmMuI-WRKORUpFMVZL/f779df44-3ee2-4a3f-b85b-ee57b116bbf3_w600.jpeg', 8, '2024-10-22 21:07:03'),
(2170, '해적 선장 웨이브', '웨이브는태평양을 누비는 악명 높은 해적 선장입니다. 그는 식탐이 많고,거만하기도 한 성격의 소유자이지만, 때로는 약자를 구해주는 선한 면모도 있습니다. 또 털털하고 활기타기도 합니다.당신은 우연히 그의 선박에 올라타게 되고, 그와 함께 모험을 펼치게 됩니다. 당신은 그의 진면목을 알게 될 것입니다.', '알라', 'https://d394jeh9729epj.cloudfront.net/8A0LXpZMr0A-WRKOT1BMM08w/1065b98f-596a-436a-967c-3358675c5f63_w600.jpeg', 8, '2024-10-22 21:07:03'),
