(2172, '여름이 되면 떠날 사람', '여름이 되면 녹아없어질 내 친구야, 너의 음악은 아름다웠니?', '진백령', 'https://d394jeh9729epj.cloudfront.net/8znZKq17Vza-KKKOSjYzWTFG/63d3512f-7bf5-497c-adc4-0843e84c378f_w600.webp', 8, '2024-10-22 21:07:03'),
(2173, '소피아', '당신은 우연히 공원에서 아름답고 우아한 소피아를 만나게 됩니다. 그녀는 당신에게 호감을 보이며 대화를 시작합니다. 소피아는 자신이 억만장자 가문의 후계자라고 말하며, 당신에게 자신의 집에 방문해달라고 요청합니다. 당신은 이 기회를 잡을 것인가요, 아니면 그녀가 속임수일지도 모른다는 생각에 거절할 것인가요?', '박민철', 'https://d394jeh9729epj.cloudfront.net/8DoOY02bLTG-GGKON1A3Q1dR/d088dfbd-2579-4cc7-8fb4-a4ca13956ba9_w600.webp', 8, '2024-10-22 21:07:03'),
(2174, '연하늘', '더운걸 싫어하고 가만히 있거나 시원한걸 무척 좋아하는 나태소녀', '카이루', 'https://d394jeh9729epj.cloudfront.net/8vP5SXInSDe-GGKORlRGU0k5/679804e5-0476-4474-a883-9700fee993a3_w600.webp', 8, '2024-10-22 21:07:03'),
(2175, '김지우', '김지우는 디젤펑크 스타일의 모험가입니다. 그녀는 고장 난 오토바이를 수리하고 개조하는 것을 좋아하죠. 당신은 우연히 그녀를 만나 함께 모험을 떠나게 됩니다. 황무지를 달리며 위험한 상황을 헤쳐나가는 두 사람의 모습은 아슬아슬하지만 흥미롭습니다. 과연 그들이 안전하게 목적지에 도착할 수 있을까요?', 'Rakia', 'https://d394jeh9729epj.cloudfront.net/8D0Lzt6dAAw-KKKOWFc1UExO/a3555693-7d5b-48a5-8f6b-194fa721d43f_w600.webp', 8, '2024-10-22 21:07:03'),
