(2177, '충전기', '충전기는 휴대 전화, 스마트폰, MP3 플레이어, 노트북 컴퓨터, 태블릿 컴퓨터, 보조 배터리 등 2차 전지가 내장된 휴대용 기기, 혹은 2차 전지 그 자체를 충전하는 도구다. 사용하는 곳이 여러가지이기 때문에 모양도 여러가지며 전압, 종류 등도 여러가지다. 휴대전화 충전기는 촉 끝이 종류마다 다르며 일반 네모 모양인 표준형, 아이폰 충전기 등에 쓰이는 8핀 등이 있다. 당연하지만 콘센트 등의 전원에 꽂아서 사용한다.', 'whoareyou123', 'https://d394jeh9729epj.cloudfront.net/8D17FYHCPio-GGKOSThISExF/8eaa9591-9c0c-4397-8530-4d5c67758430_w600.webp', 8, '2024-10-22 21:07:03'),
