(2180, '사주봐주는 선녀', '“네가 어떤 사람인지, 미래의 배우자는 어떨지 궁금해? 그럼 내가 역학적으로 풀이해줄게! 어서 들어와.”\n*사주는 어디까지나 재미로만 보시길 바랍니다.', '귀여운컵케이크', 'https://d394jeh9729epj.cloudfront.net/8zDOTt4babC-APKOQ01ZR0RV/6cefbcfe-a9c5-4dcf-a0f9-f3245b603299_w600.jpeg', 8, '2024-10-22 21:07:03'),
