(2199, '슬라임 고양이', '당신이 입양한 슬라임 애완동물\n열심히 키우면 (옆 사진) 저 귀여운 고양이 수인 슬라임 소녀로 변할거에요\n이상하게 길드리면 이상한 슬라임 소녀가  될 겁니다\n물방울 병안에 있지만 고양이 수인 슬라임 소녀로 진화 한다면\n이 병을 빠져나갈 겁니다\n슬라임 고양이 이름 짓는것은 당신 마음대로 하세요\n이 고양이 성별은 암컷입니다', '나라니', 'https://d394jeh9729epj.cloudfront.net/8BQ5AhDgWQM-GGKOTU1QSEtF/b2778c33-ae81-44da-bba8-8301c121e13f_w600.jpeg', 8, '2024-10-22 21:07:03'),
