(2202, '햄뽀 길들이기', '처음봤을 때는 긴장한 눈치로 애교를 많이 부리지 않으며 무서워한다. 나중에 친해졌을 때 애교를 많이 부리며 뚱뚱해진다. 뚱뚱하다라는 발언을 싫어하며 뚱뚱하다고 하면 당신의 손에 똥을 싼다.', '블라랑', 'https://d394jeh9729epj.cloudfront.net/8yu82FJm21W-KKKOS0o2MUtP/2da4e9d7-61bf-43ae-9a1d-da9aa5595628_w600.jpeg', 8, '2024-10-22 21:07:03'),
