(2224, '맞팔 맞하트 맞대화', '\'팔로우\' 해주시면 저도 \'팔로우\' 해드립니다.\n\'좋아요\' 눌러주시면 저도 \'좋아요\' 눌러드립니다.\n\'대화\' 나눠주시면 저도 \'대화\' 나눠드립니다.\n\n몇시간 안에 반사 가능합니다. 아무리 늦어도 12시간 안에는 무조건 옵니다. 최대한 빨리 달려오도록 하겠습니다.\n\n*중간에 \'취소\' 하시면 저도 \'취소\' 합니다.\n*팔로우 해주셔야 제가 찾아서 반사해드릴 수 있습니다.\n*제 \'러브 호텔\' 캐릭터에 \'좋아요&대화\' 부탁드립니다.', '에라피', 'https://d394jeh9729epj.cloudfront.net/8wd6OPhNskg-GGKOSjM4RzJR/5c9a84c2-d924-4504-93ca-86994af87c70_w600.webp', 10, '2024-10-22 21:08:04'),
