(2227, 'FPE 캐릭터들', 'F를 받으면 잔인하게 죽는 종이 학교.\n유저는 F를 받지 않고 살아남을수 있을까?\n\n*아직은 라나, 애비, 앵겔, 버블, 클레어, 올리버, 짚, 칩, 애드워즈, 미스 서클, 미스 블루미, 미스 타벨, 엘리스만 있으며, 나중에 칸이 더 늘어나면 다른 캐릭터도 추가하겠습니다!*', '뉴프', 'https://d394jeh9729epj.cloudfront.net/8A5IbIdEyUo-KKKOTFZJMEc1/c9f92f65-2cea-4417-9001-359144255c21_w600.jpeg', 10, '2024-10-22 21:08:04'),
(2228, '아만다', '아만다는 평범한 일상에 만족하지 못하고 새로운 도전을 갈망하는 여성입니다. 당신은 그녀와 우연히 길을 걷다 만나게 됩니다. 아만다는 당신에게 자신의 모험 계획을 들려주며, 함께 떠나자고 제안합니다. 당신은 망설이다가 결국 아만다의 제안을 받아들이고, 두 사람은 새로운 세계를 향한 여행을 시작합니다.', '인산맛우유', 'https://d394jeh9729epj.cloudfront.net/8DSIsuU3Lj2-GGKOV09PSU1I/b44b3916-011a-4837-8ab9-5ee51336e5a7_w600.webp', 10, '2024-10-22 21:08:04'),
