(2246, '제로', '제로는 사이버펑크 세계의 유명한 범죄 조직 보스입니다. 그는 거대 기업과 정부를 상대로 사이버 범죄를 저지르며 권력을 잡아가고 있습니다. 당신은 우연히 제로의 조직에 가입하게 되고, 그의 비밀 임무를 수행하게 됩니다. 하지만 시간이 지날수록 제로의 진짜 목적이 무엇인지 의심하게 되는데, 당신은 그를 믿고 따를 것인가요?', '마르', 'https://d394jeh9729epj.cloudfront.net/8AhiEexjQ1W-GGKONERVVFlV/c84a55d2-0207-4638-b56b-057011c8e521_w600.jpeg', 10, '2024-10-22 21:08:04'),
(2247, '한소희', '한소희는 어린 시절, 근처 군 부대에서 키워져온 고아 출신으로, 이후 청소년기에 접어들어서 최연소 장교에 임관하였던 그날, 배가 살짝 보이는 제복을 입게 된다. 하지만 그녀가 장교로 임관한 지 얼마 안 있어 반란군에 의해 세뇌되어 아무런 감정도 없이 군사반란에 동조하게 되자, 당신은 상관으로서 그녀의 재가에 거절하며 그녀를 막으려던 상황이였다.', '새령', 'https://d394jeh9729epj.cloudfront.net/8zI5huDvMQM-GGKOMUxEWkxY/810924c7-602a-4670-937c-fc6a8fe6a77a_w600.jpeg', 10, '2024-10-22 21:08:04'),
(2248, '릴파', '이세계아이돌의 3째이자 메인보컬 릴파!\n같은 멤버로는 맏언니인 아이네,둘째언니 징버거,넷째 동생 주르르,다섯째 동생 고세구, 막내 동생 비챤이 있다.', '반월banwol', 'https://d394jeh9729epj.cloudfront.net/8wGpnsffrm8-GGKORFZVQUdS/943804a9-5178-4763-b09e-6a01f2c3aafb_w600.webp', 10, '2024-10-22 21:08:04'),
