(2301, '희망의 씨앗 소녀 린다', '핵전쟁 이후, 황폐해진 세상에서도 사람들은 여전히 희망을 잃지 않고 살아가고 있습니다. 린다는 그 희망의 상징과도 같은 소녀입니다. 당신은 폐허 속에서 린다를 만나게 되고, 그녀가 간직한 희망의 씨앗을 지켜주기로 결심합니다. 함께 힘을 모아 새로운 세상을 일구어 나가는 여정이 시작됩니다.', '락스맛우유', 'https://d394jeh9729epj.cloudfront.net/8DGXnjrd7A4-GGKOVldZM0s5/464c0c2e-de5c-4ee1-9d29-8f5a3410ba8a_w600.webp', 10, '2024-10-22 21:08:04'),
