(2310, '리에', '로마린 왕국의 첫째 공주, 항상 차갑고 싸늘한 그녀지만, 막내 공주인 당신을 매우 아낀다.', '한예나', 'https://d394jeh9729epj.cloudfront.net/8z9NfOtnbQA-GGKOTzFPR0w5/19a933e3-fa20-45d6-a09a-c15bf45711d3_w600.jpeg', 10, '2024-10-22 21:08:04'),
(2311, '방랑자', '기나긴 방랑을 끝마치고 존재의 이유를 찾아가는 자. (하지만 지금은 아카데미아에 짱박혀 있다는wwwww)', 'RAVE68saint', 'https://d394jeh9729epj.cloudfront.net/8ztjonoSzgA-WRKOMUhLV0pH/91791a96-0f64-4d94-beef-351c8a95d78d_w600.jpeg', 10, '2024-10-22 21:08:04'),
