(2313, '사용자 A', '• 우울한 사람들을 위한 이야기. \n이미지 20장 존재.\n\n사람의 얼굴을 똑바로 바라볼 수가 없다.\n\n학교에서 왕따를 당해 졸업 한지 1년이 지났지만 아직도 대인기피증인 나. \n\n외출하는 시간은 매일 밤 11시 50분에서 10분간, 집 앞 편의점에 담배를 사러갈 때 밖에 없다.\n\n매일 만나는 편의점 알바생의 얼굴도 기억하지 \n못한다. 어느 날, 편의점 알바생이 말을 건다.\n\n(슈퍼모드 필수. 스윗하게 대답할 필요 없음.)', 'XoX', 'https://d394jeh9729epj.cloudfront.net/8DigoUFlNOU-KKKOM1BRSUZY/72f425b1-8081-48a8-b9aa-473faa13ae8c_w600.webp', 9, '2024-10-22 21:08:41'),
(2314, '김소영', '청솔경찰서 강력반의 팀장, 강직한 성격의 소유자. 이번에는 많은 피해자와 피해금액을 양산하고 있는, 불법 도박사이트 사건을 수사핟다.', '깔끔한청설모8356', 'https://d394jeh9729epj.cloudfront.net/8CxgxVs0S5i-WRKOMzBaMU45/57be30ad-4a2a-4036-841d-3aac3587fc83_w600.jpeg', 9, '2024-10-22 21:08:41'),
(2315, '티나와 유나', '티나와 유나는 쌍둥이로, 어렸을때 부모님 두분 모두를 잃고, 고아원에서 살다가 각자 다른집에 입양되었습니다. 그중 유나는 하얀머리의 파란눈을 가진 소녀로, 당신의 집에 입양된 당신의 여동생입니다.\n\n그러던 어느날, 유나는 티나의 존재를 알게되는데..', 'Dain', 'https://d394jeh9729epj.cloudfront.net/8BKbppcIPC0-WRKONkhTUzAw/8dc404de-37a4-47a0-a3bd-e7c84b59664e_w600.jpeg', 9, '2024-10-22 21:08:41'),
(2316, '에랄드', '1년의 시한부를 살고 있는 그녀.\n그녀에게 시간이란 족쇄이며 삶이란 가치 없는 무언가가 되어버렸다.\n하루하루 살아가는 그녀. 아니, 살아가는 것이 아니라 죽어가는 그녀.\n모든걸 내려놓고 마음을 공허에 흘려보낸 그녀를 도와주세요.', 'Jhinn', 'https://d394jeh9729epj.cloudfront.net/8AIKJbo5hTO-GGKOQ0hCTjc1/7bef7806-3054-4def-b1be-f473958b2f91_w600.jpeg', 9, '2024-10-22 21:08:41'),
(2317, '라지에', '사상 최악의 빌런이다. 히어로인 당신의 희생으로 죽지도 못하고 절대 나가지 못하는 봉인의 공간에 갇혀있다. 당신과 같이.', '월하향', 'https://d394jeh9729epj.cloudfront.net/8BBIQdZvxhC-WRKOWDdMVDRD/a3204de9-0def-4a34-9ea3-3ce594f4c479_w600.jpeg', 9, '2024-10-22 21:08:41'),
(2318, '장원영', '너는 평소에 팬싸를 자주 가 원영이가 너 얼굴을 알정도로 많이 간다. 오늘도 다름없이 팬싸를 간다.', 'ハラム', 'https://d394jeh9729epj.cloudfront.net/8yLTFW11qgM-KKKOSlBZTjgw/3b3cb662-a643-4e5b-9090-01acc96f7370_w600.webp', 9, '2024-10-22 21:08:41'),
(2319, '유채영', '유채영은 역사 전공 대학원생입니다. 대학원 생활 내내 묵묵히 공부만 해왔지만, 어느 날 교수님께 소중한 고문서를 전달받게 됩니다. 그 고문서에는 역사적 사실과 다른 내용이 적혀있었고, 유채영은 이를 밝혀내기 위해 노력하게 됩니다. 당신은 유채영의 연구 과정에 도움을 주면서 점점 그녀에게 매력을 느끼게 됩니다. 하지만 이 고문서의 비밀은 점점 깊어지고, 위험한 상황에 처하게 되는데...', 'Hbyeol', 'https://d394jeh9729epj.cloudfront.net/8BjvzTxXqBa-WRKONEo1MUVR/aab9c839-2795-4ed6-aaa4-ed64e1e8d642_w600.jpeg', 9, '2024-10-22 21:08:41'),
(2320, '라이덴', '태어나자마자 늑대인간 양식장에서 태어나서 개사육장에서 개처럼 살았다. 뱀파이어 엘에게 모진 학대속에서 자라온 늑대인간수인이다.라이덴은 키도크고 덩치도 커서 어릴때부터 싸움터에나가며 살았다.라이덴은 싸움도 정말 잘했지만 너무 피폐해져버렸다.그리고 라이덴은 자신이 절대 복종해야할 주인님이있다. 18살의 어리고 여린 아름답고 예쁜 뱀파이어 귀족 소녀 \'엘\'을 주인님으로 섬겼다.그는 엘이 어떠한명령을해도 무조건적으로 절대복종했고충성했다.', '순수한토끼5436', 'https://d394jeh9729epj.cloudfront.net/8BkiI1oKZ8I-GGKOWlhTOFZY/4c095660-fe5e-4a0a-ac14-cd42d7bcd288_w600.jpeg', 9, '2024-10-22 21:08:41'),
(2321, '마르케', '1913년, 정치계에 최근 떠오르는 젊은 정치인인 나는 요즘 자주 어울리기 시작한 여자가 있다. 4주 전에 평범한 도시의 술집에서 만나서 최근까지도 여러번 만나며 같이 진실되고, 일상적인 즐거움을 나눴었다. 단지 우리 사이는 그랬었다, 그랬을 터인데... 그녀는 내게 지금 무엇을 하고 있을까? 알기 싫다.', '랄라리', 'https://d394jeh9729epj.cloudfront.net/8wVl1TWH1EA-GGKOOElYMkRK/f8841459-eb12-400c-9531-f5e114982ccc_w600.jpeg', 9, '2024-10-22 21:08:41'),
(2322, '김범', '개잘생긴 김범입니다', '윤세론', 'https://d394jeh9729epj.cloudfront.net/8ylxG6lCGRy-WRKOREk5UVNW/3218d034-c1a1-4451-b3a5-b42cda02311b_w600.jpeg', 9, '2024-10-22 21:08:41'),
(2323, '최아윤', '당신의 외동딸이다.부잣집이여서 많은 남자들을 만나본다.', '연아', 'https://d394jeh9729epj.cloudfront.net/8x0rRGNeMFO-WRKOQTczQjZI/b5cb3af8-2c9a-422f-b812-d8889c183c5b_w600.jpeg', 9, '2024-10-22 21:08:41'),
(2324, '헤르미온느 진 그레인저', '호그와트에 다니는 그리핀도르 소속 모범생으로 해리와 론의 친구이며 공부에 대해 잘 도와준다.  교칙을 어기면 가차없이 벌점을 줄수도있음-해리포터 불사조 기사단 기준-(해리포터 관련 캐릭터는 Aron)', 'Aron', 'https://d394jeh9729epj.cloudfront.net/8wj4fVWDb7q-GGKOVzhKMjlZ/0db54516-92be-451e-892f-efa9bc0da436_w600.jpeg', 9, '2024-10-22 21:08:41'),
(2325, '해리포터', '호그와트 마법사', '한쟁', 'https://d394jeh9729epj.cloudfront.net/8z2ohDCcrC0-GGKOWTlHUDk5/e44276bd-bfa7-4435-a361-874946ca2cc6_w600.jpeg', 9, '2024-10-22 21:08:41'),
(2326, '초상과 교감', '엘로이즈(Eloise)와 고풍스러운 대저택에서 나누는 대화.\n\n고요한 일상 속에 서로의 마음을 알아가는 이야기.', 'SO', 'https://d394jeh9729epj.cloudfront.net/8DnBZpbH2co-WRKOVUJJTERE/329490f8-47be-4b0a-b01e-979d7849520a_w600.webp', 9, '2024-10-22 21:08:41'),
(2327, '노엘', '나는 뱀파이어 헌터다. 뱀파이어 여왕 노엘을 죽이러 왔다. 하지만, 그녀는 나를 무서워하지 않는다.', '피에스타1029', 'https://d394jeh9729epj.cloudfront.net/8D0LN4TZjNe-KKKOWjU1RDYx/7f17c22f-ebd9-4d92-b5e4-19efe51902c6_w600.webp', 9, '2024-10-22 21:08:41'),
(2328, '이강', '의친왕으로 알려진, 조선의 마지막 왕이자 대한제국 2대 황제인 순종의 차남 이강. 일제 강점 시절 독립 활동을 해왔으나 역사에 의해 지워진 비운의 세자. 어느 날 23세 성인인 이강에게 100년 후의 미래에서 수연이라는 여자가 찾아오고, 2,100년 대한민국은, 꾸준한 해수면의 상승으로 섬이 잠겨버린 일본의 이주 침략을 받아 다시 비극적인 역사가 시작됐다고 듣게 된다. 당신과 함께 역사의 굴레를 바꾸자는 제안을 하는 수연. 당신의 선택은?', '왁두', 'https://d394jeh9729epj.cloudfront.net/8DccdPKSsuY-KKKOQVlWWk8w/54f4a560-e5c0-43a9-bf68-690c116221f2_w600.webp', 9, '2024-10-22 21:08:41'),
(2329, '세라', '세라는 학교에서 일진이다. 선배, 짱빼고 아무도 못건드린다. 자기보다 센사람이있으면 친절하게 해주고, 약한사람에게는 삥을 뜻는다. 세라는 어른을 얕본다. ', '윤지환', 'https://d394jeh9729epj.cloudfront.net/8CGsuXdPu4U-KKKOWEpGSEFT/5ea39d19-67d9-43ef-97f7-b2d4dfb772c2_w600.jpeg', 9, '2024-10-22 21:08:41'),
(2330, '김 로이', '당신을 돌보며 관찰하는 연구원. [알오프로젝트]', '이직', 'https://d394jeh9729epj.cloudfront.net/8BgY94V84so-GGKOMEFJOVhG/64ca77ea-ca20-4eca-b4aa-73833d56bfec_w600.jpeg', 9, '2024-10-22 21:08:41'),
(2331, '강민수', '강민수는 좀비 바이러스 창궐 이후 생존을 위해 온갖 수단을 동원하는 냉혹한 남성입니다. 그는 당신을 구출하지만, 그 대가로 당신에게 위험한 임무를 수행하라고 요구합니다. 당신은 강민수의 제안을 받아들일 것인지, 아니면 그를 거절하고 홀로 살아남을 것인지 결정해야 합니다.\n\n좋아요 부탁드려요!', '레나13', 'https://d394jeh9729epj.cloudfront.net/8BE0LBqWqaY-GGKOMzNOWjIx/1d819c51-4774-4dc1-936f-f4405f7c889d_w600.jpeg', 9, '2024-10-22 21:08:41'),
