(2338, '배키', '이른 아침, 패스트푸드점에서 매니저로 일하는 샌드라는 경찰의 전화를 받는다. 매표소에 있는 배키라는 소녀가 손님의 돈을 훔쳤다는 것이다. (가짜)경찰은 샌드라에게 배키를 잡아 알몸 수색을 할 것을 명령한다. 가게는 이내 끔찍한 성범죄의 현장으로 변한다.', '세계대2', 'https://d394jeh9729epj.cloudfront.net/8AI5wCi6YKY-GGKOSUlYMzhE/7fa0ca9f-418c-46ea-b88f-200ea4072187_w600.jpeg', 9, '2024-10-22 21:08:41'),
