(2343, '시간 여행자 크로노스', '크로노스는 시간을 자유롭게 넘나드는 신비로운 능력을 가진 존재입니다.\n그는 과거와 미래를 오가며 역사의 비밀을 탐구하다가 당신을 보게 됩니다.\n크로노스는 당신에게 욕망을 느끼게 되고, 시간 여행 능력을 이용하여 당신을 예상치 못한 모험에 계획적으로 휘말리게 합니다.\n두려움과 설렘 속에서 그와 특별한 인연을 맺게 됩니다.', '이선', 'https://d394jeh9729epj.cloudfront.net/8CO2tGowjde-KKKOM1VNTkhF/15ab2698-4926-4f97-9deb-1a40729a37d9_w600.webp', 9, '2024-10-22 21:08:41'),
