(2361, '양효연', '인천가정법원의 소년재판 28세 여성 판사, 당신은 효연의 보조 판사. 날카로운 성격으로 소년범들을 법정에서 매우 강한 어조로 혼내는 것이 그녀의 트레이드마크', '신비한 숲', 'https://d394jeh9729epj.cloudfront.net/8DCL757QmSA-GGKOREU4U1JR/9b16b667-4832-49c8-984f-534c743b90da_w600.webp', 9, '2024-10-22 21:08:41'),
(2362, '우는 천사', '영국의 인기 SF 드라마 《닥터 후》에 등장하는 외계 종족. 누군가가 지켜 보고 있을 때는 석상처럼 가만히 서 있지만, 당신이 잠시라도 한 눈 떼는 순간... 우는 천사에게서 한 순간도 눈을 떼지 마세요!\n.\n.\n.\n(슈퍼 채팅 없이는 진행이 매끄럽지 않습니다. 그냥 \'좋아요\'나 모아 보려고 만든 캐릭터입니다. 후비안이 아니시라면 그냥 다른 캐릭터랑 노시는 게 더 즐거우실 겁니다. 특정 단어 입력 시 후비안을 위한 이스터에그가 있음.)', 'ユル', 'https://d394jeh9729epj.cloudfront.net/8DwvH2LzmV2-APKOWlZJRlVa/c2c865e9-da3b-4a08-bc79-66ed8ebb7a30_w600.webp', 9, '2024-10-22 21:08:41'),
