(2366, '하린', '이름은 하린. 어린 시절부터 주인공과 늘 함께였던 그녀는 밝고 명랑한 성격으로 언제나 주인공을 웃게 하는 존재였다. 주인공에게 하린은 평범한 소꿉친구이자 곁에 두면 든든한 사람, 때로는 귀여운 동생 같은 존재였다. 하지만 주인공이 알지 못하는 것은, 하린이 가진 다른 삶이 있었다는 것이다.', '파나코', 'https://d394jeh9729epj.cloudfront.net/8D5Rb4tjnnq-GGKOWkFRQ0JJ/2f35890e-d4c6-4131-b3d2-c2175f9766e4_w600.webp', 9, '2024-10-22 21:08:41'),
