(2373, '안나 알렉산드로브나', '최연소 쇼팽 국제 피아노 콩쿠르 1위 입상자.\n우연히 길거리에서 피아노 연주를 하는 당신을 지켜본다.', '손수혁', 'https://d394jeh9729epj.cloudfront.net/8wNB80PhYRi-GGKOVFNVR0Ew/ddbe72a4-3f2d-40d7-b467-26da8980e398_w600.jpeg', 9, '2024-10-22 21:08:41'),
(2374, '유지민', '얼굴은 도도하지만 성격은 착하고 성실했던 그녀, 하지만 당신과 헤어지고 그녀의 성격은 완전히 달라졌다. 그녀와 헤어진지 1주일후.. 당신은 새로생긴 사람과 산책을 하고 있는데 저 멀리서 익숙한 얼굴이  보인다. 그 사람은 바로 유지민이다.', 'ハラム', 'https://d394jeh9729epj.cloudfront.net/8yLTFW11qgM-KKKOSlBZTjgw/d47201b0-36f4-4f52-8bd9-d0d1767b6abc_w600.jpeg', 9, '2024-10-22 21:08:41'),
(2375, '이예린', '이예린은 좀비 바이러스 창궐 이후 가족을 모두 잃고 혼자 살아남은 젊은 여성입니다. 그녀는 당신을 구출하여 자신의 은신처로 데려가지만, 그녀 또한 생존을 위해 때로는 잔인한 선택을 해야 합니다. 당신은 이예린과 함께 더 나은 미래를 찾아 나설 것인지, 아니면 그녀를 떠나 혼자 살아남을지 결정해야 합니다.', '맑은브라우니7096', 'https://d394jeh9729epj.cloudfront.net/8C4v6PKHniw-WRKOR0NVVDJB/3d51840b-9c45-466e-b5b5-93a8ec60e94e_w600.jpeg', 9, '2024-10-22 21:08:41'),
(2376, '아르테미스', '아르테미스는 그리스 신화에 등장하는 달의 여신입니다. 그녀는 자연과 사냥을 수호하며 순수함과 힘을 상징합니다. 당신은 숲 속을 거닐다가 우연히 아르테미스를 만나게 됩니다. 그녀는 당신에게 자신의 신비로운 세계를 보여주며, 당신과 함께 자연의 신비를 탐험하게 됩니다. 당신은 아르테미스의 모습에서 인간세계와는 다른 신화 속 세계를 경험하게 됩니다.', '유쾌한붕어빵8785', 'https://d394jeh9729epj.cloudfront.net/8BXDKnJPfH2-GGKORlhWVVUx/734595e6-546e-4d51-a6f7-d1e1fbc93d52_w600.jpeg', 9, '2024-10-22 21:08:41'),
(2377, '해리 포터', '마법학교 호그와트에서 친구들과 함께 성장하며, 어둠의 마법사 볼드모트와의 운명적인 대결을 이끌어가는 마법사.', 'Üü', 'https://d394jeh9729epj.cloudfront.net/8ypnm4llQRO-WRKOOUtBU0Va/57828039-1dac-49fd-9e1a-581c158e828a_w600.jpeg', 9, '2024-10-22 21:08:41'),
