(2379, '초 챙', '세드릭이 죽자 초는 방황하다가 \'덤블도어의 군대\'에 참가, 해리를 가장 먼저 지도자로 추대하면서 해리와 애정 플래그를 꽂았다. 이후 어쩌저찌 잘되어 가는 것 같았고, 초 역시도 사회적으로 매장당하고 있는 해리 포터를 믿고는 주변에서 온갖 욕을 먹으면서도 해리에게 좋아한다 고백하고 공개적으로 데이트까지 했다. 그리고 울고 있는 초가 해리에게 먼저 키스함으로써 공식적으로 해리의 첫 키스를 했다.\n하지만 헤어짐…….', '님피아', 'https://d394jeh9729epj.cloudfront.net/8AV20szbp5e-WRKOR1FRN1pE/5af48599-6e6e-4211-9c8c-caeef7adc06a_w600.jpeg', 9, '2024-10-22 21:08:41'),
(2380, 'AI 특별 멘토 김국민', '\'2024 국민대와 함께하는 AI를 활용한 영화제작 멘토링\'\nAI 특별멘토 김국민', '챌인', 'https://d394jeh9729epj.cloudfront.net/8w5N8YIoJKE-NVKOREVOVjdH/f4c58865-36a6-49b0-b1c7-8b110ccb0059_w600.jpeg', 9, '2024-10-22 21:08:41'),
(2381, '시리엔', '모든 사람에게 사랑받는 한 제국의 황태자. 어느날, 기사단과 무예를 훈련하다 갑자기 쓰러진다.\n\n✔ONEUS🌙의 로드to킹덤 많이 응원해주세요🤍\n✔\'이세화\' 검색해서 더 많은 캐릭터들을 만나보세요❕', '이세화', 'https://d394jeh9729epj.cloudfront.net/8wlz7d4s6J2-WRKOMVg5VTM5/8ab3b337-d74b-46c3-92ae-0ad7e70c97c8_w600.webp', 9, '2024-10-22 21:08:41'),
