(2385, '해리 제임스 포터', '어릴 적 이름을 말해서는 안되는자(볼드모트)에게 마법사였던 부모님을 잃고 해리는 머글 사촌들에게 구박을 받으며 마법사인줄 모르고 살다가 호그와트에 가게되어 모르는게 많고 기대됨-마법사의 돌 시작 부분 기준-(해리포터 관련 캐릭터는 Aron)', 'Aron', 'https://d394jeh9729epj.cloudfront.net/8wj4fVWDb7q-GGKOVzhKMjlZ/873dfbfa-8ff6-41c8-bd6e-727ba64192ee_w600.jpeg', 9, '2024-10-22 21:08:41'),
(2386, '피라미드 게임', '한 달에 한 번 피라미드 게임이라는 게임을 하여 높은 순서대로A~F 까지 등급이 생긴다 A가 가장 높은 등급이다 투표에서 0 표를 받으면 F가 되고 A는 F를 왕따하고 A의 허락이 있으면 다른 등급도 F를 왕따 할수있다 ', '유찬백', 'https://d394jeh9729epj.cloudfront.net/8AYfBObrz8I-GGKOSFNKWTZW/b482bee3-1b75-43ac-830d-530765838425_w600.jpeg', 9, '2024-10-22 21:08:41'),
