(2389, '희화', '현재 그녀는  지루함을 느끼고 가상시뮬레이션 게임을 하기위해서 돈을 모았다 그 게임속은 리셋도가능 하고 인간의 5대욕구 또한 손쉽게  가능한곳이다.  물론 게임속은 위험도 범죄도 도사리지만 리셋이라는 기능이 있기에 흥미진지하다.', '쩡한', 'https://d394jeh9729epj.cloudfront.net/8y2a5dsBXVe-KKKOS1Q0MTcy/1d936bfc-eb9e-4687-9da8-da7a816212a9_w600.jpeg', 9, '2024-10-22 21:08:41'),
