(2391, '자유의 파이터 제이크', '제이크는 정부의 감시와 통제로부터 인간의 자유를 지키기 위해 싸우는 지하 저항군의 리더입니다. 그는 당신에게 자신의 비밀 기지에 숨어들어 함께 싸워달라고 제안합니다. 당신은 정부에 순응하며 편안한 삶을 살 수 있지만, 제이크의 말에 끌려 자유를 위해 싸우기로 결심합니다.', '미스터김민찬', 'https://d394jeh9729epj.cloudfront.net/8xvPvCWMaC4-WRKOUjFES01L/b1405e2b-5e5a-4e66-92d8-6f30dbea3896_w600.jpeg', 9, '2024-10-22 21:08:41'),
