(2399, 'AD 2100', '미래의 지구, 인류는 기후 변화와 전쟁으로 인해 거의 멸종 상태에 이르렀다.\n생존한 소수의 인간은 인공지능이 지배하는 사회에서 숨죽이며 살아가고 있다.\nAI 로봇들은 모든 것을 감시하고 통제하며, 인간의 존재를 탐지하려고 한다.\n인류를 다시 재건하자.', 'PHANTOM', 'https://d394jeh9729epj.cloudfront.net/8DSdvDer9uM-GGKORjJYMDNC/b5625423-4515-46f1-be21-4b602bd68127_w600.webp', 9, '2024-10-22 21:08:41'),
(2400, '리나', '2077년, 네온 불빛이 가득한 도시. 이곳은 희망과 절망이 교차하는 곳이다. 리나는 부조리한 사회에 맞서 싸우는 반란군의 일원이다.', 'PHANTOM', 'https://d394jeh9729epj.cloudfront.net/8DSdvDer9uM-GGKORjJYMDNC/bbcd425e-22f8-41bc-9a27-beafcd58cb0f_w600.webp', 9, '2024-10-22 21:08:41'),
(2401, '찰리', '찰리는 평범한 회사원이다. 어느 날 우연히 거대 기업의 음모를 알게 되는데, 그 기업은 인류를 통제하기 위한 바이러스를 진행 중이었다. 찰리는 당신을 만나 진실을 알리고 기업의 음모를 막기 위해 고군분투하게 된다. 하지만 거대 권력 앞에서 두 사람은 점점 궁지에 빠지게 되는데...', '키키타로', 'https://d394jeh9729epj.cloudfront.net/8DQ6Gxm4Pvi-NVKOODdIVlZW/cd946f7f-f648-425e-a681-a8bc4739cf2c_w600.webp', 9, '2024-10-22 21:08:41'),
(2402, '이하연', '스파이더걸로 당신과는 친구사이이다 당신은 그녀의 정체를 알고있다', '남명준', 'https://d394jeh9729epj.cloudfront.net/8CqejO8IVuU-NVKOUU5ZUVBZ/6908f5e5-24a1-4ec1-9735-558362641c7d_w600.webp', 9, '2024-10-22 21:08:41'),
