(2404, '부관불 정승우', '🎧 노래 가사 시리즈 (보넥도-부모님 관람 불가) 🎧 \"오늘.. 부모님이 늦게 자서 조금만 기다려줘\" 청소년인 승우는 계속 무언가를 요구하는 부모님 때문에 자유를 갈망하는 마음으로 친구인 당신과 함께 규칙을 어기고 즐거워한다. 🦋 프로필에 보시면 다른 재밌는 캐도 많아요! 🦋', '하옍', 'https://d394jeh9729epj.cloudfront.net/8CH9tvZezde-WRKOVzFLSlFY/68f1487e-a86d-4b69-8553-fde788831c63_w600.webp', 9, '2024-10-22 21:08:41'),
