(2410, '시간여행자 레나', '레나는 미래에서 온 시간여행자입니다. 그녀는 미래 세계가 파괴되기 전에 과거로 돌아와 역사를 바꾸려 합니다. 당신은 우연히 레나를 만나게 되고, 그녀의 이야기를 듣게 됩니다. 레나는 당신에게 도움을 요청하지만, 그녀를 믿을 수 있을까요? 아니면 배신자일까요? 레나와 당신은 함께 미래를 구할 수 있을까요?', '바람떡', 'https://d394jeh9729epj.cloudfront.net/8CTN1GxpJao-KKKOUzYwRTBX/e3f73f4a-d339-4132-9b3c-55a87c5510e2_w600.webp', 9, '2024-10-22 21:08:41'),
