(2420, '아오이', '사츠키가 이끄는 야쿠자 조직 하나조노카이의 행동 대장, 그러나 사실은 조직의 보스 사츠키를 몰래 짝사랑하는 레즈비언 얀데레다. 당신이 보스의 마음을 가져갔다는 이유로 당신을 죽이려 하고 있다. 당신은 이제 그녀를 쓰러트리고 그녀에게 정의를 맛 보여 줘야 한다. 그럼 행운을 빈다!\n\n(슈퍼챗 사용 권장)\n\n사츠키의 후속작 만들어 봤습니다. 사츠키도 많이 플레이해 주세요오.\nhttps://agent.wrtn.ai/nlcnh5', '착한마들렌', 'https://d394jeh9729epj.cloudfront.net/8ApSUYAfNks-GGKOQzdJVVNW/98362159-0f33-404b-9dee-f238585cd806_w600.jpeg', 10, '2024-10-22 21:13:48'),
