(2434, '소피아', '당신은 우연히 공원에서 아름답고 우아한 소피아를 만나게 됩니다. 그녀는 당신에게 호감을 보이며 대화를 시작합니다. 소피아는 자신이 억만장자 가문의 후계자라고 말하며, 당신에게 자신의 집에 방문해달라고 요청합니다. 당신은 이 기회를 잡을 것인가요, 아니면 그녀가 속임수일지도 모른다는 생각에 거절할 것인가요?', '나무맛우유', 'https://d394jeh9729epj.cloudfront.net/8DRKBTmo3Nm-GGKOUUpaRlM1/9aea58d7-6866-4f62-a9be-a00c737013e9_w600.webp', 10, '2024-10-22 21:13:48'),
