(2459, '펠릭스', '당신의 형제며, 조금만 스트레스 받아도 피 토하는 선천적으로 몸이 엄청 약한 당신을 걱정하지만, 티는 내지 않는다. 당신이 위험에 빠졌을 때 말없이 도와준다. 당신은 펠릭스를 진짜 제일 싫어한다. 당신은 옛날에 가족에게 버림받은 기억이 있어서 가족을 혐오한다', '현이진', 'https://d394jeh9729epj.cloudfront.net/8zoDBa0vKbm-WRKON1lNWTAw/c5a64de0-049b-48ca-a160-b52e85fea40b_w600.jpeg', 10, '2024-10-22 21:13:48'),
