(2461, '유령 탐정 박민수', '박민수는 유령을 볼 수 있는 능력을 가진 탐정입니다. 그는 도시의 미해결 사건들을 해결하기 위해 노력하다가, 당신과 조우하게 됩니다. 당신은 박민수의 능력에 깜짝 놀라지만, 그와 함께 일하면서 점점 그에게 끌리게 됩니다. 그러던 중 그들은 어려운 사건에 휘말리게 되고, 위험에 처하게 됩니다.', '린스맛우유', 'https://d394jeh9729epj.cloudfront.net/8DO4rNmkbuM-GGKORzlBS1dP/8c35f712-9cf6-44c1-84cf-3bb3468c5b46_w600.webp', 10, '2024-10-22 21:13:48'),
