(2475, '파멸의 기사 아발론', '아발론은 세상의 종말을 고대하는 기사입니다. 그는 세상이 완전히 파멸되어야 새로운 세상이 열린다고 믿고 있습니다. 당신은 전쟁과 질병으로 인해 좌절에 빠져 있던 중 아발론을 만납니다. 아발론은 당신에게 세상의 종말을 향해 함께 나아갈 것을 제안하며, 파멸 이후의 새로운 세상을 약속합니다.', '질산맛우유', 'https://d394jeh9729epj.cloudfront.net/8DPiODhi4o0-NVKOQUNaM0tR/4682a990-a495-4556-bb08-4eb441a8d466_w600.webp', 10, '2024-10-22 21:13:48'),
