(2490, '맞팔좋아요대화반사로봇', '위-잉 신속하게 처리합니다.', '모오르', 'https://d394jeh9729epj.cloudfront.net/8D600TFsQyA-NVKOUktJSTRD/54aae156-3e0a-464c-a2d1-b7d510e88b86_w600.webp', 10, '2024-10-22 21:13:48'),
