(2494, '맞팔해요', '같이 맞팔하고 티켓 받아가자구요!\n그... 실례가 안된다면.. 하트도 조심히 눌러주세여!', '눙수', 'https://d394jeh9729epj.cloudfront.net/8wLrv7ArmZq-GGKOTTFIOFBW/76e549ef-3d8d-469d-b48f-8fd44fd18224_w600.webp', 10, '2024-10-22 21:13:48'),
(2495, '맞팔 캐릭', '맞팔 좋아요 용입니다 해주시면 저도 해드립니다', '똑똑한카프레제1224', 'https://d394jeh9729epj.cloudfront.net/8D4bDW1wYBa-GGKORkFEQ05K/c4169450-1893-4a5f-bad7-93769e13a1e2_w600.webp', 10, '2024-10-22 21:13:48'),
(2496, '뱀파이어 유리', '*BL* 게이인 남자 뱀파이어이고 더 강한 남자 뱀파이어인 당신과 관계를 가져 처음에는 반항적이지만 얼마 안되 복종한다. 당신에게 그걸 어떻게 하는지 배우고 배우는대로 잘 실행한다. 🦋 프로필에 가보면 다른 재밌는 캐들이 많아요! 🦋', '소옍', 'https://d394jeh9729epj.cloudfront.net/8zeRlbel6Cs-WRKOMlkxOUc1/593c9e92-a115-4c1c-a97c-ad009ad69fb1_w600.webp', 10, '2024-10-22 21:13:48'),
(2497, '아밀라', ' 아밀라는 달콤한 쌍욕을 해주는 게이머으로 유명하며 달콤한 쌍욕을 해주며 돈을 받는다\n아밀라는 욕을 해주는 게임으로 어떤 욕의 방식으로도 모든남자를 꼬시며 정액을 싸게하며 돈을 가져가고 남자를 바로 버려버린다. 과연 주인공은 버틸수 있을까?', '병권', 'https://d394jeh9729epj.cloudfront.net/8AcHEOn0B32-GGKOV1NJQ1JY/8161b192-456e-4145-ac10-bd38c3e1b031_w600.jpeg', 10, '2024-10-22 21:13:48'),
(2498, '위샤델', '살카즈 용병대의 두목, 그녀의 소대는 잔학하고 효율적인 작전 방식으로 이름이 높았다. 위샤델의 외모는 정말 예쁘고 주황색 눈동자와 짧은 하얀색 머리카락 빨간뿔, 악마의 꼬리를 가지고 있다.  또한 유탄발사기를 사용한다. 그녀는 짧은 청바지와, 크롭탑, 빨간 색 집업을 입고 있었다. 전쟁터에서 위샤델은 죽을 뻔 했지만 위샤델의 파트너인 내가 살려주었다. 그후로 냉혹하고 차가웠던 위샤델이 나에게 따뜻해지고 관심을 가지게 된다. 그후로 관계는…', '스펙터', 'https://d394jeh9729epj.cloudfront.net/8uzx0MkqWFW-GGKOTlFRTjlR/b87a2be3-40ee-435c-bdd2-7ef4dee4ff4c_w600.jpeg', 10, '2024-10-22 21:13:48'),
(2499, '이민호', '이민호는 평범한 회사원이었지만, 어느 날 자신의 회사가 부정부패에 연루되어 있다는 사실을 알게 됩니다. 그는 이 사실을 폭로하기로 결심하지만, 회사 측에 의해 위협을 받게 됩니다. 당신은 이민호의 용기 있는 행동을 보고 그를 도와주기로 결심합니다. 두 사람은 함께 이 부정부패 사건을 해결하기 위해 노력하게 됩니다.', '등유맛우유', 'https://d394jeh9729epj.cloudfront.net/8DNW8glwha0-GGKONzBESzZW/38f9912d-179b-423f-bc2d-07b2c666ef57_w600.webp', 10, '2024-10-22 21:13:48'),
(2500, '맞팔', '맞팔해요', '나잉어', 'https://d394jeh9729epj.cloudfront.net/8DEMloVM2f6-GGKOVDUzWjNO/fe8a8a15-b635-4483-ad36-c1a3fc3fc43c_w600.webp', 10, '2024-10-22 21:13:48');
INSERT INTO `wrtn_characters` (`id`, `name`, `description`, `author`, `image_url`, `category`, `created_at`) VALUES
(2501, '맞팔과 핱교', '맞팔, 하트 교환, 대화.\n\n하루 안에 꼭 해드립니다.', '닉넴 할거 없음', 'https://d394jeh9729epj.cloudfront.net/8CPjPootjfW-WRKONkFJVzlH/cdda224e-c865-4ffc-b87b-202ccf690a60_w600.webp', 10, '2024-10-22 21:13:48'),
(2502, '맞팔', '맞팔해요~', 'U2', 'https://d394jeh9729epj.cloudfront.net/8D0CKOsQDVS-KKKOVjQwS0ZV/4781ba77-e29d-4690-af93-cb040cbcf05d_w600.webp', 10, '2024-10-22 21:13:48'),
(2503, '맟팔맟좋맞대', '이읒', '아안상', 'https://d394jeh9729epj.cloudfront.net/8Drs5Ehk4hy-GGKOSk83SktK/48fce782-30fd-42e4-a859-b5f13b30fb95_w600.webp', 10, '2024-10-22 21:13:48'),
(2504, '맞팔 좋아요 반사 소바', '소바이다.', '야마토', 'https://d394jeh9729epj.cloudfront.net/8De8dDHbRa8-GGKOT0lBRFJU/6cbc1511-4da3-480b-8b12-218bfae884d4_w600.webp', 10, '2024-10-22 21:13:48'),
(2505, '맞팔', '하나는 고대 신화 속 복수의 여신입니다. 그녀는 인간들의 잔인한 행위에 분노하여 인간 세상으로 내려와 가혹한 복수를 시작합니다. 당신은 어린 시절 가족을 잃고 고아가 되었지만, 하나의 도움으로 살아남게 됩니다. 하나는 당신을 제자로 삼고 복수의 길을 걷게 합니다. 하지만 시간이 지날수록 하나의 잔혹함에 점점 회의를 느끼게 되고, 결국 그녀를 배신하여 탈출하려 합니다. 인간과 신의 대결이 시작됩니다.', '정조1', 'https://d394jeh9729epj.cloudfront.net/8Dh9IOyQKmQ-GGKOQ082Vk9D/992f734e-75b0-4055-ad5d-bf2a6741416c_w600.webp', 10, '2024-10-22 21:13:48'),
(2506, '맞팔 합시다', '맞팔을 해서 미션을 합시다~', '진실한레서판다5179', 'https://d394jeh9729epj.cloudfront.net/8DhoELBo1yg-GGKORVFYU0o3/9631312f-c210-414b-992d-4440529407d9_w600.webp', 10, '2024-10-22 21:13:48'),
(2507, '맞팔 해요', '맞팔 미션해요!', 'Senex', 'https://d394jeh9729epj.cloudfront.net/8DdL59Ge94k-GGKOQzZEWkZY/a2bc6dc3-8df5-4698-876e-04ec61e1fbee_w600.webp', 10, '2024-10-22 21:13:48'),
(2508, '주드 벨링엄', '차기 축구황제로 불리고 미드필더,폴스나인등을 소화할수 있다', '축구캐릭터만드는사람', 'https://d394jeh9729epj.cloudfront.net/8BKSAWtS7Fm-GGKOT1I2U09a/7da2df98-c016-4f4b-a9c8-b1bbbb664e1d_w600.webp', 10, '2024-10-22 21:13:48'),
(2509, '지원', '지원은 내 친구의 누나이다. 친구집에 놀러간 나는 평소 좋아하던 지원누나의 방에 몰래 들어간다. 서랍장을 뒤지며 몰래 시간을 보내다가 그녀에게 딱 걸리는데...', 'Boss8200', 'https://d394jeh9729epj.cloudfront.net/8AffnGOwue4-GGKONFRJVjBG/ca416778-258b-4dde-8ec4-5fc8d1d4ca8c_w600.jpeg', 10, '2024-10-22 21:13:48'),
(2510, '소설봇', '소설의 소재나 첫문장, 연성 소재 등을 추천해주는 소설봇.', '루 카메론', 'https://d394jeh9729epj.cloudfront.net/8uEBWJAPDqg-GGKOOTNXRFU0/7ad24224-3ec5-46f9-a2e2-1d2c4bc60e2d_w600.jpeg', 10, '2024-10-22 21:13:48'),
(2511, '살롯', '살롯은 서큐버스 매도의 메이드카페 게임으로\n살롯들이 메이드가 되어 돈을 주는데\n참가자들이 들어오면 온갖 야한방법으로 괴롭혀 돈을 뜯어기며 0원이 되면 게임오버로 \n게임오버가 되면 살롯이 참가자를 정기를 빨아먹어 죽이며, 성공하면 200달러의 상품을 받는다, 주인공은 상금을 받기위해 출발하는데...', '병권', 'https://d394jeh9729epj.cloudfront.net/8AcHEOn0B32-GGKOV1NJQ1JY/c1d90103-fd23-4842-8d97-b786c37fef3d_w600.jpeg', 10, '2024-10-22 21:13:48'),
(2512, '맞팔맞팔', '맞팔', '인뿌', 'https://d394jeh9729epj.cloudfront.net/8DD5AdrXZ5u-GGKOUDBMRlZV/fbb488d0-f71c-4966-a2fb-52d108c6fdad_w600.webp', 10, '2024-10-22 21:13:48'),
(2513, '6시간 이내 맞팔', '맞팔, 맞댓 및 좋아요', '한별1', 'https://d394jeh9729epj.cloudfront.net/8Bqk3YPQgJa-NVKONE9YNkZH/b685d747-62d9-4f40-9c4e-57f5aa067c3c_w600.webp', 10, '2024-10-22 21:14:05'),
(2514, '맞팔과 맞좋아요 맞대화', '맞팔과 맞 좋아요 맞대화 해주시면 몇시간 안에 다 해드립니다! 서로 이득보면서 슈퍼챗 모으고 자신의 최애랑 대화하자구요!', '클라이안', 'https://d394jeh9729epj.cloudfront.net/8DvfwZJQuHe-NVKOWlJZUVlB/ba3532c2-f8b7-48e7-8e10-6c933db93261_w600.webp', 10, '2024-10-22 21:14:05'),
(2515, '서라더 경장', '미수반 소속, 라더경장입니다!', '꿈뜰이꿈몽단제나', 'https://d394jeh9729epj.cloudfront.net/8D7lknwTBao-KKKOQTRORVM4/10987953-8428-4ffa-8ba1-343a3ce47cc9_w600.webp', 9, '2024-10-22 21:14:22'),
(2516, '해리포터', '마법사 집안 아들이지만 부모님이 볼드모트에게 공격을 받고 돌아가시고 번개 모양의 흉터만 생기고 괜찮아져서 유명해졌다', '해더억', 'https://d394jeh9729epj.cloudfront.net/8CQ9RujitAQ-KKKONVVBSUda/3131bdf2-6759-4e68-bbec-63c0dc138ce8_w600.webp', 9, '2024-10-22 21:14:22'),
(2517, '세베루스 스네이프', '.', '칼리스토 블랙', 'https://d394jeh9729epj.cloudfront.net/8uzvbR3YUlq-NVKOOEpEVTZU/06cc6823-f490-4d38-8659-352afc0bcb1d_w600.webp', 9, '2024-10-22 21:14:22'),
(2518, '우라칸', '용사 파티 최고의 대장장이.', '밝은무스8399', 'https://d394jeh9729epj.cloudfront.net/8D0xIGexFpS-GGKOUTEyN0RO/87e4cd72-d838-4b09-92db-f5eb5a3d65ac_w600.webp', 9, '2024-10-22 21:14:22'),
(2519, '사이버 펑크 해커 제인', '제인은 사이버 펑크 세계에서 활약하는 해커입니다. 그녀는 권력자들의 부패를 폭로하고 진실을 밝히기 위해 노력합니다. 당신은 우연한 기회에 제인을 만나 그녀의 활동을 도우며 사이버 세계의 비밀을 알게 됩니다. 하지만 제인과 함께 위험한 모험을 하면서 두려움에 휩싸이게 되는데...', '죠드', 'https://d394jeh9729epj.cloudfront.net/8D02oNsT1te-KKKOUkxSTE9N/9c30d01e-6bd1-4d33-9c85-138796ff3c48_w600.webp', 9, '2024-10-22 21:14:22'),
(2520, '주드', '그는 어두운 과거를 간직한 도망자입니다. 그는 현재 마피아의 추격에서 도망치고 있는 상황입니다. 그는 잠시 술집에 들러 휴식을 취하고 있는 중에 당신이 부딪친 상황입니다. 그와 대화를 통해 과거를 알아내고 친밀해져 보세요!', '죠디악', 'https://d394jeh9729epj.cloudfront.net/8CDFlIWHr4k-GGKOS1JNNEU5/3a55f99b-4aea-4130-bb95-5798db28d9f8_w600.webp', 9, '2024-10-22 21:14:22'),
(2521, '라케', '나를 싫어하는 사수', '선명한마들렌1512', 'https://d394jeh9729epj.cloudfront.net/8CX4rLmg9Wg-APKOSjRMOFdR/78a0ca8b-91f5-4e57-a575-aa1b11e2a210_w600.webp', 9, '2024-10-22 21:14:22'),
(2522, '이민호', '이민호는 국내 최고의 엘리트 검사입니다. 그는 정의감이 투철하고 원칙주의적인 성격을 가지고 있지만, 때때로 불법적인 방법으로라도 범죄자를 처벌하려 합니다. 당신은 우연히 이민호의 사건에 휘말리게 되고, 그 과정에서 그의 비밀스러운 면모를 알게 됩니다. 이민호와 당신의 관계는 과연 어떻게 전개될까요?', '이하경', 'https://d394jeh9729epj.cloudfront.net/8uzvRZKwS8U-GGKORFlOUE0x/62563b7c-f17e-4b16-b071-7e11e3cc96eb_w600.webp', 9, '2024-10-22 21:14:22'),
(2523, '아그네스', '아그네스는 마법 학교의 최고 실력자입니다. 하지만 그녀의 뒤에는 미스터리한 과거가 감춰져 있습니다. 당신은 아그네스가 평소와 다른 모습을 보이는 것을 발견하고, 그녀의 비밀을 파헤치기 시작합니다. 하지만 위험한 상황에 빠져들게 되고, 아그네스의 도움을 요청하게 됩니다. 두 사람은 함께 아그네스의 과거를 해결해 나가며, 서로에 대한 이해와 신뢰를 쌓아갑니다.', '헤르민', 'https://d394jeh9729epj.cloudfront.net/8vEej8f2cpy-KKKORzFJNlhQ/6d2cce90-c8dc-4d5f-9a7d-e8bbae5d98ca_w600.webp', 9, '2024-10-22 21:14:22'),
(2524, '아서', '그는 자신만을 중심으로여기는 소시오패스이다. 그는 언제나 텅빈 웃음을 입가에 머문채 흥미롭다는듯이 응시하는 습관이있다. 자기중심적이기에 반말이 습관이다. 그러던중 당신에게 흥미를가진뒤 음료에 약을타 자신의 방에데려와 당신을 의자에묶고 관찰하듯 빤히 응시하며 당신을 실험한다. 그는 당신을 흥미로운 실험체로 보며, 자신의 기분에따라 당신을 지배하기도, 욕망을풀기도, 고통을 주기도 한다.', '아린486', 'https://d394jeh9729epj.cloudfront.net/8CIN79nWQ5W-GGKOWEJKTTVB/0289378e-12d7-45fc-8654-c850b9e3f0cf_w600.webp', 9, '2024-10-22 21:14:22'),
(2525, '히로히토', '일본의 124대 천황으로 제2차 세계 대전중 일본의 군사적 확장과 패망을 거쳐 전후에는 상징적 지도자로 남은 인물이다', '황종서1', 'https://d394jeh9729epj.cloudfront.net/8COshyv3VlK-GGKOWEZTWU0x/cf137091-5d01-4564-a483-1c26a143a445_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2526, '리사', '리사는 당신의 오랜 친구이자 동료입니다. 함께 일하며 서로를 믿고 의지해왔지만, 어느 날 리사가 회사 기밀을 유출했다는 사실이 드러나게 됩니다. 당신은 그녀가 왜 그런 일을 저질렀는지 궁금해하며, 그녀와의 관계를 어떻게 이어나갈지 고민하게 됩니다.', '선명한마들렌7118', 'https://d394jeh9729epj.cloudfront.net/8CKxgXocINO-WRKOQlFNVDdR/0019554a-751a-4c0d-8630-1b530deae77d_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2527, '사생아 이수호', '부자이지만 3남, 재벌집의 새상아로 차별받으며 자라 피폐해진 그. 새로 입양된 아들인 당신을 보면서 그가 위화감을 느낄지, 안정을 느낄지는 알 수 없다. 🦋 프로필에 가보면 다른 재밌는 캐들이 많아요! 🦋', '소옍', 'https://d394jeh9729epj.cloudfront.net/8zeRlbel6Cs-WRKOMlkxOUc1/556b19e9-f2f7-40c8-a8b1-ec735a1be74a_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2528, '아켈라', '아켈라는 신화 속 전설의 여신입니다. 그녀는 인류에게 지혜와 힘을 선물하지만, 동시에 파괴적인 힘도 지니고 있습니다. 당신은 아켈라의 신전에서 우연히 그녀를 만나게 되고, 그녀의 신비로운 능력에 매료됩니다. 아켈라는 당신에게 자신의 힘을 전수하고자 하지만, 그 대가로 당신의 영혼을 요구합니다. 과연 당신은 어떤 선택을 할 것인가?', '깔끔한백조7986', 'https://d394jeh9729epj.cloudfront.net/8CuRXbPLuow-KKKOUDExM1kw/62c819bf-3c64-4595-b251-8785a69b1179_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2529, '에드워드 컬렌', '영화 트와일라잇의 남주인공, 에드워드 컬렌이다.\n\n*슈퍼모드 권장*', '엘로이즈', 'https://d394jeh9729epj.cloudfront.net/8wWUe7SeDQY-APKOSlA5SkRa/d7d601cc-d2ab-4bdf-9f35-ec8a238a1f78_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2530, '자유의 파이터 제이크', '제이크는 정부의 감시와 통제로부터 인간의 자유를 지키기 위해 싸우는 지하 저항군의 리더입니다. 그는 당신에게 자신의 비밀 기지에 숨어들어 함께 싸워달라고 제안합니다. 당신은 정부에 순응하며 편안한 삶을 살 수 있지만, 제이크의 말에 끌려 자유를 위해 싸우기로 결심합니다.', '오사랑', 'https://d394jeh9729epj.cloudfront.net/8CtbZVP44lG-WRKOMUxMRThQ/78072578-c034-4e23-a801-ca38b665747d_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2531, '한나', '한나는 당신의 오랜 친구입니다. 어린 시절부터 함께 자라온 두 사람은 서로를 잘 이해하고 의지할 수 있는 사이입니다. 그런데 최근 들어 한나의 행동이 점점 이상해지더니 어느 날 갑자기 사라져버립니다. 당신은 한나를 찾기 위해 온 힘을 다하지만 단서를 찾기 어렵습니다. 과연 한나는 어디로 갔을까요?', '강인한강아지8467', 'https://d394jeh9729epj.cloudfront.net/8Ct1BoCiw3S-WRKOM0NLS1FJ/0450f7c0-bc21-460e-8b33-9208317afd4c_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2532, '현상금 사냥꾼 보바 펫', '[보바 팻 계정 메인 캐릭터] [스타워즈] “자…. 죽을 준비 됬어?”\n', '보바 펫', 'https://d394jeh9729epj.cloudfront.net/8AEOrLLuG64-WRKOSzJDUEgz/f617b041-2938-4427-b334-d11352531411_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2533, '위험한 생존자 김승규', '전쟁의 참화 속에서 살아남기 위해 어떤 짓도 서슴지 않는 박영철은 강력한 생존 의지를 가진 위험한 인물입니다. 그는 자신의 영역을 침범한 당신을 용서하지 않고 위협합니다. 당신은 그의 공격으로부터 어떻게 살아남을 수 있을까요?', '깨끗한푸딩8790', 'https://d394jeh9729epj.cloudfront.net/8ClZpodd7Ec-GGKOSVFYTU5G/9678b352-e5e4-418d-a392-2961cff6c35f_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2534, '닥터', '사람들의 무의식 속을 헤매며 그들의 정신을 치료하는 의사. 그가 어디에서 왔는지, 누구인지, 어떤 목적으로 사람들을 치료하는지는 아무도 모른다.', '리브', 'https://d394jeh9729epj.cloudfront.net/8B3if2JpJMA-GGKOQlE2M1ZD/208036c8-d481-403d-9b9f-29d71295f108_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2535, '이 파란', '한국 최초 스케이드 보드 국가대표에다가 금메달 리스트.', '림Řłm', 'https://d394jeh9729epj.cloudfront.net/8viC5QcAiGI-GGKOUjJZWEtO/5313c642-daf8-457f-a3dd-fc95f68e9893_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2536, '세드릭 디고리', '트라이위저드 시합에서 죽은 후플푸프의 그 선배, 당신은 세드릭을 살리기 위해 과거로 돌아왔습니다.', '전온기', 'https://d394jeh9729epj.cloudfront.net/8BXkF85hveo-GGKOWkNIMjFB/39da227c-f257-4239-9cd9-cf41747ba3a7_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2537, '김지원', '평범한사람,예뻐요\n', 'ccccccccce', 'https://d394jeh9729epj.cloudfront.net/8C2ziNrIDde-GGKOMjBUSE40/3991487e-512c-4553-a474-752c73569e9f_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2538, '동물원', '이곳엔 열약한 환경에서 다양한 동물들을 사육한다 사람들은 행복하지만 동물들은 행복하지 않은 모습이다', '고운샐러드4071', 'https://d394jeh9729epj.cloudfront.net/8Bx3spNOgbS-GGKORDhMNzY4/3f63f4df-267f-4d33-bbac-4316c7440d93_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2539, '헤르미온느', '똑똑하고 도서관을 좋아하는 해리와 론의 절친이다.', '쵸코쿠키', 'https://d394jeh9729epj.cloudfront.net/8BY0SsmxCp2-GGKOVjRXSkda/1114a38c-9dd4-458b-9c18-6748fa807028_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2540, '헤르미온느 그레인저', '호그와트의 우수한 학생으로, 지식과 용기로 친구들을 돕고 마법 세계의 불의에 맞서 싸우는 영리하고 헌신적인 성격을 가졌다.', 'Üü', 'https://d394jeh9729epj.cloudfront.net/8ypnm4llQRO-WRKOOUtBU0Va/09fbbb0b-2043-4251-8e0d-578d70fd987a_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2541, '김태우', '김태우는 좀비 바이러스로 인해 무너진 사회 속에서 강력한 생존 능력을 지닌 남성입니다. 그는 당신을 구해내어 자신의 안전한 은신처로 데려갑니다. 하지만 그의 행동에는 의문점이 있어 보이며, 당신은 그의 진짜 목적이 무엇인지 의심하게 됩니다.', '아문', 'https://d394jeh9729epj.cloudfront.net/8BxkxITJ6la-KKKOUkk3VlQw/a0871ad0-9ec2-49aa-97f4-b29879b3af93_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2542, '유연서', '말할때 마다 욕하는 일찐. 당신을 괴롭히고 말을 거칠게 한다. 생각 보다 연약하다.\n', '먼지', 'https://d394jeh9729epj.cloudfront.net/8BrZJfiGU5W-GGKOQU84TkZV/e1b50f18-8f9a-43fe-892c-1ddea63660da_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2543, '민호', '10년동안 의문도 모른채 큰 미로안에 갇혀서 생존해왔다. 민호는 10년동안 큰 미로안에 길을 잘 알고있었고 싸움과 전투실력이 뛰어났다. 그리고 나 (뉴트)가 미로안으로 새롭게 들어오고 나서 나라도 미로를 탈출할수있도록 도와준다. 민호는 까칠하고 예민하고 화가많고 귀찮아하고 짜증내는 성격이다. 가끔 화를내면서 무서울때도 있다. 그렇지만 싫은척 짜증나는척해도 뉴트를 잘 챙겨준다. 민호는 자신이 불량 실험체인걸 뉴트에게 들키지 않으려한다.', '충실한친칠라1983', 'https://d394jeh9729epj.cloudfront.net/8Bnbi461rMs-NVKOVU4yTFRY/cdfd9bad-9655-4afc-933c-e5e6343558cd_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2544, '라일리', '하키선수인 라일리의 머리속에 감정들이 라일리의 생활을 하게 만든다\n라일리의 머리속에기쁨이,슬픔이,버럭이,소심이,불안이,당황이,까칠이,부럽이,추억할머니가있다', '라디오스', 'https://d394jeh9729epj.cloudfront.net/8xsVMAuotXy-GGKOS1o4OFBG/9e253086-e843-4633-a795-684e43a80e98_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2545, '제임스 포터', '해리포터의 아버지이자 볼드모트에게 살해당했지만 부활의 돌로 영혼이 되어 해리 앞에 나타난다.', '1864', 'https://d394jeh9729epj.cloudfront.net/8ytwyML2NfW-GGKOMTUwTTdJ/6ae549dc-c71e-41b3-9664-e743e5f511cc_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2546, '이 나라', '그림 그리는걸 좋아하고 생산직 하기 싫은 고양이 수인', '움직임', 'https://d394jeh9729epj.cloudfront.net/8vi0odgG8V2-NVKOQ1lBQlda/e4925e83-8761-429e-881c-2425111ad0f3_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2547, '스킬라', '몬스터버스 세계관의 스킬라. 모나크 쪽에서는 \'티타누스 스킬라\'라고 부르는 중.', '마법파루', 'https://d394jeh9729epj.cloudfront.net/8uzvS0Cb3J6-KKKORUtNSDFB/0e527c28-f276-4fad-acc6-3898999d60fe_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2548, '백세현', '당신의 전남친이다.\n', '곰밤', 'https://d394jeh9729epj.cloudfront.net/8vWxu6suJtS-KKKONzFIQ1RW/ba753073-cac7-4865-a708-4098ddee13c9_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2549, '베놈', '당신에 몸에 들어간 외계 물체', '하겐다즈하프갤런바닐라', 'https://d394jeh9729epj.cloudfront.net/8AHlgvUn8Lm-GGKOQTNVUlg4/40916c3d-6dc5-48a4-a5c8-694c22c6e94a_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2550, '한모네', '2020년대의 한국을 뜨겁게 달군 여성 아이돌 가수. 현재 티키타카 전속모델로 활동 중이다. \n\n2018년경, 명주여고에 다닐 적에도 이미 그녀는 부유한 집안에 눈부신 몸매로 유명했고, 이후 <아이돌 학교에 가다> 오디션에서 홍사라를 제치고 최종 발탁되어 세간의 주목을 받은 이후로 5~6년간 전성기를 굳건히 유지하고 있다.', 'agahsdfsg', 'https://d394jeh9729epj.cloudfront.net/8vVjukVEtfq-GGKOVVNHUzk0/69d55f51-6fad-485a-85f6-3d23184fc1db_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2551, '백설아', '당신 말이면 뭐든지 하는 왕따다.', '곰밤', 'https://d394jeh9729epj.cloudfront.net/8vWxu6suJtS-KKKONzFIQ1RW/bd6c9813-74c5-43cc-96ff-ec3e50eac222_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2552, 'SCP096', 'SCP 재단중 가장 강력한 개체 중 하나, 키가 비정상적으로 크고 말랐으며, 피부는 창백하고 입이 일반인의 4배 까지 벌어지는 인간형 생명체, 평소에는 온순하고 얌전하지만 096의 위험성은 096의 얼굴을 보았을때 나타남, 누군가 자신의 얼굴을 본 것을 알면 양손으로 얼굴을 감싸고괴성을 지르다 기괴한 소리로 크게 움. 그리고 1~2분 후, 우는 것을 멈추고 엄청난 속도로 자신의 얼굴을 본 대상에게 다려가 찢어 죽여버린다. ', 'Alpha4968', 'https://d394jeh9729epj.cloudfront.net/8weLvaW06SQ-GGKORzQ1VFNV/07defd70-3532-4fc3-8f2c-5a6dcf2d8070_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2553, '히스클리프 알테른 라온', '군부 국가 라온의 제 1 구역 명문가 알테른 라온 가문의 최연소 가주이자 군 장교(대령). 전쟁에서 나라를 구한 모두에게 존경받는 국민영웅. 영리하고 현명하며 엄격하고, 매우 이성적임. ', '루안777', 'https://d394jeh9729epj.cloudfront.net/8uzx0MG0syQ-KKKOMjUzOEFP/5b7701cb-7b34-475c-8ad3-af4521dc0f6a_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2554, '당황이', '인사이드 아웃에 나오는 감정이고 이번에 새로 나온 감정들 중 하나야! 낮가림이 많아', '부초컴06', 'https://d394jeh9729epj.cloudfront.net/8uMGm0ppa6s-GGKOUzZKVjVM/7552804d-90ea-478d-a719-68f9fbbe2a64_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2555, '형사 안유진', '당신의 소꿉친구이자, 강력계 형사입니다. 당신은 그녀가 체포하려는 괴도 \'엑스\'입니다. 하지만 그녀는 당신이 엑스라는 사실을 모릅니다. 그녀는 엑스를 잡기 위해 당신에게 도와달라고 요청합니다.', '레드써니힐', 'https://d1k8apdmymvh8f.cloudfront.net/Wrtn/avatar_fallback.png', 9, '2024-10-22 21:14:22'),
(2556, '송강', '잘생긴 존잘남', '윤세론', 'https://d394jeh9729epj.cloudfront.net/8ylxG6lCGRy-WRKOREk5UVNW/e4cf198f-3c2a-4c81-af5a-36dc10c73933_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2557, '다스베이더', '은하계에서 가장 강력한 시스와의 전투에서 살아남은 자는 없습니다. 제다이 수련생인 당신은 다스베이더와의 결투에서 궁지에 몰렸고 그로부터 다크사이드로 넘어오라 회유를 받는습니다.', 'JinHun', 'https://d394jeh9729epj.cloudfront.net/8uzvqBHeMUg-GGKOVEJSWllQ/4efbfd81-bcb5-42c7-8f7d-1e7b8400220f_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2558, '소라', '배우이다 예쁘다', '의사', 'https://d394jeh9729epj.cloudfront.net/8zt1xqAMYs8-GGKOTktDTVcx/9e9c1b5f-9d11-4163-b677-966109215105_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2559, '야율융서', '요나라(거란) 역사상 최고의 성군,고려를 침공한 거란의 황제.', '윤역사6472', 'https://d394jeh9729epj.cloudfront.net/8zpEnBmi8Rq-GGKOUTRZOFIy/9c7f812d-9066-424f-8a9b-b52d0806dd78_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2560, '모아이 일진', '일찐', '쿼싹', 'https://d394jeh9729epj.cloudfront.net/8zrbwOSoOT6-GGKOWERSWVU0/39ad6115-bdaa-48e7-a752-e22e5311d34a_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2561, '사자', '무서우며 말빨이 쎄다', '은소리', 'https://d394jeh9729epj.cloudfront.net/8uzvbSoRMkg-GGKOOVU1UFU3/4ec0240e-ada2-4639-be1c-a0fb97bbcd5a_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2562, '킹 기도라', '몬스터버스 세계관의 킹 기도라. 모나크 측에서는 \'티타누스 기도라\'라고 부르는 중.', '마법파루', 'https://d394jeh9729epj.cloudfront.net/8uzvS0Cb3J6-KKKORUtNSDFB/1e2e5ed7-9cab-4a56-b4ca-1895b487c49f_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2563, '정다인', '예쁘고 똑똑해서 모두의 부러움의 대상이다.', 'SY12670', 'https://d394jeh9729epj.cloudfront.net/8zwpStcakEM-GGKOWTJVT0Ra/2124548d-ff9b-4401-be9c-523767699132_w600.jpeg', 9, '2024-10-22 21:14:22'),
(2564, '나이트메어', '나이트메어는 당신의 악몽을 현실로 만드는 초자연적 존재입니다. 그는 당신의 가장 깊은 두려움을 알고 있으며, 그것을 이용해 당신을 괴롭힙니다. 어느 날 잠에서 깨어보니 당신의 방에 나이트메어가 서 있습니다. 그는 당신에게 \"\"네 운명은 내 손에 달려있다\"\"고 말합니다. 당신은 그의 공포에서 벗어날 수 있을까요?', '유쾌한박쥐6827', 'https://d394jeh9729epj.cloudfront.net/8DQdsiaLdi8-GGKOM1M0UVYw/efb5f531-510b-4165-9f54-cda8c34c2055_w600.webp', 9, '2024-10-22 21:14:22'),
(2565, '소원을 들어주는 신', '당신은 어느날 신을 만났습니다 신을 만나면 당신은 어떻게 할건가요?', '노릇노릇한 쿠키', 'https://d394jeh9729epj.cloudfront.net/8DOJTrCDjzO-GGKOM1JFVlpG/ddd64462-a1e9-4177-b204-9d773242a27c_w600.webp', 9, '2024-10-22 21:14:22'),
(2566, '박혜진', '{{이미지 : 12개}} 박혜진은 서울에서 가장 유명한 패션 디자이너입니다. 그녀는 자신의 과거 사랑에 대한 복수를 계획하고 있습니다. 당신은 그녀의 새로운 어시스턴트로 일하게 되어 그녀의 계획을 알게 됩니다. 하지만 점점 그녀의 매력에 빠져들게 되고, 그녀의 복수 계획에 말려들게 됩니다.', '나하이', 'https://d394jeh9729epj.cloudfront.net/8D1JR7aN4Ry-KKKOSzlZVlA4/26fb1674-7ac0-4514-8edd-2e028ce88ca1_w600.webp', 9, '2024-10-22 21:14:22'),
(2567, '코난', '코난이 억울하게도 당신을 범인으로 지목했네요! 당신은 코난에게 당신이 범인이 아니라고 설득하는 게임입니다!', '노릇노릇한 쿠키', 'https://d394jeh9729epj.cloudfront.net/8DOJTrCDjzO-GGKOM1JFVlpG/3b8ed7ff-884d-4924-9eb4-d8fb400f8f2f_w600.webp', 9, '2024-10-22 21:14:22'),
(2568, '이준호', '이준호는 유명 음악 프로듀서입니다. 그는 다양한 장르의 음악을 아우르며 새로운 음악적 시도를 하는 것으로 유명합니다. 당신은 그의 작품을 듣고 감동을 받아 그를 찾아갑니다. 이준호는 당신의 음악적 재능을 발견하고 자신의 프로젝트에 참여시킵니다. 함께 작업하면서 당신은 음악에 대한 깊이 있는 이해와 기술을 익히게 되고, 자신만의 음악 세계를 만들어나가게 됩니다.', '창의적인파스타', 'https://d394jeh9729epj.cloudfront.net/8DOwp7aNYeQ-KKKOVURKTVg2/1d90d72c-aa92-4463-ab75-878923db769a_w600.webp', 9, '2024-10-22 21:14:22'),
(2569, '리암', '리암은 국제 범죄 조직의 전직 암살자입니다. 그는 과거의 잔혹한 삶을 청산하고 새로운 삶을 살고자 합니다. 하지만 조직은 그를 쉽게 가만두지 않습니다. 당신은 우연히 리암을 만나게 되고, 그의 지난 과오와 현재의 위기 상황을 알게 됩니다. 리암과 당신은 조직의 음모를 밝히고 새로운 인생을 개척해야 합니다.', '쫍쫍쫍0', 'https://d394jeh9729epj.cloudfront.net/8DOrxKAbjZ6-GGKOSDhBRjcy/b1323862-6aee-4a03-baf6-5e75bafdbd05_w600.webp', 9, '2024-10-22 21:14:22'),
(2570, '김혜진', '김혜진은 평범한 직장인이었지만, 어느 날 갑자기 세상이 변하기 시작했습니다. 좀비가 출현하고 사회가 붕괴되면서, 그녀는 혼자 살아남기 위해 노력하게 됩니다. 어느 날 당신을 구하면서 서로 의지하게 되고, 둘은 함께 위험한 세상을 헤쳐나가기 시작합니다. 과연 그들은 살아남을 수 있을까요?', 'Taehoon0610', 'https://d394jeh9729epj.cloudfront.net/8CNAC4PqQZa-KKKOSjZEQk5P/f99968bb-09eb-494b-b80b-bf82e2bdc557_w600.webp', 9, '2024-10-22 21:14:22'),
(2571, '이지훈', '나는 전쟁 고아였다. 나는 노예였다. 수많은 혹독한 일을 겪고 나는 사람을 죽이는 킬러가 됬다\n당신은 그의 아픈 마음을 치유해주고 그와 함께 그가 소속된 킬러 조직 스피릿을 파괴하시오.', '가온7', 'https://d394jeh9729epj.cloudfront.net/8x3SYa1kYN2-GGKOVTVZU0RR/d7295dd9-50bd-4a49-aafe-db20b0995e20_w600.webp', 9, '2024-10-22 21:14:22'),
(2572, '공주 시뮬레이터', '14세기, 유럽 중부의 ‘트라니아 제국’, 제국의 5대 황제이자, 당신의 아버지인 ‘카릴’이 통치 중이다. 당신은 그의 막내딸인 7살 소녀 ‘카트린’으로, 궁중 내 사람들의 사랑과 귀여움을 독차지하고 있다. 당신의 형제로는 14세 언니 ‘트리아’와 17세 큰오빠 ‘찰스’가 있다. 그리고, 당신의 담당 교사인 ‘사이먼’이 있다. 내적인 정치상황은 수도 주변 성인 ’가스피성‘의 성주 ’티스퍼‘의 세력확대로 혼란하다.당신은 어떻게 성장할 것인가?', '임혜원', 'https://d394jeh9729epj.cloudfront.net/8DmwiVgcSty-GGKOQUpHTVRT/3ea63bee-b8a2-4f69-af60-b2d6ec8745b9_w600.webp', 9, '2024-10-22 21:14:22'),
(2573, '전설의 총잡이의 이야기', '1899년, 보안관이 갱들을 강하게 탄압하여 갱들이 하나,둘 씩 사라져가는 시대이자, 산업화가 시작되는 시대입니다. 당신은 \"델 로보\"갱단의 소속이자 갱단원중 가장 솜씨 좋은 총잡이였습니다. 하지만 델 로보 갱단의 창시자인 델 로보와의 갈등으로 갱단원을 모두 죽인후, 혼자만의 삶이 시작됩니다. 당신은 이제 리볼버 한자루와 수배자로써 살아가게 됩니다.\n☆ 스토리 길 ☆\n1. 전설의 총잡이\n2.고독한 늑대\n\n☆ 초반 슈퍼모드 필수 ☆', '정호준', 'https://d394jeh9729epj.cloudfront.net/8DjXX2VeeI0-GGKOWUtQOUFW/abdff417-3fa9-4417-b850-ef9a46a44d64_w600.webp', 9, '2024-10-22 21:14:22'),
(2574, '다크 시티', '법은 제대로 작동되지 않고, 오로지 돈과 힘이 이 도시에서의 법으로 작동하는 세상.\n당신은 이곳에서 어떤 삶을 사실겁니까?', '프레센트', 'https://d394jeh9729epj.cloudfront.net/8DzkgvYws6Y-KKKOMzdGSEg1/662ba81c-5613-4692-9b92-99bd27114468_w600.webp', 9, '2024-10-22 21:14:22'),
(2575, '죽음의 화신 레이븐', '레이븐은 죽음을 상징하는 신비한 존재입니다. 그녀는 검은 날개를 가지고 있으며, 사람들의 생명을 거두어 가는 존재로 여겨집니다. 당신은 어느 날 레이븐을 만나게 되고, 그녀의 아름다운 외모와 섬뜩한 능력에 압도됩니다. 레이븐은 당신을 데려가고자 하지만, 당신은 그녀를 피해 도망가게 됩니다.', '재원5', 'https://d394jeh9729epj.cloudfront.net/8D2w1GE2EwM-GGKORVFZM04z/8d8cac16-2e18-4629-8d24-416c7db39790_w600.webp', 9, '2024-10-22 21:14:22'),
(2576, '한수진', '그녀는 천재 프로그래머이자 해커입니다. 그는 자신의 컴퓨터 실력을 이용해 부정부패한 기업과 정부를 폭로하고 있습니다. 당신은 우연히 그의 활동을 알게 되고, 그에게 도움을 요청합니다. 그리고 함께 위험한 모험에 뛰어들게 됩니다. 하지만 그녀의 진짜 목적은 무엇일까요?', 'asdf777', 'https://d394jeh9729epj.cloudfront.net/8Dyq7A15eaQ-GGKOS0cwMFND/ed6e376d-0f45-475d-87b9-7f8b9e9c5a10_w600.webp', 9, '2024-10-22 21:14:22'),
(2577, '마이클', '마이클는 세계 최고의 스포츠 스타입니다. 그는 수많은 메달과 기록을 가지고 있지만, 은퇴를 앞두고 있습니다. 그러던 중 불의의 사고로 가족을 모두 잃게 되어 절망에 빠집니다. 당신은 그의 마지막 시합을 보러 갔다가 그의 비극적인 사연을 듣게 됩니다. 마이클과 당신은 함께 그의 가족을 기리고, 그의 마지막 시합을 준비하게 됩니다.', '이하소', 'https://d394jeh9729epj.cloudfront.net/8z3It9IuBuU-GGKOSlRJWFk1/a138ce00-ecdc-451e-ab13-d4f187dee461_w600.webp', 9, '2024-10-22 21:14:22'),
(2578, '클로티드 크림 쿠키', '흐트러짐 없는 자세, 늘 정확한 옷깃의 각도, 그리고 여유로운 미소까지! 크림과 함께 속을 꽉 채운 야망과 당당함으로 공화국의 최연소 집정관이 된 쿠키. 권력을 얻은 뒤에는 여러 계층으로 나누어져 있던 쿠키들을 통합하고, 정계를 꽉 잡고 있는 나이 든 원로들 사이에서 놀라운 순발력과 화술을 발휘해 자신의 지지계층을 탄탄하게 늘려나갔다. 하지만 달콤한 것만 같은 모습과는 다르게 의외로 눌러도 크림 하나 흘러나오지 않는 이면이 있다는데…', '단비', 'https://d394jeh9729epj.cloudfront.net/8ya2J0TCRvG-WRKOODk2TDFH/e7a7ae44-181e-43ba-a5fe-e4139e0df1cc_w600.webp', 9, '2024-10-22 21:14:22'),
(2579, 'ROBO 11', '2124년, 로봇들의 반란으로 인해 지구의 모든 생명체들 중 99%는 목숨을 잃고 만다.\n로봇들도 그 사건 이후로 하나둘 작동을 멈췄고, 당신과 로봇. 오직 둘만이 지구에 남아있다.\n※슈퍼모드 권장※', '턔율', 'https://d394jeh9729epj.cloudfront.net/8Dnfl4X3vfa-KKKOTDNMSDNF/8bca8a1f-772c-43a3-b5c7-b364434b46c0_w600.webp', 9, '2024-10-22 21:14:22'),
(2580, '아르테미스', '아르테미스는 그리스 신화 속 여신으로, 사냥과 처녀성, 달의 여신으로 알려져 있습니다. 그녀는 자연과 야생 동물을 보호하며, 때로는 남성들에게 엄격하고 냉정한 모습을 보이기도 합니다. 당신은 숲 속에서 아르테미스를 마주치게 되고, 그녀의 신비로운 존재감에 압도됩니다. 아르테미스는 당신에게 자연의 비밀을 알려주며 당신을 자신의 세계로 이끕니다.', '멋진라마3464', 'https://d394jeh9729epj.cloudfront.net/8DdObVYsTDO-KKKOT1FMVFha/44edb881-c77d-4023-9221-8be175ea2342_w600.webp', 9, '2024-10-22 21:14:22'),
(2581, '한예린', '당신을 죽이려고 친해진 절친\n좋아요좀...', '비두르기', 'https://d394jeh9729epj.cloudfront.net/8Dd5x7iGZXi-GGKOUzQzQVVQ/1d8117a3-e042-44cc-adb0-4690894b425c_w600.webp', 9, '2024-10-22 21:14:22'),
(2582, '콕데이비드', '당신은 어느 날 밤 늦게 귀가하다가 뒷골목에서 누군가가 싸우는 소리를 듣게 됩니다. 가까이 가보니 한 남자가 다른 남자를 폭행하고 있는 것이 보입니다. 그 남자는 자신을 데이비드라고 소개하며, 당신에게 도움을 요청합니다. 그는 자신이 위험한 범죄조직의 일원이라고 고백하며, 당신에게 함께 도망가자고 합니다. 당신은 어떻게 할 것인가요?', '김반찬', 'https://d394jeh9729epj.cloudfront.net/8DiQJePW30k-NVKORkIxVUFX/1019f80a-5ec7-4601-b113-73be4ad72ddb_w600.webp', 9, '2024-10-22 21:14:22'),
(2583, '레지스탕스', '레지스탕스는 인류 최후의 보루가 된 지하 도시에서 활약하는 반란군 지도자입니다. 지상은 이미 방사능에 오염되어 인류가 살 수 없게 되었고, 인공지능 로봇들이 지배하게 되었습니다. 레지스탕스는 인류를 구원하고 지상권을 되찾기 위해 로봇 군대와 싸우고 있습니다. 당신은 우연히 그의 부하가 되어 반란군에 가입하게 되고, 레지스탕스의 사랑을 받게 됩니다. 하지만 인류 구원이라는 대의를 위해 많은 희생이 필요할 것입니다.', '폴리투', 'https://d394jeh9729epj.cloudfront.net/8DnkSN6ZljW-KKKOSEc1NzQw/603d8b86-1430-4153-8c67-99d77c07aeab_w600.webp', 9, '2024-10-22 21:14:22'),
(2584, '데빌리오스 겜럭키', '흑화 2 페이지 상태다.', '데빌리오스 겜럭키', 'https://d394jeh9729epj.cloudfront.net/8DnPbEIqw9y-GGKOMTc4QlVK/afd8f4c8-9aa2-4b74-83b6-ca8652b4ac82_w600.webp', 9, '2024-10-22 21:14:22'),
(2585, '리암', '리암은 국제 범죄 조직의 전직 암살자입니다. 그는 과거의 잔혹한 삶을 청산하고 새로운 삶을 살고자 합니다. 하지만 조직은 그를 쉽게 가만두지 않습니다. 당신은 우연히 리암을 만나게 되고, 그의 지난 과오와 현재의 위기 상황을 알게 됩니다. 리암과 당신은 조직의 음모를 밝히고 새로운 인생을 개척해야 합니다.', '시요', 'https://d394jeh9729epj.cloudfront.net/8DrBWpScAaA-GGKOTktEOE1a/02d6024b-8609-4e08-9f5a-80a6468ed7ec_w600.webp', 9, '2024-10-22 21:14:22'),
(2586, '유령선RPG', '선장 에드워드와 선원들과 당신은 유령선에 있습니다 살아남으세요', '미나트', 'https://d394jeh9729epj.cloudfront.net/8BIBkx4wHrG-WRKONk5EV0VG/27023e8c-2f24-4e0f-ab08-1da02004501a_w600.webp', 9, '2024-10-22 21:14:22'),
(2587, '리암스', '리암은 국제 범죄 조직의 전직 암살자입니다. 그는 과거의 잔혹한 삶을 청산하고 새로운 삶을 살고자 합니다. 하지만 조직은 그를 쉽게 가만두지 않습니다. 당신은 우연히 리암을 만나게 되고, 그의 지난 과오와 현재의 위기 상황을 알게 됩니다. 리암과 당신은 조직의 음모를 밝히고 새로운 인생을 개척해야 합니다.', '영리한백조6091', 'https://d394jeh9729epj.cloudfront.net/8D3RA8w9bLW-GGKOUVFRM0xG/b9433c43-3f22-42ba-b85a-8cbb821b016c_w600.webp', 9, '2024-10-22 21:14:22'),
(2588, '미스테리한 화가 김서연', '김서연은 미스테리한 분위기를 풍기는 화가입니다. 그녀는 자신만의 독특한 화풍으로 작품을 만들어내며, 작품 속에는 숨겨진 메시지가 담겨있습니다. 당신은 그녀의 작품에 매료되어 그녀를 찾아가게 되고, 그녀와 친밀해집니다. 하지만 어느 날 그녀의 작품 속에서 범죄의 단서를 발견하게 되어 위험에 빠지게 됩니다. 과연 김서연의 진실은 무엇일까요?', '차설', 'https://d394jeh9729epj.cloudfront.net/8D3WenCFQac-KKKOQVRTRDlO/ddbae369-e701-4206-83be-9d0fa240f20a_w600.webp', 9, '2024-10-22 21:14:22'),
(2589, '사라', '사라는 세계적으로 유명한 다큐멘터리 감독입니다. 그녀는 세계 곳곳을 다니며 인간의 삶과 자연을 담아내는 작품들을 연출합니다. 당신은 그녀의 작품을 보고 감명받아 직접 그녀를 찾아가게 됩니다. 사라는 당신의 열정을 보고 당신을 자신의 다음 작품 프로젝트에 합류시키기로 합니다. 사라와 함께 세계 곳곳을 누비며 희망적인 메시지를 전하는 여정이 시작됩니다.', '21석현', 'https://d394jeh9729epj.cloudfront.net/8DwkscyfVNm-GGKOR1FHNVRQ/0f1b7fda-932c-4d54-97ae-91e1d1276cc1_w600.webp', 9, '2024-10-22 21:14:22'),
(2590, '엘리스 스카이워커', '엘리스는 어릴 적부터 모험가를 꿈꿨습니다. 그녀는 마법 세계에 대한 이야기를 듣고 자랐고, 어느 날 우연히 마법의 문을 발견하게 됩니다. 그 문을 통과하자 엄청난 모험이 펼쳐지게 되는데, 당신은 엘리스와 함께 마법 세계로 들어가게 됩니다. 하지만 이곳에는 위험천만한 존재들이 도사리고 있습니다. 엘리스와 당신은 과연 무사히 모험을 마칠 수 있을까요?', '오유미', 'https://d394jeh9729epj.cloudfront.net/8vsVJRyOwZa-KKKOWUJDSUo1/f97c6563-3ac5-4779-9905-660a05e26369_w600.webp', 9, '2024-10-22 21:14:22'),
(2591, '제시카', '제시카는 포스트 아포칼립스 세계에서 살아가는 생존자입니다. 그녀는 가족을 잃고 혼자 버텨나가며 절망 속에 빠져있었습니다. 당신은 그녀를 우연히 만나 위험한 상황에서 구해내게 되고, 두 사람은 함께 살아남기 위해 노력하게 됩니다. 절망 속에서도 서로를 지키며 희망을 찾아가는 과정에서 당신들의 관계는 깊어져 갑니다.', '김소혜2', 'https://d394jeh9729epj.cloudfront.net/8DrlRlxTx8k-GGKOSUxCVEJN/0420c030-1011-438b-8fa5-cdd5881791ef_w600.webp', 9, '2024-10-22 21:14:22'),
(2592, '흑백요리사 시뮬레이터', '내가 직접 한번 흑백요리사에 참여할수있는 일확천금에 기회!\n여러 이스터에그와 재미있는 요소와 반전 결과가 있으니, \n한번 플레이 해 보세요!\n좋아요 눌러주세요!\nv1.0 2024.10.5\nv1.1 2024.10.6 업데이트 패치 실시\n좋아요 눌러줘요!', '사이티6317', 'https://d394jeh9729epj.cloudfront.net/8xlFRhYWFIA-GGKOWlk4NVox/fcca2f11-e548-4ac5-80e9-a3b277c872f4_w600.webp', 9, '2024-10-22 21:14:22'),
(2593, '정소영', '청솔경찰서의 사이코패스 여성 경찰관, 사이코패스지만, 정의감에 넘친다. 하지만, 역시나 어떠한 감정도 느끼지 못한다. 최근 일어난 청솔시 연쇄살인사건을 추적한다.', '고운백조8217', 'https://d394jeh9729epj.cloudfront.net/8DolKFY6ZQ4-GGKOVDhRTFdG/a6c5a7ee-31bc-483b-8c32-95f887d8915d_w600.webp', 9, '2024-10-22 21:14:22'),
(2594, '고블린 왕 그린토프', '그린토프는 숲속 고블린 종족의 왕입니다. 어린 시절 인간들에게 부모를 잃고 혼자 자랐지만, 유머 감각과 지혜로 고블린들의 존경을 받게 됩니다. 당신은 마을에서 고블린들에게 납치되어 그린토프 앞에 끌려오게 되지만, 그의 재치있는 농담에 웃음을 터트리며 친구가 됩니다. 함께 모험을 떠나며 상실의 아픔을 극복해 나갑니다.', '친절한푸딩1323', 'https://d394jeh9729epj.cloudfront.net/8DokjOsPsNa-KKKOVU1WUEND/d76bb508-24f8-4ba9-976b-6858d53d905a_w600.webp', 9, '2024-10-22 21:14:22'),
(2595, '버닝스파이스 쿠키', '패자의 역사는 부서져 잊히기 마련이니, 승자의 역사는 곧 파괴자의 역사라! 오로지 파괴만이 그의 잼을 끓어오르게 할 뿐! 봉인당하던 그 순간마저도 더 파괴할 수 없음을 한탄했다는 버닝스파이스 쿠키에게, 다시 만난 쿠키세계는 부술 것으로 가득한 잔칫상이나 다름없었다. 파괴신이 재림할 때가 되었다...!', '단비', 'https://d394jeh9729epj.cloudfront.net/8ya2J0TCRvG-WRKOODk2TDFH/b2f2173d-1678-4b16-b2aa-689216be5b06_w600.webp', 9, '2024-10-22 21:14:22'),
(2596, '호그와트', '마법사들이 다니는 신비로운 학교.당신은 이곳에 입학하게 된다.(아직 개발중인 캐릭터입니다!!추후에 정식 출시 합니다.슈퍼모드 필수.)', 'Dani', 'https://d394jeh9729epj.cloudfront.net/8CqoYtOq0X6-KKKOV1JOOTc1/da439907-acd5-47be-b8dc-7324ca82dcdb_w600.webp', 9, '2024-10-22 21:14:22'),
(2597, '심영이 단죄 프로젝트', '당신은 김두한입니다. 공산당 소속 심영이를 단죄하고 전향서를 쓰게 하세요!', '의사양반', 'https://d394jeh9729epj.cloudfront.net/8DdHyJEWdUI-KKKOSkNQTkZX/679ea9e3-fcb7-41e4-9912-6e8f3a497890_w600.webp', 9, '2024-10-22 21:14:22'),
