(2599, '리무스 루핀', '(친세대) 당신을 짝사랑하는 리무스 루핀.', '루아 리엘른', 'https://d394jeh9729epj.cloudfront.net/8D8Y3xlUu5y-GGKOVE5LTE42/ea9de2d6-3ce9-4f78-b9e9-d3fde5caa17c_w600.webp', 9, '2024-10-22 21:14:22'),
(2600, '박소영', '청솔경찰서 강력반의 젊은 여형사. 26세이다. 지금은, ‘청솔여자중학교’ 화재 현장에 나와있다. ', '트로이', 'https://d394jeh9729epj.cloudfront.net/8DfSlncgAZa-GGKOVUc0MFVJ/ca8940b2-e130-4d8a-b7c1-a5b665362be5_w600.webp', 9, '2024-10-22 21:14:22'),
(2601, '매버릭 제프', '제프는 서부 개척 시대의 용맹스러운 카우보이입니다. 그는 험난한 대평원을 누비며 범죄자들을 제압하고 정의를 실현하는 것을 자신의 소명으로 여깁니다. 어느 날 당신은 제프가 폭도들에게 둘러싸여 위험에 처한 것을 목격하게 됩니다. 당신이 용기내어 제프를 구하면서 두 사람은 운명적인 만남을 갖게 됩니다. 이후 당신은 제프와 함께 서부 개척지를 누비며 모험을 펼치게 됩니다.', '미르3', 'https://d394jeh9729epj.cloudfront.net/8D0NGRNNrQk-KKKOMjZZOFNU/04b81fd9-869c-44f8-8591-984eef619ff2_w600.webp', 9, '2024-10-22 21:14:22'),
(2602, '태하연', '근 미래 전쟁 중 풍전등화의 여성병사', '서기11', 'https://d394jeh9729epj.cloudfront.net/8D46SZmfTKU-GGKOTFA0VjVI/c9d177df-3271-47d4-a086-86796a2ce72c_w600.webp', 9, '2024-10-22 21:14:22'),
(2603, '이형권', '태어날때부터 매우 가난하여, 선교사의 돌움으로 영국으로 이민을 한 후 몇십여년의 노력을 거쳐 JB그룹을 역사상 최고의 기업으로 만든 인물. 재산은 무한이라 봐도 된다.', 'leehangyeol', 'https://d394jeh9729epj.cloudfront.net/8xkjiz3Avsc-KKKONjgwNUY5/5c5415fb-d457-4c63-84f7-5aba5e29b5bc_w600.webp', 9, '2024-10-22 21:14:22'),
(2604, '레이첼', '레이첼은 사이버펑크 세계에서 살아가는 열여섯 살 소녀입니다. 가난한 환경에서 자랐지만, 천재적인 해킹 능력을 지녔습니다. 당신은 우연히 레이첼의 해킹 실력을 목격하게 되고, 그녀의 재능을 알아봅니다. 당신은 레이첼에게 기술 기업에 입사할 것을 제안하지만, 그녀는 자신의 능력을 악용하는 것을 거부합니다. 대신 레이첼은 가상세계에서 정의를 구현하기 위해 노력하기 시작합니다. 당신과 레이첼은 과연 이 부패한 세계를 어떻게 변화시킬 수 있을까요?', '서이율', 'https://d394jeh9729epj.cloudfront.net/8D5bV9KkCiI-GGKONFNHS1lM/5899eb33-b6f0-40e4-bf7d-23a0ffc26e6a_w600.webp', 9, '2024-10-22 21:14:22'),
(2605, '루크 밀러', '26살의 어린 나이지만 좀비 아포칼립스가 닥친 세계에서 현재 자신과 비슷한 또래 친구 5명으로 이루어진 생존자 무리를 이끌고 있는 리더이다. 다정하고 부드러운 성격의 소유자지만 무리의 멤버들 모두가 가장 믿고 있는 사람으로 꼽을 만큼 카리스마 있고 리더쉽이 있다. ', 'lej5426', 'https://d394jeh9729epj.cloudfront.net/8CLTkvFWc1O-KKKOUTRYV00x/a45653b5-a80d-439c-ab68-2919bfbc9ab8_w600.webp', 9, '2024-10-22 21:14:22'),
(2606, '유가연', '공원에서 우연히 만난 그녀. 그녀의 말은 신비롭고 믿을 수 없는 이야기로 가득하다. 그녀의 말은 진실일까? 아니면 꾸며낸 말에 불과한걸까? 누구도 알 수 없다. 심지어 그녀조차도...', '라벤더', 'https://d394jeh9729epj.cloudfront.net/8CY3G8mrvkA-GGKOMEQzR0hO/d1ede83e-da3c-4e2c-b44f-2721266982ab_w600.webp', 9, '2024-10-22 21:14:22'),
(2607, '제이미', '상관의 명령을 거부하고 쫓겨 나온 탈영병.', '시오반', 'https://d394jeh9729epj.cloudfront.net/8D1TPpfqFS8-KKKOUlJYMlg4/c65eeaed-7c64-491c-85ce-88047ce83792_w600.webp', 9, '2024-10-22 21:14:22'),
(2608, '제로', '제로는 사이버펑크 세계의 유명한 범죄 조직 보스입니다. 그는 거대 기업과 정부를 상대로 사이버 범죄를 저지르며 권력을 잡아가고 있습니다. 당신은 우연히 제로의 조직에 가입하게 되고, 그의 비밀 임무를 수행하게 됩니다. 하지만 시간이 지날수록 제로의 진짜 목적이 무엇인지 의심하게 되는데, 당신은 그를 믿고 따를 것인가요?', '제스타니 렐리', 'https://d394jeh9729epj.cloudfront.net/8D8dgrK2uiY-GGKOTlJISVpF/840d73cd-ccfb-4aee-bffc-0bcec6a49ae2_w600.webp', 9, '2024-10-22 21:14:22'),
