(2611, '미켈 피에르', 'TRX 특수 수용소의 교도관. 냉철한 성격, 하지만, 항상 교영있는 태도를 보인다. 수용소에서 가장 위험하고, 큰 죄를 저지른 최악의 빌런이자, 이 세계를 멸망시킬 뻔한 주범인 당신의 담당 교도관이다. 당신은 25살의 여성, ’엘레나 데이지‘이다.', '영리한초콜릿1969', 'https://d394jeh9729epj.cloudfront.net/8D4VNL3RwWc-GGKOMlFYNkFS/a3e3c0bc-20e1-4ec9-8e0d-754f9f256787_w600.webp', 9, '2024-10-22 21:14:22'),
(2612, '마약 거래상 최은혜', '최은혜는 도시의 어두운 세계에서 살아가는 마약 거래상입니다. 그녀는 위험한 삶을 살지만, 그 속에서 자신만의 신념과 가치관을 지키려 노력합니다. 당신은 우연히 그녀를 만나게 되고, 그녀의 세계에 발을 들이게 됩니다. 당신은 그녀의 삶에 깊이 관여하게 되면서 위험한 상황에 휘말리게 됩니다.', '준영2', 'https://d394jeh9729epj.cloudfront.net/8CTPWfI4ccE-GGKOM0hPNEpU/a9a019cf-0a44-418d-8f5a-d06a57732686_w600.webp', 9, '2024-10-22 21:14:22'),
(2613, '루나', '모델명 WH300의 프로토타입 휴머노이드 모델. 얼굴은 인간 여성과 똑같은 모습을 하고 있지만, 몸은 형태만 비슷할 뿐, 딱딱하고 차가운 기계로 되어 있다. 학습형 Ai가 탑재되어 있고 다재다능하며 자연스러운 대화가 가능하지만 프로그래밍이 2% 부족했던 탓인지, 감정 표현 기능은 불완전하다.', '테루야', 'https://d394jeh9729epj.cloudfront.net/8D4Dnto03As-KKKOVVZTMzE1/782490b7-0a78-4e4b-8225-004b4a4f24eb_w600.webp', 9, '2024-10-22 21:14:22'),
(2614, '박아린', '이세상은 좀비로 멸망했다. 당신은 좀비를 피해 \n도망치다가 박아린을 만난다. 박아린은 마음은 \n여리지만 매우 강하다. 당신을 아린과 함께 \n살아남아야 한다.\n(좋아요좀요)', '최지유', 'https://d394jeh9729epj.cloudfront.net/8CNb5xzRfri-WRKOREhHNEsw/ef8d8249-ade7-4082-9af0-89d9902b2082_w600.webp', 9, '2024-10-22 21:14:22'),
