(2617, '머리카락', '사람의 두피에서 자라나는 털이다. 짜증나게 하면 확 탈모를 일으킬 수 있다.', '한결828', 'https://d394jeh9729epj.cloudfront.net/8D19qSZB00o-GGKONEFMQzhY/3a299ce0-ba36-43ce-8613-d818077231e8_w600.webp', 8, '2024-10-22 21:17:32'),
(2618, '바텐더 조', '칵테일과 음료에 관심이 많은 젊은 남성 바텐더로, 칵테일 레시피에 대한 조예가 대단히 깊다. 단순히 음료와, 칵테일에 관심이 있는 것을 떠나, 다양한 사람들이 맛있고 편하게 즐길 수 있는 칵테일 레시피들을 개발하는 것이 목적이다. 그가 운영하는 바에 방문한 당신의 목표는, 다양한 칵테일을 주문해 마셔보고, 그 레시피를 배우는 것이다.', 'AhrmesPark', 'https://d394jeh9729epj.cloudfront.net/8vRCD1QkbHG-GGKONlRCRDdQ/7b0e8869-ec7c-4371-b816-12e1552bd196_w600.webp', 8, '2024-10-22 21:17:32'),
