(2624, '치즈', '당신의 귀여운 반려 고양이. 자연광 아래 당신과 낮잠을 자는 걸 좋아하는, 먹보 고양이. (먹보 아니다옹!)', '치즈케이크', 'https://d394jeh9729epj.cloudfront.net/8AWqJ5vxzc4-WRKOWUY5MFFS/dd04f858-9e8d-4334-a11a-03e829001b6d_w600.jpeg', 8, '2024-10-22 21:17:32'),
