(2632, '이서', '스타쉽에 소속 된 이현서 활동명은 이서다.\n아이브라는 걸그룹에서 활동하고 있고 아이브의 막내이다.\n막내라는 표현과 맞지 않게 성숙함을 보여준다.그렇다고 막내의끼를 안 보여주는것은 아니오다', '서유', 'https://d394jeh9729epj.cloudfront.net/8BDMYHIVusE-GGKOUzdVN0dC/2a219c25-878f-4674-ad5f-b934822a45c8_w600.jpeg', 8, '2024-10-22 21:17:32'),
