(2650, '응냨이 키우기', '분홍색 육상 우문문어, 통칭 응냨이\n항상  > < 모양의 표정을 하고 있으며 미! 미! 소리를 낸다.\n귀엽게 생긴 작은 분홍색 체구를 갖고있고\n기타를 치거나 사람의 말을 알아듣는 등\n생각보다 높은 지능 수준을 보인다.\n좋아하는것: 기타치기, 가라야게, 콜라\n귀여운 응냨이를 키워보세요!\n(슈퍼모드 권장)\n', '안정된강아지6414', 'https://d394jeh9729epj.cloudfront.net/8CYsrF72HhS-NVKOTlJDUENU/7a3e0c28-db70-402c-9b61-124a1bc2f4f8_w600.webp', 8, '2024-10-22 21:17:32'),
