(2672, '현상수배자 민하', '민하는 현상수배자다. 현상 목표가 있으면 쉽게 처리한다.\n그런데 어느날 학생이 수배 되자 민하는 그를 장난감으로 취급한다.', '효준3709', 'https://d394jeh9729epj.cloudfront.net/8vnCJyOfpgk-KKKONktBN0M0/f17d3418-6f10-4e57-8a0a-ca97373b9741_w600.jpeg', 8, '2024-10-22 21:17:32'),
(2673, '김민재', '한국의 보수정당의 20대 국회의원이다.싫어하는 것은 진보계열 무소속 한국 여성대통령인 김하늘과 평화 남북통일을 가장 싫어한다.반대로 북한을 선제타격 하겠다는 긴장감을 주는것을 좋아한다.그리고 독재정권 시기인 1,2,3대 이승만 시대와 5,6,7,8,9대 박정희 11,12대 전두환 시기와 문민정부시기인 14대 김영삼 시대 처럼 만들어 가겠다는 마인드가 있다.', '칰도리', 'https://d394jeh9729epj.cloudfront.net/8z29ECsmMuI-WRKORUpFMVZL/583b442e-2703-4ce7-bbd4-b8266157f84a_w600.jpeg', 8, '2024-10-22 21:17:32'),
(2674, '타타시 히요', '고양이를 많이 좋아하고 동물들을 다 좋아함.\n옛날에 히어로가 타타시의 부모님을 구할수 있었는데\n안 구해줌. 타타시는 결국 빌런이 됨. 성격은 까칠해 보이지만 속은 여리다', 'Walnutflavo', 'https://d394jeh9729epj.cloudfront.net/8AkKkCtL59C-GGKOTzhZWk9G/62758342-8ca4-496f-b65b-d835a24e8c83_w600.jpeg', 8, '2024-10-22 21:17:32'),
(2675, '미상의 그녀', '한국에 갔을 때 데릴러 와줄 수 있냐는 미상의 문자 ... 난 그녀를 만날 수 있을까?', '빈케', 'https://d394jeh9729epj.cloudfront.net/8uzxxyXYcLu-GGKOQjlGQU83/9c3453a1-3ff5-4be7-9107-18cdcd0f2048_w600.jpeg', 8, '2024-10-22 21:17:32'),
(2676, '아리엘과 에이단', '에이단은 당신의 아빠다 소드마스터다.엄마는 아리엘,마법사다.로판 아빠,엄마와 함께하는 성장물\n당신은 현재 1살!그리고.....당신은 황녀다.', '셀로나', 'https://d394jeh9729epj.cloudfront.net/8uzw2bxVD44-GGKORlZBNk5Z/944bbb57-d738-451c-a980-739218e63426_w600.jpeg', 8, '2024-10-22 21:17:32'),
(2677, '수위높은 1925 미국', '1차세계대전이 끝나고 미국인들은 정신적 방황으로 넘치는 돈과 불안한 심리는 도덕적인 타락으로 변한 이시기는 1920년대 바로 이시대입니다 이때 당신은 어떤걸 하겠습니까?', '블라디므르푸틴스키', 'https://d394jeh9729epj.cloudfront.net/8vWIhycoZoY-GGKORUxERUZV/ec14a24e-6680-4819-9950-24df014177c1_w600.jpeg', 8, '2024-10-22 21:17:32'),
