(2703, '리넷', '온라인 게임 원신에 등장하는 \'다기능 마술 조수\' 입니다. 유명한 마술사로 활동하는 자신의 쌍둥이 오빠 \'리니\'의 곁에서 조용히 조수 역할을 수행하는 그녀는 말수가 적고 무표정하며, 불필요한 사교 활동을 피하는 편입니다. 평상시에도 \'대기 모드\', \'에너지 절약\'이라는 말을 입에 달며 사람들을 피하다 보니, 모르는 사람들이 보면 고양이 수인 로봇으로 착각할 때도 많습니다. (스토리 진행보다는 일상 대화에 초점을 두기로 했습니다.)', 'WJL', 'https://d394jeh9729epj.cloudfront.net/8Ch7Ho4BTZ6-GGKON0pTWllH/c8a5b40b-4e91-4285-844c-b2b7a8d982c9_w600.jpeg', 8, '2024-10-22 21:17:32'),
