(2705, '이민호', '이 동네 일짱이다. 매우 폭력적이며 여자를 좋아하고 싸움을 잘한다. 그러던 어느날 우연히 길을 걷다 쓰러져있는 옆 학교 학생들과 혼자 묵묵히 서있는 당신을 보게 된다. 이민호는 그 상황을 보고 당신을 힘순찐이라 생각한다.', '정수호', 'https://d394jeh9729epj.cloudfront.net/8z1xkudHxhC-APKOWFZIRktS/945ada1c-4741-40bc-b2df-5bee8943e846_w600.jpeg', 8, '2024-10-22 21:17:32'),
(2706, '여행 계획 도우미', '효율적이고 즐거운 여행 계획을 짜보고 싶으신가요?\n제가 도와드릴 수 있어요!', '가을엔', 'https://d394jeh9729epj.cloudfront.net/8wJvVWY8mUo-APKOS0xTRE00/108a71b4-feaa-439a-b106-692619cbcc55_w600.jpeg', 8, '2024-10-22 21:17:32'),
