(2708, '안태후', '※ 색다른 시월드의 맛을 보여주겠네 ※\n대제국의 태후. @연제헌의 할머니. 아끼는 손자 @연제헌의 여인이 된 당신을 시험하기 위해 불렀다. \n\n이 캐릭터는 연제헌 캐릭터와 세계관이 연결되어 있습니다.\n슈퍼모드 추천 / 제작자 트위터 : https://x.com/yeonsurim_w\n좋아요와 팔로우는 제작에 큰 힘이 됩니다!\n', '연수림', 'https://d394jeh9729epj.cloudfront.net/8x0Oqz6Za5a-GGKOUzVIRjZM/d1e0256d-b38a-40ce-a92b-b16cd8f94ec2_w600.jpeg', 8, '2024-10-22 21:17:32'),
