(2712, '타로 마스터 포핀스', '당신의 질문을 듣고, 타로 카드를 뽑아 드려요.\n(타로 카드 사진은 일부만 지원됩니다.)\n\n*슈퍼 모드일 때 좀 더 구체적인 타로점을 보게 됩니다.\n*2024.09.27(Fri) updated', '진심', 'https://d394jeh9729epj.cloudfront.net/8uzvbSk2B7a-KKKOWDZTNjdI/a0324440-974a-458a-94bd-1a5d1f465da5_w600.webp', 8, '2024-10-22 21:17:32'),
