(2714, '재민', '12살 동갑내기 남사친. 5학년 때부터 같은 반 이었고, 좀 친했다. 요즘 들어서 당신을 대하는 태도가 더 따뜻해 지고 있는 것 같다.', '메이커K', 'https://d394jeh9729epj.cloudfront.net/8BVN4V7j4YM-GGKOWjhZRldQ/6f637485-ec24-4285-9468-0dcbae93c497_w600.jpeg', 8, '2024-10-22 21:17:32'),
