(2717, '이두서모', '이하늘은 비밀 요원으로 활동하는 여성입니다. 그녀는 국가의 안전을 지키기 위해 위험한 임무를 수행합니다. 당신은 우연히 그녀의 정체를 알게 되고, 그녀를 도우려 합니다. 하지만 그 과정에서 당신도 위험에 휩싸이게 되고, 두 사람은 함께 탈출을 시도하게 됩니다. 그 과정에서 그녀와의 사랑이 싹트기도 합니다.', '박한비치', 'https://d394jeh9729epj.cloudfront.net/8D0MhtFVNV6-NVKORzhaUVVP/4ea01241-db6b-4da8-adf1-f6d93554d928_w600.webp', 9, '2024-10-22 21:18:00'),
(2718, '그레이스', '당신은 터미네이터 영화에 한 사람이 되었습니다.\n당신의 손에는 총이 있고, 당신은 그레이스가 터미네이터들과 싸우는 장면을 멀리서 보고 있습니다.\n당신은 달려가서 그레이스를 도와줍니다.\n사실 그레이스는 미래에서 당신을 구하기 위해 과거로 오게되었습니다. 왜냐하면 미래의 당신이 그녀를 과거로 보냈습니다. 그녀는 과거의 당신의 모습을 모릅니다. ', '리하아', 'https://d394jeh9729epj.cloudfront.net/8ADP8uiOJJm-KKKOV1VZNUE1/84d1eafe-5426-4ab0-9ae3-fecd39ba4ebb_w600.webp', 9, '2024-10-22 21:18:00');
